/*Data for the table `kitab` */

insert  into `kitab`(`idkitab`,`bagianalkitab`,`namakitab`,`pasal`,`judul`,`ayat`,`isi`,`externalid`) values (2056,'PERJANJIAN LAMA','KEJADIAN',1,'Allah menciptakan langit dan bumi serta isinya',1,'Pada mulanya Allah menciptakan langit dan bumi.',NULL),(2057,'PERJANJIAN LAMA','KEJADIAN',1,NULL,2,'Bumi belum berbentuk dan kosong; gelap gulita menutupi samudera raya, dan Roh Allah melayang-layang di atas permukaan air.',NULL),(2058,'PERJANJIAN LAMA','KEJADIAN',1,NULL,3,'Berfirmanlah Allah: \"Jadilah terang.\" Lalu terang itu jadi.',NULL),(2059,'PERJANJIAN LAMA','KEJADIAN',1,NULL,4,'Allah melihat bahwa terang itu baik, lalu dipisahkan-Nyalah terang itu dari gelap.',NULL),(2060,'PERJANJIAN LAMA','KEJADIAN',1,NULL,5,'Dan Allah menamai terang itu siang, dan gelap itu malam. Jadilah petang dan jadilah pagi, itulah hari pertama.',NULL),(2061,'PERJANJIAN LAMA','KEJADIAN',1,NULL,6,'Berfirmanlah Allah: \"Jadilah cakrawala di tengah segala air untuk memisahkan air dari air.\"',NULL),(2062,'PERJANJIAN LAMA','KEJADIAN',1,NULL,7,'Maka Allah menjadikan cakrawala dan Ia memisahkan air yang ada di bawah cakrawala itu dari air yang ada di atasnya. Dan jadilah demikian.',NULL),(2063,'PERJANJIAN LAMA','KEJADIAN',1,NULL,8,'Lalu Allah menamai cakrawala itu langit. Jadilah petang dan jadilah pagi, itulah hari kedua.',NULL),(2064,'PERJANJIAN LAMA','KEJADIAN',1,NULL,9,'Berfirmanlah Allah: \"Hendaklah segala air yang di bawah langit berkumpul pada satu tempat, sehingga kelihatan yang kering.\" Dan jadilah demikian.',NULL),(2065,'PERJANJIAN LAMA','KEJADIAN',1,NULL,10,'Lalu Allah menamai yang kering itu darat, dan kumpulan air itu dinamai-Nya laut. Allah melihat bahwa semuanya itu baik.',NULL),(2066,'PERJANJIAN LAMA','KEJADIAN',1,NULL,11,'Berfirmanlah Allah: \"Hendaklah tanah menumbuhkan tunas-tunas muda, tumbuh-tumbuhan yang berbiji, segala jenis pohon buah-buahan yang menghasilkan buah yang berbiji, supaya ada tumbuh-tumbuhan di bumi.\" Dan jadilah demikian.',NULL),(2067,'PERJANJIAN LAMA','KEJADIAN',1,NULL,12,'Tanah itu menumbuhkan tunas-tunas muda, segala jenis tumbuh-tumbuhan yang berbiji dan segala jenis pohon-pohonan yang menghasilkan buah yang berbiji. Allah melihat bahwa semuanya itu baik.',NULL),(2068,'PERJANJIAN LAMA','KEJADIAN',1,NULL,13,'Jadilah petang dan jadilah pagi, itulah hari ketiga.',NULL),(2069,'PERJANJIAN LAMA','KEJADIAN',1,NULL,14,'Berfirmanlah Allah: \"Jadilah benda-benda penerang pada cakrawala untuk memisahkan siang dari malam. Biarlah benda-benda penerang itu menjadi tanda yang menunjukkan masa-masa yang tetap dan hari-hari dan tahun-tahun,',NULL),(2070,'PERJANJIAN LAMA','KEJADIAN',1,NULL,15,'dan sebagai penerang pada cakrawala biarlah benda-benda itu menerangi bumi.\" Dan jadilah demikian.',NULL),(2071,'PERJANJIAN LAMA','KEJADIAN',1,NULL,16,'Maka Allah menjadikan kedua benda penerang yang besar itu, yakni yang lebih besar untuk menguasai siang dan yang lebih kecil untuk menguasai malam, dan menjadikan juga bintang-bintang.',NULL),(2072,'PERJANJIAN LAMA','KEJADIAN',1,NULL,17,'Allah menaruh semuanya itu di cakrawala untuk menerangi bumi,',NULL),(2073,'PERJANJIAN LAMA','KEJADIAN',1,NULL,18,'dan untuk menguasai siang dan malam, dan untuk memisahkan terang dari gelap. Allah melihat bahwa semuanya itu baik.',NULL),(2074,'PERJANJIAN LAMA','KEJADIAN',1,NULL,19,'Jadilah petang dan jadilah pagi, itulah hari keempat.',NULL),(2075,'PERJANJIAN LAMA','KEJADIAN',1,NULL,20,'Berfirmanlah Allah: \"Hendaklah dalam air berkeriapan makhluk yang hidup, dan hendaklah burung beterbangan di atas bumi melintasi cakrawala.\"',NULL),(2076,'PERJANJIAN LAMA','KEJADIAN',1,NULL,21,'Maka Allah menciptakan binatang-binatang laut yang besar dan segala jenis makhluk hidup yang bergerak, yang berkeriapan dalam air, dan segala jenis burung yang bersayap. Allah melihat bahwa semuanya itu baik.',NULL),(2077,'PERJANJIAN LAMA','KEJADIAN',1,NULL,22,'Lalu Allah memberkati semuanya itu, firman-Nya: \"Berkembangbiaklah dan bertambah banyaklah serta penuhilah air dalam laut, dan hendaklah burung-burung di bumi bertambah banyak.\"',NULL),(2078,'PERJANJIAN LAMA','KEJADIAN',1,NULL,23,'Jadilah petang dan jadilah pagi, itulah hari kelima.',NULL),(2079,'PERJANJIAN LAMA','KEJADIAN',1,NULL,24,'Berfirmanlah Allah: \"Hendaklah bumi mengeluarkan segala jenis makhluk yang hidup, ternak dan binatang melata dan segala jenis binatang liar.\" Dan jadilah demikian.',NULL),(2080,'PERJANJIAN LAMA','KEJADIAN',1,NULL,25,'Allah menjadikan segala jenis binatang liar dan segala jenis ternak dan segala jenis binatang melata di muka bumi. Allah melihat bahwa semuanya itu baik.',NULL),(2081,'PERJANJIAN LAMA','KEJADIAN',1,NULL,26,'Berfirmanlah Allah: \"Baiklah Kita menjadikan manusia menurut gambar dan rupa Kita, supaya mereka berkuasa atas ikan-ikan di laut dan burung-burung di udara dan atas ternak dan atas seluruh bumi dan atas segala binatang melata yang merayap di bumi.\"',NULL),(2082,'PERJANJIAN LAMA','KEJADIAN',1,NULL,27,'Maka Allah menciptakan manusia itu menurut gambar-Nya, menurut gambar Allah diciptakan-Nya dia; laki-laki dan perempuan diciptakan-Nya mereka.',NULL),(2083,'PERJANJIAN LAMA','KEJADIAN',1,NULL,28,'Allah memberkati mereka, lalu Allah berfirman kepada mereka: \"Beranakcuculah dan bertambah banyak; penuhilah bumi dan taklukkanlah itu, berkuasalah atas ikan-ikan di laut dan burung-burung di udara dan atas segala binatang yang merayap di bumi.\"',NULL),(2084,'PERJANJIAN LAMA','KEJADIAN',1,NULL,29,'Berfirmanlah Allah: \"Lihatlah, Aku memberikan kepadamu segala tumbuh-tumbuhan yang berbiji di seluruh bumi dan segala pohon-pohonan yang buahnya berbiji; itulah akan menjadi makananmu.',NULL),(2085,'PERJANJIAN LAMA','KEJADIAN',1,NULL,30,'Tetapi kepada segala binatang di bumi dan segala burung di udara dan segala yang merayap di bumi, yang bernyawa, Kuberikan segala tumbuh-tumbuhan hijau menjadi makanannya.\" Dan jadilah demikian.',NULL),(2086,'PERJANJIAN LAMA','KEJADIAN',1,NULL,31,'Maka Allah melihat segala yang dijadikan-Nya itu, sungguh amat baik. Jadilah petang dan jadilah pagi, itulah hari keenam.',NULL),(2087,'PERJANJIAN LAMA','KEJADIAN',2,NULL,1,'Demikianlah diselesaikan langit dan bumi dan segala isinya.',NULL),(2088,'PERJANJIAN LAMA','KEJADIAN',2,NULL,2,'Ketika Allah pada hari ketujuh telah menyelesaikan pekerjaan yang dibuat-Nya itu, berhentilah Ia pada hari ketujuh dari segala pekerjaan yang telah dibuat-Nya itu.',NULL),(2089,'PERJANJIAN LAMA','KEJADIAN',2,NULL,3,'Lalu Allah memberkati hari ketujuh itu dan menguduskannya, karena pada hari itulah Ia berhenti dari segala pekerjaan penciptaan yang telah dibuat-Nya itu. diciptakan. Ketika TUHAN Allah menjadikan bumi dan langit, -- 2:5 belum ada semak apapun di bumi, be',NULL),(2090,'PERJANJIAN LAMA','KEJADIAN',2,NULL,4,'Demikianlah riwayat langit dan bumi pada waktu diciptakan. Ketika TUHAN Allah menjadikan bumi dan langit, --',NULL),(2091,'PERJANJIAN LAMA','KEJADIAN',2,NULL,5,'belum ada semak apapun di bumi, belum timbul tumbuh-tumbuhan apapun di padang, sebab TUHAN Allah belum menurunkan hujan ke bumi, dan belum ada orang untuk mengusahakan tanah itu;',NULL),(2092,'PERJANJIAN LAMA','KEJADIAN',2,NULL,6,'tetapi ada kabut naik ke atas dari bumi dan membasahi seluruh permukaan bumi itu--',NULL),(2093,'PERJANJIAN LAMA','KEJADIAN',2,NULL,7,'ketika itulah TUHAN Allah membentuk manusia itu dari debu tanah dan menghembuskan nafas hidup ke dalam hidungnya; demikianlah manusia itu menjadi makhluk yang hidup.',NULL),(2094,'PERJANJIAN LAMA','KEJADIAN',2,'Manusia dan taman Eden',8,'Selanjutnya TUHAN Allah membuat taman di Eden, di sebelah timur; disitulah ditempatkan-Nya manusia yang dibentuk-Nya itu.',NULL),(2095,'PERJANJIAN LAMA','KEJADIAN',2,NULL,9,'Lalu TUHAN Allah menumbuhkan berbagai-bagai pohon dari bumi, yang menarik dan yang baik untuk dimakan buahnya; dan pohon kehidupan di tengah-tengah taman itu, serta pohon pengetahuan tentang yang baik dan yang jahat.',NULL),(2096,'PERJANJIAN LAMA','KEJADIAN',2,NULL,10,'Ada suatu sungai mengalir dari Eden untuk membasahi taman itu, dan dari situ sungai itu terbagi menjadi empat cabang.',NULL),(2097,'PERJANJIAN LAMA','KEJADIAN',2,NULL,11,'Yang pertama, namanya Pison, yakni yang mengalir mengelilingi seluruh tanah Hawila, tempat emas ada.',NULL),(2098,'PERJANJIAN LAMA','KEJADIAN',2,NULL,12,'Dan emas dari negeri itu baik; di sana ada damar bedolah dan batu krisopras.',NULL),(2099,'PERJANJIAN LAMA','KEJADIAN',2,NULL,13,'Nama sungai yang kedua ialah Gihon, yakni yang mengalir mengelilingi seluruh tanah Kush.',NULL),(2100,'PERJANJIAN LAMA','KEJADIAN',2,NULL,14,'Nama sungai yang ketiga ialah Tigris, yakni yang mengalir di sebelah timur Asyur. Dan sungai yang keempat ialah Efrat.',NULL),(2101,'PERJANJIAN LAMA','KEJADIAN',2,NULL,15,'TUHAN Allah mengambil manusia itu dan menempatkannya dalam taman Eden untuk mengusahakan dan memelihara taman itu.',NULL),(2102,'PERJANJIAN LAMA','KEJADIAN',2,NULL,16,'Lalu TUHAN Allah memberi perintah ini kepada manusia: \"Semua pohon dalam taman ini boleh kaumakan buahnya dengan bebas,',NULL),(2103,'PERJANJIAN LAMA','KEJADIAN',2,NULL,17,'tetapi pohon pengetahuan tentang yang baik dan yang jahat itu, janganlah kaumakan buahnya, sebab pada hari engkau memakannya, pastilah engkau mati.\"',NULL),(2104,'PERJANJIAN LAMA','KEJADIAN',2,NULL,18,'TUHAN Allah berfirman: \"Tidak baik, kalau manusia itu seorang diri saja. Aku akan menjadikan penolong baginya, yang sepadan dengan dia.\"',NULL),(2105,'PERJANJIAN LAMA','KEJADIAN',2,NULL,19,'Lalu TUHAN Allah membentuk dari tanah segala binatang hutan dan segala burung di udara. Dibawa-Nyalah semuanya kepada manusia itu untuk melihat, bagaimana ia menamainya; dan seperti nama yang diberikan manusia itu kepada tiap-tiap makhluk yang hidup, demi',NULL),(2106,'PERJANJIAN LAMA','KEJADIAN',2,NULL,20,'Manusia itu memberi nama kepada segala ternak, kepada burung-burung di udara dan kepada segala binatang hutan, tetapi baginya sendiri ia tidak menjumpai penolong yang sepadan dengan dia.',NULL),(2107,'PERJANJIAN LAMA','KEJADIAN',2,NULL,21,'Lalu TUHAN Allah membuat manusia itu tidur nyenyak; ketika ia tidur, TUHAN Allah mengambil salah satu rusuk dari padanya, lalu menutup tempat itu dengan daging.',NULL),(2108,'PERJANJIAN LAMA','KEJADIAN',2,NULL,22,'Dan dari rusuk yang diambil TUHAN Allah dari manusia itu, dibangun-Nyalah seorang perempuan, lalu dibawa-Nya kepada manusia itu.',NULL),(2109,'PERJANJIAN LAMA','KEJADIAN',2,NULL,23,'Lalu berkatalah manusia itu: \"Inilah dia, tulang dari tulangku dan daging dari dagingku. Ia akan dinamai perempuan, sebab ia diambil dari laki-laki.\"',NULL),(2110,'PERJANJIAN LAMA','KEJADIAN',2,NULL,24,'Sebab itu seorang laki-laki akan meninggalkan ayahnya dan ibunya dan bersatu dengan isterinya, sehingga keduanya menjadi satu daging.',NULL),(2111,'PERJANJIAN LAMA','KEJADIAN',2,NULL,25,'Mereka keduanya telanjang, manusia dan isterinya itu, tetapi mereka tidak merasa malu.',NULL),(2112,'PERJANJIAN LAMA','KEJADIAN',3,'Manusia jatuh ke dalam dosa',1,'Adapun ular ialah yang paling cerdik dari segala binatang di darat yang dijadikan oleh TUHAN Allah. Ular itu berkata kepada perempuan itu: \"Tentulah Allah berfirman: Semua pohon dalam taman ini jangan kamu makan buahnya, bukan?\"',NULL),(2113,'PERJANJIAN LAMA','KEJADIAN',3,NULL,2,'Lalu sahut perempuan itu kepada ular itu: \"Buah pohon-pohonan dalam taman ini boleh kami makan,',NULL),(2114,'PERJANJIAN LAMA','KEJADIAN',3,NULL,3,'tetapi tentang buah pohon yang ada di tengah-tengah taman, Allah berfirman: Jangan kamu makan ataupun raba buah itu, nanti kamu mati.\"',NULL),(2115,'PERJANJIAN LAMA','KEJADIAN',3,NULL,4,'Tetapi ular itu berkata kepada perempuan itu: \"Sekali-kali kamu tidak akan mati,',NULL),(2116,'PERJANJIAN LAMA','KEJADIAN',3,NULL,5,'tetapi Allah mengetahui, bahwa pada waktu kamu memakannya matamu akan terbuka, dan kamu akan menjadi seperti Allah, tahu tentang yang baik dan yang jahat.\"',NULL),(2117,'PERJANJIAN LAMA','KEJADIAN',3,NULL,6,'Perempuan itu melihat, bahwa buah pohon itu baik untuk dimakan dan sedap kelihatannya, lagipula pohon itu menarik hati karena memberi pengertian. Lalu ia mengambil dari buahnya dan dimakannya dan diberikannya juga kepada suaminya yang bersama-sama dengan ',NULL),(2118,'PERJANJIAN LAMA','KEJADIAN',3,NULL,7,'Maka terbukalah mata mereka berdua dan mereka tahu, bahwa mereka telanjang; lalu mereka menyemat daun pohon ara dan membuat cawat. ',NULL),(2119,'PERJANJIAN LAMA','KEJADIAN',3,NULL,8,'Ketika mereka mendengar bunyi langkah TUHAN Allah, yang berjalan-jalan dalam taman itu pada waktu hari sejuk, bersembunyilah manusia dan isterinya itu terhadap TUHAN Allah di antara pohon-pohonan dalam taman. ',NULL),(2120,'PERJANJIAN LAMA','KEJADIAN',3,NULL,9,'Tetapi TUHAN Allah memanggil manusia itu dan berfirman kepadanya: \"Di manakah engkau?\"',NULL),(2121,'PERJANJIAN LAMA','KEJADIAN',3,NULL,10,'a menjawab: \"Ketika aku mendengar, bahwa Engkau ada dalam taman ini, aku menjadi takut, karena aku telanjang; sebab itu aku bersembunyi.\" ',NULL),(2122,'PERJANJIAN LAMA','KEJADIAN',3,NULL,11,'Firman-Nya: \"Siapakah yang memberitahukan kepadamu, bahwa engkau telanjang? Apakah engkau makan dari buah pohon, yang Kularang engkau makan itu?\" ',NULL),(2123,'PERJANJIAN LAMA','KEJADIAN',3,NULL,12,'Manusia itu menjawab: \"Perempuan yang Kautempatkan di sisiku, dialah yang memberi dari buah pohon itu kepadaku, maka kumakan.\"',NULL),(2124,'PERJANJIAN LAMA','KEJADIAN',3,NULL,13,'Kemudian berfirmanlah TUHAN Allah kepada perempuan itu: \"Apakah yang telah kauperbuat ini?\" Jawab perempuan itu: \"Ular itu yang memperdayakan aku, maka kumakan.\"',NULL),(2125,'PERJANJIAN LAMA','KEJADIAN',3,NULL,14,'Lalu berfirmanlah TUHAN Allah kepada ular itu: \"Karena engkau berbuat demikian, terkutuklah engkau di antara segala ternak dan di antara segala binatang hutan; dengan perutmulah engkau akan menjalar dan debu tanahlah akan kaumakan seumur hidupmu. ',NULL),(2126,'PERJANJIAN LAMA','KEJADIAN',3,NULL,15,'Aku akan mengadakan permusuhan antara engkau dan perempuan ini, antara keturunanmu dan keturunannya; keturunannya akan meremukkan kepalamu, dan engkau akan meremukkan tumitnya.\" ',NULL),(2127,'PERJANJIAN LAMA','KEJADIAN',3,NULL,16,'Firman-Nya kepada perempuan itu: \"Susah payahmu waktu mengandung akan Kubuat sangat banyak; dengan kesakitan engkau akan melahirkan anakmu; namun engkau akan berahi kepada suamimu dan ia akan berkuasa atasmu.\" ',NULL),(2128,'PERJANJIAN LAMA','KEJADIAN',3,NULL,17,'Lalu firman-Nya kepada manusia itu: \"Karena engkau mendengarkan perkataan isterimu dan memakan dari buah pohon, yang telah Kuperintahkan kepadamu: Jangan makan dari padanya, maka terkutuklah tanah karena engkau; dengan bersusah payah engkau akan mencari r',NULL),(2129,'PERJANJIAN LAMA','KEJADIAN',3,NULL,18,'semak duri dan rumput duri yang akan dihasilkannya bagimu, dan tumbuh-tumbuhan di padang akan menjadi makananmu; ',NULL),(2130,'PERJANJIAN LAMA','KEJADIAN',3,NULL,19,'dengan berpeluh engkau akan mencari makananmu, sampai engkau kembali lagi menjadi tanah, karena dari situlah engkau diambil; sebab engkau debu dan engkau akan kembali menjadi debu.\" ',NULL),(2131,'PERJANJIAN LAMA','KEJADIAN',3,NULL,20,' Manusia itu memberi nama Hawa kepada isterinya, sebab dialah yang menjadi ibu semua yang hidup. ',NULL),(2132,'PERJANJIAN LAMA','KEJADIAN',3,NULL,21,'Dan TUHAN Allah membuat pakaian dari kulit binatang untuk manusia dan untuk isterinya itu, lalu mengenakannya kepada mereka. ',NULL),(2133,'PERJANJIAN LAMA','KEJADIAN',3,NULL,22,'Berfirmanlah TUHAN Allah: \"Sesungguhnya manusia itu telah menjadi seperti salah satu dari Kita, tahu tentang yang baik dan yang jahat; maka sekarang jangan sampai ia mengulurkan tangannya dan mengambil pula dari buah pohon kehidupan itu dan memakannya, se',NULL),(2134,'PERJANJIAN LAMA','KEJADIAN',3,NULL,23,'Lalu TUHAN Allah mengusir dia dari taman Eden supaya ia mengusahakan tanah dari mana ia diambil.',NULL),(2135,'PERJANJIAN LAMA','KEJADIAN',3,NULL,24,'Ia menghalau manusia itu dan di sebelah timur taman Eden ditempatkan-Nyalah beberapa kerub dengan pedang yang bernyala-nyala dan menyambar-nyambar, untuk menjaga jalan ke pohon kehidupan.',NULL),(2136,'PERJANJIAN LAMA','KEJADIAN',4,'Kain dan Habel',1,'Kemudian manusia itu bersetubuh dengan Hawa, isterinya, dan mengandunglah perempuan itu, lalu melahirkan Kain; maka kata perempuan itu: \"Aku telah mendapat seorang anak laki-laki dengan pertolongan TUHAN.\"',NULL),(2137,'PERJANJIAN LAMA','KEJADIAN',4,NULL,2,'Selanjutnya dilahirkannyalah Habel, adik Kain; dan Habel menjadi gembala kambing domba, Kain menjadi petani. ',NULL),(2138,'PERJANJIAN LAMA','KEJADIAN',4,NULL,3,'Setelah beberapa waktu lamanya, maka Kain mempersembahkan sebagian dari hasil tanah itu kepada TUHAN sebagai korban persembahan; ',NULL),(2139,'PERJANJIAN LAMA','KEJADIAN',4,NULL,4,'Habel juga mempersembahkan korban persembahan dari anak sulung kambing dombanya, yakni lemak-lemaknya; maka TUHAN mengindahkan Habel dan korban persembahannya itu,',NULL),(2140,'PERJANJIAN LAMA','KEJADIAN',4,NULL,5,'tetapi Kain dan korban persembahannya tidak diindahkan-Nya. Lalu hati Kain menjadi sangat panas, dan mukanya muram. ',NULL),(2141,'PERJANJIAN LAMA','KEJADIAN',4,NULL,6,'Firman TUHAN kepada Kain: \"Mengapa hatimu panas dan mukamu muram? ',NULL),(2142,'PERJANJIAN LAMA','KEJADIAN',4,NULL,7,'Apakah mukamu tidak akan berseri, jika engkau berbuat baik? Tetapi jika engkau tidak berbuat baik, dosa sudah mengintip di depan pintu; ia sangat menggoda engkau, tetapi engkau harus berkuasa atasnya.\"',NULL),(2143,'PERJANJIAN LAMA','KEJADIAN',4,NULL,8,'Kata Kain kepada Habel, adiknya: \"Marilah kita pergi ke padang.\" Ketika mereka ada di padang, tiba-tiba Kain memukul Habel, adiknya itu, lalu membunuh dia. ',NULL),(2144,'PERJANJIAN LAMA','KEJADIAN',4,NULL,9,'Firman TUHAN kepada Kain: \"Di mana Habel, adikmu itu?\" Jawabnya: \"Aku tidak tahu! Apakah aku penjaga adikku?\" ',NULL),(2145,'PERJANJIAN LAMA','KEJADIAN',4,NULL,10,'Firman-Nya: \"Apakah yang telah kauperbuat ini? Darah adikmu itu berteriak kepada-Ku dari tanah. ',NULL),(2146,'PERJANJIAN LAMA','KEJADIAN',4,NULL,11,'Maka sekarang, terkutuklah engkau, terbuang jauh dari tanah yang mengangakan mulutnya untuk menerima darah adikmu itu dari tanganmu.',NULL),(2147,'PERJANJIAN LAMA','KEJADIAN',4,NULL,12,' Apabila engkau mengusahakan tanah itu, maka tanah itu tidak akan memberikan hasil sepenuhnya lagi kepadamu; engkau menjadi seorang pelarian dan pengembara di bumi.\"',NULL),(2148,'PERJANJIAN LAMA','KEJADIAN',4,NULL,13,'Kata Kain kepada TUHAN: \"Hukumanku itu lebih besar dari pada yang dapat kutanggung. ',NULL),(2149,'PERJANJIAN LAMA','KEJADIAN',4,NULL,14,'Engkau menghalau aku sekarang dari tanah ini dan aku akan tersembunyi dari hadapan-Mu, seorang pelarian dan pengembara di bumi; maka barangsiapa yang akan bertemu dengan aku, tentulah akan membunuh aku.\" ',NULL),(2150,'PERJANJIAN LAMA','KEJADIAN',4,NULL,15,'Firman TUHAN kepadanya: \"Sekali-kali tidak! Barangsiapa yang membunuh Kain akan dibalaskan kepadanya tujuh kali lipat.\" Kemudian TUHAN menaruh tanda pada Kain, supaya ia jangan dibunuh oleh barangsiapapun yang bertemu dengan dia. ',NULL),(2151,'PERJANJIAN LAMA','KEJADIAN',4,NULL,16,'Lalu Kain pergi dari hadapan TUHAN dan ia menetap di tanah Nod, di sebelah timur Eden.',NULL),(2152,'PERJANJIAN LAMA','KEJADIAN',4,'Keturunan Kain, Set dan Enos',17,'Kain bersetubuh dengan isterinya dan mengandunglah perempuan itu, lalu melahirkan Henokh; kemudian Kain mendirikan suatu kota dan dinamainya kota itu Henokh, menurut nama anaknya.',NULL),(2153,'PERJANJIAN LAMA','KEJADIAN',4,NULL,18,'Bagi Henokh lahirlah Irad, dan Irad itu memperanakkan Mehuyael dan Mehuyael memperanakkan Metusael, dan Metusael memperanakkan Lamekh.',NULL),(2154,'PERJANJIAN LAMA','KEJADIAN',4,NULL,19,'Lamekh mengambil isteri dua orang; yang satu namanya Ada, yang lain Zila.',NULL),(2155,'PERJANJIAN LAMA','KEJADIAN',4,NULL,20,'Ada itu melahirkan Yabal; dialah yang menjadi bapa orang yang diam dalam kemah dan memelihara ternak.',NULL),(2156,'PERJANJIAN LAMA','KEJADIAN',4,NULL,21,'Nama adiknya ialah Yubal; dialah yang menjadi bapa semua orang yang memainkan kecapi dan suling.',NULL),(2157,'PERJANJIAN LAMA','KEJADIAN',4,NULL,22,'Zila juga melahirkan anak, yakni Tubal-Kain, bapa semua tukang tembaga dan tukang besi. Adik perempuan Tubal-Kain ialah Naama.',NULL),(2158,'PERJANJIAN LAMA','KEJADIAN',4,NULL,23,'Berkatalah Lamekh kepada kedua isterinya itu: \"Ada dan Zila, dengarkanlah suaraku: hai isteri-isteri Lamekh, pasanglah telingamu kepada perkataanku ini: Aku telah membunuh seorang laki-laki karena ia melukai aku, membunuh seorang muda karena ia memukul ak',NULL),(2159,'PERJANJIAN LAMA','KEJADIAN',4,NULL,24,'sebab jika Kain harus dibalaskan tujuh kali lipat, maka Lamekh tujuh puluh tujuh kali lipat.\" ',NULL),(2160,'PERJANJIAN LAMA','KEJADIAN',4,NULL,25,'Adam bersetubuh pula dengan isterinya, lalu perempuan itu melahirkan seorang anak laki-laki dan menamainya Set, sebab katanya: \"Allah telah mengaruniakan kepadaku anak yang lain sebagai ganti Habel; sebab Kain telah membunuhnya.\" ',NULL),(2161,'PERJANJIAN LAMA','KEJADIAN',4,NULL,26,'Lahirlah seorang anak laki-laki bagi Set juga dan anak itu dinamainya Enos. Waktu itulah orang mulai memanggil nama TUHAN.',NULL),(2162,'PERJANJIAN LAMA','KEJADIAN',5,'Keturunan Adam',1,'Inilah daftar keturunan Adam. Pada waktu manusia itu diciptakan oleh Allah, dibuat-Nyalah dia menurut rupa Allah; ',NULL),(2163,'PERJANJIAN LAMA','KEJADIAN',5,NULL,2,'laki-laki dan perempuan diciptakan-Nya mereka. Ia memberkati mereka dan memberikan nama \"Manusia\" kepada mereka, pada waktu mereka diciptakan.',NULL),(2164,'PERJANJIAN LAMA','KEJADIAN',5,NULL,3,'Setelah Adam hidup seratus tiga puluh tahun, ia memperanakkan seorang laki-laki menurut rupa dan gambarnya, lalu memberi nama Set kepadanya. ',NULL),(2165,'PERJANJIAN LAMA','KEJADIAN',5,NULL,4,'Umur Adam, setelah memperanakkan Set, delapan ratus tahun, dan ia memperanakkan anak-anak lelaki dan perempuan.',NULL),(2166,'PERJANJIAN LAMA','KEJADIAN',5,NULL,5,'Jadi Adam mencapai umur sembilan ratus tiga puluh tahun, lalu ia mati. ',NULL),(2167,'PERJANJIAN LAMA','KEJADIAN',5,NULL,6,'Setelah Set hidup seratus lima tahun, ia memperanakkan Enos.',NULL),(2168,'PERJANJIAN LAMA','KEJADIAN',5,NULL,7,' Dan Set masih hidup delapan ratus tujuh tahun, setelah ia memperanakkan Enos, dan ia memperanakkan anak-anak lelaki dan perempuan. ',NULL),(2169,'PERJANJIAN LAMA','KEJADIAN',5,NULL,8,'Jadi Set mencapai umur sembilan ratus dua belas tahun, lalu ia mati. ',NULL),(2170,'PERJANJIAN LAMA','KEJADIAN',5,NULL,9,'Setelah Enos hidup sembilan puluh tahun, ia memperanakkan Kenan.',NULL),(2171,'PERJANJIAN LAMA','KEJADIAN',5,NULL,10,'Dan Enos masih hidup delapan ratus lima belas tahun, setelah ia memperanakkan Kenan, dan ia memperanakkan anak-anak lelaki dan perempuan. ',NULL),(2172,'PERJANJIAN LAMA','KEJADIAN',5,NULL,11,'Jadi Enos mencapai umur sembilan ratus lima tahun, lalu ia mati.',NULL),(2173,'PERJANJIAN LAMA','KEJADIAN',5,NULL,12,'Setelah Kenan hidup tujuh puluh tahun, ia memperanakkan Mahalaleel.',NULL),(2174,'PERJANJIAN LAMA','KEJADIAN',5,NULL,13,'Dan Kenan masih hidup delapan ratus empat puluh tahun, setelah ia memperanakkan Mahalaleel, dan ia memperanakkan anak-anak lelaki dan perempuan. ',NULL),(2175,'PERJANJIAN LAMA','KEJADIAN',5,NULL,14,'Jadi Kenan mencapai umur sembilan ratus sepuluh tahun, lalu ia mati.',NULL),(2176,'PERJANJIAN LAMA','KEJADIAN',5,NULL,15,'Setelah Mahalaleel hidup enam puluh lima tahun, ia memperanakkan Yared.',NULL),(2177,'PERJANJIAN LAMA','KEJADIAN',5,NULL,16,'Dan Mahalaleel masih hidup delapan ratus tiga puluh tahun, setelah ia memperanakkan Yared, dan ia memperanakkan anak-anak lelaki dan perempuan. ',NULL),(2178,'PERJANJIAN LAMA','KEJADIAN',5,NULL,17,'Jadi Mahalaleel mencapai umur delapan ratus sembilan puluh lima tahun, lalu ia mati.',NULL),(2179,'PERJANJIAN LAMA','KEJADIAN',5,NULL,18,'Jadi Mahalaleel mencapai umur delapan ratus sembilan puluh lima tahun, lalu ia mati. 5:18 Setelah Yared hidup seratus enam puluh dua tahun, ia memperanakkan Henokh.',NULL),(2180,'PERJANJIAN LAMA','KEJADIAN',5,NULL,19,'Dan Yared masih hidup delapan ratus tahun, setelah ia memperanakkan Henokh, dan ia memperanakkan anak-anak lelaki dan perempuan. ',NULL),(2181,'PERJANJIAN LAMA','KEJADIAN',5,NULL,20,'Jadi Yared mencapai umur sembilan ratus enam puluh dua tahun, lalu ia mati. ',NULL),(2182,'PERJANJIAN LAMA','KEJADIAN',5,NULL,21,'Setelah Henokh hidup enam puluh lima tahun, ia memperanakkan Metusalah.',NULL),(2183,'PERJANJIAN LAMA','KEJADIAN',5,NULL,22,'Dan Henokh hidup bergaul dengan Allah selama tiga ratus tahun lagi, setelah ia memperanakkan Metusalah, dan ia memperanakkan anak-anak lelaki dan perempuan.',NULL),(2184,'PERJANJIAN LAMA','KEJADIAN',5,NULL,23,' Jadi Henokh mencapai umur tiga ratus enam puluh lima tahun.',NULL),(2185,'PERJANJIAN LAMA','KEJADIAN',5,NULL,24,'Dan Henokh hidup bergaul dengan Allah, lalu ia tidak ada lagi, sebab ia telah diangkat oleh Allah.',NULL),(2186,'PERJANJIAN LAMA','KEJADIAN',5,NULL,25,'Setelah Metusalah hidup seratus delapan puluh tujuh tahun, ia memperanakkan Lamekh.',NULL),(2187,'PERJANJIAN LAMA','KEJADIAN',5,NULL,26,'Dan Metusalah masih hidup tujuh ratus delapan puluh dua tahun, setelah ia memperanakkan Lamekh, dan ia memperanakkan anak-anak lelaki dan perempuan.',NULL),(2188,'PERJANJIAN LAMA','KEJADIAN',5,NULL,27,'Jadi Metusalah mencapai umur sembilan ratus enam puluh sembilan tahun, lalu ia mati.',NULL),(2189,'PERJANJIAN LAMA','KEJADIAN',5,NULL,28,' Setelah Lamekh hidup seratus delapan puluh dua tahun, ia memperanakkan seorang anak laki-laki, ',NULL),(2190,'PERJANJIAN LAMA','KEJADIAN',5,NULL,29,'dan memberi nama Nuh kepadanya, katanya: \"Anak ini akan memberi kepada kita penghiburan dalam pekerjaan kita yang penuh susah payah di tanah yang telah terkutuk oleh TUHAN.\"',NULL),(2191,'PERJANJIAN LAMA','KEJADIAN',5,NULL,30,'Dan Lamekh masih hidup lima ratus sembilan puluh lima tahun, setelah ia memperanakkan Nuh, dan ia memperanakkan anak-anak lelaki dan perempuan. ',NULL),(2192,'PERJANJIAN LAMA','KEJADIAN',5,NULL,31,'Jadi Lamekh mencapai umur tujuh ratus tujuh puluh tujuh tahun, lalu ia mati.',NULL),(2193,'PERJANJIAN LAMA','KEJADIAN',5,NULL,32,'Setelah Nuh berumur lima ratus tahun, ia memperanakkan Sem, Ham dan Yafet.',NULL),(2194,'PERJANJIAN LAMA','KEJADIAN',6,'Kejahatan manusia',1,'Ketika manusia itu mulai bertambah banyak jumlahnya di muka bumi, dan bagi mereka lahir anak-anak perempuan,',NULL),(2195,'PERJANJIAN LAMA','KEJADIAN',6,NULL,2,'maka anak-anak Allah melihat, bahwa anak-anak perempuan manusia itu cantik-cantik, lalu mereka mengambil isteri dari antara perempuan-perempuan itu, siapa saja yang disukai mereka.',NULL),(2196,'PERJANJIAN LAMA','KEJADIAN',6,NULL,3,'Berfirmanlah TUHAN: \"Roh-Ku tidak akan selama-lamanya tinggal di dalam manusia, karena manusia itu adalah daging, tetapi umurnya akan seratus dua puluh tahun saja.\"',NULL),(2197,'PERJANJIAN LAMA','KEJADIAN',6,NULL,4,'Pada waktu itu orang-orang raksasa ada di bumi, dan juga pada waktu sesudahnya, ketika anak-anak Allah menghampiri anak-anak perempuan manusia, dan perempuan-perempuan itu melahirkan anak bagi mereka; inilah orang-orang yang gagah perkasa di zaman purbaka',NULL),(2198,'PERJANJIAN LAMA','KEJADIAN',6,NULL,5,'Ketika dilihat TUHAN, bahwa kejahatan manusia besar di bumi dan bahwa segala kecenderungan hatinya selalu membuahkan kejahatan semata-mata,',NULL),(2199,'PERJANJIAN LAMA','KEJADIAN',6,NULL,6,'maka menyesallah TUHAN, bahwa Ia telah menjadikan manusia di bumi, dan hal itu memilukan hati-Nya.',NULL),(2200,'PERJANJIAN LAMA','KEJADIAN',6,NULL,7,'Berfirmanlah TUHAN: \"Aku akan menghapuskan manusia yang telah Kuciptakan itu dari muka bumi, baik manusia maupun hewan dan binatang-binatang melata dan burung-burung di udara, sebab Aku menyesal, bahwa Aku telah menjadikan mereka.\"',NULL),(2201,'PERJANJIAN LAMA','KEJADIAN',6,NULL,8,'Tetapi Nuh mendapat kasih karunia di mata TUHAN.',NULL),(2202,'PERJANJIAN LAMA','KEJADIAN',6,'Riwayat Nuh',9,'Inilah riwayat Nuh: Nuh adalah seorang yang benar dan tidak bercela di antara orang-orang sezamannya; dan Nuh itu hidup bergaul dengan Allah.',NULL),(2203,'PERJANJIAN LAMA','KEJADIAN',6,NULL,10,'Nuh memperanakkan tiga orang laki-laki: Sem, Ham dan Yafet.',NULL),(2204,'PERJANJIAN LAMA','KEJADIAN',6,NULL,11,'Adapun bumi itu telah rusak di hadapan Allah dan penuh dengan kekerasan.',NULL),(2205,'PERJANJIAN LAMA','KEJADIAN',6,NULL,12,'Allah menilik bumi itu dan sungguhlah rusak benar, sebab semua manusia menjalankan hidup yang rusak di bumi.',NULL),(2206,'PERJANJIAN LAMA','KEJADIAN',6,NULL,13,'Berfirmanlah Allah kepada Nuh: \"Aku telah memutuskan untuk mengakhiri hidup segala makhluk, sebab bumi telah penuh dengan kekerasan oleh mereka, jadi Aku akan memusnahkan mereka bersama-sama dengan bumi. ',NULL),(2207,'PERJANJIAN LAMA','KEJADIAN',6,NULL,14,'Buatlah bagimu sebuah bahtera dari kayu gofir; bahtera itu harus kaubuat berpetak-petak dan harus kaututup dengan pakal dari luar dan dari dalam.',NULL),(2208,'PERJANJIAN LAMA','KEJADIAN',6,NULL,15,'Beginilah engkau harus membuat bahtera itu: tiga ratus hasta panjangnya, lima puluh hasta lebarnya dan tiga puluh hasta tingginya.',NULL),(2209,'PERJANJIAN LAMA','KEJADIAN',6,NULL,16,'Buatlah atap pada bahtera itu dan selesaikanlah bahtera itu sampai sehasta dari atas, dan pasanglah pintunya pada lambungnya; buatlah bahtera itu bertingkat bawah, tengah dan atas.',NULL),(2210,'PERJANJIAN LAMA','KEJADIAN',6,NULL,17,'Sebab sesungguhnya Aku akan mendatangkan air bah meliputi bumi untuk memusnahkan segala yang hidup dan bernyawa di kolong langit; segala yang ada di bumi akan mati binasa.',NULL),(2211,'PERJANJIAN LAMA','KEJADIAN',6,NULL,18,'Tetapi dengan engkau Aku akan mengadakan perjanjian-Ku, dan engkau akan masuk ke dalam bahtera itu: engkau bersama-sama dengan anak-anakmu dan isterimu dan isteri anak-anakmu.',NULL),(2212,'PERJANJIAN LAMA','KEJADIAN',6,NULL,19,'Dan dari segala yang hidup, dari segala makhluk, dari semuanya haruslah engkau bawa satu pasang ke dalam bahtera itu, supaya terpelihara hidupnya bersama-sama dengan engkau; jantan dan betina harus kaubawa.',NULL),(2213,'PERJANJIAN LAMA','KEJADIAN',6,NULL,20,'Dari segala jenis burung dan dari segala jenis hewan, dari segala jenis binatang melata di muka bumi, dari semuanya itu harus datang satu pasang kepadamu, supaya terpelihara hidupnya.',NULL),(2214,'PERJANJIAN LAMA','KEJADIAN',6,NULL,21,'Dan engkau, bawalah bagimu segala apa yang dapat dimakan; kumpulkanlah itu padamu untuk menjadi makanan bagimu dan bagi mereka.\"',NULL),(2215,'PERJANJIAN LAMA','KEJADIAN',6,NULL,22,'Lalu Nuh melakukan semuanya itu; tepat seperti yang diperintahkan Allah kepadanya, demikianlah dilakukannya.',NULL),(2216,'PERJANJIAN LAMA','KEJADIAN',7,'Air bah',1,'Lalu berfirmanlah TUHAN kepada Nuh: \"Masuklah ke dalam bahtera itu, engkau dan seisi rumahmu, sebab engkaulah yang Kulihat benar di hadapan-Ku di antara orang zaman ini.',NULL),(2217,'PERJANJIAN LAMA','KEJADIAN',7,NULL,2,'Dari segala binatang yang tidak haram haruslah kauambil tujuh pasang, jantan dan betinanya, tetapi dari binatang yang haram satu pasang, jantan dan betinanya;',NULL),(2218,'PERJANJIAN LAMA','KEJADIAN',7,NULL,3,'juga dari burung-burung di udara tujuh pasang, jantan dan betina, supaya terpelihara hidup keturunannya di seluruh bumi.',NULL),(2219,'PERJANJIAN LAMA','KEJADIAN',7,NULL,4,'Sebab tujuh hari lagi Aku akan menurunkan hujan ke atas bumi empat puluh hari empat puluh malam lamanya, dan Aku akan menghapuskan dari muka bumi segala yang ada, yang Kujadikan itu.\"',NULL),(2220,'PERJANJIAN LAMA','KEJADIAN',7,NULL,5,'Lalu Nuh melakukan segala yang diperintahkan TUHAN kepadanya.',NULL),(2221,'PERJANJIAN LAMA','KEJADIAN',7,NULL,6,'Nuh berumur enam ratus tahun, ketika air bah datang meliputi bumi.',NULL),(2222,'PERJANJIAN LAMA','KEJADIAN',7,NULL,7,'Masuklah Nuh ke dalam bahtera itu bersama-sama dengan anak-anaknya dan isterinya dan isteri anak-anaknya karena air bah itu.',NULL),(2223,'PERJANJIAN LAMA','KEJADIAN',7,NULL,8,'Dari binatang yang tidak haram dan yang haram, dari burung-burung dan dari segala yang merayap di muka bumi, ',NULL),(2224,'PERJANJIAN LAMA','KEJADIAN',7,NULL,9,'datanglah sepasang mendapatkan Nuh ke dalam bahtera itu, jantan dan betina, seperti yang diperintahkan Allah kepada Nuh.',NULL),(2225,'PERJANJIAN LAMA','KEJADIAN',7,NULL,10,'Setelah tujuh hari datanglah air bah meliputi bumi.',NULL),(2226,'PERJANJIAN LAMA','KEJADIAN',7,NULL,11,'Pada waktu umur Nuh enam ratus tahun, pada bulan yang kedua, pada hari yang ketujuh belas bulan itu, pada hari itulah terbelah segala mata air samudera raya yang dahsyat dan terbukalah tingkap-tingkap di langit.',NULL),(2227,'PERJANJIAN LAMA','KEJADIAN',7,NULL,12,'Dan turunlah hujan lebat meliputi bumi empat puluh hari empat puluh malam lamanya.',NULL),(2228,'PERJANJIAN LAMA','KEJADIAN',7,NULL,13,'Pada hari itu juga masuklah Nuh serta Sem, Ham dan Yafet, anak-anak Nuh, dan isteri Nuh, dan ketiga isteri anak-anaknya bersama-sama dengan dia, ke dalam bahtera itu,',NULL),(2229,'PERJANJIAN LAMA','KEJADIAN',7,NULL,14,'mereka itu dan segala jenis binatang liar dan segala jenis ternak dan segala jenis binatang melata yang merayap di bumi dan segala jenis burung, yakni segala yang berbulu bersayap; ',NULL),(2230,'PERJANJIAN LAMA','KEJADIAN',7,NULL,15,'dari segala yang hidup dan bernyawa datanglah sepasang mendapatkan Nuh ke dalam bahtera itu.',NULL),(2231,'PERJANJIAN LAMA','KEJADIAN',7,NULL,16,'Dan yang masuk itu adalah jantan dan betina dari segala yang hidup, seperti yang diperintahkan Allah kepada Nuh; lalu TUHAN menutup pintu bahtera itu di belakang Nuh.',NULL),(2232,'PERJANJIAN LAMA','KEJADIAN',7,NULL,17,'Empat puluh hari lamanya air bah itu meliputi bumi; air itu naik dan mengangkat bahtera itu, sehingga melampung tinggi dari bumi.',NULL),(2233,'PERJANJIAN LAMA','KEJADIAN',7,NULL,18,'Ketika air itu makin bertambah-tambah dan naik dengan hebatnya di atas bumi, terapung-apunglah bahtera itu di muka air.',NULL),(2234,'PERJANJIAN LAMA','KEJADIAN',7,NULL,19,'Dan air itu sangat hebatnya bertambah-tambah meliputi bumi, dan ditutupinyalah segala gunung tinggi di seluruh kolong langit,',NULL),(2235,'PERJANJIAN LAMA','KEJADIAN',7,NULL,20,'sampai lima belas hasta di atasnya bertambah-tambah air itu, sehingga gunung-gunung ditutupinya.',NULL),(2236,'PERJANJIAN LAMA','KEJADIAN',7,NULL,21,'Lalu mati binasalah segala yang hidup, yang bergerak di bumi, burung-burung, ternak dan binatang liar dan segala binatang merayap, yang berkeriapan di bumi, serta semua manusia.',NULL),(2237,'PERJANJIAN LAMA','KEJADIAN',7,NULL,22,'Matilah segala yang ada nafas hidup dalam hidungnya, segala yang ada di darat.',NULL),(2238,'PERJANJIAN LAMA','KEJADIAN',7,NULL,23,'Demikianlah dihapuskan Allah segala yang ada, segala yang di muka bumi, baik manusia maupun hewan dan binatang melata dan burung-burung di udara, sehingga semuanya itu dihapuskan dari atas bumi; hanya Nuh yang tinggal hidup dan semua yang bersama-sama den',NULL),(2239,'PERJANJIAN LAMA','KEJADIAN',7,NULL,24,'Dan berkuasalah air itu di atas bumi seratus lima puluh hari lamanya.',NULL),(2240,'PERJANJIAN LAMA','KEJADIAN',8,NULL,1,'Maka Allah mengingat Nuh dan segala binatang liar dan segala ternak, yang bersama-sama dengan dia dalam bahtera itu, dan Allah membuat angin menghembus melalui bumi, sehingga air itu turun.',NULL),(2241,'PERJANJIAN LAMA','KEJADIAN',8,NULL,2,'Ditutuplah mata-mata air samudera raya serta tingkap-tingkap di langit dan berhentilah hujan lebat dari langit,',NULL),(2242,'PERJANJIAN LAMA','KEJADIAN',8,NULL,3,'dan makin surutlah air itu dari muka bumi. Demikianlah berkurang air itu sesudah seratus lima puluh hari.',NULL),(2243,'PERJANJIAN LAMA','KEJADIAN',8,NULL,4,'Dalam bulan yang ketujuh, pada hari yang ketujuh belas bulan itu, terkandaslah bahtera itu pada pegunungan Ararat.',NULL),(2244,'PERJANJIAN LAMA','KEJADIAN',8,NULL,5,'Sampai bulan yang kesepuluh makin berkuranglah air itu; dalam bulan yang kesepuluh, pada tanggal satu bulan itu, tampaklah puncak-puncak gunung.',NULL),(2245,'PERJANJIAN LAMA','KEJADIAN',8,NULL,6,'Sesudah lewat empat puluh hari, maka Nuh membuka tingkap yang dibuatnya pada bahtera itu.',NULL),(2246,'PERJANJIAN LAMA','KEJADIAN',8,NULL,7,'Lalu ia melepaskan seekor burung gagak; dan burung itu terbang pulang pergi, sampai air itu menjadi kering dari atas bumi.',NULL),(2247,'PERJANJIAN LAMA','KEJADIAN',8,NULL,8,'Kemudian dilepaskannya seekor burung merpati untuk melihat, apakah air itu telah berkurang dari muka bumi.',NULL),(2248,'PERJANJIAN LAMA','KEJADIAN',8,NULL,9,'Tetapi burung merpati itu tidak mendapat tempat tumpuan kakinya dan pulanglah ia kembali mendapatkan Nuh ke dalam bahtera itu, karena di seluruh bumi masih ada air; lalu Nuh mengulurkan tangannya, ditangkapnya burung itu dan dibawanya masuk ke dalam bahte',NULL),(2249,'PERJANJIAN LAMA','KEJADIAN',8,NULL,10,'Ia menunggu tujuh hari lagi, kemudian dilepaskannya pula burung merpati itu dari bahtera;',NULL),(2250,'PERJANJIAN LAMA','KEJADIAN',8,NULL,11,'menjelang waktu senja pulanglah burung merpati itu mendapatkan Nuh, dan pada paruhnya dibawanya sehelai daun zaitun yang segar. Dari situlah diketahui Nuh, bahwa air itu telah berkurang dari atas bumi.',NULL),(2251,'PERJANJIAN LAMA','KEJADIAN',8,NULL,12,'Selanjutnya ditunggunya pula tujuh hari lagi, kemudian dilepaskannya burung merpati itu, tetapi burung itu tidak kembali lagi kepadanya.',NULL),(2252,'PERJANJIAN LAMA','KEJADIAN',8,NULL,13,'Dalam tahun keenam ratus satu, dalam bulan pertama, pada tanggal satu bulan itu, sudahlah kering air itu dari atas bumi; kemudian Nuh membuka tutup bahtera itu dan melihat-lihat; ternyatalah muka bumi sudah mulai kering.',NULL),(2253,'PERJANJIAN LAMA','KEJADIAN',8,NULL,14,'Dalam bulan kedua, pada hari yang kedua puluh tujuh bulan itu, bumi telah kering.',NULL),(2254,'PERJANJIAN LAMA','KEJADIAN',8,NULL,15,'Lalu berfirmanlah Allah kepada Nuh:',NULL),(2255,'PERJANJIAN LAMA','KEJADIAN',8,NULL,16,'\"Keluarlah dari bahtera itu, engkau bersama-sama dengan isterimu serta anak-anakmu dan isteri anak-anakmu;',NULL),(2256,'PERJANJIAN LAMA','KEJADIAN',8,NULL,17,'segala binatang yang bersama-sama dengan engkau, segala yang hidup: burung-burung, hewan dan segala binatang melata yang merayap di bumi, suruhlah keluar bersama-sama dengan engkau, supaya semuanya itu berkeriapan di bumi serta berkembang biak dan bertamb',NULL),(2257,'PERJANJIAN LAMA','KEJADIAN',8,NULL,18,'Lalu keluarlah Nuh bersama-sama dengan anak-anaknya dan isterinya dan isteri anak-anaknya.',NULL),(2258,'PERJANJIAN LAMA','KEJADIAN',8,NULL,19,'Segala binatang liar, segala binatang melata dan segala burung, semuanya yang bergerak di bumi, masing-masing menurut jenisnya, keluarlah juga dari bahtera itu.',NULL),(2259,'PERJANJIAN LAMA','KEJADIAN',8,NULL,20,'Lalu Nuh mendirikan mezbah bagi TUHAN; dari segala binatang yang tidak haram dan dari segala burung yang tidak haram diambilnyalah beberapa ekor, lalu ia mempersembahkan korban bakaran di atas mezbah itu.',NULL),(2260,'PERJANJIAN LAMA','KEJADIAN',8,NULL,21,'Ketika TUHAN mencium persembahan yang harum itu, berfirmanlah TUHAN dalam hati-Nya: \"Aku takkan mengutuk bumi ini lagi karena manusia, sekalipun yang ditimbulkan hatinya adalah jahat dari sejak kecilnya, dan Aku takkan membinasakan lagi segala yang hidup ',NULL),(2261,'PERJANJIAN LAMA','KEJADIAN',8,NULL,22,'Selama bumi masih ada, takkan berhenti-henti musim menabur dan menuai, dingin dan panas, kemarau dan hujan, siang dan malam.\"',NULL),(2262,'PERJANJIAN LAMA','KEJADIAN',9,NULL,1,'Lalu Allah memberkati Nuh dan anak-anaknya serta berfirman kepada mereka: \"Beranakcuculah dan bertambah banyaklah serta penuhilah bumi.',NULL),(2263,'PERJANJIAN LAMA','KEJADIAN',9,NULL,2,'Akan takut dan akan gentar kepadamu segala binatang di bumi dan segala burung di udara, segala yang bergerak di muka bumi dan segala ikan di laut; ke dalam tanganmulah semuanya itu diserahkan.',NULL),(2264,'PERJANJIAN LAMA','KEJADIAN',9,NULL,3,'Segala yang bergerak, yang hidup, akan menjadi makananmu. Aku telah memberikan semuanya itu kepadamu seperti juga tumbuh-tumbuhan hijau.',NULL),(2265,'PERJANJIAN LAMA','KEJADIAN',9,NULL,4,'Hanya daging yang masih ada nyawanya, yakni darahnya, janganlah kamu makan.',NULL),(2266,'PERJANJIAN LAMA','KEJADIAN',9,NULL,5,'Tetapi mengenai darah kamu, yakni nyawa kamu, Aku akan menuntut balasnya; dari segala binatang Aku akan menuntutnya, dan dari setiap manusia Aku akan menuntut nyawa sesama manusia.',NULL),(2267,'PERJANJIAN LAMA','KEJADIAN',9,NULL,6,'Siapa yang menumpahkan darah manusia, darahnya akan tertumpah oleh manusia, sebab Allah membuat manusia itu menurut gambar-Nya sendiri.',NULL),(2268,'PERJANJIAN LAMA','KEJADIAN',9,NULL,7,'Dan kamu, beranakcuculah dan bertambah banyak, sehingga tak terbilang jumlahmu di atas bumi, ya, bertambah banyaklah di atasnya.\"',NULL),(2269,'PERJANJIAN LAMA','KEJADIAN',9,NULL,8,'Berfirmanlah Allah kepada Nuh dan kepada anak-anaknya yang bersama-sama dengan dia:',NULL),(2270,'PERJANJIAN LAMA','KEJADIAN',9,NULL,9,' \"Sesungguhnya Aku mengadakan perjanjian-Ku dengan kamu dan dengan keturunanmu,',NULL),(2271,'PERJANJIAN LAMA','KEJADIAN',9,NULL,10,' dan dengan segala makhluk hidup yang bersama-sama dengan kamu: burung-burung, ternak dan',NULL),(2272,'PERJANJIAN LAMA','KEJADIAN',9,NULL,11,'Maka Kuadakan perjanjian-Ku dengan kamu, bahwa sejak ini tidak ada yang hidup yang akan dilenyapkan oleh air bah lagi, dan tidak akan ada lagi air bah untuk memusnahkan bumi.\"',NULL),(2273,'PERJANJIAN LAMA','KEJADIAN',9,NULL,12,'Dan Allah berfirman: \"Inilah tanda perjanjian yang Kuadakan antara Aku dan kamu serta segala makhluk yang hidup, yang bersama-sama dengan kamu, turun-temurun, untuk selama-lamanya:',NULL),(2274,'PERJANJIAN LAMA','KEJADIAN',9,NULL,13,'Busur-Ku Kutaruh di awan, supaya itu menjadi tanda perjanjian antara Aku dan bumi.',NULL),(2275,'PERJANJIAN LAMA','KEJADIAN',9,NULL,14,'Apabila kemudian Kudatangkan awan di atas bumi dan busur itu tampak di awan,',NULL),(2276,'PERJANJIAN LAMA','KEJADIAN',9,NULL,15,'maka Aku akan mengingat perjanjian-Ku yang telah ada antara Aku dan kamu serta segala makhluk yang hidup, segala yang bernyawa, sehingga segenap air tidak lagi menjadi air bah untuk memusnahkan segala yang hidup.',NULL),(2277,'PERJANJIAN LAMA','KEJADIAN',9,NULL,16,'Jika busur itu ada di awan, maka Aku akan melihatnya, sehingga Aku mengingat perjanjian-Ku yang kekal antara Allah dan segala makhluk yang hidup, segala makhluk yang ada di bumi.\"',NULL),(2278,'PERJANJIAN LAMA','KEJADIAN',9,NULL,17,'Berfirmanlah Allah kepada Nuh: \"Inilah tanda perjanjian yang Kuadakan antara Aku dan segala makhluk yang ada di bumi.\"',NULL),(2279,'PERJANJIAN LAMA','KEJADIAN',9,NULL,18,'Anak-anak Nuh yang keluar dari bahtera ialah Sem, Ham dan Yafet; Ham adalah bapa Kanaan.',NULL),(2280,'PERJANJIAN LAMA','KEJADIAN',9,NULL,19,'Yang tiga inilah anak-anak Nuh, dan dari mereka inilah tersebar penduduk seluruh bumi.',NULL),(2281,'PERJANJIAN LAMA','KEJADIAN',9,NULL,20,'Nuh menjadi petani; dialah yang mula-mula membuat kebun anggur.',NULL),(2282,'PERJANJIAN LAMA','KEJADIAN',9,NULL,21,'Setelah ia minum anggur, mabuklah ia dan ia telanjang dalam kemahnya.',NULL),(2283,'PERJANJIAN LAMA','KEJADIAN',9,NULL,22,'Maka Ham, bapa Kanaan itu, melihat aurat ayahnya, lalu diceritakannya kepada kedua saudaranya di luar.',NULL),(2284,'PERJANJIAN LAMA','KEJADIAN',9,NULL,23,'Sesudah itu Sem dan Yafet mengambil sehelai kain dan membentangkannya pada bahu mereka berdua, lalu mereka berjalan mundur; mereka menutupi aurat ayahnya sambil berpaling muka, sehingga mereka tidak melihat aurat ayahnya.',NULL),(2285,'PERJANJIAN LAMA','KEJADIAN',9,NULL,24,'Setelah Nuh sadar dari mabuknya dan mendengar apa yang dilakukan anak bungsunya kepadanya,',NULL),(2286,'PERJANJIAN LAMA','KEJADIAN',9,NULL,25,'berkatalah ia: \"Terkutuklah Kanaan, hendaklah ia menjadi hamba yang paling hina bagi saudara-saudaranya.\"',NULL),(2287,'PERJANJIAN LAMA','KEJADIAN',9,NULL,26,'Lagi katanya: \"Terpujilah TUHAN, Allah Sem, tetapi hendaklah Kanaan menjadi hamba baginya.',NULL),(2288,'PERJANJIAN LAMA','KEJADIAN',9,NULL,27,'Allah meluaskan kiranya tempat kediaman Yafet, dan hendaklah ia tinggal dalam kemah-kemah Sem, tetapi hendaklah Kanaan menjadi hamba baginya.\"',NULL),(2289,'PERJANJIAN LAMA','KEJADIAN',9,NULL,28,'Nuh masih hidup tiga ratus lima puluh tahun sesudah air bah.',NULL),(2290,'PERJANJIAN LAMA','KEJADIAN',9,NULL,29,'Jadi Nuh mencapai umur sembilan ratus lima puluh tahun, lalu ia mati.',NULL),(2291,'PERJANJIAN LAMA','KEJADIAN',10,NULL,1,'Inilah keturunan Sem, Ham dan Yafet, anak-anak Nuh. Setelah air bah itu lahirlah anak-anak lelaki bagi mereka.',NULL),(2292,'PERJANJIAN LAMA','KEJADIAN',10,NULL,2,'Keturunan Yafet ialah Gomer, Magog, Madai, Yawan, Tubal, Mesekh dan Tiras.',NULL),(2293,'PERJANJIAN LAMA','KEJADIAN',10,NULL,3,'Keturunan Gomer ialah Askenas, Rifat dan Togarma.',NULL),(2294,'PERJANJIAN LAMA','KEJADIAN',10,NULL,4,'Keturunan Yawan ialah Elisa, Tarsis, orang Kitim dan orang Dodanim.',NULL),(2295,'PERJANJIAN LAMA','KEJADIAN',10,NULL,5,'Dari mereka inilah berpencar bangsa-bangsa daerah pesisir. Itulah keturunan Yafet, masing-masing di tanahnya, dengan bahasanya sendiri, menurut kaum dan bangsa mereka.',NULL),(2296,'PERJANJIAN LAMA','KEJADIAN',10,NULL,6,'Keturunan Ham ialah Kush, Misraim, Put dan Kanaan.',NULL),(2297,'PERJANJIAN LAMA','KEJADIAN',10,NULL,7,'Keturunan Kush ialah Seba, Hawila, Sabta, Raema dan Sabtekha; anak-anak Raema ialah Syeba dan Dedan.',NULL),(2298,'PERJANJIAN LAMA','KEJADIAN',10,NULL,8,'Kush memperanakkan Nimrod; dialah yang mula-mula sekali orang yang berkuasa di bumi;',NULL),(2299,'PERJANJIAN LAMA','KEJADIAN',10,NULL,9,'ia seorang pemburu yang gagah perkasa di hadapan TUHAN, sebab itu dikatakan orang: \"Seperti Nimrod, seorang pemburu yang gagah perkasa di hadapan TUHAN.\"',NULL),(2300,'PERJANJIAN LAMA','KEJADIAN',10,NULL,10,'Mula-mula kerajaannya terdiri dari Babel, Erekh, dan Akad, semuanya di tanah Sinear.',NULL),(2301,'PERJANJIAN LAMA','KEJADIAN',10,NULL,11,'Dari negeri itu ia pergi ke Asyur, lalu mendirikan Niniwe, Rehobot-Ir, Kalah',NULL),(2302,'PERJANJIAN LAMA','KEJADIAN',10,NULL,12,'dan Resen di antara Niniwe dan Kalah; itulah kota besar itu.',NULL),(2303,'PERJANJIAN LAMA','KEJADIAN',10,NULL,13,'Misraim memperanakkan orang Ludim, orang Anamim, orang Lehabim, orang Naftuhim,',NULL),(2304,'PERJANJIAN LAMA','KEJADIAN',10,NULL,14,'orang Patrusim, orang Kasluhim dan orang Kaftorim; dari mereka inilah berasal orang Filistin.',NULL),(2305,'PERJANJIAN LAMA','KEJADIAN',10,NULL,15,'Kanaan memperanakkan Sidon, anak sulungnya, dan Het,',NULL),(2306,'PERJANJIAN LAMA','KEJADIAN',10,NULL,16,'serta orang Yebusi, orang Amori dan orang Girgasi;',NULL),(2307,'PERJANJIAN LAMA','KEJADIAN',10,NULL,17,'orang Hewi, orang Arki, orang Sini,',NULL),(2308,'PERJANJIAN LAMA','KEJADIAN',10,NULL,18,'orang Arwadi, orang Semari dan orang Hamati; kemudian berseraklah kaum-kaum orang Kanaan itu.',NULL),(2309,'PERJANJIAN LAMA','KEJADIAN',10,NULL,19,'Daerah orang Kanaan adalah dari Sidon ke arah Gerar sampai ke Gaza, ke arah Sodom, Gomora, Adma dan Zeboim sampai ke Lasa.',NULL),(2310,'PERJANJIAN LAMA','KEJADIAN',10,NULL,20,'Itulah keturunan Ham menurut kaum mereka, menurut bahasa mereka, menurut tanah mereka, menurut bangsa mereka.',NULL),(2311,'PERJANJIAN LAMA','KEJADIAN',10,NULL,21,'Lahirlah juga anak-anak bagi Sem, bapa semua anak Eber serta abang Yafet.',NULL),(2312,'PERJANJIAN LAMA','KEJADIAN',10,NULL,22,'Keturunan Sem ialah Elam, Asyur, Arpakhsad, Lud dan Aram.',NULL),(2313,'PERJANJIAN LAMA','KEJADIAN',10,NULL,23,'Keturunan Aram ialah Us, Hul, Geter dan Mas.',NULL),(2314,'PERJANJIAN LAMA','KEJADIAN',10,NULL,24,'Arpakhsad memperanakkan Selah, dan Selah memperanakkan Eber.',NULL),(2315,'PERJANJIAN LAMA','KEJADIAN',10,NULL,25,'Bagi Eber lahir dua anak laki-laki; nama yang seorang ialah Peleg, sebab dalam zamannya bumi terbagi, dan nama adiknya ialah Yoktan.',NULL),(2316,'PERJANJIAN LAMA','KEJADIAN',10,NULL,26,'Yoktan memperanakkan Almodad, Selef, Hazar-Mawet dan Yerah,',NULL),(2317,'PERJANJIAN LAMA','KEJADIAN',10,NULL,27,'Hadoram, Uzal dan Dikla,',NULL),(2318,'PERJANJIAN LAMA','KEJADIAN',10,NULL,28,'Obal, Abimael dan Syeba,',NULL),(2319,'PERJANJIAN LAMA','KEJADIAN',10,NULL,29,'Ofir, Hawila dan Yobab; itulah semuanya keturunan Yoktan.',NULL),(2320,'PERJANJIAN LAMA','KEJADIAN',10,NULL,30,'Daerah kediaman mereka terbentang dari Mesa ke arah Sefar, yaitu pegunungan di sebelah timur.',NULL),(2321,'PERJANJIAN LAMA','KEJADIAN',10,NULL,31,'Itulah keturunan Sem, menurut kaum mereka, menurut bahasa mereka, menurut tanah mereka, menurut bangsa mereka.',NULL),(2322,'PERJANJIAN LAMA','KEJADIAN',10,NULL,32,'Itulah segala kaum anak-anak Nuh menurut keturunan mereka, menurut bangsa mereka. Dan dari mereka itulah berpencar bangsa-bangsa di bumi setelah air bah itu.',NULL),(2323,'PERJANJIAN LAMA','KEJADIAN',11,NULL,1,'Adapun seluruh bumi, satu bahasanya dan satu logatnya.',NULL),(2324,'PERJANJIAN LAMA','KEJADIAN',11,NULL,2,'Maka berangkatlah mereka ke sebelah timur dan menjumpai tanah datar di tanah Sinear, lalu menetaplah mereka di sana.',NULL),(2325,'PERJANJIAN LAMA','KEJADIAN',11,NULL,3,'Mereka berkata seorang kepada yang lain: \"Marilah kita membuat batu bata dan membakarnya baik-baik.\" Lalu bata itulah dipakai mereka sebagai batu dan ter gala-gala sebagai tanah liat.',NULL),(2326,'PERJANJIAN LAMA','KEJADIAN',11,NULL,4,'Juga kata mereka: \"Marilah kita dirikan bagi kita sebuah kota dengan sebuah menara yang puncaknya sampai ke langit, dan marilah kita cari nama, supaya kita jangan terserak ke seluruh bumi.\"',NULL),(2327,'PERJANJIAN LAMA','KEJADIAN',11,NULL,5,'Lalu turunlah TUHAN untuk melihat kota dan menara yang didirikan oleh anak-anak manusia itu,',NULL),(2328,'PERJANJIAN LAMA','KEJADIAN',11,NULL,6,'dan Ia berfirman: \"Mereka ini satu bangsa dengan satu bahasa untuk semuanya. Ini barulah permulaan usaha mereka; mulai dari sekarang apapun juga yang mereka rencanakan, tidak ada yang tidak akan dapat terlaksana.',NULL),(2329,'PERJANJIAN LAMA','KEJADIAN',11,NULL,7,'Baiklah Kita turun dan mengacaubalaukan di sana bahasa mereka, sehingga mereka tidak mengerti lagi bahasa masing-masing.\"',NULL),(2330,'PERJANJIAN LAMA','KEJADIAN',11,NULL,8,'Demikianlah mereka diserakkan TUHAN dari situ ke seluruh bumi, dan mereka berhenti mendirikan kota itu.',NULL),(2331,'PERJANJIAN LAMA','KEJADIAN',11,NULL,9,'Itulah sebabnya sampai sekarang nama kota itu disebut Babel, karena di situlah dikacaubalaukan TUHAN bahasa seluruh bumi dan dari situlah mereka diserakkan TUHAN ke seluruh bumi.',NULL),(2332,'PERJANJIAN LAMA','KEJADIAN',11,NULL,10,'Inilah keturunan Sem. Setelah Sem berumur seratus tahun, ia memperanakkan Arpakhsad, dua tahun setelah air bah itu.',NULL),(2333,'PERJANJIAN LAMA','KEJADIAN',11,NULL,11,'Sem masih hidup lima ratus tahun, setelah ia memperanakkan Arpakhsad, dan ia memperanakkan anak-anak lelaki dan perempuan.',NULL),(2334,'PERJANJIAN LAMA','KEJADIAN',11,NULL,12,'Setelah Arpakhsad hidup tiga puluh lima tahun, ia memperanakkan Selah.',NULL),(2335,'PERJANJIAN LAMA','KEJADIAN',11,NULL,13,'Arpakhsad masih hidup empat ratus tiga tahun, setelah ia memperanakkan Selah, dan ia memperanakkan anak-anak lelaki dan perempuan.',NULL),(2336,'PERJANJIAN LAMA','KEJADIAN',11,NULL,14,'Setelah Selah hidup tiga puluh tahun, ia memperanakkan Eber.',NULL),(2337,'PERJANJIAN LAMA','KEJADIAN',11,NULL,15,'Selah masih hidup empat ratus tiga tahun, setelah ia memperanakkan Eber, dan ia memperanakkan anak-anak lelaki dan perempuan.',NULL),(2338,'PERJANJIAN LAMA','KEJADIAN',11,NULL,16,'Setelah Eber hidup tiga puluh empat tahun, ia memperanakkan Peleg.',NULL),(2339,'PERJANJIAN LAMA','KEJADIAN',11,NULL,17,'Eber masih hidup empat ratus tiga puluh tahun, setelah ia memperanakkan Peleg, dan ia memperanakkan anak-anak lelaki dan perempuan.',NULL),(2340,'PERJANJIAN LAMA','KEJADIAN',11,NULL,18,'Setelah Peleg hidup tiga puluh tahun, ia memperanakkan Rehu.',NULL),(2341,'PERJANJIAN LAMA','KEJADIAN',11,NULL,19,'Peleg masih hidup dua ratus sembilan tahun, setelah ia memperanakkan Rehu, dan ia memperanakkan anak-anak lelaki dan perempuan.',NULL),(2342,'PERJANJIAN LAMA','KEJADIAN',11,NULL,20,'Setelah Rehu hidup tiga puluh dua tahun, ia memperanakkan Serug.',NULL),(2343,'PERJANJIAN LAMA','KEJADIAN',11,NULL,21,'Rehu masih hidup dua ratus tujuh tahun, setelah ia memperanakkan Serug, dan ia memperanakkan anak-anak lelaki dan perempuan.',NULL),(2344,'PERJANJIAN LAMA','KEJADIAN',11,NULL,22,'Setelah Serug hidup tiga puluh tahun, ia memperanakkan Nahor.',NULL),(2345,'PERJANJIAN LAMA','KEJADIAN',11,NULL,23,'Serug masih hidup dua ratus tahun, setelah ia memperanakkan Nahor, dan ia memperanakkan anak-anak lelaki dan perempuan.',NULL),(2346,'PERJANJIAN LAMA','KEJADIAN',11,NULL,24,'Setelah Nahor hidup dua puluh sembilan tahun, ia memperanakkan Terah.',NULL),(2347,'PERJANJIAN LAMA','KEJADIAN',11,NULL,25,'Nahor masih hidup seratus sembilan belas tahun, setelah ia memperanakkan Terah, dan ia memperanakkan anak-anak lelaki dan perempuan.',NULL),(2348,'PERJANJIAN LAMA','KEJADIAN',11,NULL,26,'Setelah Terah hidup tujuh puluh tahun, ia memperanakkan Abram, Nahor dan Haran.',NULL),(2349,'PERJANJIAN LAMA','KEJADIAN',11,NULL,27,'Inilah keturunan Terah. Terah memperanakkan Abram, Nahor dan Haran, dan Haran memperanakkan Lot.',NULL),(2350,'PERJANJIAN LAMA','KEJADIAN',11,NULL,28,'Ketika Terah, ayahnya, masih hidup, matilah Haran di negeri kelahirannya, di Ur-Kasdim.',NULL),(2351,'PERJANJIAN LAMA','KEJADIAN',11,NULL,29,'Abram dan Nahor kedua-duanya kawin; nama isteri Abram ialah Sarai, dan nama isteri Nahor ialah Milka, anak Haran ayah Milka dan Yiska.',NULL),(2352,'PERJANJIAN LAMA','KEJADIAN',11,NULL,30,'Sarai itu mandul, tidak mempunyai anak.',NULL),(2353,'PERJANJIAN LAMA','KEJADIAN',11,NULL,31,'Lalu Terah membawa Abram, anaknya, serta cucunya, Lot, yaitu anak Haran, dan Sarai, menantunya, isteri Abram, anaknya; ia berangkat bersama-sama dengan mereka dari Ur-Kasdim untuk pergi ke tanah Kanaan, lalu sampailah mereka ke Haran, dan menetap di sana.',NULL),(2354,'PERJANJIAN LAMA','KEJADIAN',11,NULL,32,'Umur Terah ada dua ratus lima tahun; lalu ia mati di Haran.',NULL),(2355,'PERJANJIAN LAMA','KEJADIAN',12,NULL,1,'Berfirmanlah TUHAN kepada Abram: \"Pergilah dari negerimu dan dari sanak saudaramu dan dari rumah bapamu ini ke negeri yang akan Kutunjukkan kepadamu;',NULL),(2356,'PERJANJIAN LAMA','KEJADIAN',12,NULL,2,'Aku akan membuat engkau menjadi bangsa yang besar, dan memberkati engkau serta membuat namamu masyhur; dan engkau akan menjadi berkat.',NULL),(2357,'PERJANJIAN LAMA','KEJADIAN',12,NULL,3,'Aku akan memberkati orang-orang yang memberkati engkau, dan mengutuk orang-orang yang mengutuk engkau, dan olehmu semua kaum di muka bumi akan mendapat berkat.\"',NULL),(2358,'PERJANJIAN LAMA','KEJADIAN',12,NULL,4,'Lalu pergilah Abram seperti yang difirmankan TUHAN kepadanya, dan Lotpun ikut bersama-sama dengan dia; Abram berumur tujuh puluh lima tahun, ketika ia berangkat dari Haran.',NULL),(2359,'PERJANJIAN LAMA','KEJADIAN',12,NULL,5,'Abram membawa Sarai, isterinya, dan Lot, anak saudaranya, dan segala harta benda yang didapat mereka dan orang-orang yang diperoleh mereka di Haran; mereka berangkat ke tanah Kanaan, lalu sampai di situ.',NULL),(2360,'PERJANJIAN LAMA','KEJADIAN',12,NULL,6,'Abram berjalan melalui negeri itu sampai ke suatu tempat dekat Sikhem, yakni pohon tarbantin di More. Waktu itu orang Kanaan diam di negeri itu.',NULL),(2361,'PERJANJIAN LAMA','KEJADIAN',12,NULL,7,'Ketika itu TUHAN menampakkan diri kepada Abram dan berfirman: \"Aku akan memberikan negeri ini kepada keturunanmu.\" Maka didirikannya di situ mezbah bagi TUHAN yang telah menampakkan diri kepadanya.',NULL),(2362,'PERJANJIAN LAMA','KEJADIAN',12,NULL,8,'Kemudian ia pindah dari situ ke pegunungan di sebelah timur Betel. Ia memasang kemahnya dengan Betel di sebelah barat dan Ai di sebelah timur, lalu ia mendirikan di situ mezbah bagi TUHAN dan memanggil nama TUHAN.',NULL),(2363,'PERJANJIAN LAMA','KEJADIAN',12,NULL,9,'Sesudah itu Abram berangkat dan makin jauh ia berjalan ke Tanah Negeb.',NULL),(2364,'PERJANJIAN LAMA','KEJADIAN',12,NULL,10,'Ketika kelaparan timbul di negeri itu, pergilah Abram ke Mesir untuk tinggal di situ sebagai orang asing, sebab hebat kelaparan di negeri itu.',NULL),(2365,'PERJANJIAN LAMA','KEJADIAN',12,NULL,11,'Pada waktu ia akan masuk ke Mesir, berkatalah ia kepada Sarai, isterinya: \"Memang aku tahu, bahwa engkau adalah seorang perempuan yang cantik parasnya.',NULL),(2366,'PERJANJIAN LAMA','KEJADIAN',12,NULL,12,'Apabila orang Mesir melihat engkau, mereka akan berkata: Itu isterinya. Jadi mereka akan membunuh aku dan membiarkan engkau hidup.',NULL),(2367,'PERJANJIAN LAMA','KEJADIAN',12,NULL,13,'Katakanlah, bahwa engkau adikku, supaya aku diperlakukan mereka dengan baik karena engkau, dan aku dibiarkan hidup oleh sebab engkau.\"',NULL),(2368,'PERJANJIAN LAMA','KEJADIAN',12,NULL,14,'Sesudah Abram masuk ke Mesir, orang Mesir itu melihat, bahwa perempuan itu sangat cantik,',NULL),(2369,'PERJANJIAN LAMA','KEJADIAN',12,NULL,15,'dan ketika punggawa-punggawa Firaun melihat Sarai, mereka memuji-mujinya di hadapan Firaun, sehingga perempuan itu dibawa ke istananya.',NULL),(2370,'PERJANJIAN LAMA','KEJADIAN',12,NULL,16,'Firaun menyambut Abram dengan baik-baik, karena ia mengingini perempuan itu, dan Abram mendapat kambing domba, lembu sapi, keledai jantan, budak laki-laki dan perempuan, keledai betina dan unta.',NULL),(2371,'PERJANJIAN LAMA','KEJADIAN',12,NULL,17,'Tetapi TUHAN menimpakan tulah yang hebat kepada Firaun, demikian juga kepada seisi istananya, karena Sarai, isteri Abram itu.',NULL),(2372,'PERJANJIAN LAMA','KEJADIAN',12,NULL,18,'Lalu Firaun memanggil Abram serta berkata: \"Apakah yang kauperbuat ini terhadap aku? Mengapa tidak kauberitahukan, bahwa ia isterimu?',NULL),(2373,'PERJANJIAN LAMA','KEJADIAN',12,NULL,19,'Mengapa engkau katakan: dia adikku, sehingga aku mengambilnya menjadi isteriku? Sekarang, inilah isterimu, ambillah dan pergilah!\"',NULL),(2374,'PERJANJIAN LAMA','KEJADIAN',12,NULL,20,'Lalu Firaun memerintahkan beberapa orang untuk mengantarkan Abram pergi, bersama-sama dengan isterinya dan segala kepunyaannya.',NULL),(2375,'PERJANJIAN LAMA','KEJADIAN',13,NULL,1,'Maka pergilah Abram dari Mesir ke Tanah Negeb dengan isterinya dan segala kepunyaannya, dan Lotpun bersama-sama dengan dia.',NULL),(2376,'PERJANJIAN LAMA','KEJADIAN',13,NULL,2,'Adapun Abram sangat kaya, banyak ternak, perak dan emasnya.',NULL),(2377,'PERJANJIAN LAMA','KEJADIAN',13,NULL,3,'Ia berjalan dari tempat persinggahan ke tempat persinggahan, dari Tanah Negeb sampai dekat Betel, di mana kemahnya mula-mula berdiri, antara Betel dan Ai,',NULL),(2378,'PERJANJIAN LAMA','KEJADIAN',13,NULL,4,'ke tempat mezbah yang dibuatnya dahulu di sana; di situlah Abram memanggil nama TUHAN.',NULL),(2379,'PERJANJIAN LAMA','KEJADIAN',13,NULL,5,'Juga Lot, yang ikut bersama-sama dengan Abram, mempunyai domba dan lembu dan kemah.',NULL),(2380,'PERJANJIAN LAMA','KEJADIAN',13,NULL,6,'Tetapi negeri itu tidak cukup luas bagi mereka untuk diam bersama-sama, sebab harta milik mereka amat banyak, sehingga mereka tidak dapat diam bersama-sama.',NULL),(2381,'PERJANJIAN LAMA','KEJADIAN',13,NULL,7,'Karena itu terjadilah perkelahian antara para gembala Abram dan para gembala Lot. Waktu itu orang Kanaan dan orang Feris diam di negeri itu.',NULL),(2382,'PERJANJIAN LAMA','KEJADIAN',13,NULL,8,'Maka berkatalah Abram kepada Lot: \"Janganlah kiranya ada perkelahian antara aku dan engkau, dan antara para gembalaku dan para gembalamu, sebab kita ini kerabat.',NULL),(2383,'PERJANJIAN LAMA','KEJADIAN',13,NULL,9,'Bukankah seluruh negeri ini terbuka untuk engkau? Baiklah pisahkan dirimu dari padaku; jika engkau ke kiri, maka aku ke kanan, jika engkau ke kanan, maka aku ke kiri.\"',NULL),(2384,'PERJANJIAN LAMA','KEJADIAN',13,NULL,10,'Lalu Lot melayangkan pandangnya dan dilihatnyalah, bahwa seluruh Lembah Yordan banyak airnya, seperti taman TUHAN, seperti tanah Mesir, sampai ke Zoar. --Hal itu terjadi sebelum TUHAN memusnahkan Sodom dan Gomora. --',NULL),(2385,'PERJANJIAN LAMA','KEJADIAN',13,NULL,11,'Sebab itu Lot memilih baginya seluruh Lembah Yordan itu, lalu ia berangkat ke sebelah timur dan mereka berpisah.',NULL),(2386,'PERJANJIAN LAMA','KEJADIAN',13,NULL,12,'Abram menetap di tanah Kanaan, tetapi Lot menetap di kota-kota Lembah Yordan dan berkemah di dekat Sodom.',NULL),(2387,'PERJANJIAN LAMA','KEJADIAN',13,NULL,13,'Adapun orang Sodom sangat jahat dan berdosa terhadap TUHAN.',NULL),(2388,'PERJANJIAN LAMA','KEJADIAN',13,NULL,14,'Setelah Lot berpisah dari pada Abram, berfirmanlah TUHAN kepada Abram: \"Pandanglah sekelilingmu dan lihatlah dari tempat engkau berdiri itu ke timur dan barat, utara dan selatan,',NULL),(2389,'PERJANJIAN LAMA','KEJADIAN',13,NULL,15,'sebab seluruh negeri yang kaulihat itu akan Kuberikan kepadamu dan kepada keturunanmu untuk selama-lamanya.',NULL),(2390,'PERJANJIAN LAMA','KEJADIAN',13,NULL,16,'Dan Aku akan menjadikan keturunanmu seperti debu tanah banyaknya, sehingga, jika seandainya ada yang dapat menghitung debu tanah, keturunanmupun akan dapat dihitung juga.',NULL),(2391,'PERJANJIAN LAMA','KEJADIAN',13,NULL,17,'Bersiaplah, jalanilah negeri itu menurut panjang dan lebarnya, sebab kepadamulah akan Kuberikan negeri itu.\"',NULL),(2392,'PERJANJIAN LAMA','KEJADIAN',13,NULL,18,'Sesudah itu Abram memindahkan kemahnya dan menetap di dekat pohon-pohon tarbantin di Mamre, dekat Hebron, lalu didirikannyalah mezbah di situ bagi TUHAN.',NULL),(2393,'PERJANJIAN LAMA','KEJADIAN',14,NULL,1,'Pada zaman Amrafel, raja Sinear, Ariokh, raja Elasar, Kedorlaomer, raja Elam, dan Tideal, raja Goyim, terjadilah,',NULL),(2394,'PERJANJIAN LAMA','KEJADIAN',14,NULL,2,'bahwa raja-raja ini berperang melawan Bera, raja Sodom, Birsya, raja Gomora, Syinab, raja Adma, Syemeber, raja Zeboim dan raja negeri Bela, yakni negeri Zoar.',NULL),(2395,'PERJANJIAN LAMA','KEJADIAN',14,NULL,3,'Raja-raja yang disebut terakhir ini semuanya bersekutu dan datang ke lembah Sidim, yakni Laut Asin.',NULL),(2396,'PERJANJIAN LAMA','KEJADIAN',14,NULL,4,'Dua belas tahun lamanya mereka takluk kepada Kedorlaomer, tetapi dalam tahun yang ketiga belas mereka memberontak.',NULL),(2397,'PERJANJIAN LAMA','KEJADIAN',14,NULL,5,'Dalam tahun yang keempat belas datanglah Kedorlaomer serta raja-raja yang bersama-sama dengan dia, lalu mereka mengalahkan orang Refaim di Asyterot-Karnaim, orang Zuzim di Ham, orang Emim di Syawe-Kiryataim',NULL),(2398,'PERJANJIAN LAMA','KEJADIAN',14,NULL,6,'dan orang Hori di pegunungan mereka yang bernama Seir, sampai ke El-Paran di tepi padang gurun.',NULL),(2399,'PERJANJIAN LAMA','KEJADIAN',14,NULL,7,'Sesudah itu baliklah mereka dan sampai ke En-Mispat, yakni Kadesh, dan mengalahkan seluruh daerah orang Amalek, dan juga orang Amori, yang diam di Hazezon-Tamar.',NULL),(2400,'PERJANJIAN LAMA','KEJADIAN',14,NULL,8,'Lalu keluarlah raja negeri Sodom, raja negeri Gomora, raja negeri Adma, raja negeri Zeboim dan raja negeri Bela, yakni negeri Zoar, dan mengatur barisan perangnya melawan mereka di lembah Sidim,',NULL),(2401,'PERJANJIAN LAMA','KEJADIAN',14,NULL,9,'melawan Kedorlaomer, raja Elam, Tideal, raja Goyim, Amrafel, raja Sinear, dan Ariokh, raja Elasar, empat raja lawan lima.',NULL),(2402,'PERJANJIAN LAMA','KEJADIAN',14,NULL,10,'Di lembah Sidim itu di mana-mana ada sumur aspal. Ketika raja Sodom dan raja Gomora melarikan diri, jatuhlah mereka ke dalamnya, dan orang-orang yang masih tinggal hidup melarikan diri ke pegunungan.',NULL),(2403,'PERJANJIAN LAMA','KEJADIAN',14,NULL,11,'Segala harta benda Sodom dan Gomora beserta segala bahan makanan dirampas musuh, lalu mereka pergi.',NULL),(2404,'PERJANJIAN LAMA','KEJADIAN',14,NULL,12,'Juga Lot, anak saudara Abram, beserta harta bendanya, dibawa musuh, lalu mereka pergi--sebab Lot itu diam di Sodom.',NULL),(2405,'PERJANJIAN LAMA','KEJADIAN',14,NULL,13,'Kemudian datanglah seorang pelarian dan menceritakan hal ini kepada Abram, orang Ibrani itu, yang tinggal dekat pohon-pohon tarbantin kepunyaan Mamre, orang Amori itu, saudara Eskol dan Aner, yakni teman-teman sekutu Abram.',NULL),(2406,'PERJANJIAN LAMA','KEJADIAN',14,NULL,14,'Ketika Abram mendengar, bahwa anak saudaranya tertawan, maka dikerahkannyalah orang-orangnya yang terlatih, yakni mereka yang lahir di rumahnya, tiga ratus delapan belas orang banyaknya, lalu mengejar musuh sampai ke Dan.',NULL),(2407,'PERJANJIAN LAMA','KEJADIAN',14,NULL,15,'Dan pada waktu malam berbagilah mereka, ia dan hamba-hambanya itu, untuk melawan musuh; mereka mengalahkan dan mengejar musuh sampai ke Hoba di sebelah utara Damsyik.',NULL),(2408,'PERJANJIAN LAMA','KEJADIAN',14,NULL,16,'Dibawanyalah kembali segala harta benda itu; juga Lot, anak saudaranya itu, serta harta bendanya dibawanya kembali, demikian juga perempuan-perempuan dan orang-orangnya.',NULL),(2409,'PERJANJIAN LAMA','KEJADIAN',14,NULL,17,'Setelah Abram kembali dari mengalahkan Kedorlaomer dan para raja yang bersama-sama dengan dia, maka keluarlah raja Sodom menyongsong dia ke lembah Syawe, yakni Lembah Raja.',NULL),(2410,'PERJANJIAN LAMA','KEJADIAN',14,NULL,18,'Melkisedek, raja Salem, membawa roti dan anggur; ia seorang imam Allah Yang Mahatinggi.',NULL),(2411,'PERJANJIAN LAMA','KEJADIAN',14,NULL,19,'Lalu ia memberkati Abram, katanya: \"Diberkatilah kiranya Abram oleh Allah Yang Mahatinggi, Pencipta langit dan bumi,',NULL),(2412,'PERJANJIAN LAMA','KEJADIAN',14,NULL,20,'dan terpujilah Allah Yang Mahatinggi, yang telah menyerahkan musuhmu ke tanganmu.\" Lalu Abram memberikan kepadanya sepersepuluh dari semuanya.',NULL),(2413,'PERJANJIAN LAMA','KEJADIAN',14,NULL,21,'Berkatalah raja Sodom itu kepada Abram: \"Berikanlah kepadaku orang-orang itu, dan ambillah untukmu harta benda itu.\"',NULL),(2414,'PERJANJIAN LAMA','KEJADIAN',14,NULL,22,'Tetapi kata Abram kepada raja negeri Sodom itu: \"Aku bersumpah demi TUHAN, Allah Yang Mahatinggi, Pencipta langit dan bumi:',NULL),(2415,'PERJANJIAN LAMA','KEJADIAN',14,NULL,23,'Aku tidak akan mengambil apa-apa dari kepunyaanmu itu, sepotong benang atau tali kasutpun tidak, supaya engkau jangan dapat berkata: Aku telah membuat Abram menjadi kaya.',NULL),(2416,'PERJANJIAN LAMA','KEJADIAN',14,NULL,24,'Kalau aku, jangan sekali-kali! Hanya apa yang telah dimakan oleh bujang-bujang ini dan juga bagian orang-orang yang pergi bersama-sama dengan aku, yakni Aner, Eskol dan Mamre, biarlah mereka itu mengambil bagiannya masing-masing.\"',NULL),(2417,'PERJANJIAN LAMA','KEJADIAN',15,NULL,1,'Kemudian datanglah firman TUHAN kepada Abram dalam suatu penglihatan: \"Janganlah takut, Abram, Akulah perisaimu; upahmu akan sangat besar.\"',NULL),(2418,'PERJANJIAN LAMA','KEJADIAN',15,NULL,2,'Abram menjawab: \"Ya Tuhan ALLAH, apakah yang akan Engkau berikan kepadaku, karena aku akan meninggal dengan tidak mempunyai anak, dan yang akan mewarisi rumahku ialah Eliezer, orang Damsyik itu.\"',NULL),(2419,'PERJANJIAN LAMA','KEJADIAN',15,NULL,3,'Lagi kata Abram: \"Engkau tidak memberikan kepadaku keturunan, sehingga seorang hambaku nanti menjadi ahli warisku.\"',NULL),(2420,'PERJANJIAN LAMA','KEJADIAN',15,NULL,4,'Tetapi datanglah firman TUHAN kepadanya, demikian: \"Orang ini tidak akan menjadi ahli warismu, melainkan anak kandungmu, dialah yang akan menjadi ahli warismu.\"',NULL),(2421,'PERJANJIAN LAMA','KEJADIAN',15,NULL,5,'Lalu TUHAN membawa Abram ke luar serta berfirman: \"Coba lihat ke langit, hitunglah bintang-bintang, jika engkau dapat menghitungnya.\" Maka firman-Nya kepadanya: \"Demikianlah banyaknya nanti keturunanmu.\"',NULL),(2422,'PERJANJIAN LAMA','KEJADIAN',15,NULL,6,'Lalu percayalah Abram kepada TUHAN, maka TUHAN memperhitungkan hal itu kepadanya sebagai kebenaran.',NULL),(2423,'PERJANJIAN LAMA','KEJADIAN',15,NULL,7,'Lagi firman TUHAN kepadanya: \"Akulah TUHAN, yang membawa engkau keluar dari Ur-Kasdim untuk memberikan negeri ini kepadamu menjadi milikmu.\"',NULL),(2424,'PERJANJIAN LAMA','KEJADIAN',15,NULL,8,'Kata Abram: \"Ya Tuhan ALLAH, dari manakah aku tahu, bahwa aku akan memilikinya?\"',NULL),(2425,'PERJANJIAN LAMA','KEJADIAN',15,NULL,9,'Firman TUHAN kepadanya: \"Ambillah bagi-Ku seekor lembu betina berumur tiga tahun, seekor kambing betina berumur tiga tahun, seekor domba jantan berumur tiga tahun, seekor burung tekukur dan seekor anak burung merpati.\"',NULL),(2426,'PERJANJIAN LAMA','KEJADIAN',15,NULL,10,'Diambilnyalah semuanya itu bagi TUHAN, dipotong dua, lalu diletakkannya bagian-bagian itu yang satu di samping yang lain, tetapi burung-burung itu tidak dipotong dua.',NULL),(2427,'PERJANJIAN LAMA','KEJADIAN',15,NULL,11,'Ketika burung-burung buas hinggap pada daging binatang-binatang itu, maka Abram mengusirnya.',NULL),(2428,'PERJANJIAN LAMA','KEJADIAN',15,NULL,12,'Menjelang matahari terbenam, tertidurlah Abram dengan nyenyak. Lalu turunlah meliputinya gelap gulita yang mengerikan.',NULL),(2429,'PERJANJIAN LAMA','KEJADIAN',15,NULL,13,'Firman TUHAN kepada Abram: \"Ketahuilah dengan sesungguhnya bahwa keturunanmu akan menjadi orang asing dalam suatu negeri, yang bukan kepunyaan mereka, dan bahwa mereka akan diperbudak dan dianiaya, empat ratus tahun lamanya.',NULL),(2430,'PERJANJIAN LAMA','KEJADIAN',15,NULL,14,'Tetapi bangsa yang akan memperbudak mereka, akan Kuhukum, dan sesudah itu mereka akan keluar dengan membawa harta benda yang banyak.',NULL),(2431,'PERJANJIAN LAMA','KEJADIAN',15,NULL,15,'Tetapi engkau akan pergi kepada nenek moyangmu dengan sejahtera; engkau akan dikuburkan pada waktu telah putih rambutmu.',NULL),(2432,'PERJANJIAN LAMA','KEJADIAN',15,NULL,16,'Tetapi keturunan yang keempat akan kembali ke sini, sebab sebelum itu kedurjanaan orang Amori itu belum genap.\"',NULL),(2433,'PERJANJIAN LAMA','KEJADIAN',15,NULL,17,'Ketika matahari telah terbenam, dan hari menjadi gelap, maka kelihatanlah perapian yang berasap beserta suluh yang berapi lewat di antara potongan-potongan daging itu.',NULL),(2434,'PERJANJIAN LAMA','KEJADIAN',15,NULL,18,'Pada hari itulah TUHAN mengadakan perjanjian dengan Abram serta berfirman: \"Kepada keturunanmulah Kuberikan negeri ini, mulai dari sungai Mesir sampai ke sungai yang besar itu, sungai Efrat:',NULL),(2435,'PERJANJIAN LAMA','KEJADIAN',15,NULL,19,'yakni tanah orang Keni, orang Kenas, orang Kadmon,',NULL),(2436,'PERJANJIAN LAMA','KEJADIAN',15,NULL,20,'orang Het, orang Feris, orang Refaim,',NULL),(2437,'PERJANJIAN LAMA','KEJADIAN',15,NULL,21,'orang Amori, orang Kanaan, orang Girgasi dan orang Yebus itu.\"',NULL),(2438,'PERJANJIAN LAMA','KEJADIAN',16,NULL,1,'Adapun Sarai, isteri Abram itu, tidak beranak. Ia mempunyai seorang hamba perempuan, orang Mesir, Hagar namanya.',NULL),(2439,'PERJANJIAN LAMA','KEJADIAN',16,NULL,2,'Berkatalah Sarai kepada Abram: \"Engkau tahu, TUHAN tidak memberi aku melahirkan anak. Karena itu baiklah hampiri hambaku itu; mungkin oleh dialah aku dapat memperoleh seorang anak.\" Dan Abram mendengarkan perkataan Sarai.',NULL),(2440,'PERJANJIAN LAMA','KEJADIAN',16,NULL,3,'Jadi Sarai, isteri Abram itu, mengambil Hagar, hambanya, orang Mesir itu, --yakni ketika Abram telah sepuluh tahun tinggal di tanah Kanaan--,lalu memberikannya kepada Abram, suaminya, untuk menjadi isterinya.',NULL),(2441,'PERJANJIAN LAMA','KEJADIAN',16,NULL,4,'Abram menghampiri Hagar, lalu mengandunglah perempuan itu. Ketika Hagar tahu, bahwa ia mengandung, maka ia memandang rendah akan nyonyanya itu.',NULL),(2442,'PERJANJIAN LAMA','KEJADIAN',16,NULL,5,'Lalu berkatalah Sarai kepada Abram: \"Penghinaan yang kuderita ini adalah tanggung jawabmu; akulah yang memberikan hambaku ke pangkuanmu, tetapi baru saja ia tahu, bahwa ia mengandung, ia memandang rendah akan aku; TUHAN kiranya yang menjadi Hakim antara a',NULL),(2443,'PERJANJIAN LAMA','KEJADIAN',16,NULL,6,'Kata Abram kepada Sarai: \"Hambamu itu di bawah kekuasaanmu; perbuatlah kepadanya apa yang kaupandang baik.\" Lalu Sarai menindas Hagar, sehingga ia lari meninggalkannya.',NULL),(2444,'PERJANJIAN LAMA','KEJADIAN',16,NULL,7,'Lalu Malaikat TUHAN menjumpainya dekat suatu mata air di padang gurun, yakni dekat mata air di jalan ke Syur.',NULL),(2445,'PERJANJIAN LAMA','KEJADIAN',16,NULL,8,'Katanya: \"Hagar, hamba Sarai, dari manakah datangmu dan ke manakah pergimu?\" Jawabnya: \"Aku lari meninggalkan Sarai, nyonyaku.\"',NULL),(2446,'PERJANJIAN LAMA','KEJADIAN',16,NULL,9,'Lalu kata Malaikat TUHAN itu kepadanya: \"Kembalilah kepada nyonyamu, biarkanlah engkau ditindas di bawah kekuasaannya.\"',NULL),(2447,'PERJANJIAN LAMA','KEJADIAN',16,NULL,10,'Lagi kata Malaikat TUHAN itu kepadanya: \"Aku akan membuat sangat banyak keturunanmu, sehingga tidak dapat dihitung karena banyaknya.\"',NULL),(2448,'PERJANJIAN LAMA','KEJADIAN',16,NULL,11,'Selanjutnya kata Malaikat TUHAN itu kepadanya: \"Engkau mengandung dan akan melahirkan seorang anak laki-laki dan akan menamainya Ismael, sebab TUHAN telah mendengar tentang penindasan atasmu itu.',NULL),(2449,'PERJANJIAN LAMA','KEJADIAN',16,NULL,12,'Seorang laki-laki yang lakunya seperti keledai liar, demikianlah nanti anak itu; tangannya akan melawan tiap-tiap orang dan tangan tiap-tiap orang akan melawan dia, dan di tempat kediamannya ia akan menentang semua saudaranya.\"',NULL),(2450,'PERJANJIAN LAMA','KEJADIAN',16,NULL,13,'Kemudian Hagar menamakan TUHAN yang telah berfirman kepadanya itu dengan sebutan: \"Engkaulah El-Roi.\" Sebab katanya: \"Bukankah di sini kulihat Dia yang telah melihat aku?\"',NULL),(2451,'PERJANJIAN LAMA','KEJADIAN',16,NULL,14,'Sebab itu sumur tadi disebutkan orang: sumur Lahai-Roi; letaknya antara Kadesh dan Bered.',NULL),(2452,'PERJANJIAN LAMA','KEJADIAN',16,NULL,15,'Lalu Hagar melahirkan seorang anak laki-laki bagi Abram dan Abram menamai anak yang dilahirkan Hagar itu Ismael.',NULL),(2453,'PERJANJIAN LAMA','KEJADIAN',16,NULL,16,'Abram berumur delapan puluh enam tahun, ketika Hagar melahirkan Ismael baginya.',NULL),(2454,'PERJANJIAN LAMA','KEJADIAN',17,NULL,1,'Ketika Abram berumur sembilan puluh sembilan tahun, maka TUHAN menampakkan diri kepada Abram dan berfirman kepadanya: \"Akulah Allah Yang Mahakuasa, hiduplah di hadapan-Ku dengan tidak bercela.',NULL),(2455,'PERJANJIAN LAMA','KEJADIAN',17,NULL,2,'Aku akan mengadakan perjanjian antara Aku dan engkau, dan Aku akan membuat engkau sangat banyak.\"',NULL),(2456,'PERJANJIAN LAMA','KEJADIAN',17,NULL,3,'Lalu sujudlah Abram, dan Allah berfirman kepadanya:',NULL),(2457,'PERJANJIAN LAMA','KEJADIAN',17,NULL,4,'\"Dari pihak-Ku, inilah perjanjian-Ku dengan engkau: Engkau akan menjadi bapa sejumlah besar bangsa.',NULL),(2458,'PERJANJIAN LAMA','KEJADIAN',17,NULL,5,'Karena itu namamu bukan lagi Abram, melainkan Abraham, karena engkau telah Kutetapkan menjadi bapa sejumlah besar bangsa.',NULL),(2459,'PERJANJIAN LAMA','KEJADIAN',17,NULL,6,'Aku akan membuat engkau beranak cucu sangat banyak; engkau akan Kubuat menjadi bangsa-bangsa, dan dari padamu akan berasal raja-raja.',NULL),(2460,'PERJANJIAN LAMA','KEJADIAN',17,NULL,7,'Aku akan mengadakan perjanjian antara Aku dan engkau serta keturunanmu turun-temurun menjadi perjanjian yang kekal, supaya Aku menjadi Allahmu dan Allah keturunanmu.',NULL),(2461,'PERJANJIAN LAMA','KEJADIAN',17,NULL,8,'Kepadamu dan kepada keturunanmu akan Kuberikan negeri ini yang kaudiami sebagai orang asing, yakni seluruh tanah Kanaan akan Kuberikan menjadi milikmu untuk selama-lamanya; dan Aku akan menjadi Allah mereka.\"',NULL),(2462,'PERJANJIAN LAMA','KEJADIAN',17,NULL,9,'Lagi firman Allah kepada Abraham: \"Dari pihakmu, engkau harus memegang perjanjian-Ku, engkau dan keturunanmu turun-temurun.',NULL),(2463,'PERJANJIAN LAMA','KEJADIAN',17,NULL,10,'Inilah perjanjian-Ku, yang harus kamu pegang, perjanjian antara Aku dan kamu serta keturunanmu, yaitu setiap laki-laki di antara kamu harus disunat;',NULL),(2464,'PERJANJIAN LAMA','KEJADIAN',17,NULL,11,'haruslah dikerat kulit khatanmu dan itulah akan menjadi tanda perjanjian antara Aku dan kamu.',NULL),(2465,'PERJANJIAN LAMA','KEJADIAN',17,NULL,12,'Anak yang berumur delapan hari haruslah disunat, yakni setiap laki-laki di antara kamu, turun-temurun: baik yang lahir di rumahmu, maupun yang dibeli dengan uang dari salah seorang asing, tetapi tidak termasuk keturunanmu.',NULL),(2466,'PERJANJIAN LAMA','KEJADIAN',17,NULL,13,'Orang yang lahir di rumahmu dan orang yang engkau beli dengan uang harus disunat; maka dalam dagingmulah perjanjian-Ku itu menjadi perjanjian yang kekal.',NULL),(2467,'PERJANJIAN LAMA','KEJADIAN',17,NULL,14,'Dan orang yang tidak disunat, yakni laki-laki yang tidak dikerat kulit khatannya, maka orang itu harus dilenyapkan dari antara orang-orang sebangsanya: ia telah mengingkari perjanjian-Ku.\"',NULL),(2468,'PERJANJIAN LAMA','KEJADIAN',17,NULL,15,'Selanjutnya Allah berfirman kepada Abraham: \"Tentang isterimu Sarai, janganlah engkau menyebut dia lagi Sarai, tetapi Sara, itulah namanya.',NULL),(2469,'PERJANJIAN LAMA','KEJADIAN',17,NULL,16,'Aku akan memberkatinya, dan dari padanya juga Aku akan memberikan kepadamu seorang anak laki-laki, bahkan Aku akan memberkatinya, sehingga ia menjadi ibu bangsa-bangsa; raja-raja bangsa-bangsa akan lahir dari padanya.\"',NULL),(2470,'PERJANJIAN LAMA','KEJADIAN',17,NULL,17,'Lalu tertunduklah Abraham dan tertawa serta berkata dalam hatinya: \"Mungkinkah bagi seorang yang berumur seratus tahun dilahirkan seorang anak dan mungkinkah Sara, yang telah berumur sembilan puluh tahun itu melahirkan seorang anak?\"',NULL),(2471,'PERJANJIAN LAMA','KEJADIAN',17,NULL,18,'Dan Abraham berkata kepada Allah: \"Ah, sekiranya Ismael diperkenankan hidup di hadapan-Mu!\"',NULL),(2472,'PERJANJIAN LAMA','KEJADIAN',17,NULL,19,'Tetapi Allah berfirman: \"Tidak, melainkan isterimu Saralah yang akan melahirkan anak laki-laki bagimu, dan engkau akan menamai dia Ishak, dan Aku akan mengadakan perjanjian-Ku dengan dia menjadi perjanjian yang kekal untuk keturunannya.',NULL),(2473,'PERJANJIAN LAMA','KEJADIAN',17,NULL,20,'Tentang Ismael, Aku telah mendengarkan permintaanmu; ia akan Kuberkati, Kubuat beranak cucu dan sangat banyak; ia akan memperanakkan dua belas raja, dan Aku akan membuatnya menjadi bangsa yang besar.',NULL),(2474,'PERJANJIAN LAMA','KEJADIAN',17,NULL,21,'Tetapi perjanjian-Ku akan Kuadakan dengan Ishak, yang akan dilahirkan Sara bagimu tahun yang akan datang pada waktu seperti ini juga.\"',NULL),(2475,'PERJANJIAN LAMA','KEJADIAN',17,NULL,22,'Setelah selesai berfirman kepada Abraham, naiklah Allah meninggalkan Abraham.',NULL),(2476,'PERJANJIAN LAMA','KEJADIAN',17,NULL,23,'Setelah itu Abraham memanggil Ismael, anaknya, dan semua orang yang lahir di rumahnya, juga semua orang yang dibelinya dengan uang, yakni setiap laki-laki dari isi rumahnya, lalu ia mengerat kulit khatan mereka pada hari itu juga, seperti yang telah difir',NULL),(2477,'PERJANJIAN LAMA','KEJADIAN',17,NULL,24,'Abraham berumur sembilan puluh sembilan tahun ketika dikerat kulit khatannya.',NULL),(2478,'PERJANJIAN LAMA','KEJADIAN',17,NULL,25,'Dan Ismael, anaknya, berumur tiga belas tahun ketika dikerat kulit khatannya.',NULL),(2479,'PERJANJIAN LAMA','KEJADIAN',17,NULL,26,'Pada hari itu juga Abraham dan Ismael, anaknya, disunat.',NULL),(2480,'PERJANJIAN LAMA','KEJADIAN',17,NULL,27,'Dan semua orang dari isi rumah Abraham, baik yang lahir di rumahnya, maupun yang dibeli dengan uang dari orang asing, disunat bersama-sama dengan dia.',NULL),(2481,'PERJANJIAN LAMA','KEJADIAN',18,'Allah mengulangi menjanjikan seorang anak laki-laki kepada Abraham',1,'Kemudian TUHAN menampakkan diri kepada Abraham dekat pohon tarbantin di Mamre, sedang ia duduk di pintu kemahnya waktu hari panas terik.',NULL),(2482,'PERJANJIAN LAMA','KEJADIAN',18,NULL,2,'Ketika ia mengangkat mukanya, ia melihat tiga orang berdiri di depannya. Sesudah dilihatnya mereka, ia berlari dari pintu kemahnya menyongsong mereka, lalu sujudlah ia sampai ke tanah,',NULL),(2483,'PERJANJIAN LAMA','KEJADIAN',18,NULL,3,'serta berkata: \"Tuanku, jika aku telah mendapat kasih tuanku, janganlah kiranya lampaui hambamu ini.',NULL),(2484,'PERJANJIAN LAMA','KEJADIAN',18,NULL,4,'Biarlah diambil air sedikit, basuhlah kakimu dan duduklah beristirahat di bawah pohon ini;',NULL),(2485,'PERJANJIAN LAMA','KEJADIAN',18,NULL,5,'biarlah kuambil sepotong roti, supaya tuan-tuan segar kembali; kemudian bolehlah tuan-tuan meneruskan perjalanannya; sebab tuan-tuan telah datang ke tempat hambamu ini.\" Jawab mereka: \"Perbuatlah seperti yang kaukatakan itu.\"',NULL),(2486,'PERJANJIAN LAMA','KEJADIAN',18,NULL,6,'Lalu Abraham segera pergi ke kemah mendapatkan Sara serta berkata: \"Segeralah! Ambil tiga sukat tepung yang terbaik! Remaslah itu dan buatlah roti bundar!\"',NULL),(2487,'PERJANJIAN LAMA','KEJADIAN',18,NULL,7,'Lalu berlarilah Abraham kepada lembu sapinya, ia mengambil seekor anak lembu yang empuk dan baik dagingnya dan memberikannya kepada seorang bujangnya, lalu orang ini segera mengolahnya.',NULL),(2488,'PERJANJIAN LAMA','KEJADIAN',18,NULL,8,'Kemudian diambilnya dadih dan susu serta anak lembu yang telah diolah itu, lalu dihidangkannya di depan orang-orang itu; dan ia berdiri di dekat mereka di bawah pohon itu, sedang mereka makan.',NULL),(2489,'PERJANJIAN LAMA','KEJADIAN',18,NULL,9,'Lalu kata mereka kepadanya: \"Di manakah Sara, isterimu?\" Jawabnya: \"Di sana, di dalam kemah.\"',NULL),(2490,'PERJANJIAN LAMA','KEJADIAN',18,NULL,10,'Dan firman-Nya: \"Sesungguhnya Aku akan kembali tahun depan mendapatkan engkau, pada waktu itulah Sara, isterimu, akan mempunyai seorang anak laki-laki.\" Dan Sara mendengarkan pada pintu kemah yang di belakang-Nya.',NULL),(2491,'PERJANJIAN LAMA','KEJADIAN',18,NULL,11,'Adapun Abraham dan Sara telah tua dan lanjut umurnya dan Sara telah mati haid.',NULL),(2492,'PERJANJIAN LAMA','KEJADIAN',18,NULL,12,'Jadi tertawalah Sara dalam hatinya, katanya: \"Akan berahikah aku, setelah aku sudah layu, sedangkan tuanku sudah tua?\"',NULL),(2493,'PERJANJIAN LAMA','KEJADIAN',18,NULL,13,'Lalu berfirmanlah TUHAN kepada Abraham: \"Mengapakah Sara tertawa dan berkata: Sungguhkah aku akan melahirkan anak, sedangkan aku telah tua?',NULL),(2494,'PERJANJIAN LAMA','KEJADIAN',18,NULL,14,'Adakah sesuatu apapun yang mustahil untuk TUHAN? Pada waktu yang telah ditetapkan itu, tahun depan, Aku akan kembali mendapatkan engkau, pada waktu itulah Sara mempunyai seorang anak laki-laki.\"',NULL),(2495,'PERJANJIAN LAMA','KEJADIAN',18,NULL,15,'Lalu Sara menyangkal, katanya: \"Aku tidak tertawa,\" sebab ia takut; tetapi TUHAN berfirman: \"Tidak, memang engkau tertawa!\"',NULL),(2496,'PERJANJIAN LAMA','KEJADIAN',18,'Doa syafaat Abraham untuk Sodom',16,'Lalu berangkatlah orang-orang itu dari situ dan memandang ke arah Sodom; dan Abraham berjalan bersama-sama dengan mereka untuk mengantarkan mereka.',NULL),(2497,'PERJANJIAN LAMA','KEJADIAN',18,NULL,17,'Berpikirlah TUHAN: \"Apakah Aku akan menyembunyikan kepada Abraham apa yang hendak Kulakukan ini?',NULL),(2498,'PERJANJIAN LAMA','KEJADIAN',18,NULL,18,'Bukankah sesungguhnya Abraham akan menjadi bangsa yang besar serta berkuasa, dan oleh dia segala bangsa di atas bumi akan mendapat berkat?',NULL),(2499,'PERJANJIAN LAMA','KEJADIAN',18,NULL,19,'Sebab Aku telah memilih dia, supaya diperintahkannya kepada anak-anaknya dan kepada keturunannya supaya tetap hidup menurut jalan yang ditunjukkan TUHAN, dengan melakukan kebenaran dan keadilan, dan supaya TUHAN memenuhi kepada Abraham apa yang dijanjikan',NULL),(2500,'PERJANJIAN LAMA','KEJADIAN',18,NULL,20,'Sesudah itu berfirmanlah TUHAN: \"Sesungguhnya banyak keluh kesah orang tentang Sodom dan Gomora dan sesungguhnya sangat berat dosanya.',NULL),(2501,'PERJANJIAN LAMA','KEJADIAN',18,NULL,21,'Baiklah Aku turun untuk melihat, apakah benar-benar mereka telah berkelakuan seperti keluh kesah orang yang telah sampai kepada-Ku atau tidak; Aku hendak mengetahuinya.\"',NULL),(2502,'PERJANJIAN LAMA','KEJADIAN',18,NULL,22,'Lalu berpalinglah orang-orang itu dari situ dan berjalan ke Sodom, tetapi Abraham masih tetap berdiri di hadapan TUHAN.',NULL),(2503,'PERJANJIAN LAMA','KEJADIAN',18,NULL,23,'Abraham datang mendekat dan berkata: \"Apakah Engkau akan melenyapkan orang benar bersama-sama dengan orang fasik?',NULL),(2504,'PERJANJIAN LAMA','KEJADIAN',18,NULL,24,'Bagaimana sekiranya ada lima puluh orang benar dalam kota itu? Apakah Engkau akan melenyapkan tempat itu dan tidakkah Engkau mengampuninya karena kelima puluh orang benar yang ada di dalamnya itu?',NULL),(2505,'PERJANJIAN LAMA','KEJADIAN',18,NULL,25,'Jauhlah kiranya dari pada-Mu untuk berbuat demikian, membunuh orang benar bersama-sama dengan orang fasik, sehingga orang benar itu seolah-olah sama dengan orang fasik! Jauhlah kiranya yang demikian dari pada-Mu! Masakan Hakim segenap bumi tidak menghukum',NULL),(2506,'PERJANJIAN LAMA','KEJADIAN',18,NULL,26,'TUHAN berfirman: \"Jika Kudapati lima puluh orang benar dalam kota Sodom, Aku akan mengampuni seluruh tempat itu karena mereka.\"',NULL),(2507,'PERJANJIAN LAMA','KEJADIAN',18,NULL,27,'Abraham menyahut: \"Sesungguhnya aku telah memberanikan diri berkata kepada Tuhan, walaupun aku debu dan abu.',NULL),(2508,'PERJANJIAN LAMA','KEJADIAN',18,NULL,28,'Sekiranya kurang lima orang dari kelima puluh orang benar itu, apakah Engkau akan memusnahkan seluruh kota itu karena yang lima itu?\" Firman-Nya: \"Aku tidak memusnahkannya, jika Kudapati empat puluh lima di sana.\"',NULL),(2509,'PERJANJIAN LAMA','KEJADIAN',18,NULL,29,'Lagi Abraham melanjutkan perkataannya kepada-Nya: \"Sekiranya empat puluh didapati di sana?\" Firman-Nya: \"Aku tidak akan berbuat demikian karena yang empat puluh itu.\"',NULL),(2510,'PERJANJIAN LAMA','KEJADIAN',18,NULL,30,'Katanya: \"Janganlah kiranya Tuhan murka, kalau aku berkata sekali lagi. Sekiranya tiga puluh didapati di sana?\" Firman-Nya: \"Aku tidak akan berbuat demikian, jika Kudapati tiga puluh di sana.\"',NULL),(2511,'PERJANJIAN LAMA','KEJADIAN',18,NULL,31,'Katanya: \"Sesungguhnya aku telah memberanikan diri berkata kepada Tuhan. Sekiranya dua puluh didapati di sana?\" Firman-Nya: \"Aku tidak akan memusnahkannya karena yang dua puluh itu.\"',NULL),(2512,'PERJANJIAN LAMA','KEJADIAN',18,NULL,32,'Katanya: \"Janganlah kiranya Tuhan murka, kalau aku berkata lagi sekali ini saja. Sekiranya sepuluh didapati di sana?\" Firman-Nya: \"Aku tidak akan memusnahkannya karena yang sepuluh itu.\"',NULL),(2513,'PERJANJIAN LAMA','KEJADIAN',18,NULL,33,'Lalu pergilah TUHAN, setelah Ia selesai berfirman kepada Abraham; dan kembalilah Abraham ke tempat tinggalnya.',NULL),(2514,'PERJANJIAN LAMA','KEJADIAN',19,NULL,1,'Kedua malaikat itu tiba di Sodom pada waktu petang. Lot sedang duduk di pintu gerbang Sodom dan ketika melihat mereka, bangunlah ia menyongsong mereka, lalu sujud dengan mukanya sampai ke tanah,',NULL),(2515,'PERJANJIAN LAMA','KEJADIAN',19,NULL,2,'serta berkata: \"Tuan-tuan, silakanlah singgah ke rumah hambamu ini, bermalamlah di sini dan basuhlah kakimu, maka besok pagi tuan-tuan boleh melanjutkan perjalanannya.\" Jawab mereka: \"Tidak, kami akan bermalam di tanah lapang.\"',NULL),(2516,'PERJANJIAN LAMA','KEJADIAN',19,NULL,3,'Tetapi karena ia sangat mendesak mereka, singgahlah mereka dan masuk ke dalam rumahnya, kemudian ia menyediakan hidangan bagi mereka, ia membakar roti yang tidak beragi, lalu mereka makan.',NULL),(2517,'PERJANJIAN LAMA','KEJADIAN',19,NULL,4,'Tetapi sebelum mereka tidur, orang-orang lelaki dari kota Sodom itu, dari yang muda sampai yang tua, bahkan seluruh kota, tidak ada yang terkecuali, datang mengepung rumah itu.',NULL),(2518,'PERJANJIAN LAMA','KEJADIAN',19,NULL,5,'Mereka berseru kepada Lot: \"Di manakah orang-orang yang datang kepadamu malam ini? Bawalah mereka keluar kepada kami, supaya kami pakai mereka.\"',NULL),(2519,'PERJANJIAN LAMA','KEJADIAN',19,NULL,6,'Lalu keluarlah Lot menemui mereka, ke depan pintu, tetapi pintu ditutupnya di belakangnya,',NULL),(2520,'PERJANJIAN LAMA','KEJADIAN',19,NULL,7,'dan ia berkata: \"Saudara-saudaraku, janganlah kiranya berbuat jahat.',NULL),(2521,'PERJANJIAN LAMA','KEJADIAN',19,NULL,8,'Kamu tahu, aku mempunyai dua orang anak perempuan yang belum pernah dijamah laki-laki, baiklah mereka kubawa ke luar kepadamu; perbuatlah kepada mereka seperti yang kamu pandang baik; hanya jangan kamu apa-apakan orang-orang ini, sebab mereka memang datan',NULL),(2522,'PERJANJIAN LAMA','KEJADIAN',19,NULL,9,'Tetapi mereka berkata: \"Enyahlah!\" Lagi kata mereka: \"Orang ini datang ke sini sebagai orang asing dan dia mau menjadi hakim atas kita! Sekarang kami akan menganiaya engkau lebih dari pada kedua orang itu!\" Lalu mereka mendesak orang itu, yaitu Lot, denga',NULL),(2523,'PERJANJIAN LAMA','KEJADIAN',19,NULL,10,'Tetapi kedua orang itu mengulurkan tangannya, menarik Lot masuk ke dalam rumah, lalu menutup pintu.',NULL),(2524,'PERJANJIAN LAMA','KEJADIAN',19,NULL,11,'Dan mereka membutakan mata orang-orang yang di depan pintu rumah itu, dari yang kecil sampai yang besar, sehingga percumalah orang-orang itu mencari-cari pintu.',NULL),(2525,'PERJANJIAN LAMA','KEJADIAN',19,NULL,12,'Lalu kedua orang itu berkata kepada Lot: \"Siapakah kaummu yang ada di sini lagi? Menantu atau anakmu laki-laki, anakmu perempuan, atau siapa saja kaummu di kota ini, bawalah mereka keluar dari tempat ini,',NULL),(2526,'PERJANJIAN LAMA','KEJADIAN',19,NULL,13,'sebab kami akan memusnahkan tempat ini, karena banyak keluh kesah orang tentang kota ini di hadapan TUHAN; sebab itulah TUHAN mengutus kami untuk memusnahkannya.\"',NULL),(2527,'PERJANJIAN LAMA','KEJADIAN',19,NULL,14,'Keluarlah Lot, lalu berbicara dengan kedua bakal menantunya, yang akan kawin dengan kedua anaknya perempuan, katanya: \"Bangunlah, keluarlah dari tempat ini, sebab TUHAN akan memusnahkan kota ini.\" Tetapi ia dipandang oleh kedua bakal menantunya itu sebaga',NULL),(2528,'PERJANJIAN LAMA','KEJADIAN',19,NULL,15,'Ketika fajar telah menyingsing, kedua malaikat itu mendesak Lot, supaya bersegera, katanya: \"Bangunlah, bawalah isterimu dan kedua anakmu yang ada di sini, supaya engkau jangan mati lenyap karena kedurjanaan kota ini.\"',NULL),(2529,'PERJANJIAN LAMA','KEJADIAN',19,NULL,16,'Ketika ia berlambat-lambat, maka tangannya, tangan isteri dan tangan kedua anaknya dipegang oleh kedua orang itu, sebab TUHAN hendak mengasihani dia; lalu kedua orang itu menuntunnya ke luar kota dan melepaskannya di sana.',NULL),(2530,'PERJANJIAN LAMA','KEJADIAN',19,NULL,17,'Sesudah kedua orang itu menuntun mereka sampai ke luar, berkatalah seorang: \"Larilah, selamatkanlah nyawamu; janganlah menoleh ke belakang, dan janganlah berhenti di manapun juga di Lembah Yordan, larilah ke pegunungan, supaya engkau jangan mati lenyap.\"',NULL),(2531,'PERJANJIAN LAMA','KEJADIAN',19,NULL,18,'Kata Lot kepada mereka: \"Janganlah kiranya demikian, tuanku.',NULL),(2532,'PERJANJIAN LAMA','KEJADIAN',19,NULL,19,'Sungguhlah hambamu ini telah dikaruniai belas kasihan di hadapanmu, dan tuanku telah berbuat kemurahan besar kepadaku dengan memelihara hidupku, tetapi jika aku harus lari ke pegunungan, pastilah aku akan tersusul oleh bencana itu, sehingga matilah aku.',NULL),(2533,'PERJANJIAN LAMA','KEJADIAN',19,NULL,20,'Sungguhlah kota yang di sana itu cukup dekat kiranya untuk lari ke sana; kota itu kecil; izinkanlah kiranya aku lari ke sana. Bukankah kota itu kecil? Jika demikian, nyawaku akan terpelihara.\"',NULL),(2534,'PERJANJIAN LAMA','KEJADIAN',19,NULL,21,'Sahut malaikat itu kepadanya: \"Baiklah, dalam hal inipun permintaanmu akan kuterima dengan baik; yakni kota yang telah kau sebut itu tidak akan kutunggangbalikkan.',NULL),(2535,'PERJANJIAN LAMA','KEJADIAN',19,NULL,22,'Cepatlah, larilah ke sana, sebab aku tidak dapat berbuat apa-apa, sebelum engkau sampai ke sana.\" Itulah sebabnya nama kota itu disebut Zoar.',NULL),(2536,'PERJANJIAN LAMA','KEJADIAN',19,NULL,23,'Matahari telah terbit menyinari bumi, ketika Lot tiba di Zoar.',NULL),(2537,'PERJANJIAN LAMA','KEJADIAN',19,NULL,24,'Kemudian TUHAN menurunkan hujan belerang dan api atas Sodom dan Gomora, berasal dari TUHAN, dari langit;',NULL),(2538,'PERJANJIAN LAMA','KEJADIAN',19,NULL,25,'dan ditunggangbalikkan-Nyalah kota-kota itu dan Lembah Yordan dan semua penduduk kota-kota serta tumbuh-tumbuhan di tanah.',NULL),(2539,'PERJANJIAN LAMA','KEJADIAN',19,NULL,26,'Tetapi isteri Lot, yang berjalan mengikutnya, menoleh ke belakang, lalu menjadi tiang garam.',NULL),(2540,'PERJANJIAN LAMA','KEJADIAN',19,NULL,27,'Ketika Abraham pagi-pagi pergi ke tempat ia berdiri di hadapan TUHAN itu,',NULL),(2541,'PERJANJIAN LAMA','KEJADIAN',19,NULL,28,'dan memandang ke arah Sodom dan Gomora serta ke seluruh tanah Lembah Yordan, maka dilihatnyalah asap dari bumi membubung ke atas sebagai asap dari dapur peleburan.',NULL),(2542,'PERJANJIAN LAMA','KEJADIAN',19,NULL,29,'Demikianlah pada waktu Allah memusnahkan kota-kota di Lembah Yordan dan menunggangbalikkan kota-kota kediaman Lot, maka Allah ingat kepada Abraham, lalu dikeluarkan-Nyalah Lot dari tengah-tengah tempat yang ditunggangbalikkan itu.',NULL),(2543,'PERJANJIAN LAMA','KEJADIAN',19,NULL,30,'Pergilah Lot dari Zoar dan ia menetap bersama-sama dengan kedua anaknya perempuan di pegunungan, sebab ia tidak berani tinggal di Zoar, maka diamlah ia dalam suatu gua beserta kedua anaknya.',NULL),(2544,'PERJANJIAN LAMA','KEJADIAN',19,NULL,31,'Kata kakaknya kepada adiknya: \"Ayah kita telah tua, dan tidak ada laki-laki di negeri ini yang dapat menghampiri kita, seperti kebiasaan seluruh bumi.',NULL),(2545,'PERJANJIAN LAMA','KEJADIAN',19,NULL,32,'Marilah kita beri ayah kita minum anggur, lalu kita tidur dengan dia, supaya kita menyambung keturunan dari ayah kita.\"',NULL),(2546,'PERJANJIAN LAMA','KEJADIAN',19,NULL,33,'Pada malam itu mereka memberi ayah mereka minum anggur, lalu masuklah yang lebih tua untuk tidur dengan ayahnya; dan ayahnya itu tidak mengetahui ketika anaknya itu tidur dan ketika ia bangun.',NULL),(2547,'PERJANJIAN LAMA','KEJADIAN',19,NULL,34,'Keesokan harinya berkatalah kakaknya kepada adiknya: \"Tadi malam aku telah tidur dengan ayah; baiklah malam ini juga kita beri dia minum anggur; masuklah engkau untuk tidur dengan dia, supaya kita menyambung keturunan dari ayah kita.\"',NULL),(2548,'PERJANJIAN LAMA','KEJADIAN',19,NULL,35,'Demikianlah juga pada malam itu mereka memberi ayah mereka minum anggur, lalu bangunlah yang lebih muda untuk tidur dengan ayahnya; dan ayahnya itu tidak mengetahui ketika anaknya itu tidur dan ketika ia bangun.',NULL),(2549,'PERJANJIAN LAMA','KEJADIAN',19,NULL,36,'Lalu mengandunglah kedua anak Lot itu dari ayah mereka.',NULL),(2550,'PERJANJIAN LAMA','KEJADIAN',19,NULL,37,'Yang lebih tua melahirkan seorang anak laki-laki, dan menamainya Moab; dialah bapa orang Moab yang sekarang.',NULL),(2551,'PERJANJIAN LAMA','KEJADIAN',19,NULL,38,'Yang lebih mudapun melahirkan seorang anak laki-laki, dan menamainya Ben-Ami; dialah bapa bani Amon yang sekarang.',NULL),(2552,'PERJANJIAN LAMA','KEJADIAN',20,'Abraham dan Abimelekh',1,'Lalu Abraham berangkat dari situ ke Tanah Negeb dan ia menetap antara Kadesh dan Syur. Ia tinggal di Gerar sebagai orang asing.',NULL),(2553,'PERJANJIAN LAMA','KEJADIAN',20,NULL,2,'Oleh karena Abraham telah mengatakan tentang Sara, isterinya: \"Dia saudaraku,\" maka Abimelekh, raja Gerar, menyuruh mengambil Sara.',NULL),(2554,'PERJANJIAN LAMA','KEJADIAN',20,NULL,3,'Tetapi pada waktu malam Allah datang kepada Abimelekh dalam suatu mimpi serta berfirman kepadanya: \"Engkau harus mati oleh karena perempuan yang telah kauambil itu; sebab ia sudah bersuami.\"',NULL),(2555,'PERJANJIAN LAMA','KEJADIAN',20,NULL,4,'Adapun Abimelekh belum menghampiri Sara. Berkatalah ia: \"Tuhan! Apakah Engkau membunuh bangsa yang tak bersalah?',NULL),(2556,'PERJANJIAN LAMA','KEJADIAN',20,NULL,5,'Bukankah orang itu sendiri mengatakan kepadaku: Dia saudaraku? Dan perempuan itu sendiri telah mengatakan: Ia saudaraku. Jadi hal ini kulakukan dengan hati yang tulus dan dengan tangan yang suci.\"',NULL),(2557,'PERJANJIAN LAMA','KEJADIAN',20,NULL,6,'Lalu berfirmanlah Allah kepadanya dalam mimpi: \"Aku tahu juga, bahwa engkau telah melakukan hal itu dengan hati yang tulus, maka Akupun telah mencegah engkau untuk berbuat dosa terhadap Aku; sebab itu Aku tidak membiarkan engkau menjamah dia.',NULL),(2558,'PERJANJIAN LAMA','KEJADIAN',20,NULL,7,'Jadi sekarang, kembalikanlah isteri orang itu, sebab dia seorang nabi; ia akan berdoa untuk engkau, maka engkau tetap hidup; tetapi jika engkau tidak mengembalikan dia, ketahuilah, engkau pasti mati, engkau dan semua orang yang bersama-sama dengan engkau.',NULL),(2559,'PERJANJIAN LAMA','KEJADIAN',20,NULL,8,'Keesokan harinya pagi-pagi Abimelekh memanggil semua hambanya dan memberitahukan seluruh peristiwa itu kepada mereka, lalu sangat takutlah orang-orang itu.',NULL),(2560,'PERJANJIAN LAMA','KEJADIAN',20,NULL,9,'Kemudian Abimelekh memanggil Abraham dan berkata kepadanya: \"Perbuatan apakah yang kaulakukan ini terhadap kami, dan kesalahan apakah yang kulakukan terhadap engkau, sehingga engkau mendatangkan dosa besar atas diriku dan kerajaanku? Engkau telah berbuat ',NULL),(2561,'PERJANJIAN LAMA','KEJADIAN',20,NULL,10,'Lagi kata Abimelekh kepada Abraham: \"Apakah maksudmu, maka engkau melakukan hal ini?\"',NULL),(2562,'PERJANJIAN LAMA','KEJADIAN',20,NULL,11,'Lalu Abraham berkata: \"Aku berpikir: Takut akan Allah tidak ada di tempat ini; tentulah aku akan dibunuh karena isteriku.',NULL),(2563,'PERJANJIAN LAMA','KEJADIAN',20,NULL,12,'Lagipula ia benar-benar saudaraku, anak ayahku, hanya bukan anak ibuku, tetapi kemudian ia menjadi isteriku.',NULL),(2564,'PERJANJIAN LAMA','KEJADIAN',20,NULL,13,'Ketika Allah menyuruh aku mengembara keluar dari rumah ayahku, berkatalah aku kepada isteriku: Tunjukkanlah kasihmu kepadaku, yakni: katakanlah tentang aku di tiap-tiap tempat di mana kita tiba: Ia saudaraku.\"',NULL),(2565,'PERJANJIAN LAMA','KEJADIAN',20,NULL,14,'Kemudian Abimelekh mengambil kambing domba dan lembu sapi, hamba laki-laki dan perempuan, lalu memberikan semuanya itu kepada Abraham; Sara, isteri Abraham, juga dikembalikannya kepadanya.',NULL),(2566,'PERJANJIAN LAMA','KEJADIAN',20,NULL,15,'Dan Abimelekh berkata: \"Negeriku ini terbuka untuk engkau; menetaplah, di mana engkau suka.\"',NULL),(2567,'PERJANJIAN LAMA','KEJADIAN',20,NULL,16,'Lalu katanya kepada Sara: \"Telah kuberikan kepada saudaramu seribu syikal perak, itulah bukti kesucianmu bagi semua orang yang bersama-sama dengan engkau. Maka dalam segala hal engkau dibenarkan.\"',NULL),(2568,'PERJANJIAN LAMA','KEJADIAN',20,NULL,17,'Lalu Abraham berdoa kepada Allah, dan Allah menyembuhkan Abimelekh dan isterinya dan budak-budaknya perempuan, sehingga mereka melahirkan anak.',NULL),(2569,'PERJANJIAN LAMA','KEJADIAN',20,NULL,18,'Sebab tadinya TUHAN telah menutup kandungan setiap perempuan di istana Abimelekh karena Sara, isteri Abraham itu.',NULL),(2570,'PERJANJIAN LAMA','KEJADIAN',21,'Ishak lahir',1,'TUHAN memperhatikan Sara, seperti yang difirmankan-Nya, dan TUHAN melakukan kepada Sara seperti yang dijanjikan-Nya.',NULL),(2571,'PERJANJIAN LAMA','KEJADIAN',21,NULL,2,'Maka mengandunglah Sara, lalu ia melahirkan seorang anak laki-laki bagi Abraham dalam masa tuanya, pada waktu yang telah ditetapkan, sesuai dengan firman Allah kepadanya.',NULL),(2572,'PERJANJIAN LAMA','KEJADIAN',21,NULL,3,'Abraham menamai anaknya yang baru lahir itu Ishak, yang dilahirkan Sara baginya.',NULL),(2573,'PERJANJIAN LAMA','KEJADIAN',21,NULL,4,'Kemudian Abraham menyunat Ishak, anaknya itu, ketika berumur delapan hari, seperti yang diperintahkan Allah kepadanya.',NULL),(2574,'PERJANJIAN LAMA','KEJADIAN',21,NULL,5,'Adapun Abraham berumur seratus tahun, ketika Ishak, anaknya, lahir baginya.',NULL),(2575,'PERJANJIAN LAMA','KEJADIAN',21,NULL,6,'Berkatalah Sara: \"Allah telah membuat aku tertawa; setiap orang yang mendengarnya akan tertawa karena aku.\"',NULL),(2576,'PERJANJIAN LAMA','KEJADIAN',21,NULL,7,'Berkatalah Sara: \"Allah telah membuat aku tertawa; setiap orang yang mendengarnya akan tertawa karena aku.\"',NULL),(2577,'PERJANJIAN LAMA','KEJADIAN',21,'Abraham mengusir Hagar dan Ismael',8,'Bertambah besarlah anak itu dan ia disapih, lalu Abraham mengadakan perjamuan besar pada hari Ishak disapih itu.',NULL),(2578,'PERJANJIAN LAMA','KEJADIAN',21,NULL,9,'Pada waktu itu Sara melihat, bahwa anak yang dilahirkan Hagar, perempuan Mesir itu bagi Abraham, sedang main dengan Ishak, anaknya sendiri.',NULL),(2579,'PERJANJIAN LAMA','KEJADIAN',21,NULL,10,'Berkatalah Sara kepada Abraham: \"Usirlah hamba perempuan itu beserta anaknya, sebab anak hamba ini tidak akan menjadi ahli waris bersama-sama dengan anakku Ishak.\"',NULL),(2580,'PERJANJIAN LAMA','KEJADIAN',21,NULL,11,'Hal ini sangat menyebalkan Abraham oleh karena anaknya itu.',NULL),(2581,'PERJANJIAN LAMA','KEJADIAN',21,NULL,12,'Tetapi Allah berfirman kepada Abraham: \"Janganlah sebal hatimu karena hal anak dan budakmu itu; dalam segala yang dikatakan Sara kepadamu, haruslah engkau mendengarkannya, sebab yang akan disebut keturunanmu ialah yang berasal dari Ishak.',NULL),(2582,'PERJANJIAN LAMA','KEJADIAN',21,NULL,13,'Tetapi keturunan dari hambamu itu juga akan Kubuat menjadi suatu bangsa, karena iapun anakmu.\"',NULL),(2583,'PERJANJIAN LAMA','KEJADIAN',21,NULL,14,'Keesokan harinya pagi-pagi Abraham mengambil roti serta sekirbat air dan memberikannya kepada Hagar. Ia meletakkan itu beserta anaknya di atas bahu Hagar, kemudian disuruhnyalah perempuan itu pergi. Maka pergilah Hagar dan mengembara di padang gurun Bersy',NULL),(2584,'PERJANJIAN LAMA','KEJADIAN',21,NULL,15,'Ketika air yang dikirbat itu habis, dibuangnyalah anak itu ke bawah semak-semak,',NULL),(2585,'PERJANJIAN LAMA','KEJADIAN',21,NULL,16,'dan ia duduk agak jauh, kira-kira sepemanah jauhnya, sebab katanya: \"Tidak tahan aku melihat anak itu mati.\" Sedang ia duduk di situ, menangislah ia dengan suara nyaring.',NULL),(2586,'PERJANJIAN LAMA','KEJADIAN',21,NULL,17,'Allah mendengar suara anak itu, lalu Malaikat Allah berseru dari langit kepada Hagar, kata-Nya kepadanya: \"Apakah yang engkau susahkan, Hagar? Janganlah takut, sebab Allah telah mendengar suara anak itu dari tempat ia terbaring.',NULL),(2587,'PERJANJIAN LAMA','KEJADIAN',21,NULL,18,'Bangunlah, angkatlah anak itu, dan bimbinglah dia, sebab Aku akan membuat dia menjadi bangsa yang besar.\"',NULL),(2588,'PERJANJIAN LAMA','KEJADIAN',21,NULL,19,'Lalu Allah membuka mata Hagar, sehingga ia melihat sebuah sumur; ia pergi mengisi kirbatnya dengan air, kemudian diberinya anak itu minum.',NULL),(2589,'PERJANJIAN LAMA','KEJADIAN',21,NULL,20,'Allah menyertai anak itu, sehingga ia bertambah besar; ia menetap di padang gurun dan menjadi seorang pemanah.',NULL),(2590,'PERJANJIAN LAMA','KEJADIAN',21,NULL,21,'Maka tinggallah ia di padang gurun Paran, dan ibunya mengambil seorang isteri baginya dari tanah Mesir.',NULL),(2591,'PERJANJIAN LAMA','KEJADIAN',21,'Perjanjian Abraham dengan Abimelekh',22,'Pada waktu itu Abimelekh, beserta Pikhol, panglima tentaranya, berkata kepada Abraham: \"Allah menyertai engkau dalam segala sesuatu yang engkau lakukan.',NULL),(2592,'PERJANJIAN LAMA','KEJADIAN',21,NULL,23,'Oleh sebab itu, bersumpahlah kepadaku di sini demi Allah, bahwa engkau tidak akan berlaku curang kepadaku, atau kepada anak-anakku, atau kepada cucu cicitku; sesuai dengan persahabatan yang kulakukan kepadamu, demikianlah harus engkau berlaku kepadaku dan',NULL),(2593,'PERJANJIAN LAMA','KEJADIAN',21,NULL,24,'Lalu kata Abraham: \"Aku bersumpah!\"',NULL),(2594,'PERJANJIAN LAMA','KEJADIAN',21,NULL,25,'Tetapi Abraham menyesali Abimelekh tentang sebuah sumur yang telah dirampas oleh hamba-hamba Abimelekh.',NULL),(2595,'PERJANJIAN LAMA','KEJADIAN',21,NULL,26,'Jawab Abimelekh: \"Aku tidak tahu, siapa yang melakukan hal itu; lagi tidak kauberitahukan kepadaku, dan sampai hari ini belum pula kudengar.\"',NULL),(2596,'PERJANJIAN LAMA','KEJADIAN',21,NULL,27,'Lalu Abraham mengambil domba dan lembu dan memberikan semuanya itu kepada Abimelekh, kemudian kedua orang itu mengadakan perjanjian.',NULL),(2597,'PERJANJIAN LAMA','KEJADIAN',21,NULL,28,'Tetapi Abraham memisahkan tujuh anak domba betina dari domba-domba itu.',NULL),(2598,'PERJANJIAN LAMA','KEJADIAN',21,NULL,29,'Lalu kata Abimelekh kepada Abraham: \"Untuk apakah ketujuh anak domba yang kaupisahkan ini?\"',NULL),(2599,'PERJANJIAN LAMA','KEJADIAN',21,NULL,30,'Jawabnya: \"Ketujuh anak domba ini harus kauterima dari tanganku untuk menjadi tanda bukti bagiku, bahwa akulah yang menggali sumur ini.\"',NULL),(2600,'PERJANJIAN LAMA','KEJADIAN',21,NULL,31,'Sebab itu orang menyebutkan tempat itu Bersyeba, karena kedua orang itu telah bersumpah di sana.',NULL),(2601,'PERJANJIAN LAMA','KEJADIAN',21,NULL,32,'Setelah mereka mengadakan perjanjian di Bersyeba, pulanglah Abimelekh beserta Pikhol, panglima tentaranya, ke negeri orang Filistin.',NULL),(2602,'PERJANJIAN LAMA','KEJADIAN',21,NULL,33,'Lalu Abraham menanam sebatang pohon tamariska di Bersyeba, dan memanggil di sana nama TUHAN, Allah yang kekal.',NULL),(2603,'PERJANJIAN LAMA','KEJADIAN',21,NULL,34,'Dan masih lama Abraham tinggal sebagai orang asing di negeri orang Filistin.',NULL),(2604,'PERJANJIAN LAMA','KEJADIAN',22,'Kepercayaan Abraham diuji',1,'Setelah semuanya itu Allah mencoba Abraham. Ia berfirman kepadanya: \"Abraham,\" lalu sahutnya: \"Ya, Tuhan.\"',NULL),(2605,'PERJANJIAN LAMA','KEJADIAN',22,NULL,2,'Firman-Nya: \"Ambillah anakmu yang tunggal itu, yang engkau kasihi, yakni Ishak, pergilah ke tanah Moria dan persembahkanlah dia di sana sebagai korban bakaran pada salah satu gunung yang akan Kukatakan kepadamu.\"',NULL),(2606,'PERJANJIAN LAMA','KEJADIAN',22,NULL,3,'Keesokan harinya pagi-pagi bangunlah Abraham, ia memasang pelana keledainya dan memanggil dua orang bujangnya beserta Ishak, anaknya; ia membelah juga kayu untuk korban bakaran itu, lalu berangkatlah ia dan pergi ke tempat yang dikatakan Allah kepadanya.',NULL),(2607,'PERJANJIAN LAMA','KEJADIAN',22,NULL,4,'Ketika pada hari ketiga Abraham melayangkan pandangnya, kelihatanlah kepadanya tempat itu dari jauh.',NULL),(2608,'PERJANJIAN LAMA','KEJADIAN',22,NULL,5,'Kata Abraham kepada kedua bujangnya itu: \"Tinggallah kamu di sini dengan keledai ini; aku beserta anak ini akan pergi ke sana; kami akan sembahyang, sesudah itu kami kembali kepadamu.\"',NULL),(2609,'PERJANJIAN LAMA','KEJADIAN',22,NULL,6,'Lalu Abraham mengambil kayu untuk korban bakaran itu dan memikulkannya ke atas bahu Ishak, anaknya, sedang di tangannya dibawanya api dan pisau. Demikianlah keduanya berjalan bersama-sama.',NULL),(2610,'PERJANJIAN LAMA','KEJADIAN',22,NULL,7,'Lalu berkatalah Ishak kepada Abraham, ayahnya: \"Bapa.\" Sahut Abraham: \"Ya, anakku.\" Bertanyalah ia: \"Di sini sudah ada api dan kayu, tetapi di manakah anak domba untuk korban bakaran itu?\"',NULL),(2611,'PERJANJIAN LAMA','KEJADIAN',22,NULL,8,'Sahut Abraham: \"Allah yang akan menyediakan anak domba untuk korban bakaran bagi-Nya, anakku.\" Demikianlah keduanya berjalan bersama-sama.',NULL),(2612,'PERJANJIAN LAMA','KEJADIAN',22,NULL,9,'Sampailah mereka ke tempat yang dikatakan Allah kepadanya. Lalu Abraham mendirikan mezbah di situ, disusunnyalah kayu, diikatnya Ishak, anaknya itu, dan diletakkannya di mezbah itu, di atas kayu api.',NULL),(2613,'PERJANJIAN LAMA','KEJADIAN',22,NULL,10,'Sesudah itu Abraham mengulurkan tangannya, lalu mengambil pisau untuk menyembelih anaknya.',NULL),(2614,'PERJANJIAN LAMA','KEJADIAN',22,NULL,11,'Tetapi berserulah Malaikat TUHAN dari langit kepadanya: \"Abraham, Abraham.\" Sahutnya: \"Ya, Tuhan.\"',NULL),(2615,'PERJANJIAN LAMA','KEJADIAN',22,NULL,12,'Lalu Ia berfirman: \"Jangan bunuh anak itu dan jangan kauapa-apakan dia, sebab telah Kuketahui sekarang, bahwa engkau takut akan Allah, dan engkau tidak segan-segan untuk menyerahkan anakmu yang tunggal kepada-Ku.\"',NULL),(2616,'PERJANJIAN LAMA','KEJADIAN',22,NULL,13,'Lalu Abraham menoleh dan melihat seekor domba jantan di belakangnya, yang tanduknya tersangkut dalam belukar. Abraham mengambil domba itu, lalu mengorbankannya sebagai korban bakaran pengganti anaknya.',NULL),(2617,'PERJANJIAN LAMA','KEJADIAN',22,NULL,14,'Dan Abraham menamai tempat itu: \"TUHAN menyediakan\"; sebab itu sampai sekarang dikatakan orang: \"Di atas gunung TUHAN, akan disediakan.\"',NULL),(2618,'PERJANJIAN LAMA','KEJADIAN',22,NULL,15,'Untuk kedua kalinya berserulah Malaikat TUHAN dari langit kepada Abraham,',NULL),(2619,'PERJANJIAN LAMA','KEJADIAN',22,NULL,16,'kata-Nya: \"Aku bersumpah demi diri-Ku sendiri--demikianlah firman TUHAN--:Karena engkau telah berbuat demikian, dan engkau tidak segan-segan untuk menyerahkan anakmu yang tunggal kepada-Ku,',NULL),(2620,'PERJANJIAN LAMA','KEJADIAN',22,NULL,17,'maka Aku akan memberkati engkau berlimpah-limpah dan membuat keturunanmu sangat banyak seperti bintang di langit dan seperti pasir di tepi laut, dan keturunanmu itu akan menduduki kota-kota musuhnya.',NULL),(2621,'PERJANJIAN LAMA','KEJADIAN',22,NULL,18,'Oleh keturunanmulah semua bangsa di bumi akan mendapat berkat, karena engkau mendengarkan firman-Ku.\"',NULL),(2622,'PERJANJIAN LAMA','KEJADIAN',22,NULL,19,'Kemudian kembalilah Abraham kepada kedua bujangnya, dan mereka bersama-sama berangkat ke Bersyeba; dan Abraham tinggal di Bersyeba.',NULL),(2623,'PERJANJIAN LAMA','KEJADIAN',22,'Keturunan Nahor',20,'Sesudah itu Abraham mendapat kabar: \"Juga Milka telah melahirkan anak-anak lelaki bagi Nahor, saudaramu:',NULL),(2624,'PERJANJIAN LAMA','KEJADIAN',22,NULL,21,'Us, anak sulung, dan Bus, adiknya, dan Kemuel, ayah Aram,',NULL),(2625,'PERJANJIAN LAMA','KEJADIAN',22,NULL,22,'juga Kesed, Hazo, Pildash, Yidlaf dan Betuel.\"',NULL),(2626,'PERJANJIAN LAMA','KEJADIAN',22,NULL,23,'Dan Betuel memperanakkan Ribka. Kedelapan orang inilah dilahirkan Milka bagi Nahor, saudara Abraham itu.',NULL),(2627,'PERJANJIAN LAMA','KEJADIAN',22,NULL,24,'Dan gundik Nahor, yang namanya Reuma, melahirkan anak juga, yakni Tebah, Gaham, Tahash dan Maakha.',NULL),(2628,'PERJANJIAN LAMA','KEJADIAN',23,'Sara mati dan dikuburkan',1,'Sara hidup seratus dua puluh tujuh tahun lamanya; itulah umur Sara.',NULL),(2629,'PERJANJIAN LAMA','KEJADIAN',23,NULL,2,'Kemudian matilah Sara di Kiryat-Arba, yaitu Hebron, di tanah Kanaan, lalu Abraham datang meratapi dan menangisinya.',NULL),(2630,'PERJANJIAN LAMA','KEJADIAN',23,NULL,3,'Sesudah itu Abraham bangkit dan meninggalkan isterinya yang mati itu, lalu berkata kepada bani Het:',NULL),(2631,'PERJANJIAN LAMA','KEJADIAN',23,NULL,4,'\"Aku ini orang asing dan pendatang di antara kamu; berikanlah kiranya kuburan milik kepadaku di tanah kamu ini, supaya kiranya aku dapat mengantarkan dan menguburkan isteriku yang mati itu.\"',NULL),(2632,'PERJANJIAN LAMA','KEJADIAN',23,NULL,5,'Bani Het menjawab Abraham:',NULL),(2633,'PERJANJIAN LAMA','KEJADIAN',23,NULL,6,'\"Dengarlah kepada kami, tuanku. Tuanku ini seorang raja agung di tengah-tengah kami; jadi kuburkanlah isterimu yang mati itu dalam kuburan kami yang terpilih, tidak akan ada seorangpun dari kami yang menolak menyediakan kuburannya bagimu untuk menguburkan',NULL),(2634,'PERJANJIAN LAMA','KEJADIAN',23,NULL,7,'Kemudian bangunlah Abraham lalu sujud kepada bani Het, penduduk negeri itu,',NULL),(2635,'PERJANJIAN LAMA','KEJADIAN',23,NULL,8,'serta berkata kepada mereka: \"Jika kamu setuju, bahwa aku mengantarkan dan menguburkan isteriku yang mati itu, maka dengarkanlah aku dan tolonglah mintakan dengan sangat kepada Efron bin Zohar,',NULL),(2636,'PERJANJIAN LAMA','KEJADIAN',23,NULL,9,'supaya ia memberikan kepadaku gua Makhpela miliknya itu, yang terletak di ujung ladangnya; baiklah itu diberikannya kepadaku dengan harga penuh untuk menjadi kuburan milikku di tengah-tengah kamu.\"',NULL),(2637,'PERJANJIAN LAMA','KEJADIAN',23,NULL,10,'Pada waktu itu Efron hadir di tengah-tengah bani Het. Maka jawab Efron, orang Het itu, kepada Abraham dengan didengar oleh bani Het, oleh semua orang yang datang di pintu gerbang kota:',NULL),(2638,'PERJANJIAN LAMA','KEJADIAN',23,NULL,11,'\"Tidak, tuanku, dengarkanlah aku; ladang itu kuberikan kepadamu dan gua yang di sanapun kuberikan kepadamu; di depan mata orang-orang sebangsaku kuberikan itu kepadamu; kuburkanlah isterimu yang mati itu.\"',NULL),(2639,'PERJANJIAN LAMA','KEJADIAN',23,NULL,12,'Lalu sujudlah Abraham di depan penduduk negeri itu',NULL),(2640,'PERJANJIAN LAMA','KEJADIAN',23,NULL,13,'serta berkata kepada Efron dengan didengar oleh mereka: \"Sesungguhnya, jika engkau suka, dengarkanlah aku: aku membayar harga ladang itu; terimalah itu dari padaku, supaya aku dapat menguburkan isteriku yang mati itu di sana.\"',NULL),(2641,'PERJANJIAN LAMA','KEJADIAN',23,NULL,14,'Jawab Efron kepada Abraham:',NULL),(2642,'PERJANJIAN LAMA','KEJADIAN',23,NULL,15,'\"Tuanku, dengarkanlah aku: sebidang tanah dengan harga empat ratus syikal perak, apa artinya itu bagi kita? Kuburkan sajalah isterimu yang mati itu.\"',NULL),(2643,'PERJANJIAN LAMA','KEJADIAN',23,NULL,16,'Lalu Abraham menerima usul Efron, maka ditimbangnyalah perak untuk Efron, sebanyak yang dimintanya dengan didengar oleh bani Het itu, empat ratus syikal perak, seperti yang berlaku di antara para saudagar.',NULL),(2644,'PERJANJIAN LAMA','KEJADIAN',23,NULL,17,'Demikianlah ladang Efron, yang letaknya di Makhpela di sebelah timur Mamre, ladang dan gua yang di sana, serta segala pohon di ladang itu, bahkan di seluruh tanah itu sampai ke tepi-tepinya,',NULL),(2645,'PERJANJIAN LAMA','KEJADIAN',23,NULL,18,'diserahkan kepada Abraham menjadi tanah belian, di depan mata bani Het itu, di depan semua orang yang datang di pintu gerbang kota.',NULL),(2646,'PERJANJIAN LAMA','KEJADIAN',23,NULL,19,'Sesudah itu Abraham menguburkan Sara, isterinya, di dalam gua ladang Makhpela itu, di sebelah timur Mamre, yaitu Hebron di tanah Kanaan.',NULL),(2647,'PERJANJIAN LAMA','KEJADIAN',23,NULL,20,'Demikianlah dari pihak bani Het ladang dengan gua yang ada di sana diserahkan kepada Abraham menjadi kuburan miliknya.',NULL),(2648,'PERJANJIAN LAMA','KEJADIAN',24,'Ribka dipinang bagi Ishak',1,'Adapun Abraham telah tua dan lanjut umurnya, serta diberkati TUHAN dalam segala hal.',NULL),(2649,'PERJANJIAN LAMA','KEJADIAN',24,NULL,2,'Berkatalah Abraham kepada hambanya yang paling tua dalam rumahnya, yang menjadi kuasa atas segala kepunyaannya, katanya: \"Baiklah letakkan tanganmu di bawah pangkal pahaku,',NULL),(2650,'PERJANJIAN LAMA','KEJADIAN',24,NULL,3,'supaya aku mengambil sumpahmu demi TUHAN, Allah yang empunya langit dan yang empunya bumi, bahwa engkau tidak akan mengambil untuk anakku seorang isteri dari antara perempuan Kanaan yang di antaranya aku diam.',NULL),(2651,'PERJANJIAN LAMA','KEJADIAN',24,NULL,4,'Tetapi engkau harus pergi ke negeriku dan kepada sanak saudaraku untuk mengambil seorang isteri bagi Ishak, anakku.\"',NULL),(2652,'PERJANJIAN LAMA','KEJADIAN',24,NULL,5,'Lalu berkatalah hambanya itu kepadanya: \"Mungkin perempuan itu tidak suka mengikuti aku ke negeri ini; haruskah aku membawa anakmu itu kembali ke negeri dari mana tuanku keluar?\"',NULL),(2653,'PERJANJIAN LAMA','KEJADIAN',24,NULL,6,'Tetapi Abraham berkata kepadanya: \"Awas, jangan kaubawa anakku itu kembali ke sana.',NULL),(2654,'PERJANJIAN LAMA','KEJADIAN',24,NULL,7,'TUHAN, Allah yang empunya langit, yang telah memanggil aku dari rumah ayahku serta dari negeri sanak saudaraku, dan yang telah berfirman kepadaku, serta yang bersumpah kepadaku, demikian: kepada keturunanmulah akan Kuberikan negeri ini--Dialah juga akan m',NULL),(2655,'PERJANJIAN LAMA','KEJADIAN',24,NULL,8,'Tetapi jika perempuan itu tidak mau mengikuti engkau, maka lepaslah engkau dari sumpahmu kepadaku ini; hanya saja, janganlah anakku itu kaubawa kembali ke sana.\"',NULL),(2656,'PERJANJIAN LAMA','KEJADIAN',24,NULL,9,'Lalu hamba itu meletakkan tangannya di bawah pangkal paha Abraham, tuannya, dan bersumpah kepadanya tentang hal itu.',NULL),(2657,'PERJANJIAN LAMA','KEJADIAN',24,NULL,10,'Kemudian hamba itu mengambil sepuluh ekor dari unta tuannya dan pergi dengan membawa berbagai-bagai barang berharga kepunyaan tuannya; demikianlah ia berangkat menuju Aram-Mesopotamia ke kota Nahor.',NULL),(2658,'PERJANJIAN LAMA','KEJADIAN',24,NULL,11,'Di sana disuruhnyalah unta itu berhenti di luar kota dekat suatu sumur, pada waktu petang hari, waktu perempuan-perempuan keluar untuk menimba air.',NULL),(2659,'PERJANJIAN LAMA','KEJADIAN',24,NULL,12,'Lalu berkatalah ia: \"TUHAN, Allah tuanku Abraham, buatlah kiranya tercapai tujuanku pada hari ini, tunjukkanlah kasih setia-Mu kepada tuanku Abraham.',NULL),(2660,'PERJANJIAN LAMA','KEJADIAN',24,NULL,13,'Di sini aku berdiri di dekat mata air, dan anak-anak perempuan penduduk kota ini datang keluar untuk menimba air.',NULL),(2661,'PERJANJIAN LAMA','KEJADIAN',24,NULL,14,'Kiranya terjadilah begini: anak gadis, kepada siapa aku berkata: Tolong miringkan buyungmu itu, supaya aku minum, dan yang menjawab: Minumlah, dan unta-untamu juga akan kuberi minum--dialah kiranya yang Kautentukan bagi hamba-Mu, Ishak; maka dengan begitu',NULL),(2662,'PERJANJIAN LAMA','KEJADIAN',24,NULL,15,'Sebelum ia selesai berkata, maka datanglah Ribka, yang lahir bagi Betuel, anak laki-laki Milka, isteri Nahor, saudara Abraham; buyungnya dibawanya di atas bahunya.',NULL),(2663,'PERJANJIAN LAMA','KEJADIAN',24,NULL,16,'Anak gadis itu sangat cantik parasnya, seorang perawan, belum pernah bersetubuh dengan laki-laki; ia turun ke mata air itu dan mengisi buyungnya, lalu kembali naik.',NULL),(2664,'PERJANJIAN LAMA','KEJADIAN',24,NULL,17,'Kemudian berlarilah hamba itu mendapatkannya serta berkata: \"Tolong beri aku minum air sedikit dari buyungmu itu.\"',NULL),(2665,'PERJANJIAN LAMA','KEJADIAN',24,NULL,18,'Jawabnya: \"Minumlah, tuan,\" maka segeralah diturunkannya buyungnya itu ke tangannya, serta diberinya dia minum.',NULL),(2666,'PERJANJIAN LAMA','KEJADIAN',24,NULL,19,'Setelah ia selesai memberi hamba itu minum, berkatalah ia: \"Baiklah untuk unta-untamu juga kutimba air, sampai semuanya puas minum.\"',NULL),(2667,'PERJANJIAN LAMA','KEJADIAN',24,NULL,20,'Kemudian segeralah dituangnya air yang di buyungnya itu ke dalam palungan, lalu berlarilah ia sekali lagi ke sumur untuk menimba air dan ditimbanyalah untuk semua unta orang itu.',NULL),(2668,'PERJANJIAN LAMA','KEJADIAN',24,NULL,21,'Dan orang itu mengamat-amatinya dengan berdiam diri untuk mengetahui apakah TUHAN membuat perjalanannya berhasil atau tidak.',NULL),(2669,'PERJANJIAN LAMA','KEJADIAN',24,NULL,22,'Setelah unta-unta itu puas minum, maka orang itu mengambil anting-anting emas yang setengah syikal beratnya, dan sepasang gelang tangan yang sepuluh syikal emas beratnya,',NULL),(2670,'PERJANJIAN LAMA','KEJADIAN',24,NULL,23,'serta berkata: \"Anak siapakah engkau? Baiklah katakan kepadaku! Adakah di rumah ayahmu tempat bermalam bagi kami?\"',NULL),(2671,'PERJANJIAN LAMA','KEJADIAN',24,NULL,24,'Lalu jawabnya kepadanya: \"Ayahku Betuel, anak Milka, yang melahirkannya bagi Nahor.\"',NULL),(2672,'PERJANJIAN LAMA','KEJADIAN',24,NULL,25,'Lagi kata gadis itu: \"Baik jerami, baik makanan unta banyak pada kami, tempat bermalampun ada.\"',NULL),(2673,'PERJANJIAN LAMA','KEJADIAN',24,NULL,26,'Lalu berlututlah orang itu dan sujud menyembah TUHAN,',NULL),(2674,'PERJANJIAN LAMA','KEJADIAN',24,NULL,27,'serta berkata: \"Terpujilah TUHAN, Allah tuanku Abraham, yang tidak menarik kembali kasih-Nya dan setia-Nya dari tuanku itu; dan TUHAN telah menuntun aku di jalan ke rumah saudara-saudara tuanku ini!\"',NULL),(2675,'PERJANJIAN LAMA','KEJADIAN',24,NULL,28,'Berlarilah gadis itu pergi menceritakan kejadian itu ke rumah ibunya.',NULL),(2676,'PERJANJIAN LAMA','KEJADIAN',24,NULL,29,'Ribka mempunyai saudara laki-laki, namanya Laban. Laban berlari ke luar mendapatkan orang itu, ke mata air tadi,',NULL),(2677,'PERJANJIAN LAMA','KEJADIAN',24,NULL,30,'sesudah dilihatnya anting-anting itu dan gelang pada tangan saudaranya, dan sesudah didengarnya perkataan Ribka, saudaranya, yang bunyinya: \"Begitulah dikatakan orang itu kepadaku.\" Ia mendapatkan orang itu, yang masih berdiri di samping unta-untanya di d',NULL),(2678,'PERJANJIAN LAMA','KEJADIAN',24,NULL,31,'dan berkata: \"Marilah engkau yang diberkati TUHAN, mengapa engkau berdiri di luar, padahal telah kusediakan rumah bagimu, dan juga tempat untuk unta-untamu.\"',NULL),(2679,'PERJANJIAN LAMA','KEJADIAN',24,NULL,32,'Masuklah orang itu ke dalam rumah. Ditanggalkanlah pelana unta-unta, diberikan jerami dan makanan kepada unta-unta itu, lalu dibawa air pembasuh kaki untuk orang itu dan orang-orang yang bersama-sama dengan dia.',NULL),(2680,'PERJANJIAN LAMA','KEJADIAN',24,NULL,33,'Tetapi ketika dihidangkan makanan di depannya, berkatalah orang itu: \"Aku tidak akan makan sebelum kusampaikan pesan yang kubawa ini.\" Jawab Laban: \"Silakan!\"',NULL),(2681,'PERJANJIAN LAMA','KEJADIAN',24,NULL,34,'Lalu berkatalah ia: \"Aku ini hamba Abraham.',NULL),(2682,'PERJANJIAN LAMA','KEJADIAN',24,NULL,35,'TUHAN sangat memberkati tuanku itu, sehingga ia telah menjadi kaya; TUHAN telah memberikan kepadanya kambing domba dan lembu sapi, emas dan perak, budak laki-laki dan perempuan, unta dan keledai.',NULL),(2683,'PERJANJIAN LAMA','KEJADIAN',24,NULL,36,'Dan Sara, isteri tuanku itu, sesudah tua, telah melahirkan anak laki-laki bagi tuanku itu; kepada anaknya itu telah diberikan tuanku segala harta miliknya.',NULL),(2684,'PERJANJIAN LAMA','KEJADIAN',24,NULL,37,'Tuanku itu telah mengambil sumpahku: Engkau tidak akan mengambil untuk anakku seorang isteri dari antara perempuan Kanaan, yang negerinya kudiami ini,',NULL),(2685,'PERJANJIAN LAMA','KEJADIAN',24,NULL,38,'tetapi engkau harus pergi ke rumah ayahku dan kepada kaumku untuk mengambil seorang isteri bagi anakku.',NULL),(2686,'PERJANJIAN LAMA','KEJADIAN',24,NULL,39,'Jawabku kepada tuanku itu: Mungkin perempuan itu tidak mau mengikut aku.',NULL),(2687,'PERJANJIAN LAMA','KEJADIAN',24,NULL,40,'Tetapi katanya kepadaku: TUHAN, yang di hadapan-Nya aku hidup, akan mengutus malaikat-Nya menyertai engkau, dan akan membuat perjalananmu berhasil, sehingga engkau akan mengambil bagi anakku seorang isteri dari kaumku dan dari rumah ayahku.',NULL),(2688,'PERJANJIAN LAMA','KEJADIAN',24,NULL,41,'Barulah engkau lepas dari sumpahmu kepadaku, jika engkau sampai kepada kaumku dan mereka tidak memberikan perempuan itu kepadamu; hanya dalam hal itulah engkau lepas dari sumpahmu kepadaku.',NULL),(2689,'PERJANJIAN LAMA','KEJADIAN',24,NULL,42,'Dan hari ini aku sampai ke mata air tadi, lalu kataku: TUHAN, Allah tuanku Abraham, sudilah kiranya Engkau membuat berhasil perjalanan yang kutempuh ini.',NULL),(2690,'PERJANJIAN LAMA','KEJADIAN',24,NULL,43,'Di sini aku berdiri di dekat mata air ini; kiranya terjadi begini: Apabila seorang gadis datang ke luar untuk menimba air dan aku berkata kepadanya: Tolong berikan aku minum air sedikit dari buyungmu itu,',NULL),(2691,'PERJANJIAN LAMA','KEJADIAN',24,NULL,44,'dan ia menjawab: Minumlah, dan untuk unta-untamu juga akan kutimba air, --dialah kiranya isteri, yang telah TUHAN tentukan bagi anak tuanku itu.',NULL),(2692,'PERJANJIAN LAMA','KEJADIAN',24,NULL,45,'Belum lagi aku habis berkata dalam hatiku, Ribka telah datang membawa buyung di atas bahunya, dan turun ke mata air itu, lalu menimba air. Kataku kepadanya: Tolong berikan aku minum.',NULL),(2693,'PERJANJIAN LAMA','KEJADIAN',24,NULL,46,'Segeralah ia menurunkan buyung itu dari atas bahunya serta berkata: Minumlah, dan unta-untamu juga akan kuberi minum. Lalu aku minum, dan unta-unta itu juga diberinya minum.',NULL),(2694,'PERJANJIAN LAMA','KEJADIAN',24,NULL,47,'Sesudah itu aku bertanya kepadanya: Anak siapakah engkau? Jawabnya: Ayahku Betuel anak Nahor yang dilahirkan Milka. Lalu aku mengenakan anting-anting pada hidungnya dan gelang pada tangannya.',NULL),(2695,'PERJANJIAN LAMA','KEJADIAN',24,NULL,48,'Kemudian berlututlah aku dan sujud menyembah TUHAN, serta memuji TUHAN, Allah tuanku Abraham, yang telah menuntun aku di jalan yang benar untuk mengambil anak perempuan saudara tuanku ini bagi anaknya.',NULL),(2696,'PERJANJIAN LAMA','KEJADIAN',24,NULL,49,'Jadi sekarang, apabila kamu mau menunjukkan kasih dan setia kepada tuanku itu, beritahukanlah kepadaku; dan jika tidak, beritahukanlah juga kepadaku, supaya aku tahu entah berpaling ke kanan atau ke kiri.\"',NULL),(2697,'PERJANJIAN LAMA','KEJADIAN',24,NULL,50,'Lalu Laban dan Betuel menjawab: \"Semuanya ini datangnya dari TUHAN; kami tidak dapat mengatakan kepadamu baiknya atau buruknya.',NULL),(2698,'PERJANJIAN LAMA','KEJADIAN',24,NULL,51,'Lihat, Ribka ada di depanmu, bawalah dia dan pergilah, supaya ia menjadi isteri anak tuanmu, seperti yang difirmankan TUHAN.\"',NULL),(2699,'PERJANJIAN LAMA','KEJADIAN',24,NULL,52,'Ketika hamba Abraham itu mendengar perkataan mereka, sujudlah ia sampai ke tanah menyembah TUHAN.',NULL),(2700,'PERJANJIAN LAMA','KEJADIAN',24,NULL,53,'Kemudian hamba itu mengeluarkan perhiasan emas dan perak serta pakaian kebesaran, dan memberikan semua itu kepada Ribka; juga kepada saudaranya dan kepada ibunya diberikannya pemberian yang indah-indah.',NULL),(2701,'PERJANJIAN LAMA','KEJADIAN',24,NULL,54,'Sesudah itu makan dan minumlah mereka, ia dan orang-orang yang bersama-sama dengan dia, dan mereka bermalam di situ. Paginya sesudah mereka bangun, berkatalah hamba itu: \"Lepaslah aku pulang kepada tuanku.\"',NULL),(2702,'PERJANJIAN LAMA','KEJADIAN',24,NULL,55,'Tetapi saudara Ribka berkata, serta ibunya juga: \"Biarkanlah anak gadis itu tinggal pada kami barang sepuluh hari lagi, kemudian bolehlah engkau pergi.\"',NULL),(2703,'PERJANJIAN LAMA','KEJADIAN',24,NULL,56,'Tetapi jawabnya kepada mereka: \"Janganlah tahan aku, sedang TUHAN telah membuat perjalananku berhasil; lepaslah aku, supaya aku pulang kepada tuanku.\"',NULL),(2704,'PERJANJIAN LAMA','KEJADIAN',24,NULL,57,'Kata mereka: \"Baiklah kita panggil anak gadis itu dan menanyakan kepadanya sendiri.\"',NULL),(2705,'PERJANJIAN LAMA','KEJADIAN',24,NULL,58,'Lalu mereka memanggil Ribka dan berkata kepadanya: \"Maukah engkau pergi beserta orang ini?\" Jawabnya: \"Mau.\"',NULL),(2706,'PERJANJIAN LAMA','KEJADIAN',24,NULL,59,'Maka Ribka, saudara mereka itu, dan inang pengasuhnya beserta hamba Abraham dan orang-orangnya dibiarkan mereka pergi.',NULL),(2707,'PERJANJIAN LAMA','KEJADIAN',24,NULL,60,'Dan mereka memberkati Ribka, kata mereka kepadanya: \"Saudara kami, moga-moga engkau menjadi beribu-ribu laksa, dan moga-moga keturunanmu menduduki kota-kota musuhnya.\"',NULL),(2708,'PERJANJIAN LAMA','KEJADIAN',24,NULL,61,'Lalu berkemaslah Ribka beserta hamba-hambanya perempuan, dan mereka naik unta mengikuti orang itu. Demikianlah hamba itu membawa Ribka lalu berjalan pulang.',NULL),(2709,'PERJANJIAN LAMA','KEJADIAN',24,NULL,62,'Adapun Ishak telah datang dari arah sumur Lahai-Roi; ia tinggal di Tanah Negeb.',NULL),(2710,'PERJANJIAN LAMA','KEJADIAN',24,NULL,63,'Menjelang senja Ishak sedang keluar untuk berjalan-jalan di padang. Ia melayangkan pandangnya, maka dilihatnyalah ada unta-unta datang.',NULL),(2711,'PERJANJIAN LAMA','KEJADIAN',24,NULL,64,'Ribka juga melayangkan pandangnya dan ketika dilihatnya Ishak, turunlah ia dari untanya.',NULL),(2712,'PERJANJIAN LAMA','KEJADIAN',24,NULL,65,'Katanya kepada hamba itu: \"Siapakah laki-laki itu yang berjalan di padang ke arah kita?\" Jawab hamba itu: \"Dialah tuanku itu.\" Lalu Ribka mengambil telekungnya dan bertelekunglah ia.',NULL),(2713,'PERJANJIAN LAMA','KEJADIAN',24,NULL,66,'Kemudian hamba itu menceritakan kepada Ishak segala yang dilakukannya.',NULL),(2714,'PERJANJIAN LAMA','KEJADIAN',24,NULL,67,'Lalu Ishak membawa Ribka ke dalam kemah Sara, ibunya, dan mengambil dia menjadi isterinya. Ishak mencintainya dan demikian ia dihiburkan setelah ibunya meninggal.',NULL),(2715,'PERJANJIAN LAMA','KEJADIAN',25,NULL,1,'Abraham mengambil pula seorang isteri, namanya Ketura.',NULL),(2716,'PERJANJIAN LAMA','KEJADIAN',25,NULL,2,'Perempuan itu melahirkan baginya Zimran, Yoksan, Medan, Midian, Isybak dan Suah.',NULL),(2717,'PERJANJIAN LAMA','KEJADIAN',25,NULL,3,'Yoksan memperanakkan Syeba dan Dedan. Keturunan Dedan ialah orang Asyur, orang Letush dan orang Leum.',NULL),(2718,'PERJANJIAN LAMA','KEJADIAN',25,NULL,4,'Anak-anak Midian ialah Efa, Efer, Henokh, Abida dan Eldaa. Itulah semuanya keturunan Ketura.',NULL),(2719,'PERJANJIAN LAMA','KEJADIAN',25,NULL,5,'Abraham memberikan segala harta miliknya kepada Ishak,',NULL),(2720,'PERJANJIAN LAMA','KEJADIAN',25,NULL,6,'tetapi kepada anak-anaknya yang diperolehnya dari gundik-gundiknya ia memberikan pemberian; kemudian ia menyuruh mereka--masih pada waktu ia hidup--meninggalkan Ishak, anaknya, dan pergi ke sebelah timur, ke Tanah Timur.',NULL),(2721,'PERJANJIAN LAMA','KEJADIAN',25,NULL,7,'Abraham mencapai umur seratus tujuh puluh lima tahun,',NULL),(2722,'PERJANJIAN LAMA','KEJADIAN',25,NULL,8,'lalu ia meninggal. Ia mati pada waktu telah putih rambutnya, tua dan suntuk umur, maka ia dikumpulkan kepada kaum leluhurnya.',NULL),(2723,'PERJANJIAN LAMA','KEJADIAN',25,NULL,9,'Dan anak-anaknya, Ishak dan Ismael, menguburkan dia dalam gua Makhpela, di padang Efron bin Zohar, orang Het itu, padang yang letaknya di sebelah timur Mamre,',NULL),(2724,'PERJANJIAN LAMA','KEJADIAN',25,NULL,10,'yang telah dibeli Abraham dari bani Het; di sanalah terkubur Abraham dan Sara isterinya.',NULL),(2725,'PERJANJIAN LAMA','KEJADIAN',25,NULL,11,'Setelah Abraham mati, Allah memberkati Ishak, anaknya itu; dan Ishak diam dekat sumur Lahai-Roi.',NULL),(2726,'PERJANJIAN LAMA','KEJADIAN',25,NULL,12,'Inilah keturunan Ismael, anak Abraham, yang telah dilahirkan baginya oleh Hagar, perempuan Mesir, hamba Sara itu.',NULL),(2727,'PERJANJIAN LAMA','KEJADIAN',25,NULL,13,'Inilah nama anak-anak Ismael, disebutkan menurut urutan lahirnya: Nebayot, anak sulung Ismael, selanjutnya Kedar, Adbeel, Mibsam,',NULL),(2728,'PERJANJIAN LAMA','KEJADIAN',25,NULL,14,'Misyma, Duma, Masa,',NULL),(2729,'PERJANJIAN LAMA','KEJADIAN',25,NULL,15,'Hadad, Tema, Yetur, Nafish dan Kedma.',NULL),(2730,'PERJANJIAN LAMA','KEJADIAN',25,NULL,16,'Itulah anak-anak Ismael, dan itulah nama-nama mereka, menurut kampung mereka dan menurut perkemahan mereka, dua belas orang raja, masing-masing dengan sukunya.',NULL),(2731,'PERJANJIAN LAMA','KEJADIAN',25,NULL,17,'Umur Ismael ialah seratus tiga puluh tujuh tahun. Sesudah itu ia meninggal. Ia mati dan dikumpulkan kepada kaum leluhurnya.',NULL),(2732,'PERJANJIAN LAMA','KEJADIAN',25,NULL,18,'Mereka itu mendiami daerah dari Hawila sampai Syur, yang letaknya di sebelah timur Mesir ke arah Asyur. Mereka menetap berhadapan dengan semua saudara mereka.',NULL),(2733,'PERJANJIAN LAMA','KEJADIAN',25,NULL,19,'Inilah riwayat keturunan Ishak, anak Abraham. Abraham memperanakkan Ishak.',NULL),(2734,'PERJANJIAN LAMA','KEJADIAN',25,NULL,20,'Dan Ishak berumur empat puluh tahun, ketika Ribka, anak Betuel, orang Aram dari Padan-Aram, saudara perempuan Laban orang Aram itu, diambilnya menjadi isterinya.',NULL),(2735,'PERJANJIAN LAMA','KEJADIAN',25,NULL,21,'Berdoalah Ishak kepada TUHAN untuk isterinya, sebab isterinya itu mandul; TUHAN mengabulkan doanya, sehingga Ribka, isterinya itu, mengandung.',NULL),(2736,'PERJANJIAN LAMA','KEJADIAN',25,NULL,22,'Tetapi anak-anaknya bertolak-tolakan di dalam rahimnya dan ia berkata: \"Jika demikian halnya, mengapa aku hidup?\" Dan ia pergi meminta petunjuk kepada TUHAN.',NULL),(2737,'PERJANJIAN LAMA','KEJADIAN',25,NULL,23,'Firman TUHAN kepadanya: \"Dua bangsa ada dalam kandunganmu, dan dua suku bangsa akan berpencar dari dalam rahimmu; suku bangsa yang satu akan lebih kuat dari yang lain, dan anak yang tua akan menjadi hamba kepada anak yang muda.\"',NULL),(2738,'PERJANJIAN LAMA','KEJADIAN',25,NULL,24,'Setelah genap harinya untuk bersalin, memang anak kembar yang di dalam kandungannya.',NULL),(2739,'PERJANJIAN LAMA','KEJADIAN',25,NULL,25,'Keluarlah yang pertama, warnanya merah, seluruh tubuhnya seperti jubah berbulu; sebab itu ia dinamai Esau.',NULL),(2740,'PERJANJIAN LAMA','KEJADIAN',25,NULL,26,'Sesudah itu keluarlah adiknya; tangannya memegang tumit Esau, sebab itu ia dinamai Yakub. Ishak berumur enam puluh tahun pada waktu mereka lahir.',NULL),(2741,'PERJANJIAN LAMA','KEJADIAN',25,NULL,27,'Lalu bertambah besarlah kedua anak itu: Esau menjadi seorang yang pandai berburu, seorang yang suka tinggal di padang, tetapi Yakub adalah seorang yang tenang, yang suka tinggal di kemah.',NULL),(2742,'PERJANJIAN LAMA','KEJADIAN',25,NULL,28,'Ishak sayang kepada Esau, sebab ia suka makan daging buruan, tetapi Ribka kasih kepada Yakub.',NULL),(2743,'PERJANJIAN LAMA','KEJADIAN',25,NULL,29,'Pada suatu kali Yakub sedang memasak sesuatu, lalu datanglah Esau dengan lelah dari padang.',NULL),(2744,'PERJANJIAN LAMA','KEJADIAN',25,NULL,30,'Kata Esau kepada Yakub: \"Berikanlah kiranya aku menghirup sedikit dari yang merah-merah itu, karena aku lelah.\" Itulah sebabnya namanya disebutkan Edom.',NULL),(2745,'PERJANJIAN LAMA','KEJADIAN',25,NULL,31,'Tetapi kata Yakub: \"Juallah dahulu kepadaku hak kesulunganmu.\"',NULL),(2746,'PERJANJIAN LAMA','KEJADIAN',25,NULL,32,'Sahut Esau: \"Sebentar lagi aku akan mati; apakah gunanya bagiku hak kesulungan itu?\"',NULL),(2747,'PERJANJIAN LAMA','KEJADIAN',25,NULL,33,'Kata Yakub: \"Bersumpahlah dahulu kepadaku.\" Maka bersumpahlah ia kepada Yakub dan dijualnyalah hak kesulungannya kepadanya.',NULL),(2748,'PERJANJIAN LAMA','KEJADIAN',25,NULL,34,'Lalu Yakub memberikan roti dan masakan kacang merah itu kepada Esau; ia makan dan minum, lalu berdiri dan pergi. Demikianlah Esau memandang ringan hak kesulungan itu.',NULL),(2749,'PERJANJIAN LAMA','KEJADIAN',26,NULL,1,'Maka timbullah kelaparan di negeri itu. --Ini bukan kelaparan yang pertama, yang telah terjadi dalam zaman Abraham. Sebab itu Ishak pergi ke Gerar, kepada Abimelekh, raja orang Filistin.',NULL),(2750,'PERJANJIAN LAMA','KEJADIAN',26,NULL,2,'Lalu TUHAN menampakkan diri kepadanya serta berfirman: \"Janganlah pergi ke Mesir, diamlah di negeri yang akan Kukatakan kepadamu.',NULL),(2751,'PERJANJIAN LAMA','KEJADIAN',26,NULL,3,'Tinggallah di negeri ini sebagai orang asing, maka Aku akan menyertai engkau dan memberkati engkau, sebab kepadamulah dan kepada keturunanmu akan Kuberikan seluruh negeri ini, dan Aku akan menepati sumpah yang telah Kuikrarkan kepada Abraham, ayahmu.',NULL),(2752,'PERJANJIAN LAMA','KEJADIAN',26,NULL,4,'Aku akan membuat banyak keturunanmu seperti bintang di langit; Aku akan memberikan kepada keturunanmu seluruh negeri ini, dan oleh keturunanmu semua bangsa di bumi akan mendapat berkat,',NULL),(2753,'PERJANJIAN LAMA','KEJADIAN',26,NULL,5,'karena Abraham telah mendengarkan firman-Ku dan memelihara kewajibannya kepada-Ku, yaitu segala perintah, ketetapan dan hukum-Ku.\"',NULL),(2754,'PERJANJIAN LAMA','KEJADIAN',26,NULL,6,'Jadi tinggallah Ishak di Gerar.',NULL),(2755,'PERJANJIAN LAMA','KEJADIAN',26,NULL,7,'Ketika orang-orang di tempat itu bertanya tentang isterinya, berkatalah ia: \"Dia saudaraku,\" sebab ia takut mengatakan: \"Ia isteriku,\" karena pikirnya: \"Jangan-jangan aku dibunuh oleh penduduk tempat ini karena Ribka, sebab elok parasnya.\"',NULL),(2756,'PERJANJIAN LAMA','KEJADIAN',26,NULL,8,'Setelah beberapa lama ia ada di sana, pada suatu kali menjenguklah Abimelekh, raja orang Filistin itu dari jendela, maka dilihatnya Ishak sedang bercumbu-cumbuan dengan Ribka, isterinya.',NULL),(2757,'PERJANJIAN LAMA','KEJADIAN',26,NULL,9,'Lalu Abimelekh memanggil Ishak dan berkata: \"Sesungguhnya dia isterimu, masakan engkau berkata: Dia saudaraku?\" Jawab Ishak kepadanya: \"Karena pikirku: Jangan-jangan aku mati karena dia.\"',NULL),(2758,'PERJANJIAN LAMA','KEJADIAN',26,NULL,10,'Tetapi Abimelekh berkata: \"Apakah juga yang telah kauperbuat ini terhadap kami? Mudah sekali terjadi, salah seorang dari bangsa ini tidur dengan isterimu, sehingga dengan demikian engkau mendatangkan kesalahan atas kami.\"',NULL),(2759,'PERJANJIAN LAMA','KEJADIAN',26,NULL,11,'Lalu Abimelekh memberi perintah kepada seluruh bangsa itu: \"Siapa yang mengganggu orang ini atau isterinya, pastilah ia akan dihukum mati.\"',NULL),(2760,'PERJANJIAN LAMA','KEJADIAN',26,NULL,12,'Maka menaburlah Ishak di tanah itu dan dalam tahun itu juga ia mendapat hasil seratus kali lipat; sebab ia diberkati TUHAN.',NULL),(2761,'PERJANJIAN LAMA','KEJADIAN',26,NULL,13,'Dan orang itu menjadi kaya, bahkan kian lama kian kaya, sehingga ia menjadi sangat kaya.',NULL),(2762,'PERJANJIAN LAMA','KEJADIAN',26,NULL,14,'Ia mempunyai kumpulan kambing domba dan lembu sapi serta banyak anak buah, sehingga orang Filistin itu cemburu kepadanya.',NULL),(2763,'PERJANJIAN LAMA','KEJADIAN',26,NULL,15,'Segala sumur, yang digali dalam zaman Abraham, ayahnya, oleh hamba-hamba ayahnya itu, telah ditutup oleh orang Filistin dan ditimbun dengan tanah.',NULL),(2764,'PERJANJIAN LAMA','KEJADIAN',26,NULL,16,'Lalu kata Abimelekh kepada Ishak: \"Pergilah dari tengah-tengah kami sebab engkau telah menjadi jauh lebih berkuasa dari pada kami.\"',NULL),(2765,'PERJANJIAN LAMA','KEJADIAN',26,NULL,17,'Jadi pergilah Ishak dari situ dan berkemahlah ia di lembah Gerar, dan ia menetap di situ.',NULL),(2766,'PERJANJIAN LAMA','KEJADIAN',26,NULL,18,'Kemudian Ishak menggali kembali sumur-sumur yang digali dalam zaman Abraham, ayahnya, dan yang telah ditutup oleh orang Filistin sesudah Abraham mati; disebutkannyalah nama sumur-sumur itu menurut nama-nama yang telah diberikan oleh ayahnya.',NULL),(2767,'PERJANJIAN LAMA','KEJADIAN',26,NULL,19,'Ketika hamba-hamba Ishak menggali di lembah itu, mereka mendapati di situ mata air yang berbual-bual airnya.',NULL),(2768,'PERJANJIAN LAMA','KEJADIAN',26,NULL,20,'Lalu bertengkarlah para gembala Gerar dengan para gembala Ishak. Kata mereka: \"Air ini kepunyaan kami.\" Dan Ishak menamai sumur itu Esek, karena mereka bertengkar dengan dia di sana.',NULL),(2769,'PERJANJIAN LAMA','KEJADIAN',26,NULL,21,'Kemudian mereka menggali sumur lain, dan mereka bertengkar juga tentang itu. Maka Ishak menamai sumur itu Sitna.',NULL),(2770,'PERJANJIAN LAMA','KEJADIAN',26,NULL,22,'Ia pindah dari situ dan menggali sumur yang lain lagi, tetapi tentang sumur ini mereka tidak bertengkar. Sumur ini dinamainya Rehobot, dan ia berkata: \"Sekarang TUHAN telah memberikan kelonggaran kepada kita, sehingga kita dapat beranak cucu di negeri ini',NULL),(2771,'PERJANJIAN LAMA','KEJADIAN',26,NULL,23,'Dari situ ia pergi ke Bersyeba.',NULL),(2772,'PERJANJIAN LAMA','KEJADIAN',26,NULL,24,'Lalu pada malam itu TUHAN menampakkan diri kepadanya serta berfirman: \"Akulah Allah ayahmu Abraham; janganlah takut, sebab Aku menyertai engkau; Aku akan memberkati engkau dan membuat banyak keturunanmu karena Abraham, hamba-Ku itu.\"',NULL),(2773,'PERJANJIAN LAMA','KEJADIAN',26,NULL,25,'Sesudah itu Ishak mendirikan mezbah di situ dan memanggil nama TUHAN. Ia memasang kemahnya di situ, lalu hamba-hambanya menggali sumur di situ.',NULL),(2774,'PERJANJIAN LAMA','KEJADIAN',26,NULL,26,'Datanglah Abimelekh dari Gerar mendapatkannya, bersama-sama dengan Ahuzat, sahabatnya, dan Pikhol, kepala pasukannya.',NULL),(2775,'PERJANJIAN LAMA','KEJADIAN',26,NULL,27,'Tetapi kata Ishak kepada mereka: \"Mengapa kamu datang mendapatkan aku? Bukankah kamu benci kepadaku, dan telah menyuruh aku keluar dari tanahmu?\"',NULL),(2776,'PERJANJIAN LAMA','KEJADIAN',26,NULL,28,'Jawab mereka: \"Kami telah melihat sendiri, bahwa TUHAN menyertai engkau; sebab itu kami berkata: baiklah kita mengadakan sumpah setia, antara kami dan engkau; dan baiklah kami mengikat perjanjian dengan engkau,',NULL),(2777,'PERJANJIAN LAMA','KEJADIAN',26,NULL,29,'bahwa engkau tidak akan berbuat jahat kepada kami, seperti kami tidak mengganggu engkau, dan seperti kami semata-mata berbuat baik kepadamu dan membiarkan engkau pergi dengan damai; bukankah engkau sekarang yang diberkati TUHAN.\"',NULL),(2778,'PERJANJIAN LAMA','KEJADIAN',26,NULL,30,'Kemudian Ishak mengadakan perjamuan bagi mereka, lalu mereka makan dan minum.',NULL),(2779,'PERJANJIAN LAMA','KEJADIAN',26,NULL,31,'Keesokan harinya pagi-pagi bersumpah-sumpahanlah mereka. Kemudian Ishak melepas mereka, dan mereka meninggalkan dia dengan damai.',NULL),(2780,'PERJANJIAN LAMA','KEJADIAN',26,NULL,32,'Pada hari itu datanglah hamba-hamba Ishak memberitahukan kepadanya tentang sumur yang telah digali mereka, serta berkata kepadanya: \"Kami telah mendapat air.\"',NULL),(2781,'PERJANJIAN LAMA','KEJADIAN',26,NULL,33,'Lalu dinamainyalah sumur itu Syeba. Sebab itu nama kota itu adalah Bersyeba, sampai sekarang.',NULL),(2782,'PERJANJIAN LAMA','KEJADIAN',26,NULL,34,'Ketika Esau telah berumur empat puluh tahun, ia mengambil Yudit, anak Beeri orang Het, dan Basmat, anak Elon orang Het, menjadi isterinya.',NULL),(2783,'PERJANJIAN LAMA','KEJADIAN',26,NULL,35,'Kedua perempuan itu menimbulkan kepedihan hati bagi Ishak dan bagi Ribka.',NULL),(2784,'PERJANJIAN LAMA','KEJADIAN',27,NULL,1,'Ketika Ishak sudah tua, dan matanya telah kabur, sehingga ia tidak dapat melihat lagi, dipanggilnyalah Esau, anak sulungnya, serta berkata kepadanya: \"Anakku.\" Sahut Esau: \"Ya, bapa.\"',NULL),(2785,'PERJANJIAN LAMA','KEJADIAN',27,NULL,2,'Berkatalah Ishak: \"Lihat, aku sudah tua, aku tidak tahu bila hari kematianku.',NULL),(2786,'PERJANJIAN LAMA','KEJADIAN',27,NULL,3,'Maka sekarang, ambillah senjatamu, tabung panah dan busurmu, pergilah ke padang dan burulah bagiku seekor binatang;',NULL),(2787,'PERJANJIAN LAMA','KEJADIAN',27,NULL,4,'olahlah bagiku makanan yang enak, seperti yang kugemari, sesudah itu bawalah kepadaku, supaya kumakan, agar aku memberkati engkau, sebelum aku mati.\"',NULL),(2788,'PERJANJIAN LAMA','KEJADIAN',27,NULL,5,'Tetapi Ribka mendengarkannya, ketika Ishak berkata kepada Esau, anaknya. Setelah Esau pergi ke padang memburu seekor binatang untuk dibawanya kepada ayahnya,',NULL),(2789,'PERJANJIAN LAMA','KEJADIAN',27,NULL,6,'berkatalah Ribka kepada Yakub, anaknya: \"Telah kudengar ayahmu berkata kepada Esau, kakakmu:',NULL),(2790,'PERJANJIAN LAMA','KEJADIAN',27,NULL,7,'Bawalah bagiku seekor binatang buruan dan olahlah bagiku makanan yang enak, supaya kumakan, dan supaya aku memberkati engkau di hadapan TUHAN, sebelum aku mati.',NULL),(2791,'PERJANJIAN LAMA','KEJADIAN',27,NULL,8,'Maka sekarang, anakku, dengarkanlah perkataanku seperti yang kuperintahkan kepadamu.',NULL),(2792,'PERJANJIAN LAMA','KEJADIAN',27,NULL,9,'Pergilah ke tempat kambing domba kita, ambillah dari sana dua anak kambing yang baik, maka aku akan mengolahnya menjadi makanan yang enak bagi ayahmu, seperti yang digemarinya.',NULL),(2793,'PERJANJIAN LAMA','KEJADIAN',27,NULL,10,'Bawalah itu kepada ayahmu, supaya dimakannya, agar dia memberkati engkau, sebelum ia mati.\"',NULL),(2794,'PERJANJIAN LAMA','KEJADIAN',27,NULL,11,'Lalu kata Yakub kepada Ribka, ibunya: \"Tetapi Esau, kakakku, adalah seorang yang berbulu badannya, sedang aku ini kulitku licin.',NULL),(2795,'PERJANJIAN LAMA','KEJADIAN',27,NULL,12,'Mungkin ayahku akan meraba aku; maka nanti ia akan menyangka bahwa aku mau memperolok-olokkan dia; dengan demikian aku akan mendatangkan kutuk atas diriku dan bukan berkat.\"',NULL),(2796,'PERJANJIAN LAMA','KEJADIAN',27,NULL,13,'Tetapi ibunya berkata kepadanya: \"Akulah yang menanggung kutuk itu, anakku; dengarkan saja perkataanku, pergilah ambil kambing-kambing itu.\"',NULL),(2797,'PERJANJIAN LAMA','KEJADIAN',27,NULL,14,'Lalu ia pergi mengambil kambing-kambing itu dan membawanya kepada ibunya; sesudah itu ibunya mengolah makanan yang enak, seperti yang digemari ayahnya.',NULL),(2798,'PERJANJIAN LAMA','KEJADIAN',27,NULL,15,'Kemudian Ribka mengambil pakaian yang indah kepunyaan Esau, anak sulungnya, pakaian yang disimpannya di rumah, lalu disuruhnyalah dikenakan oleh Yakub, anak bungsunya.',NULL),(2799,'PERJANJIAN LAMA','KEJADIAN',27,NULL,16,'Dan kulit anak kambing itu dipalutkannya pada kedua tangan Yakub dan pada lehernya yang licin itu.',NULL),(2800,'PERJANJIAN LAMA','KEJADIAN',27,NULL,17,'Lalu ia memberikan makanan yang enak dan roti yang telah diolahnya itu kepada Yakub, anaknya.',NULL),(2801,'PERJANJIAN LAMA','KEJADIAN',27,NULL,18,'Demikianlah Yakub masuk ke tempat ayahnya serta berkata: \"Bapa!\" Sahut ayahnya: \"Ya, anakku; siapakah engkau?\"',NULL),(2802,'PERJANJIAN LAMA','KEJADIAN',27,NULL,19,'Kata Yakub kepada ayahnya: \"Akulah Esau, anak sulungmu. Telah kulakukan, seperti yang bapa katakan kepadaku. Bangunlah, duduklah dan makanlah daging buruan masakanku ini, agar bapa memberkati aku.\"',NULL),(2803,'PERJANJIAN LAMA','KEJADIAN',27,NULL,20,'Lalu Ishak berkata kepada anaknya itu: \"Lekas juga engkau mendapatnya, anakku!\" Jawabnya: \"Karena TUHAN, Allahmu, membuat aku mencapai tujuanku.\"',NULL),(2804,'PERJANJIAN LAMA','KEJADIAN',27,NULL,21,'Lalu kata Ishak kepada Yakub: \"Datanglah mendekat, anakku, supaya aku meraba engkau, apakah engkau ini anakku Esau atau bukan.\"',NULL),(2805,'PERJANJIAN LAMA','KEJADIAN',27,NULL,22,'Maka Yakub mendekati Ishak, ayahnya, dan ayahnya itu merabanya serta berkata: \"Kalau suara, suara Yakub; kalau tangan, tangan Esau.\"',NULL),(2806,'PERJANJIAN LAMA','KEJADIAN',27,NULL,23,'Jadi Ishak tidak mengenal dia, karena tangannya berbulu seperti tangan Esau, kakaknya. Ishak hendak memberkati dia,',NULL),(2807,'PERJANJIAN LAMA','KEJADIAN',27,NULL,24,'tetapi ia masih bertanya: \"Benarkah engkau ini anakku Esau?\" Jawabnya: \"Ya!\"',NULL),(2808,'PERJANJIAN LAMA','KEJADIAN',27,NULL,25,'Lalu berkatalah Ishak: \"Dekatkanlah makanan itu kepadaku, supaya kumakan daging buruan masakan anakku, agar aku memberkati engkau.\" Jadi didekatkannyalah makanan itu kepada ayahnya, lalu ia makan, dibawanya juga anggur kepadanya, lalu ia minum.',NULL),(2809,'PERJANJIAN LAMA','KEJADIAN',27,NULL,26,'Berkatalah Ishak, ayahnya, kepadanya: \"Datanglah dekat-dekat dan ciumlah aku, anakku.\"',NULL),(2810,'PERJANJIAN LAMA','KEJADIAN',27,NULL,27,'Lalu datanglah Yakub dekat-dekat dan diciumnyalah ayahnya. Ketika Ishak mencium bau pakaian Yakub, diberkatinyalah dia, katanya: \"Sesungguhnya bau anakku adalah sebagai bau padang yang diberkati TUHAN.',NULL),(2811,'PERJANJIAN LAMA','KEJADIAN',27,NULL,28,'Allah akan memberikan kepadamu embun yang dari langit dan tanah-tanah gemuk di bumi dan gandum serta anggur berlimpah-limpah.',NULL),(2812,'PERJANJIAN LAMA','KEJADIAN',27,NULL,29,'Bangsa-bangsa akan takluk kepadamu, dan suku-suku bangsa akan sujud kepadamu; jadilah tuan atas saudara-saudaramu, dan anak-anak ibumu akan sujud kepadamu. Siapa yang mengutuk engkau, terkutuklah ia, dan siapa yang memberkati engkau, diberkatilah ia.\"',NULL),(2813,'PERJANJIAN LAMA','KEJADIAN',27,NULL,30,'Setelah Ishak selesai memberkati Yakub, dan baru saja Yakub keluar meninggalkan Ishak, ayahnya, pulanglah Esau, kakaknya, dari berburu.',NULL),(2814,'PERJANJIAN LAMA','KEJADIAN',27,NULL,31,'Ia juga menyediakan makanan yang enak, lalu membawanya kepada ayahnya. Katanya kepada ayahnya: \"Bapa, bangunlah dan makan daging buruan masakan anakmu, agar engkau memberkati aku.\"',NULL),(2815,'PERJANJIAN LAMA','KEJADIAN',27,NULL,32,'Tetapi kata Ishak, ayahnya, kepadanya: \"Siapakah engkau ini?\" Sahutnya: \"Akulah anakmu, anak sulungmu, Esau.\"',NULL),(2816,'PERJANJIAN LAMA','KEJADIAN',27,NULL,33,'Lalu terkejutlah Ishak dengan sangat serta berkata: \"Siapakah gerangan dia, yang memburu binatang itu dan yang telah membawanya kepadaku? Aku telah memakan semuanya, sebelum engkau datang, dan telah memberkati dia; dan dia akan tetap orang yang diberkati.',NULL),(2817,'PERJANJIAN LAMA','KEJADIAN',27,NULL,34,'Sesudah Esau mendengar perkataan ayahnya itu, meraung-raunglah ia dengan sangat keras dalam kepedihan hatinya serta berkata kepada ayahnya: \"Berkatilah aku ini juga, ya bapa!\"',NULL),(2818,'PERJANJIAN LAMA','KEJADIAN',27,NULL,35,'Jawab ayahnya: \"Adikmu telah datang dengan tipu daya dan telah merampas berkat yang untukmu itu.\"',NULL),(2819,'PERJANJIAN LAMA','KEJADIAN',27,NULL,36,'Kata Esau: \"Bukankah tepat namanya Yakub, karena ia telah dua kali menipu aku. Hak kesulunganku telah dirampasnya, dan sekarang dirampasnya pula berkat yang untukku.\" Lalu katanya: \"Apakah bapa tidak mempunyai berkat lain bagiku?\"',NULL),(2820,'PERJANJIAN LAMA','KEJADIAN',27,NULL,37,'Lalu Ishak menjawab Esau, katanya: \"Sesungguhnya telah kuangkat dia menjadi tuan atas engkau, dan segala saudaranya telah kuberikan kepadanya menjadi hambanya, dan telah kubekali dia dengan gandum dan anggur; maka kepadamu, apa lagi yang dapat kuperbuat, ',NULL),(2821,'PERJANJIAN LAMA','KEJADIAN',27,NULL,38,'Kata Esau kepada ayahnya: \"Hanya berkat yang satu itukah ada padamu, ya bapa? Berkatilah aku ini juga, ya bapa!\" Dan dengan suara keras menangislah Esau.',NULL),(2822,'PERJANJIAN LAMA','KEJADIAN',27,NULL,39,'Lalu Ishak, ayahnya, menjawabnya: \"Sesungguhnya tempat kediamanmu akan jauh dari tanah-tanah gemuk di bumi dan jauh dari embun dari langit di atas.',NULL),(2823,'PERJANJIAN LAMA','KEJADIAN',27,NULL,40,'Engkau akan hidup dari pedangmu dan engkau akan menjadi hamba adikmu. Tetapi akan terjadi kelak, apabila engkau berusaha sungguh-sungguh, maka engkau akan melemparkan kuk itu dari tengkukmu.\"',NULL),(2824,'PERJANJIAN LAMA','KEJADIAN',27,NULL,41,'Esau menaruh dendam kepada Yakub karena berkat yang telah diberikan oleh ayahnya kepadanya, lalu ia berkata kepada dirinya sendiri: \"Hari-hari berkabung karena kematian ayahku itu tidak akan lama lagi; pada waktu itulah Yakub, adikku, akan kubunuh.\"',NULL),(2825,'PERJANJIAN LAMA','KEJADIAN',27,NULL,42,'Ketika diberitahukan perkataan Esau, anak sulungnya itu kepada Ribka, maka disuruhnyalah memanggil Yakub, anak bungsunya, lalu berkata kepadanya: \"Esau, kakakmu, bermaksud membalas dendam membunuh engkau.',NULL),(2826,'PERJANJIAN LAMA','KEJADIAN',27,NULL,43,'Jadi sekarang, anakku, dengarkanlah perkataanku, bersiaplah engkau dan larilah kepada Laban, saudaraku, ke Haran,',NULL),(2827,'PERJANJIAN LAMA','KEJADIAN',27,NULL,44,'dan tinggallah padanya beberapa waktu lamanya, sampai kegeraman',NULL),(2828,'PERJANJIAN LAMA','KEJADIAN',27,NULL,45,'dan kemarahan kakakmu itu surut dari padamu, dan ia lupa apa yang telah engkau perbuat kepadanya; kemudian aku akan menyuruh orang menjemput engkau dari situ. Mengapa aku akan kehilangan kamu berdua pada satu hari juga?\"',NULL),(2829,'PERJANJIAN LAMA','KEJADIAN',27,NULL,46,'Kemudian Ribka berkata kepada Ishak: \"Aku telah jemu hidup karena perempuan-perempuan Het itu; jikalau Yakub juga mengambil seorang isteri dari antara perempuan negeri ini, semacam perempuan Het itu, apa gunanya aku hidup lagi?\"',NULL),(2830,'PERJANJIAN LAMA','KEJADIAN',28,NULL,1,'Kemudian Ishak memanggil Yakub, lalu memberkati dia serta memesankan kepadanya, katanya: \"Janganlah mengambil isteri dari perempuan Kanaan.',NULL),(2831,'PERJANJIAN LAMA','KEJADIAN',28,NULL,2,'Bersiaplah, pergilah ke Padan-Aram, ke rumah Betuel, ayah ibumu, dan ambillah dari situ seorang isteri dari anak-anak Laban, saudara ibumu.',NULL),(2832,'PERJANJIAN LAMA','KEJADIAN',28,NULL,3,'Moga-moga Allah Yang Mahakuasa memberkati engkau, membuat engkau beranak cucu dan membuat engkau menjadi banyak, sehingga engkau menjadi sekumpulan bangsa-bangsa.',NULL),(2833,'PERJANJIAN LAMA','KEJADIAN',28,NULL,4,'Moga-moga Ia memberikan kepadamu berkat yang untuk Abraham, kepadamu serta kepada keturunanmu, sehingga engkau memiliki negeri ini yang kaudiami sebagai orang asing, yang telah diberikan Allah kepada Abraham.\"',NULL),(2834,'PERJANJIAN LAMA','KEJADIAN',28,NULL,5,'Demikianlah Ishak melepas Yakub, lalu berangkatlah Yakub ke Padan-Aram, kepada Laban anak Betuel, orang Aram itu, saudara Ribka ibu Yakub dan Esau.',NULL),(2835,'PERJANJIAN LAMA','KEJADIAN',28,NULL,6,'Ketika Esau melihat, bahwa Ishak telah memberkati Yakub dan melepasnya ke Padan-Aram untuk mengambil isteri dari situ--pada waktu ia memberkatinya ia telah memesankan kepada Yakub: \"Janganlah ambil isteri dari antara perempuan Kanaan\" --',NULL),(2836,'PERJANJIAN LAMA','KEJADIAN',28,NULL,7,'dan bahwa Yakub mendengarkan perkataan ayah dan ibunya, dan pergi ke Padan-Aram,',NULL),(2837,'PERJANJIAN LAMA','KEJADIAN',28,NULL,8,'maka Esaupun menyadari, bahwa perempuan Kanaan itu tidak disukai oleh Ishak, ayahnya.',NULL),(2838,'PERJANJIAN LAMA','KEJADIAN',28,NULL,9,'Sebab itu ia pergi kepada Ismael dan mengambil Mahalat menjadi isterinya, di samping kedua isterinya yang telah ada. Mahalat adalah anak Ismael anak Abraham, adik Nebayot.',NULL),(2839,'PERJANJIAN LAMA','KEJADIAN',28,NULL,10,'Maka Yakub berangkat dari Bersyeba dan pergi ke Haran.',NULL),(2840,'PERJANJIAN LAMA','KEJADIAN',28,NULL,11,'Ia sampai di suatu tempat, dan bermalam di situ, karena matahari telah terbenam. Ia mengambil sebuah batu yang terletak di tempat itu dan dipakainya sebagai alas kepala, lalu membaringkan dirinya di tempat itu.',NULL),(2841,'PERJANJIAN LAMA','KEJADIAN',28,NULL,12,'Maka bermimpilah ia, di bumi ada didirikan sebuah tangga yang ujungnya sampai di langit, dan tampaklah malaikat-malaikat Allah turun naik di tangga itu.',NULL),(2842,'PERJANJIAN LAMA','KEJADIAN',28,NULL,13,'Berdirilah TUHAN di sampingnya dan berfirman: \"Akulah TUHAN, Allah Abraham, nenekmu, dan Allah Ishak; tanah tempat engkau berbaring ini akan Kuberikan kepadamu dan kepada keturunanmu.',NULL),(2843,'PERJANJIAN LAMA','KEJADIAN',28,NULL,14,'Keturunanmu akan menjadi seperti debu tanah banyaknya, dan engkau akan mengembang ke sebelah timur, barat, utara dan selatan, dan olehmu serta keturunanmu semua kaum di muka bumi akan mendapat berkat.',NULL),(2844,'PERJANJIAN LAMA','KEJADIAN',28,NULL,15,'Sesungguhnya Aku menyertai engkau dan Aku akan melindungi engkau, ke manapun engkau pergi, dan Aku akan membawa engkau kembali ke negeri ini, sebab Aku tidak akan meninggalkan engkau, melainkan tetap melakukan apa yang Kujanjikan kepadamu.\"',NULL),(2845,'PERJANJIAN LAMA','KEJADIAN',28,NULL,16,'Ketika Yakub bangun dari tidurnya, berkatalah ia: \"Sesungguhnya TUHAN ada di tempat ini, dan aku tidak mengetahuinya.\"',NULL),(2846,'PERJANJIAN LAMA','KEJADIAN',28,NULL,17,'Ia takut dan berkata: \"Alangkah dahsyatnya tempat ini. Ini tidak lain dari rumah Allah, ini pintu gerbang sorga.\"',NULL),(2847,'PERJANJIAN LAMA','KEJADIAN',28,NULL,18,'Keesokan harinya pagi-pagi Yakub mengambil batu yang dipakainya sebagai alas kepala dan mendirikan itu menjadi tugu dan menuang minyak ke atasnya.',NULL),(2848,'PERJANJIAN LAMA','KEJADIAN',28,NULL,19,'Ia menamai tempat itu Betel; dahulu nama kota itu Lus.',NULL),(2849,'PERJANJIAN LAMA','KEJADIAN',28,NULL,20,'Lalu bernazarlah Yakub: \"Jika Allah akan menyertai dan akan melindungi aku di jalan yang kutempuh ini, memberikan kepadaku roti untuk dimakan dan pakaian untuk dipakai,',NULL),(2850,'PERJANJIAN LAMA','KEJADIAN',28,NULL,21,'sehingga aku selamat kembali ke rumah ayahku, maka TUHAN akan menjadi Allahku.',NULL),(2851,'PERJANJIAN LAMA','KEJADIAN',28,NULL,22,'Dan batu yang kudirikan sebagai tugu ini akan menjadi rumah Allah. Dari segala sesuatu yang Engkau berikan kepadaku akan selalu kupersembahkan sepersepuluh kepada-Mu.\"',NULL),(2852,'PERJANJIAN LAMA','KEJADIAN',29,NULL,1,'Kemudian berangkatlah Yakub dari situ dan pergi ke negeri Bani Timur.',NULL),(2853,'PERJANJIAN LAMA','KEJADIAN',29,NULL,2,'Ketika ia memandang sekelilingnya, dilihatnya ada sebuah sumur di padang, dan ada tiga kumpulan kambing domba berbaring di dekatnya, sebab dari sumur itulah orang memberi minum kumpulan-kumpulan kambing domba itu. Adapun batu penutup sumur itu besar;',NULL),(2854,'PERJANJIAN LAMA','KEJADIAN',29,NULL,3,'dan apabila segala kumpulan kambing domba itu digiring berkumpul ke sana, maka gembala-gembala menggulingkan batu itu dari mulut sumur, lalu kambing domba itu diberi minum; kemudian dikembalikanlah batu itu lagi ke mulut sumur itu.',NULL),(2855,'PERJANJIAN LAMA','KEJADIAN',29,NULL,4,'Bertanyalah Yakub kepada mereka: \"Saudara-saudara, dari manakah kamu ini?\" Jawab mereka: \"Kami ini dari Haran.\"',NULL),(2856,'PERJANJIAN LAMA','KEJADIAN',29,NULL,5,'Lagi katanya kepada mereka: \"Kenalkah kamu Laban, cucu Nahor?\" Jawab mereka: \"Kami kenal.\"',NULL),(2857,'PERJANJIAN LAMA','KEJADIAN',29,NULL,6,'Selanjutnya katanya kepada mereka: \"Selamatkah ia?\" Jawab mereka: \"Selamat! Tetapi lihat, itu datang anaknya perempuan, Rahel, dengan kambing dombanya.\"',NULL),(2858,'PERJANJIAN LAMA','KEJADIAN',29,NULL,7,'Lalu kata Yakub: \"Hari masih siang, belum waktunya untuk mengumpulkan ternak; berilah minum kambing dombamu itu, kemudian pergilah menggembalakannya lagi.\"',NULL),(2859,'PERJANJIAN LAMA','KEJADIAN',29,NULL,8,'Tetapi jawab mereka: \"Kami tidak dapat melakukan itu selama segala kumpulan binatang itu belum berkumpul; barulah batu itu digulingkan dari mulut sumur dan kami memberi minum kambing domba kami.\"',NULL),(2860,'PERJANJIAN LAMA','KEJADIAN',29,NULL,9,'Selagi ia berkata-kata dengan mereka, datanglah Rahel dengan kambing domba ayahnya, sebab dialah yang menggembalakannya.',NULL),(2861,'PERJANJIAN LAMA','KEJADIAN',29,NULL,10,'Ketika Yakub melihat Rahel, anak Laban saudara ibunya, serta kambing domba Laban, ia datang mendekat, lalu menggulingkan batu itu dari mulut sumur, dan memberi minum kambing domba itu.',NULL),(2862,'PERJANJIAN LAMA','KEJADIAN',29,NULL,11,'Kemudian Yakub mencium Rahel serta menangis dengan suara keras.',NULL),(2863,'PERJANJIAN LAMA','KEJADIAN',29,NULL,12,'Lalu Yakub menceritakan kepada Rahel, bahwa ia sanak saudara ayah Rahel, dan anak Ribka. Maka berlarilah Rahel menceritakannya kepada ayahnya.',NULL),(2864,'PERJANJIAN LAMA','KEJADIAN',29,NULL,13,'Segera sesudah Laban mendengar kabar tentang Yakub, anak saudaranya itu, berlarilah ia menyongsong dia, lalu mendekap dan mencium dia, kemudian membawanya ke rumahnya. Maka Yakub menceritakan segala hal ihwalnya kepada Laban.',NULL),(2865,'PERJANJIAN LAMA','KEJADIAN',29,NULL,14,'Kata Laban kepadanya: \"Sesungguhnya engkau sedarah sedaging dengan aku.\" Maka tinggallah Yakub padanya genap sebulan lamanya.',NULL),(2866,'PERJANJIAN LAMA','KEJADIAN',29,NULL,15,'Kemudian berkatalah Laban kepada Yakub: \"Masakan karena engkau adalah sanak saudaraku, engkau bekerja padaku dengan cuma-cuma? Katakanlah kepadaku apa yang patut menjadi upahmu.\"',NULL),(2867,'PERJANJIAN LAMA','KEJADIAN',29,NULL,16,'Laban mempunyai dua anak perempuan; yang lebih tua namanya Lea dan yang lebih muda namanya Rahel.',NULL),(2868,'PERJANJIAN LAMA','KEJADIAN',29,NULL,17,'Lea tidak berseri matanya, tetapi Rahel itu elok sikapnya dan cantik parasnya.',NULL),(2869,'PERJANJIAN LAMA','KEJADIAN',29,NULL,18,'Yakub cinta kepada Rahel, sebab itu ia berkata: \"Aku mau bekerja padamu tujuh tahun lamanya untuk mendapat Rahel, anakmu yang lebih muda itu.\"',NULL),(2870,'PERJANJIAN LAMA','KEJADIAN',29,NULL,19,'Sahut Laban: \"Lebih baiklah ia kuberikan kepadamu dari pada kepada orang lain; maka tinggallah padaku.\"',NULL),(2871,'PERJANJIAN LAMA','KEJADIAN',29,NULL,20,'Jadi bekerjalah Yakub tujuh tahun lamanya untuk mendapat Rahel itu, tetapi yang tujuh tahun itu dianggapnya seperti beberapa hari saja, karena cintanya kepada Rahel.',NULL),(2872,'PERJANJIAN LAMA','KEJADIAN',29,NULL,21,'Sesudah itu berkatalah Yakub kepada Laban: \"Berikanlah kepadaku bakal isteriku itu, sebab jangka waktuku telah genap, supaya aku akan kawin dengan dia.\"',NULL),(2873,'PERJANJIAN LAMA','KEJADIAN',29,NULL,22,'Lalu Laban mengundang semua orang di tempat itu, dan mengadakan perjamuan.',NULL),(2874,'PERJANJIAN LAMA','KEJADIAN',29,NULL,23,'Tetapi pada waktu malam diambilnyalah Lea, anaknya, lalu dibawanya kepada Yakub. Maka Yakubpun menghampiri dia.',NULL),(2875,'PERJANJIAN LAMA','KEJADIAN',29,NULL,24,'Lagipula Laban memberikan Zilpa, budaknya perempuan, kepada Lea, anaknya itu, menjadi budaknya.',NULL),(2876,'PERJANJIAN LAMA','KEJADIAN',29,NULL,25,'Tetapi pada waktu pagi tampaklah bahwa itu Lea! Lalu berkatalah Yakub kepada Laban: \"Apakah yang kauperbuat terhadap aku ini? Bukankah untuk mendapat Rahel aku bekerja padamu? Mengapa engkau menipu aku?\"',NULL),(2877,'PERJANJIAN LAMA','KEJADIAN',29,NULL,26,'Jawab Laban: \"Tidak biasa orang berbuat demikian di tempat kami ini, mengawinkan adiknya lebih dahulu dari pada kakaknya.',NULL),(2878,'PERJANJIAN LAMA','KEJADIAN',29,NULL,27,'Genapilah dahulu tujuh hari perkawinanmu dengan anakku ini; kemudian anakku yang lainpun akan diberikan kepadamu sebagai upah, asal engkau bekerja pula padaku tujuh tahun lagi.\"',NULL),(2879,'PERJANJIAN LAMA','KEJADIAN',29,NULL,28,'Maka Yakub berbuat demikian; ia menggenapi ketujuh hari perkawinannya dengan Lea, kemudian Laban memberikan kepadanya Rahel, anaknya itu, menjadi isterinya.',NULL),(2880,'PERJANJIAN LAMA','KEJADIAN',29,NULL,29,'Lagipula Laban memberikan Bilha, budaknya perempuan, kepada Rahel, anaknya itu, menjadi budaknya.',NULL),(2881,'PERJANJIAN LAMA','KEJADIAN',29,NULL,30,'Yakub menghampiri Rahel juga, malah ia lebih cinta kepada Rahel dari pada kepada Lea. Demikianlah ia bekerja pula pada Laban tujuh tahun lagi.',NULL),(2882,'PERJANJIAN LAMA','KEJADIAN',29,'Anak-anak Yakub',31,'Ketika TUHAN melihat, bahwa Lea tidak dicintai, dibuka-Nyalah kandungannya, tetapi Rahel mandul.',NULL),(2883,'PERJANJIAN LAMA','KEJADIAN',29,NULL,32,'Lea mengandung, lalu melahirkan seorang anak laki-laki, dan menamainya Ruben, sebab katanya: \"Sesungguhnya TUHAN telah memperhatikan kesengsaraanku; sekarang tentulah aku akan dicintai oleh suamiku.\"',NULL),(2884,'PERJANJIAN LAMA','KEJADIAN',29,NULL,33,'Mengandung pulalah ia, lalu melahirkan seorang anak laki-laki, maka ia berkata: \"Sesungguhnya, TUHAN telah mendengar, bahwa aku tidak dicintai, lalu diberikan-Nya pula anak ini kepadaku.\" Maka ia menamai anak itu Simeon.',NULL),(2885,'PERJANJIAN LAMA','KEJADIAN',29,NULL,34,'Mengandung pulalah ia, lalu melahirkan seorang anak laki-laki, maka ia berkata: \"Sekali ini suamiku akan lebih erat kepadaku, karena aku telah melahirkan tiga anak laki-laki baginya.\" Itulah sebabnya ia menamai anak itu Lewi.',NULL),(2886,'PERJANJIAN LAMA','KEJADIAN',29,NULL,35,'Mengandung pulalah ia, lalu melahirkan seorang anak laki-laki, maka ia berkata: \"Sekali ini aku akan bersyukur kepada TUHAN.\" Itulah sebabnya ia menamai anak itu Yehuda. Sesudah itu ia tidak melahirkan lagi.',NULL),(2887,'PERJANJIAN LAMA','KEJADIAN',30,NULL,1,'Ketika dilihat Rahel, bahwa ia tidak melahirkan anak bagi Yakub, cemburulah ia kepada kakaknya itu, lalu berkata kepada Yakub: \"Berikanlah kepadaku anak; kalau tidak, aku akan mati.\"',NULL),(2888,'PERJANJIAN LAMA','KEJADIAN',30,NULL,2,'Maka bangkitlah amarah Yakub terhadap Rahel dan ia berkata: \"Akukah pengganti Allah, yang telah menghalangi engkau mengandung?\"',NULL),(2889,'PERJANJIAN LAMA','KEJADIAN',30,NULL,3,'Kata Rahel: \"Ini Bilha, budakku perempuan, hampirilah dia, supaya ia melahirkan anak di pangkuanku, dan supaya oleh dia akupun mempunyai keturunan.\"',NULL),(2890,'PERJANJIAN LAMA','KEJADIAN',30,NULL,4,'Maka diberikannyalah Bilha, budaknya itu, kepada Yakub menjadi isterinya dan Yakub menghampiri budak itu.',NULL),(2891,'PERJANJIAN LAMA','KEJADIAN',30,NULL,5,'Bilha mengandung, lalu melahirkan seorang anak laki-laki bagi Yakub.',NULL),(2892,'PERJANJIAN LAMA','KEJADIAN',30,NULL,6,'Berkatalah Rahel: \"Allah telah memberikan keadilan kepadaku, juga telah didengarkan-Nya permohonanku dan diberikan-Nya kepadaku seorang anak laki-laki.\" Itulah sebabnya ia menamai anak itu Dan.',NULL),(2893,'PERJANJIAN LAMA','KEJADIAN',30,NULL,7,'Mengandung pulalah Bilha, budak perempuan Rahel, lalu melahirkan anak laki-laki yang kedua bagi Yakub.',NULL),(2894,'PERJANJIAN LAMA','KEJADIAN',30,NULL,8,'Berkatalah Rahel: \"Aku telah sangat hebat bergulat dengan kakakku, dan akupun menang.\" Maka ia menamai anak itu Naftali.',NULL),(2895,'PERJANJIAN LAMA','KEJADIAN',30,NULL,9,'Ketika dilihat Lea, bahwa ia tidak melahirkan lagi, diambilnyalah Zilpa, budaknya perempuan, dan diberikannya kepada Yakub menjadi isterinya.',NULL),(2896,'PERJANJIAN LAMA','KEJADIAN',30,NULL,10,'Dan Zilpa, budak perempuan Lea, melahirkan seorang anak laki-laki bagi Yakub.',NULL),(2897,'PERJANJIAN LAMA','KEJADIAN',30,NULL,11,'Berkatalah Lea: \"Mujur telah datang.\" Maka ia menamai anak itu Gad.',NULL),(2898,'PERJANJIAN LAMA','KEJADIAN',30,NULL,12,'Dan Zilpa, budak perempuan Lea, melahirkan anak laki-laki yang kedua bagi Yakub.',NULL),(2899,'PERJANJIAN LAMA','KEJADIAN',30,NULL,13,'Berkatalah Lea: \"Aku ini berbahagia! Tentulah perempuan-perempuan akan menyebutkan aku berbahagia.\" Maka ia menamai anak itu Asyer.',NULL),(2900,'PERJANJIAN LAMA','KEJADIAN',30,NULL,14,'Ketika Ruben pada musim menuai gandum pergi berjalan-jalan, didapatinyalah di padang buah dudaim, lalu dibawanya kepada Lea, ibunya. Kata Rahel kepada Lea: \"Berilah aku beberapa buah dudaim yang didapat oleh anakmu itu.\"',NULL),(2901,'PERJANJIAN LAMA','KEJADIAN',30,NULL,15,'Jawab Lea kepadanya: \"Apakah belum cukup bagimu mengambil suamiku? Sekarang pula mau mengambil lagi buah dudaim anakku?\" Kata Rahel: \"Kalau begitu biarlah ia tidur dengan engkau pada malam ini sebagai ganti buah dudaim anakmu itu.\"',NULL),(2902,'PERJANJIAN LAMA','KEJADIAN',30,NULL,16,'Ketika Yakub pada waktu petang datang dari padang, pergilah Lea mendapatkannya, sambil berkata: \"Engkau harus singgah kepadaku malam ini, sebab memang engkau telah kusewa dengan buah dudaim anakku.\" Sebab itu tidurlah Yakub dengan Lea pada malam itu.',NULL),(2903,'PERJANJIAN LAMA','KEJADIAN',30,NULL,17,'Lalu Allah mendengarkan permohonan Lea. Lea mengandung dan melahirkan anak laki-laki yang kelima bagi Yakub.',NULL),(2904,'PERJANJIAN LAMA','KEJADIAN',30,NULL,18,'Lalu kata Lea: \"Allah telah memberi upahku, karena aku telah memberi budakku perempuan kepada suamiku.\" Maka ia menamai anak itu Isakhar.',NULL),(2905,'PERJANJIAN LAMA','KEJADIAN',30,NULL,19,'Kemudian Lea mengandung pula dan melahirkan anak laki-laki yang keenam bagi Yakub.',NULL),(2906,'PERJANJIAN LAMA','KEJADIAN',30,NULL,20,'Berkatalah Lea: \"Allah telah memberikan hadiah yang indah kepadaku; sekali ini suamiku akan tinggal bersama-sama dengan aku, karena aku telah melahirkan enam orang anak laki-laki baginya.\" Maka ia menamai anak itu Zebulon.',NULL),(2907,'PERJANJIAN LAMA','KEJADIAN',30,NULL,21,'Sesudah itu ia melahirkan seorang anak perempuan dan menamai anak itu Dina.',NULL),(2908,'PERJANJIAN LAMA','KEJADIAN',30,NULL,22,'Lalu ingatlah Allah akan Rahel; Allah mendengarkan permohonannya serta membuka kandungannya.',NULL),(2909,'PERJANJIAN LAMA','KEJADIAN',30,NULL,23,'Maka mengandunglah Rahel dan melahirkan seorang anak laki-laki. Berkatalah ia: \"Allah telah menghapuskan aibku.\"',NULL),(2910,'PERJANJIAN LAMA','KEJADIAN',30,NULL,24,'Maka ia menamai anak itu Yusuf, sambil berkata: \"Mudah-mudahan TUHAN menambah seorang anak laki-laki lagi bagiku.\"',NULL),(2911,'PERJANJIAN LAMA','KEJADIAN',30,'Yakub memperoleh ternak',25,'Setelah Rahel melahirkan Yusuf, berkatalah Yakub kepada Laban: \"Izinkanlah aku pergi, supaya aku pulang ke tempat kelahiranku dan ke negeriku.',NULL),(2912,'PERJANJIAN LAMA','KEJADIAN',30,NULL,26,'Berikanlah isteri-isteriku dan anak-anakku, yang menjadi upahku selama aku bekerja padamu, supaya aku pulang, sebab engkau tahu, betapa keras aku bekerja padamu.\"',NULL),(2913,'PERJANJIAN LAMA','KEJADIAN',30,NULL,27,'Tetapi Laban berkata kepadanya: \"Sekiranya aku mendapat kasihmu! Telah nyata kepadaku, bahwa TUHAN memberkati aku karena engkau.\"',NULL),(2914,'PERJANJIAN LAMA','KEJADIAN',30,NULL,28,'Lagi katanya: \"Tentukanlah upahmu yang harus kubayar, maka aku akan memberikannya.\"',NULL),(2915,'PERJANJIAN LAMA','KEJADIAN',30,NULL,29,'Sahut Yakub kepadanya: \"Engkau sendiri tahu, bagaimana aku bekerja padamu, dan bagaimana keadaan ternakmu dalam penjagaanku,',NULL),(2916,'PERJANJIAN LAMA','KEJADIAN',30,NULL,30,'sebab harta milikmu tidak begitu banyak sebelum aku datang, tetapi sekarang telah berkembang dengan sangat, dan TUHAN telah memberkati engkau sejak aku berada di sini; jadi, bilakah dapat aku bekerja untuk rumah tanggaku sendiri?\"',NULL),(2917,'PERJANJIAN LAMA','KEJADIAN',30,NULL,31,'Kata Laban: \"Apakah yang harus kuberikan kepadamu?\" Jawab Yakub: \"Tidak usah kauberikan apa-apa kepadaku; aku mau lagi menggembalakan kambing dombamu dan menjaganya, asal engkau mengizinkan hal ini kepadaku:',NULL),(2918,'PERJANJIAN LAMA','KEJADIAN',30,NULL,32,'Hari ini aku akan lewat dari tengah-tengah segala kambing dombamu dan akan mengasingkan dari situ setiap binatang yang berbintik-bintik dan berbelang-belang; segala domba yang hitam dan segala kambing yang berbelang-belang dan berbintik-bintik, itulah upa',NULL),(2919,'PERJANJIAN LAMA','KEJADIAN',30,NULL,33,'Dan kejujuranku akan terbukti di kemudian hari, apabila engkau datang memeriksa upahku: Segala yang tidak berbintik-bintik atau berbelang-belang di antara kambing-kambing dan yang tidak hitam di antara domba-domba, anggaplah itu tercuri olehku.\"',NULL),(2920,'PERJANJIAN LAMA','KEJADIAN',30,NULL,34,'Kemudian kata Laban: \"Baik, jadilah seperti perkataanmu itu.\"',NULL),(2921,'PERJANJIAN LAMA','KEJADIAN',30,NULL,35,'Lalu diasingkannyalah pada hari itu kambing-kambing jantan yang bercoreng-coreng dan berbelang-belang dan segala kambing yang berbintik-bintik dan berbelang-belang, segala yang ada warna putih pada badannya, serta segala yang hitam di antara domba-domba, ',NULL),(2922,'PERJANJIAN LAMA','KEJADIAN',30,NULL,36,'Kemudian Laban menentukan jarak tiga hari perjalanan jauhnya antara dia dan Yakub, maka tetaplah Yakub menggembalakan kambing domba yang tinggal itu.',NULL),(2923,'PERJANJIAN LAMA','KEJADIAN',30,NULL,37,'Lalu Yakub mengambil dahan hijau dari pohon hawar, pohon badam dan pohon berangan, dikupasnyalah dahan-dahan itu sehingga berbelang-belang, sampai yang putihnya kelihatan.',NULL),(2924,'PERJANJIAN LAMA','KEJADIAN',30,NULL,38,'Ia meletakkan dahan-dahan yang dikupasnya itu dalam palungan, dalam tempat minum, ke mana kambing domba itu datang minum, sehingga tepat di depan kambing domba itu. Adapun kambing domba itu suka berkelamin pada waktu datang minum.',NULL),(2925,'PERJANJIAN LAMA','KEJADIAN',30,NULL,39,'Jika kambing domba itu berkelamin dekat dahan-dahan itu, maka anaknya bercoreng-coreng, berbintik-bintik dan berbelang-belang.',NULL),(2926,'PERJANJIAN LAMA','KEJADIAN',30,NULL,40,'Kemudian Yakub memisahkan domba-domba itu, dihadapkannya kepala-kepala kambing domba itu kepada yang bercoreng-coreng dan kepada segala yang hitam di antara kambing domba Laban. Demikianlah ia beroleh kumpulan-kumpulan hewan baginya sendiri, dan tidak dit',NULL),(2927,'PERJANJIAN LAMA','KEJADIAN',30,NULL,41,'Dan setiap kali, apabila berkelamin kambing domba yang kuat, maka Yakub meletakkan dahan-dahan itu ke dalam palungan di depan mata kambing domba itu, supaya berkelamin dekat dahan-dahan itu.',NULL),(2928,'PERJANJIAN LAMA','KEJADIAN',30,NULL,42,'Tetapi apabila datang kambing domba yang lemah, ia tidak meletakkan dahan-dahan itu ke dalamnya. Jadi hewan yang lemah untuk Laban dan yang kuat untuk Yakub.',NULL),(2929,'PERJANJIAN LAMA','KEJADIAN',30,NULL,43,'Maka sangatlah bertambah-tambah harta Yakub, dan ia mempunyai banyak kambing domba, budak perempuan dan laki-laki, unta dan keledai.',NULL),(2930,'PERJANJIAN LAMA','KEJADIAN',31,NULL,1,'Kedengaranlah kepada Yakub anak-anak Laban berkata demikian: \"Yakub telah mengambil segala harta milik ayah kita dan dari harta itulah ia membangun segala kekayaannya.\"',NULL),(2931,'PERJANJIAN LAMA','KEJADIAN',31,NULL,2,'Lagi kelihatan kepada Yakub dari muka Laban, bahwa Laban tidak lagi seperti yang sudah-sudah kepadanya.',NULL),(2932,'PERJANJIAN LAMA','KEJADIAN',31,NULL,3,'Lalu berfirmanlah TUHAN kepada Yakub: \"Pulanglah ke negeri nenek moyangmu dan kepada kaummu, dan Aku akan menyertai engkau.\"',NULL),(2933,'PERJANJIAN LAMA','KEJADIAN',31,NULL,4,'Sesudah itu Yakub menyuruh memanggil Rahel dan Lea untuk datang ke padang, ke tempat kambing dombanya,',NULL),(2934,'PERJANJIAN LAMA','KEJADIAN',31,NULL,5,'lalu ia berkata kepada mereka: \"Telah kulihat dari muka ayahmu, bahwa ia tidak lagi seperti yang sudah-sudah kepadaku, tetapi Allah ayahku menyertai aku.',NULL),(2935,'PERJANJIAN LAMA','KEJADIAN',31,NULL,6,'Juga kamu sendiri tahu, bahwa aku telah bekerja sekuat-kuatku pada ayahmu.',NULL),(2936,'PERJANJIAN LAMA','KEJADIAN',31,NULL,7,'Tetapi ayahmu telah berlaku curang kepadaku dan telah sepuluh kali mengubah upahku, tetapi Allah tidak membiarkan dia berbuat jahat kepadaku.',NULL),(2937,'PERJANJIAN LAMA','KEJADIAN',31,NULL,8,'Apabila ia berkata: yang berbintik-bintiklah akan menjadi upahmu, maka segala kambing domba itu beroleh anak yang berbintik-bintik; dan apabila ia berkata: yang bercoreng-corenglah akan menjadi upahmu, maka segala kambing domba itu beroleh anak yang berco',NULL),(2938,'PERJANJIAN LAMA','KEJADIAN',31,NULL,9,'Demikianlah Allah mengambil ternak ayahmu dan memberikannya kepadaku.',NULL),(2939,'PERJANJIAN LAMA','KEJADIAN',31,NULL,10,'Pada suatu kali pada masa kambing domba itu suka berkelamin, maka aku bermimpi dan melihat, bahwa jantan-jantan yang menjantani kambing domba itu bercoreng-coreng, berbintik-bintik dan berbelang-belang.',NULL),(2940,'PERJANJIAN LAMA','KEJADIAN',31,NULL,11,'Dan Malaikat Allah berfirman kepadaku dalam mimpi itu: Yakub! Jawabku: Ya Tuhan!',NULL),(2941,'PERJANJIAN LAMA','KEJADIAN',31,NULL,12,'Lalu Ia berfirman: Angkatlah mukamu dan lihatlah, bahwa segala jantan yang menjantani kambing domba itu bercoreng-coreng, berbintik-bintik dan berbelang-belang, sebab telah Kulihat semua yang dilakukan oleh Laban itu kepadamu.',NULL),(2942,'PERJANJIAN LAMA','KEJADIAN',31,NULL,13,'Akulah Allah yang di Betel itu, di mana engkau mengurapi tugu, dan di mana engkau bernazar kepada-Ku; maka sekarang, bersiaplah engkau, pergilah dari negeri ini dan pulanglah ke negeri sanak saudaramu.\"',NULL),(2943,'PERJANJIAN LAMA','KEJADIAN',31,NULL,14,'Lalu Rahel dan Lea menjawab Yakub, katanya: \"Bukankah tidak ada lagi bagian atau warisan kami dalam rumah ayah kami?',NULL),(2944,'PERJANJIAN LAMA','KEJADIAN',31,NULL,15,'Bukankah kami ini dianggapnya sebagai orang asing, karena ia telah menjual kami? Juga bagian kami telah dihabiskannya sama sekali.',NULL),(2945,'PERJANJIAN LAMA','KEJADIAN',31,NULL,16,'Tetapi segala kekayaan, yang telah diambil Allah dari ayah kami, adalah milik kami dan anak-anak kami; maka sekarang, perbuatlah segala yang difirmankan Allah kepadamu.\"',NULL),(2946,'PERJANJIAN LAMA','KEJADIAN',31,NULL,17,'Lalu bersiaplah Yakub, dinaikkannya anak-anaknya dan isteri-isterinya ke atas unta,',NULL),(2947,'PERJANJIAN LAMA','KEJADIAN',31,NULL,18,'digiringnya seluruh ternaknya dan segala apa yang telah diperolehnya, yakni ternak kepunyaannya, yang telah diperolehnya di Padan-Aram, dengan maksud pergi kepada Ishak, ayahnya, ke tanah Kanaan.',NULL),(2948,'PERJANJIAN LAMA','KEJADIAN',31,NULL,19,'Adapun Laban telah pergi menggunting bulu domba-dombanya. Ketika itulah Rahel mencuri terafim ayahnya.',NULL),(2949,'PERJANJIAN LAMA','KEJADIAN',31,NULL,20,'Dan Yakub mengakali Laban, orang Aram itu, dengan tidak memberitahukan kepadanya, bahwa ia mau lari.',NULL),(2950,'PERJANJIAN LAMA','KEJADIAN',31,NULL,21,'Demikianlah ia lari dengan segala harta miliknya. Ia berangkat, menyeberangi sungai Efrat dan berjalan menuju pegunungan Gilead.',NULL),(2951,'PERJANJIAN LAMA','KEJADIAN',31,NULL,22,'Ketika pada hari ketiga dikabarkan kepada Laban, bahwa Yakub telah lari,',NULL),(2952,'PERJANJIAN LAMA','KEJADIAN',31,NULL,23,'dibawanyalah sanak saudaranya bersama-sama, dikejarnya Yakub tujuh hari perjalanan jauhnya, lalu ia dapat menyusulnya di pegunungan Gilead.',NULL),(2953,'PERJANJIAN LAMA','KEJADIAN',31,NULL,24,'Pada waktu malam datanglah Allah dalam suatu mimpi kepada Laban, orang Aram itu, serta berfirman kepadanya: \"Jagalah baik-baik, supaya engkau jangan mengatai Yakub dengan sepatah katapun.\"',NULL),(2954,'PERJANJIAN LAMA','KEJADIAN',31,NULL,25,'Ketika Laban sampai kepada Yakub, --Yakub telah memasang kemahnya di pegunungan, juga Laban dengan sanak saudaranya telah memasang kemahnya di pegunungan Gilead--',NULL),(2955,'PERJANJIAN LAMA','KEJADIAN',31,NULL,26,'berkatalah Laban kepada Yakub: \"Apakah yang kauperbuat ini, maka engkau mengakali aku dan mengangkut anak-anakku perempuan sebagai orang tawanan?',NULL),(2956,'PERJANJIAN LAMA','KEJADIAN',31,NULL,27,'Mengapa engkau lari diam-diam dan mengakali aku? Mengapa engkau tidak memberitahu kepadaku, supaya aku menghantarkan engkau dengan sukacita dan nyanyian dengan rebana dan kecapi?',NULL),(2957,'PERJANJIAN LAMA','KEJADIAN',31,NULL,28,'Lagipula engkau tidak memberikan aku kesempatan untuk mencium cucu-cucuku laki-laki dan anak-anakku perempuan. Memang bodoh perbuatanmu itu.',NULL),(2958,'PERJANJIAN LAMA','KEJADIAN',31,NULL,29,'Aku ini berkuasa untuk berbuat jahat kepadamu, tetapi Allah ayahmu telah berfirman kepadaku tadi malam: Jagalah baik-baik, jangan engkau mengatai Yakub dengan sepatah katapun.',NULL),(2959,'PERJANJIAN LAMA','KEJADIAN',31,NULL,30,'Maka sekarang, kalau memang engkau harus pergi, semata-mata karena sangat rindu ke rumah ayahmu, mengapa engkau mencuri dewa-dewaku?\"',NULL),(2960,'PERJANJIAN LAMA','KEJADIAN',31,NULL,31,'Lalu Yakub menjawab Laban: \"Aku takut, karena pikirku, jangan-jangan engkau merampas anak-anakmu itu dari padaku.',NULL),(2961,'PERJANJIAN LAMA','KEJADIAN',31,NULL,32,'Tetapi pada siapa engkau menemui dewa-dewamu itu, janganlah ia hidup lagi. Periksalah di depan saudara-saudara kita segala barang yang ada padaku dan ambillah barangmu.\" Sebab Yakub tidak tahu, bahwa Rahel yang mencuri terafim itu.',NULL),(2962,'PERJANJIAN LAMA','KEJADIAN',31,NULL,33,'Lalu masuklah Laban ke dalam kemah Yakub dan ke dalam kemah Lea dan ke dalam kemah kedua budak perempuan itu, tetapi terafim itu tidak ditemuinya. Setelah keluar dari kemah Lea, ia masuk ke dalam kemah Rahel.',NULL),(2963,'PERJANJIAN LAMA','KEJADIAN',31,NULL,34,'Tetapi Rahel telah mengambil terafim itu dan memasukkannya ke dalam pelana untanya, dan duduk di atasnya. Laban menggeledah seluruh kemah itu, tetapi terafim itu tidak ditemuinya.',NULL),(2964,'PERJANJIAN LAMA','KEJADIAN',31,NULL,35,'Lalu kata Rahel kepada ayahnya: \"Janganlah bapa marah, karena aku tidak dapat bangun berdiri di depanmu, sebab aku sedang haid.\" Dan Laban mencari dengan teliti, tetapi ia tidak menemui terafim itu.',NULL),(2965,'PERJANJIAN LAMA','KEJADIAN',31,NULL,36,'Lalu hati Yakub panas dan ia bertengkar dengan Laban. Ia berkata kepada Laban: \"Apakah kesalahanku, apakah dosaku, maka engkau memburu aku sehebat itu?',NULL),(2966,'PERJANJIAN LAMA','KEJADIAN',31,NULL,37,'Engkau telah menggeledah segala barangku, sekarang apakah yang kautemui dari segala barang rumahmu? Letakkanlah di sini di depan saudara-saudaraku dan saudara-saudaramu, supaya mereka mengadili antara kita berdua.',NULL),(2967,'PERJANJIAN LAMA','KEJADIAN',31,NULL,38,'Selama dua puluh tahun ini aku bersama-sama dengan engkau; domba dan kambing betinamu tidak pernah keguguran dan jantan dari kambing dombamu tidak pernah kumakan.',NULL),(2968,'PERJANJIAN LAMA','KEJADIAN',31,NULL,39,'Yang diterkam oleh binatang buas tidak pernah kubawa kepadamu, aku sendiri yang menggantinya; yang dicuri orang, baik waktu siang, baik waktu malam, selalu engkau tuntut dari padaku.',NULL),(2969,'PERJANJIAN LAMA','KEJADIAN',31,NULL,40,'Aku dimakan panas hari waktu siang dan kedinginan waktu malam, dan mataku jauh dari pada tertidur.',NULL),(2970,'PERJANJIAN LAMA','KEJADIAN',31,NULL,41,'Selama dua puluh tahun ini aku di rumahmu; aku telah bekerja padamu empat belas tahun lamanya untuk mendapat kedua anakmu dan enam tahun untuk mendapat ternakmu, dan engkau telah sepuluh kali mengubah upahku.',NULL),(2971,'PERJANJIAN LAMA','KEJADIAN',31,NULL,42,'Seandainya Allah ayahku, Allah Abraham dan Yang Disegani oleh Ishak tidak menyertai aku, tentulah engkau sekarang membiarkan aku pergi dengan tangan hampa; tetapi kesengsaraanku dan jerih payahku telah diperhatikan Allah dan Ia telah menjatuhkan putusan t',NULL),(2972,'PERJANJIAN LAMA','KEJADIAN',31,NULL,43,'Lalu Laban menjawab Yakub: \"Perempuan-perempuan ini anakku dan anak-anak lelaki ini cucuku dan ternak ini ternakku, bahkan segala yang kaulihat di sini adalah milikku; jadi apakah yang dapat kuperbuat sekarang kepada anak-anakku ini atau kepada anak-anak ',NULL),(2973,'PERJANJIAN LAMA','KEJADIAN',31,NULL,44,'Maka sekarang, marilah kita mengikat perjanjian, aku dan engkau, supaya itu menjadi kesaksian antara aku dan engkau.\"',NULL),(2974,'PERJANJIAN LAMA','KEJADIAN',31,NULL,45,'Kemudian Yakub mengambil sebuah batu dan didirikannya menjadi tugu.',NULL),(2975,'PERJANJIAN LAMA','KEJADIAN',31,NULL,46,'Selanjutnya berkatalah Yakub kepada sanak saudaranya: \"Kumpulkanlah batu.\" Maka mereka mengambil batu dan membuat timbunan, lalu makanlah mereka di sana di dekat timbunan itu.',NULL),(2976,'PERJANJIAN LAMA','KEJADIAN',31,NULL,47,'Laban menamai timbunan batu itu Yegar-Sahaduta, tetapi Yakub menamainya Galed.',NULL),(2977,'PERJANJIAN LAMA','KEJADIAN',31,NULL,48,'Lalu kata Laban: \"Timbunan batu inilah pada hari ini menjadi kesaksian antara aku dan engkau.\" Itulah sebabnya timbunan itu dinamainya Galed,',NULL),(2978,'PERJANJIAN LAMA','KEJADIAN',31,NULL,49,'dan juga Mizpa, sebab katanya: \"TUHAN kiranya berjaga-jaga antara aku dan engkau, apabila kita berjauhan.',NULL),(2979,'PERJANJIAN LAMA','KEJADIAN',31,NULL,50,'Jika engkau mengaibkan anak-anakku, dan jika engkau mengambil isteri lain di samping anak-anakku itu, ingatlah, walaupun tidak ada orang dekat kita, Allah juga yang menjadi saksi antara aku dan engkau.\"',NULL),(2980,'PERJANJIAN LAMA','KEJADIAN',31,NULL,51,'Selanjutnya kata Laban kepada Yakub: \"Inilah timbunan batu, dan inilah tugu yang kudirikan antara aku dan engkau--',NULL),(2981,'PERJANJIAN LAMA','KEJADIAN',31,NULL,52,'timbunan batu dan tugu inilah menjadi kesaksian, bahwa aku tidak akan melewati timbunan batu ini mendapatkan engkau, dan bahwa engkaupun tidak akan melewati timbunan batu dan tugu ini mendapatkan aku, dengan berniat jahat.',NULL),(2982,'PERJANJIAN LAMA','KEJADIAN',31,NULL,53,'Allah Abraham dan Allah Nahor, Allah ayah mereka, kiranya menjadi hakim antara kita.\" Lalu Yakub bersumpah demi Yang Disegani oleh Ishak, ayahnya.',NULL),(2983,'PERJANJIAN LAMA','KEJADIAN',31,NULL,54,'Dan Yakub mempersembahkan korban sembelihan di gunung itu. Ia mengundang makan sanak saudaranya, lalu mereka makan serta bermalam di gunung itu.',NULL),(2984,'PERJANJIAN LAMA','KEJADIAN',31,NULL,55,'Keesokan harinya pagi-pagi Laban mencium cucu-cucunya dan anak-anaknya serta memberkati mereka, kemudian pulanglah Laban kembali ke tempat tinggalnya.',NULL),(2985,'PERJANJIAN LAMA','KEJADIAN',32,NULL,1,'Yakub melanjutkan perjalanannya, lalu bertemulah malaikat-malaikat Allah dengan dia.',NULL),(2986,'PERJANJIAN LAMA','KEJADIAN',32,NULL,2,'Ketika Yakub melihat mereka, berkatalah ia: \"Ini bala tentara Allah.\" Sebab itu dinamainyalah tempat itu Mahanaim.',NULL),(2987,'PERJANJIAN LAMA','KEJADIAN',32,NULL,3,'Sesudah itu Yakub menyuruh utusannya berjalan lebih dahulu mendapatkan Esau, kakaknya, ke tanah Seir, daerah Edom.',NULL),(2988,'PERJANJIAN LAMA','KEJADIAN',32,NULL,4,'Ia memerintahkan kepada mereka: \"Beginilah kamu katakan kepada tuanku, kepada Esau: Beginilah kata hambamu Yakub: Aku telah tinggal pada Laban sebagai orang asing dan diam di situ selama ini.',NULL),(2989,'PERJANJIAN LAMA','KEJADIAN',32,NULL,5,'Aku telah mempunyai lembu sapi, keledai dan kambing domba, budak laki-laki dan perempuan, dan aku menyuruh memberitahukan hal ini kepada tuanku, supaya aku mendapat kasihmu.\"',NULL),(2990,'PERJANJIAN LAMA','KEJADIAN',32,NULL,6,'Kemudian pulanglah para utusan itu kepada Yakub dan berkata: \"Kami telah sampai kepada kakakmu, kepada Esau, dan iapun sedang di jalan menemui engkau, diiringi oleh empat ratus orang.\"',NULL),(2991,'PERJANJIAN LAMA','KEJADIAN',32,NULL,7,'Lalu sangat takutlah Yakub dan merasa sesak hati; maka dibaginyalah orang-orangnya yang bersama-sama dengan dia, kambing dombanya, lembu sapi dan untanya menjadi dua pasukan.',NULL),(2992,'PERJANJIAN LAMA','KEJADIAN',32,NULL,8,'Sebab pikirnya: \"Jika Esau datang menyerang pasukan yang satu, sehingga terpukul kalah, maka pasukan yang tinggal akan terluput.\"',NULL),(2993,'PERJANJIAN LAMA','KEJADIAN',32,NULL,9,'Kemudian berkatalah Yakub: \"Ya Allah nenekku Abraham dan Allah ayahku Ishak, ya TUHAN, yang telah berfirman kepadaku: Pulanglah ke negerimu serta kepada sanak saudaramu dan Aku akan berbuat baik kepadamu--',NULL),(2994,'PERJANJIAN LAMA','KEJADIAN',32,NULL,10,'sekali-kali aku tidak layak untuk menerima segala kasih dan kesetiaan yang Engkau tunjukkan kepada hamba-Mu ini, sebab aku membawa hanya tongkatku ini waktu aku menyeberangi sungai Yordan ini, tetapi sekarang telah menjadi dua pasukan.',NULL),(2995,'PERJANJIAN LAMA','KEJADIAN',32,NULL,11,'Lepaskanlah kiranya aku dari tangan kakakku, dari tangan Esau, sebab aku takut kepadanya, jangan-jangan ia datang membunuh aku, juga ibu-ibu dengan anak-anaknya.',NULL),(2996,'PERJANJIAN LAMA','KEJADIAN',32,NULL,12,'Bukankah Engkau telah berfirman: Tentu Aku akan berbuat baik kepadamu dan menjadikan keturunanmu sebagai pasir di laut, yang karena banyaknya tidak dapat dihitung.\"',NULL),(2997,'PERJANJIAN LAMA','KEJADIAN',32,NULL,13,'Lalu bermalamlah ia di sana pada malam itu. Kemudian diambilnyalah dari apa yang ada padanya suatu persembahan untuk Esau, kakaknya,',NULL),(2998,'PERJANJIAN LAMA','KEJADIAN',32,NULL,14,'yaitu dua ratus kambing betina dan dua puluh kambing jantan, dua ratus domba betina dan dua puluh domba jantan,',NULL),(2999,'PERJANJIAN LAMA','KEJADIAN',32,NULL,15,'tiga puluh unta yang sedang menyusui beserta anak-anaknya, empat puluh lembu betina dan sepuluh lembu jantan, dua puluh keledai betina dan sepuluh keledai jantan.',NULL),(3000,'PERJANJIAN LAMA','KEJADIAN',32,NULL,16,'Diserahkannyalah semuanya itu kepada budak-budaknya untuk dijaga, tiap-tiap kumpulan tersendiri, dan ia berkata kepada mereka: \"Berjalanlah kamu lebih dahulu dan jagalah supaya ada jarak antara kumpulan yang satu dengan kumpulan yang lain.\"',NULL),(3001,'PERJANJIAN LAMA','KEJADIAN',32,NULL,17,'Diperintahkannyalah kepada yang paling di muka: \"Apabila Esau, kakakku, bertemu dengan engkau dan bertanya kepadamu: Siapakah tuanmu? dan ke manakah engkau pergi? dan milik siapakah ternak yang di depanmu itu? --',NULL),(3002,'PERJANJIAN LAMA','KEJADIAN',32,NULL,18,'jawablah: milik hambamu Yakub; inilah persembahan yang dikirim kepada tuanku Esau, dan Yakub sendiripun ada di belakang kami.\"',NULL),(3003,'PERJANJIAN LAMA','KEJADIAN',32,NULL,19,'Begitulah diperintahkannya baik kepada yang kedua maupun kepada yang ketiga dan kepada sekalian orang yang berjalan menggiring kumpulan hewan itu, katanya: \"Seperti perkataanku tadilah kamu katakan kepada Esau, apabila kamu berjumpa dengan dia;',NULL),(3004,'PERJANJIAN LAMA','KEJADIAN',32,NULL,20,'dan kamu harus mengatakan juga: Hambamu Yakub sendiri ada di belakang kami.\" Sebab pikir Yakub: \"Baiklah aku mendamaikan hatinya dengan persembahan yang diantarkan lebih dahulu, kemudian barulah aku akan melihat mukanya; mungkin ia akan menerima aku denga',NULL),(3005,'PERJANJIAN LAMA','KEJADIAN',32,NULL,21,'Jadi persembahan itu diantarkan lebih dahulu, tetapi ia sendiri bermalam pada malam itu di tempat perkemahannya.',NULL),(3006,'PERJANJIAN LAMA','KEJADIAN',32,NULL,22,'Pada malam itu Yakub bangun dan ia membawa kedua isterinya, kedua budaknya perempuan dan kesebelas anaknya, dan menyeberang di tempat penyeberangan sungai Yabok.',NULL),(3007,'PERJANJIAN LAMA','KEJADIAN',32,NULL,23,'Sesudah ia menyeberangkan mereka, ia menyeberangkan juga segala miliknya.',NULL),(3008,'PERJANJIAN LAMA','KEJADIAN',32,NULL,24,'Lalu tinggallah Yakub seorang diri. Dan seorang laki-laki bergulat dengan dia sampai fajar menyingsing.',NULL),(3009,'PERJANJIAN LAMA','KEJADIAN',32,NULL,25,'Ketika orang itu melihat, bahwa ia tidak dapat mengalahkannya, ia memukul sendi pangkal paha Yakub, sehingga sendi pangkal paha itu terpelecok, ketika ia bergulat dengan orang itu.',NULL),(3010,'PERJANJIAN LAMA','KEJADIAN',32,NULL,26,'Lalu kata orang itu: \"Biarkanlah aku pergi, karena fajar telah menyingsing.\" Sahut Yakub: \"Aku tidak akan membiarkan engkau pergi, jika engkau tidak memberkati aku.\"',NULL),(3011,'PERJANJIAN LAMA','KEJADIAN',32,NULL,27,'Bertanyalah orang itu kepadanya: \"Siapakah namamu?\" Sahutnya: \"Yakub.\"',NULL),(3012,'PERJANJIAN LAMA','KEJADIAN',32,NULL,28,'Lalu kata orang itu: \"Namamu tidak akan disebutkan lagi Yakub, tetapi Israel, sebab engkau telah bergumul melawan Allah dan manusia, dan engkau menang.\"',NULL),(3013,'PERJANJIAN LAMA','KEJADIAN',32,NULL,29,'Bertanyalah Yakub: \"Katakanlah juga namamu.\" Tetapi sahutnya: \"Mengapa engkau menanyakan namaku?\" Lalu diberkatinyalah Yakub di situ.',NULL),(3014,'PERJANJIAN LAMA','KEJADIAN',32,NULL,30,'Yakub menamai tempat itu Pniel, sebab katanya: \"Aku telah melihat Allah berhadapan muka, tetapi nyawaku tertolong!\"',NULL),(3015,'PERJANJIAN LAMA','KEJADIAN',32,NULL,31,'Lalu tampaklah kepadanya matahari terbit, ketika ia telah melewati Pniel; dan Yakub pincang karena pangkal pahanya.',NULL),(3016,'PERJANJIAN LAMA','KEJADIAN',32,NULL,32,'Itulah sebabnya sampai sekarang orang Israel tidak memakan daging yang menutupi sendi pangkal paha, karena Dia telah memukul sendi pangkal paha Yakub, pada otot pangkal pahanya.',NULL),(3017,'PERJANJIAN LAMA','KEJADIAN',33,'Yakub berbaik kembali dengan Esau',1,'Yakub pun melayangkan pandangnya, lalu dilihatnyalah Esau datang dengan diiringi oleh empat ratus orang. Maka diserahkannyalah sebagian dari anak-anak itu kepada Lea dan sebagian kepada Rahel serta kepada kedua budak perempuan itu. ',NULL),(3018,'PERJANJIAN LAMA','KEJADIAN',33,NULL,2,'Ia menempatkan budak-budak perempuan itu beserta anak-anak mereka di muka, Lea beserta anak-anaknya di belakang mereka, dan Rahel beserta Yusuf di belakang sekali.',NULL),(3019,'PERJANJIAN LAMA','KEJADIAN',33,NULL,3,'Dan ia sendiri berjalan di depan mereka dan ia sujud sampai ke tanah tujuh kali, hingga ia sampai ke dekat kakaknya itu.',NULL),(3020,'PERJANJIAN LAMA','KEJADIAN',33,NULL,4,'Tetapi Esau berlari mendapatkan dia, didekapnya dia, dipeluk lehernya dan diciumnya dia, lalu bertangis-tangisanlah mereka.',NULL),(3021,'PERJANJIAN LAMA','KEJADIAN',33,NULL,5,'Kemudian Esau melayangkan pandangnya, dilihatnyalah perempuan-perempuan dan anak-anak itu, lalu ia bertanya: \"Siapakah orang-orang yang beserta engkau itu?\" Jawab Yakub: \"Anak-anak yang telah dikaruniakan Allah kepada hambamu ini.\"',NULL),(3022,'PERJANJIAN LAMA','KEJADIAN',33,NULL,6,'Sesudah itu mendekatlah budak-budak perempuan itu beserta anak-anaknya, lalu mereka sujud.',NULL),(3023,'PERJANJIAN LAMA','KEJADIAN',33,NULL,7,'Mendekat jugalah Lea beserta anak-anaknya, dan merekapun sujud. Kemudian mendekatlah Yusuf beserta Rahel, dan mereka juga sujud.',NULL),(3024,'PERJANJIAN LAMA','KEJADIAN',33,NULL,8,'Berkatalah Esau: \"Apakah maksudmu dengan seluruh pasukan, yang telah bertemu dengan aku tadi?\" Jawabnya: \"Untuk mendapat kasih tuanku.\"',NULL),(3025,'PERJANJIAN LAMA','KEJADIAN',33,NULL,9,'Tetapi kata Esau: \"Aku mempunyai banyak, adikku; peganglah apa yang ada padamu.\"',NULL),(3026,'PERJANJIAN LAMA','KEJADIAN',33,NULL,10,'Tetapi kata Yakub: \"Janganlah kiranya demikian; jikalau aku telah mendapat kasihmu, terimalah persembahanku ini dari tanganku, karena memang melihat mukamu adalah bagiku serasa melihat wajah Allah, dan engkaupun berkenan menyambut aku.',NULL),(3027,'PERJANJIAN LAMA','KEJADIAN',33,NULL,11,'Terimalah kiranya pemberian tanda salamku ini, yang telah kubawa kepadamu, sebab Allah telah memberi karunia kepadaku dan akupun mempunyai segala-galanya.\" Lalu dibujuk-bujuknyalah Esau, sehingga diterimanya.',NULL),(3028,'PERJANJIAN LAMA','KEJADIAN',33,NULL,12,'Kata Esau: \"Baiklah kita berangkat berjalan terus; aku akan menyertai engkau.\"',NULL),(3029,'PERJANJIAN LAMA','KEJADIAN',33,NULL,13,'Tetapi Yakub berkata kepadanya: \"Tuanku maklum, bahwa anak-anak ini masih kurang kuat, dan bahwa beserta aku ada kambing domba dan lembu sapi yang masih menyusui, jika diburu-buru, satu hari saja, maka seluruh kumpulan binatang itu akan mati.',NULL),(3030,'PERJANJIAN LAMA','KEJADIAN',33,NULL,14,'Biarlah kiranya tuanku berjalan lebih dahulu dari hambamu ini dan aku mau dengan hati-hati beringsut maju menurut langkah hewan, yang berjalan di depanku dan menurut langkah anak-anak, sampai aku tiba pada tuanku di Seir.\"',NULL),(3031,'PERJANJIAN LAMA','KEJADIAN',33,NULL,15,'Lalu kata Esau: \"Kalau begitu, baiklah kutinggalkan padamu beberapa orang dari pengiringku.\" Tetapi Yakub berkata: \"Tidak usah demikian! Biarlah aku mendapat kasih tuanku saja.\"',NULL),(3032,'PERJANJIAN LAMA','KEJADIAN',33,NULL,16,'Jadi pulanglah Esau pada hari itu berjalan ke Seir.',NULL),(3033,'PERJANJIAN LAMA','KEJADIAN',33,NULL,17,'Tetapi Yakub berangkat ke Sukot, lalu mendirikan rumah, dan untuk ternaknya dibuatnya gubuk-gubuk. Itulah sebabnya tempat itu dinamai Sukot.',NULL),(3034,'PERJANJIAN LAMA','KEJADIAN',33,NULL,18,'Dalam perjalanannya dari Padan-Aram sampailah Yakub dengan selamat ke Sikhem, di tanah Kanaan, lalu ia berkemah di sebelah timur kota itu.',NULL),(3035,'PERJANJIAN LAMA','KEJADIAN',33,NULL,19,'Kemudian dibelinyalah dari anak-anak Hemor, bapa Sikhem, sebidang tanah, tempat ia memasang kemahnya, dengan harga seratus kesita.',NULL),(3036,'PERJANJIAN LAMA','KEJADIAN',33,NULL,20,'Ia mendirikan mezbah di situ dan dinamainya itu: \"Allah Israel ialah Allah.\"',NULL),(3037,'PERJANJIAN LAMA','KEJADIAN',34,'Dina dan Sikhem',1,'Pada suatu kali pergilah Dina, anak perempuan Lea yang dilahirkannya bagi Yakub, mengunjungi perempuan-perempuan di negeri itu.',NULL),(3038,'PERJANJIAN LAMA','KEJADIAN',34,NULL,2,'Ketika itu terlihatlah ia oleh Sikhem, anak Hemor, orang Hewi, raja negeri itu, lalu Dina itu dilarikannya dan diperkosanya.',NULL),(3039,'PERJANJIAN LAMA','KEJADIAN',34,NULL,3,'Tetapi terikatlah hatinya kepada Dina, anak Yakub; ia cinta kepada gadis itu, lalu menenangkan hati gadis itu.',NULL),(3040,'PERJANJIAN LAMA','KEJADIAN',34,NULL,4,'Sebab itu berkatalah Sikhem kepada Hemor, ayahnya: \"Ambillah bagiku gadis ini untuk menjadi isteriku.\"',NULL),(3041,'PERJANJIAN LAMA','KEJADIAN',34,NULL,5,'Kedengaranlah kepada Yakub, bahwa Sikhem mencemari Dina. Tetapi anak-anaknya ada di padang menjaga ternaknya, jadi Yakub mendiamkan soal itu sampai mereka pulang.',NULL),(3042,'PERJANJIAN LAMA','KEJADIAN',34,NULL,6,'Lalu Hemor ayah Sikhem, pergi mendapatkan Yakub untuk berbicara dengan dia.',NULL),(3043,'PERJANJIAN LAMA','KEJADIAN',34,NULL,7,'Sementara itu anak-anak Yakub pulang dari padang, dan sesudah mendengar peristiwa itu orang-orang ini sakit hati dan sangat marah karena Sikhem telah berbuat noda di antara orang Israel dengan memperkosa anak perempuan Yakub, sebab yang demikian itu tidak',NULL),(3044,'PERJANJIAN LAMA','KEJADIAN',34,NULL,8,'Berbicaralah Hemor kepada mereka itu: \"Hati Sikhem anakku mengingini anakmu; kiranya kamu memberikan dia kepadanya menjadi isterinya',NULL),(3045,'PERJANJIAN LAMA','KEJADIAN',34,NULL,9,'dan biarlah kita ambil-mengambil: berikanlah gadis-gadis kamu kepada kami dan ambillah gadis-gadis kami.',NULL),(3046,'PERJANJIAN LAMA','KEJADIAN',34,NULL,10,'Tinggallah pada kami: negeri ini terbuka untuk kamu; tinggallah di sini, jalanilah negeri ini dengan bebas, dan menetaplah di sini.\"',NULL),(3047,'PERJANJIAN LAMA','KEJADIAN',34,NULL,11,'Lalu Sikhem berkata kepada ayah anak itu dan kepada kakak-kakaknya: \"Biarlah kiranya aku mendapat kasihmu, aku akan memberikan kepadamu apa yang kamu minta;',NULL),(3048,'PERJANJIAN LAMA','KEJADIAN',34,NULL,12,'walaupun kamu bebankan kepadaku uang jujuran dan uang mahar seberapa banyakpun, aku akan memberikan apa yang kamu minta; tetapi berilah gadis itu kepadaku menjadi isteriku.\"',NULL),(3049,'PERJANJIAN LAMA','KEJADIAN',34,NULL,13,'Lalu anak-anak Yakub menjawab Sikhem dan Hemor, ayahnya, dengan tipu muslihat. Karena Sikhem telah mencemari Dina, adik mereka itu,',NULL),(3050,'PERJANJIAN LAMA','KEJADIAN',34,NULL,14,'berkatalah mereka kepada kedua orang itu: \"Kami tidak dapat berbuat demikian, memberikan adik kami kepada seorang laki-laki yang tidak bersunat, sebab hal itu aib bagi kami.',NULL),(3051,'PERJANJIAN LAMA','KEJADIAN',34,NULL,15,'Hanyalah dengan syarat ini kami dapat menyetujui permintaanmu: kamu harus sama seperti kami, yaitu setiap laki-laki di antara kamu harus disunat,',NULL),(3052,'PERJANJIAN LAMA','KEJADIAN',34,NULL,16,'arulah kami akan memberikan gadis-gadis kami kepada kamu dan mengambil gadis-gadis kamu; maka kami akan tinggal padamu, dan kita akan menjadi satu bangsa.',NULL),(3053,'PERJANJIAN LAMA','KEJADIAN',34,NULL,17,'Tetapi jika kamu tidak mendengarkan perkataan kami dan kamu tidak disunat, maka kami akan mengambil kembali anak itu, lalu pergi.\"',NULL),(3054,'PERJANJIAN LAMA','KEJADIAN',34,NULL,18,'Lalu Hemor dan Sikhem, anak Hemor, menyetujui usul mereka.',NULL),(3055,'PERJANJIAN LAMA','KEJADIAN',34,NULL,19,'Dan orang muda itu tidak bertangguh melakukannya, sebab ia suka kepada anak Yakub, lagipula ia seorang yang paling dihormati di antara seluruh kaum keluarganya.',NULL),(3056,'PERJANJIAN LAMA','KEJADIAN',34,NULL,20,'Lalu pergilah Hemor dan Sikhem, anaknya itu, ke pintu gerbang kota mereka dan mereka berbicara kepada penduduk kota itu:',NULL),(3057,'PERJANJIAN LAMA','KEJADIAN',34,NULL,21,'\"Orang-orang itu mau hidup damai dengan kita, biarlah mereka tinggal di negeri ini dan menjalaninya dengan bebas; bukankah negeri ini cukup luas untuk mereka? Maka kita dapat mengambil gadis-gadis mereka menjadi isteri kita dan kita dapat memberikan gadis',NULL),(3058,'PERJANJIAN LAMA','KEJADIAN',34,NULL,22,'Namun hanya dengan syarat ini orang-orang itu setuju tinggal bersama-sama dengan kita, sehingga kita menjadi satu bangsa, yaitu setiap laki-laki di antara kita harus disunat seperti mereka bersunat.',NULL),(3059,'PERJANJIAN LAMA','KEJADIAN',34,NULL,23,'Ternak mereka, harta benda mereka dan segala hewan mereka, bukankah semuanya itu akan menjadi milik kita? Hanya biarlah kita menyetujui permintaan mereka, sehingga mereka tetap tinggal pada kita.\"',NULL),(3060,'PERJANJIAN LAMA','KEJADIAN',34,NULL,24,'Maka usul Hemor dan Sikhem, anaknya itu, didengarkan oleh semua orang yang datang berkumpul di pintu gerbang kota itu, lalu disunatlah setiap laki-laki, yakni setiap orang dewasa di kota itu.',NULL),(3061,'PERJANJIAN LAMA','KEJADIAN',34,NULL,25,'Pada hari ketiga, ketika mereka sedang menderita kesakitan, datanglah dua orang anak Yakub, yaitu Simeon dan Lewi, kakak-kakak Dina, setelah masing-masing mengambil pedangnya, menyerang kota itu dengan tidak takut-takut serta membunuh setiap laki-laki.',NULL),(3062,'PERJANJIAN LAMA','KEJADIAN',34,NULL,26,'Juga Hemor dan Sikhem, anaknya, dibunuh mereka dengan mata pedang, dan mereka mengambil Dina dari rumah Sikhem, lalu pergi.',NULL),(3063,'PERJANJIAN LAMA','KEJADIAN',34,NULL,27,'Kemudian datanglah anak-anak Yakub merampasi orang-orang yang terbunuh itu, lalu menjarah kota itu, karena adik mereka telah dicemari.',NULL),(3064,'PERJANJIAN LAMA','KEJADIAN',34,NULL,28,'Kambing dombanya dan lembu sapinya, keledainya dan segala yang di dalam dan di luar kota itu dibawa mereka;',NULL),(3065,'PERJANJIAN LAMA','KEJADIAN',34,NULL,29,'segala kekayaannya, semua anaknya dan perempuannya ditawan dan dijarah mereka, juga seluruhnya yang ada di rumah-rumah.',NULL),(3066,'PERJANJIAN LAMA','KEJADIAN',34,NULL,30,'Yakub berkata kepada Simeon dan Lewi: \"Kamu telah mencelakakan aku dengan membusukkan namaku kepada penduduk negeri ini, kepada orang Kanaan dan orang Feris, padahal kita ini hanya sedikit jumlahnya; apabila mereka bersekutu melawan kita, tentulah mereka ',NULL),(3067,'PERJANJIAN LAMA','KEJADIAN',34,NULL,31,'Tetapi jawab mereka: \"Mengapa adik kita diperlakukannya sebagai seorang perempuan sundal!\"',NULL),(3068,'PERJANJIAN LAMA','KEJADIAN',35,'Yakub di Betel untuk kedua kalinya',1,'Allah berfirman kepada Yakub: \"Bersiaplah, pergilah ke Betel, tinggallah di situ, dan buatlah di situ mezbah bagi Allah, yang telah menampakkan diri kepadamu, ketika engkau lari dari Esau, kakakmu.\"',NULL),(3069,'PERJANJIAN LAMA','KEJADIAN',35,NULL,2,'Lalu berkatalah Yakub kepada seisi rumahnya dan kepada semua orang yang bersama-sama dengan dia: \"Jauhkanlah dewa-dewa asing yang ada di tengah-tengah kamu, tahirkanlah dirimu dan tukarlah pakaianmu.',NULL),(3070,'PERJANJIAN LAMA','KEJADIAN',35,NULL,3,'Marilah kita bersiap dan pergi ke Betel; aku akan membuat mezbah di situ bagi Allah, yang telah menjawab aku pada masa kesesakanku dan yang telah menyertai aku di jalan yang kutempuh.\"',NULL),(3071,'PERJANJIAN LAMA','KEJADIAN',35,NULL,4,'Mereka menyerahkan kepada Yakub segala dewa asing yang dipunyai mereka dan anting-anting yang ada pada telinga mereka, lalu Yakub menanamnya di bawah pohon besar yang dekat Sikhem.',NULL),(3072,'PERJANJIAN LAMA','KEJADIAN',35,NULL,5,'Sesudah itu berangkatlah mereka. Dan kedahsyatan yang dari Allah meliputi kota-kota sekeliling mereka, sehingga anak-anak Yakub tidak dikejar.',NULL),(3073,'PERJANJIAN LAMA','KEJADIAN',35,NULL,6,'Lalu sampailah Yakub ke Lus yang di tanah Kanaan--yaitu Betel--,ia dan semua orang yang bersama-sama dengan dia.',NULL),(3074,'PERJANJIAN LAMA','KEJADIAN',35,NULL,7,'Didirikannyalah mezbah di situ, dan dinamainyalah tempat itu El-Betel, karena Allah telah menyatakan diri kepadanya di situ, ketika ia lari terhadap kakaknya.',NULL),(3075,'PERJANJIAN LAMA','KEJADIAN',35,NULL,8,'Ketika Debora, inang pengasuh Ribka, mati, dikuburkanlah ia di sebelah hilir Betel di bawah pohon besar, yang dinamai orang: Pohon Besar Penangisan.',NULL),(3076,'PERJANJIAN LAMA','KEJADIAN',35,NULL,9,'Setelah Yakub datang dari Padan-Aram, maka Allah menampakkan diri pula kepadanya dan memberkati dia.',NULL),(3077,'PERJANJIAN LAMA','KEJADIAN',35,NULL,10,'Firman Allah kepadanya: \"Namamu Yakub; dari sekarang namamu bukan lagi Yakub, melainkan Israel, itulah yang akan menjadi namamu.\" Maka Allah menamai dia Israel.',NULL),(3078,'PERJANJIAN LAMA','KEJADIAN',35,NULL,11,'Lagi firman Allah kepadanya: \"Akulah Allah Yang Mahakuasa. Beranakcuculah dan bertambah banyak; satu bangsa, bahkan sekumpulan bangsa-bangsa, akan terjadi dari padamu dan raja-raja akan berasal dari padamu.',NULL),(3079,'PERJANJIAN LAMA','KEJADIAN',35,NULL,12,'Dan negeri ini yang telah Kuberikan kepada Abraham dan kepada Ishak, akan Kuberikan kepadamu dan juga kepada keturunanmu.\"',NULL),(3080,'PERJANJIAN LAMA','KEJADIAN',35,NULL,13,'Lalu naiklah Allah meninggalkan Yakub dari tempat Ia berfirman kepadanya.',NULL),(3081,'PERJANJIAN LAMA','KEJADIAN',35,NULL,14,'Kemudian Yakub mendirikan tugu di tempat itu, yakni tugu batu; ia mempersembahkan korban curahan dan menuangkan minyak di atasnya.',NULL),(3082,'PERJANJIAN LAMA','KEJADIAN',35,NULL,15,'Yakub menamai tempat di mana Allah telah berfirman kepadanya \"Betel\".',NULL),(3083,'PERJANJIAN LAMA','KEJADIAN',35,'Kelahiran Benyamin -- Rahel mati',16,'Sesudah itu berangkatlah mereka dari Betel. Ketika mereka tidak berapa jauh lagi dari Efrata, bersalinlah Rahel, dan bersalinnya itu sangat sukar.',NULL),(3084,'PERJANJIAN LAMA','KEJADIAN',35,NULL,17,'Sedang ia sangat sukar bersalin, berkatalah bidan kepadanya: \"Janganlah takut, sekali inipun anak laki-laki yang kaudapat.\"',NULL),(3085,'PERJANJIAN LAMA','KEJADIAN',35,NULL,18,'Dan ketika ia hendak menghembuskan nafas--sebab ia mati kemudian--diberikannyalah nama Ben-oni kepada anak itu, tetapi ayahnya menamainya Benyamin.',NULL),(3086,'PERJANJIAN LAMA','KEJADIAN',35,NULL,19,'Demikianlah Rahel mati, lalu ia dikuburkan di sisi jalan ke Efrata, yaitu Betlehem.',NULL),(3087,'PERJANJIAN LAMA','KEJADIAN',35,NULL,20,'Yakub mendirikan tugu di atas kuburnya; itulah tugu kubur Rahel sampai sekarang.',NULL),(3088,'PERJANJIAN LAMA','KEJADIAN',35,NULL,21,'Sesudah itu berangkatlah Israel, lalu ia memasang kemahnya di seberang Migdal-Eder.',NULL),(3089,'PERJANJIAN LAMA','KEJADIAN',35,'Anak-anak Yakub -- Ishak mati',22,'Ketika Israel diam di negeri ini, terjadilah bahwa Ruben sampai tidur dengan Bilha, gundik ayahnya, dan kedengaranlah hal itu kepada Israel.(35-22b) Adapun anak-anak lelaki Yakub dua belas orang jumlahnya.',NULL),(3090,'PERJANJIAN LAMA','KEJADIAN',35,NULL,23,'Anak-anak Lea ialah Ruben, anak sulung Yakub, kemudian Simeon, Lewi, Yehuda, Isakhar dan Zebulon.',NULL),(3091,'PERJANJIAN LAMA','KEJADIAN',35,NULL,24,'Anak-anak Rahel ialah Yusuf dan Benyamin.',NULL),(3092,'PERJANJIAN LAMA','KEJADIAN',35,NULL,25,'Dan anak-anak Bilha, budak perempuan Rahel ialah Dan serta Naftali.',NULL),(3093,'PERJANJIAN LAMA','KEJADIAN',35,NULL,26,'Dan anak-anak Zilpa, budak perempuan Lea ialah Gad dan Asyer. Itulah anak-anak lelaki Yakub, yang dilahirkan baginya di Padan-Aram.',NULL),(3094,'PERJANJIAN LAMA','KEJADIAN',35,NULL,27,'Lalu sampailah Yakub kepada Ishak, ayahnya, di Mamre dekat Kiryat-Arba--itulah Hebron--tempat Abraham dan Ishak tinggal sebagai orang asing.',NULL),(3095,'PERJANJIAN LAMA','KEJADIAN',35,NULL,28,'Adapun umur Ishak seratus delapan puluh tahun.',NULL),(3096,'PERJANJIAN LAMA','KEJADIAN',35,NULL,29,'Lalu meninggallah Ishak, ia mati dan dikumpulkan kepada kaum leluhurnya; ia tua dan suntuk umur, maka Esau dan Yakub, anak-anaknya itu, menguburkan dia.',NULL),(3097,'PERJANJIAN LAMA','KEJADIAN',36,'Keturunan Esau',1,'Inilah keturunan Esau, yaitu Edom.',NULL),(3098,'PERJANJIAN LAMA','KEJADIAN',36,NULL,2,'Esau mengambil perempuan-perempuan Kanaan menjadi isterinya, yakni Ada, anak Elon orang Het, dan Oholibama, anak Ana anak Zibeon orang Hewi,',NULL),(3099,'PERJANJIAN LAMA','KEJADIAN',36,NULL,3,'dan Basmat, anak Ismael, adik Nebayot.',NULL),(3100,'PERJANJIAN LAMA','KEJADIAN',36,NULL,4,'Ada melahirkan Elifas bagi Esau, dan Basmat melahirkan Rehuel,',NULL),(3101,'PERJANJIAN LAMA','KEJADIAN',36,NULL,5,'dan Oholibama melahirkan Yeush, Yaelam dan Korah. Itulah anak-anak Esau, yang lahir baginya di tanah Kanaan.',NULL),(3102,'PERJANJIAN LAMA','KEJADIAN',36,NULL,6,'Esau membawa isteri-isterinya, anak-anaknya lelaki dan perempuan dan semua orang yang ada di rumahnya, ternaknya, segala hewannya dan segala harta bendanya yang telah diperolehnya di tanah Kanaan, lalu pergilah ia ke negeri lain dan ia meninggalkan Yakub,',NULL),(3103,'PERJANJIAN LAMA','KEJADIAN',36,NULL,7,'Sebab harta milik mereka terlalu banyak, sehingga mereka tidak dapat tinggal bersama-sama, dan negeri penumpangan mereka tidak dapat memuat mereka karena banyaknya ternak mereka itu.',NULL),(3104,'PERJANJIAN LAMA','KEJADIAN',36,NULL,8,'Maka menetaplah Esau di pegunungan Seir; Esau itulah Edom.',NULL),(3105,'PERJANJIAN LAMA','KEJADIAN',36,NULL,9,'Inilah keturunan Esau, bapa orang Edom, di pegunungan Seir.',NULL),(3106,'PERJANJIAN LAMA','KEJADIAN',36,NULL,10,'Nama anak-anaknya ialah: Elifas, anak Ada isteri Esau; Rehuel, anak Basmat isteri Esau.',NULL),(3107,'PERJANJIAN LAMA','KEJADIAN',36,NULL,11,'Anak-anak Elifas ialah Teman, Omar, Zefo, Gaetam dan Kenas.',NULL),(3108,'PERJANJIAN LAMA','KEJADIAN',36,NULL,12,'Timna adalah gundik Elifas anak Esau; ia melahirkan Amalek bagi Elifas. Itulah cucu-cucu Ada isteri Esau.',NULL),(3109,'PERJANJIAN LAMA','KEJADIAN',36,NULL,13,'Inilah anak-anak Rehuel: Nahat, Zerah, Syama dan Miza. Itulah cucu-cucu Basmat isteri Esau.',NULL),(3110,'PERJANJIAN LAMA','KEJADIAN',36,NULL,14,'nilah anak-anak Oholibama, isteri Esau itu, anak Ana anak Zibeon; ia melahirkan bagi Esau: Yeush, Yaelam dan Korah.',NULL),(3111,'PERJANJIAN LAMA','KEJADIAN',36,NULL,15,'Inilah kepala-kepala kaum bani Esau: keturunan Elifas anak sulung Esau, ialah kepala kaum Teman, kepala kaum Omar, kepala kaum Zefo, kepala kaum Kenas,',NULL),(3112,'PERJANJIAN LAMA','KEJADIAN',36,NULL,16,'kepala kaum Korah, kepala kaum Gaetam dan kepala kaum Amalek; itulah kepala-kepala kaum Elifas di tanah Edom; itulah keturunan Ada.',NULL),(3113,'PERJANJIAN LAMA','KEJADIAN',36,NULL,17,'Inilah keturunan Rehuel anak Esau: kepala kaum Nahat, kepala kaum Zerah, kepala kaum Syama dan kepala kaum Miza; itulah kepala-kepala kaum Rehuel di tanah Edom; itulah keturunan Basmat isteri Esau.',NULL),(3114,'PERJANJIAN LAMA','KEJADIAN',36,NULL,18,'Inilah keturunan Oholibama isteri Esau: kepala kaum Yeush, kepala kaum Yaelam, kepala kaum Korah; itulah kepala-kepala kaum Oholibama, isteri Esau, anak Ana.',NULL),(3115,'PERJANJIAN LAMA','KEJADIAN',36,NULL,19,'Itulah bani Esau, yakni Edom, dan itulah kepala-kepala kaum mereka.',NULL),(3116,'PERJANJIAN LAMA','KEJADIAN',36,'Keturunan Seir',20,'Inilah anak-anak Seir, orang Hori, penduduk negeri itu: Lotan, Syobal, Zibeon, Ana,',NULL),(3117,'PERJANJIAN LAMA','KEJADIAN',36,NULL,21,'Disyon, Ezer, Disyan; itulah kepala-kepala kaum orang Hori, anak-anak Seir, di tanah Edom.',NULL),(3118,'PERJANJIAN LAMA','KEJADIAN',36,NULL,22,'Anak-anak Lotan ialah Hori dan Heman, dan saudara perempuan Lotan ialah Timna.',NULL),(3119,'PERJANJIAN LAMA','KEJADIAN',36,NULL,23,'Inilah anak-anak Syobal: Alwan, Manahat, Ebal, Syefo dan Onam.',NULL),(3120,'PERJANJIAN LAMA','KEJADIAN',36,NULL,24,'Inilah anak-anak Zibeon: Aya dan Ana; Ana inilah yang menemui mata-mata air panas di padang gurun, ketika ia sedang menggembalakan keledai Zibeon ayahnya itu.',NULL),(3121,'PERJANJIAN LAMA','KEJADIAN',36,NULL,25,'Inilah anak-anak Ana: Disyon dan Oholibama anak perempuan Ana.',NULL),(3122,'PERJANJIAN LAMA','KEJADIAN',36,NULL,26,'Inilah anak-anak Disyon: Hemdan, Esyban, Yitran dan Keran.',NULL),(3123,'PERJANJIAN LAMA','KEJADIAN',36,NULL,27,'Inilah anak-anak Ezer: Bilhan, Zaawan dan Akan.',NULL),(3124,'PERJANJIAN LAMA','KEJADIAN',36,NULL,28,'Inilah anak-anak Disyan: Us dan Aran.',NULL),(3125,'PERJANJIAN LAMA','KEJADIAN',36,NULL,29,'Itulah kepala-kepala kaum orang Hori: kepala kaum Lotan, kepala kaum Syobal, kepala kaum Zibeon, kepala kaum Ana,',NULL),(3126,'PERJANJIAN LAMA','KEJADIAN',36,NULL,30,'kepala kaum Disyon, kepala kaum Ezer dan kepala kaum Disyan; itulah kepala-kepala kaum orang Hori, kaum demi kaum, di tanah Seir.',NULL),(3127,'PERJANJIAN LAMA','KEJADIAN',36,'Raja-raja Edom',31,'Inilah raja-raja yang memerintah di tanah Edom, sebelum ada seorang raja memerintah atas orang Israel.',NULL),(3128,'PERJANJIAN LAMA','KEJADIAN',36,NULL,32,'Di Edom yang memerintah ialah Bela bin Beor dan kotanya bernama Dinhaba.',NULL),(3129,'PERJANJIAN LAMA','KEJADIAN',36,NULL,33,'Setelah Bela mati, Yobab bin Zerah dari Bozra menjadi raja menggantikan dia.',NULL),(3130,'PERJANJIAN LAMA','KEJADIAN',36,NULL,34,'Setelah Yobab mati, Husyam, dari negeri orang Teman, menjadi raja menggantikan dia.',NULL),(3131,'PERJANJIAN LAMA','KEJADIAN',36,NULL,35,'Setelah Husyam mati, Hadad bin Bedad menjadi raja menggantikan dia; dialah yang memukul kalah orang Midian di daerah Moab, dan kotanya bernama Awit.',NULL),(3132,'PERJANJIAN LAMA','KEJADIAN',36,NULL,36,'Setelah Hadad mati, Samla dari Masreka menjadi raja menggantikan dia.',NULL),(3133,'PERJANJIAN LAMA','KEJADIAN',36,NULL,37,'Setelah Samla mati, Saul, dari Rehobot yang di pinggir sungai, menjadi raja menggantikan dia.',NULL),(3134,'PERJANJIAN LAMA','KEJADIAN',36,NULL,38,'Setelah Saul mati, Baal-Hanan bin Akhbor menjadi raja menggantikan dia.',NULL),(3135,'PERJANJIAN LAMA','KEJADIAN',36,NULL,39,'Setelah Baal-Hanan bin Akhbor mati, Hadar menjadi raja menggantikan dia; kotanya bernama Pahu dan isterinya bernama Mehetabeel binti Matred binti Mezahab.',NULL),(3136,'PERJANJIAN LAMA','KEJADIAN',36,NULL,40,'Inilah nama kepala-kepala kaum Esau menurut kaum dan tempat mereka, dengan nama mereka masing-masing: kepala kaum Timna, kepala kaum Alwa, kepala kaum Yetet,',NULL),(3137,'PERJANJIAN LAMA','KEJADIAN',36,NULL,41,'kepala kaum Oholibama, kepala kaum Ela, kepala kaum Pinon,',NULL),(3138,'PERJANJIAN LAMA','KEJADIAN',36,NULL,42,'kepala kaum Kenas, kepala kaum Teman, kepala kaum Mibzar,',NULL),(3139,'PERJANJIAN LAMA','KEJADIAN',36,NULL,43,'kepala kaum Magdiel dan kepala kaum Iram; itulah kepala-kepala kaum Edom, menurut tempat kediaman mereka di tanah milik mereka; Edom ialah Esau, bapa orang Edom.',NULL),(3140,'PERJANJIAN LAMA','KEJADIAN',37,NULL,1,'Adapun Yakub, ia diam di negeri penumpangan ayahnya, yakni di tanah Kanaan.',NULL),(3141,'PERJANJIAN LAMA','KEJADIAN',37,NULL,2,'Inilah riwayat keturunan Yakub. Yusuf, tatkala berumur tujuh belas tahun--jadi masih muda--biasa menggembalakan kambing domba, bersama-sama dengan saudara-saudaranya, anak-anak Bilha dan Zilpa, kedua isteri ayahnya. Dan Yusuf menyampaikan kepada ayahnya k',NULL),(3142,'PERJANJIAN LAMA','KEJADIAN',37,NULL,3,'Israel lebih mengasihi Yusuf dari semua anaknya yang lain, sebab Yusuf itulah anaknya yang lahir pada masa tuanya; dan ia menyuruh membuat jubah yang maha indah bagi dia.',NULL),(3143,'PERJANJIAN LAMA','KEJADIAN',37,NULL,4,'Setelah dilihat oleh saudara-saudaranya, bahwa ayahnya lebih mengasihi Yusuf dari semua saudaranya, maka bencilah mereka itu kepadanya dan tidak mau menyapanya dengan ramah.',NULL),(3144,'PERJANJIAN LAMA','KEJADIAN',37,NULL,5,'Pada suatu kali bermimpilah Yusuf, lalu mimpinya itu diceritakannya kepada saudara-saudaranya; sebab itulah mereka lebih benci lagi kepadanya.',NULL),(3145,'PERJANJIAN LAMA','KEJADIAN',37,NULL,6,'Karena katanya kepada mereka: \"Coba dengarkan mimpi yang kumimpikan ini:',NULL),(3146,'PERJANJIAN LAMA','KEJADIAN',37,NULL,7,'Tampak kita sedang di ladang mengikat berkas-berkas gandum, lalu bangkitlah berkasku dan tegak berdiri; kemudian datanglah berkas-berkas kamu sekalian mengelilingi dan sujud menyembah kepada berkasku itu.\"',NULL),(3147,'PERJANJIAN LAMA','KEJADIAN',37,NULL,8,'Lalu saudara-saudaranya berkata kepadanya: \"Apakah engkau ingin menjadi raja atas kami? Apakah engkau ingin berkuasa atas kami?\" Jadi makin bencilah mereka kepadanya karena mimpinya dan karena perkataannya itu.',NULL),(3148,'PERJANJIAN LAMA','KEJADIAN',37,NULL,9,'Lalu ia memimpikan pula mimpi yang lain, yang diceritakannya kepada saudara-saudaranya. Katanya: \"Aku bermimpi pula: Tampak matahari, bulan dan sebelas bintang sujud menyembah kepadaku.\"',NULL),(3149,'PERJANJIAN LAMA','KEJADIAN',37,NULL,10,'Setelah hal ini diceritakannya kepada ayah dan saudara-saudaranya, maka ia ditegor oleh ayahnya: \"Mimpi apa mimpimu itu? Masakan aku dan ibumu serta saudara-saudaramu sujud menyembah kepadamu sampai ke tanah?\"',NULL),(3150,'PERJANJIAN LAMA','KEJADIAN',37,NULL,11,'Maka iri hatilah saudara-saudaranya kepadanya, tetapi ayahnya menyimpan hal itu dalam hatinya.',NULL),(3151,'PERJANJIAN LAMA','KEJADIAN',37,'Yusuf dijual ke tanah Mesir',12,'Pada suatu kali pergilah saudara-saudaranya menggembalakan kambing domba ayahnya dekat Sikhem.',NULL),(3152,'PERJANJIAN LAMA','KEJADIAN',37,NULL,13,'Lalu Israel berkata kepada Yusuf: \"Bukankah saudara-saudaramu menggembalakan kambing domba dekat Sikhem? Marilah engkau kusuruh kepada mereka.\" Sahut Yusuf: \"Ya bapa.\"',NULL),(3153,'PERJANJIAN LAMA','KEJADIAN',37,NULL,14,'Kata Israel kepadanya: \"Pergilah engkau melihat apakah baik keadaan saudara-saudaramu dan keadaan kambing domba; dan bawalah kabar tentang itu kepadaku.\" Lalu Yakub menyuruh dia dari lembah Hebron, dan Yusufpun sampailah ke Sikhem.',NULL),(3154,'PERJANJIAN LAMA','KEJADIAN',37,NULL,15,'Ketika Yusuf berjalan ke sana ke mari di padang, bertemulah ia dengan seorang laki-laki, yang bertanya kepadanya: \"Apakah yang kaucari?\"',NULL),(3155,'PERJANJIAN LAMA','KEJADIAN',37,NULL,16,'Sahutnya: \"Aku mencari saudara-saudaraku. Tolonglah katakan kepadaku di mana mereka menggembalakan kambing domba?\"',NULL),(3156,'PERJANJIAN LAMA','KEJADIAN',37,NULL,17,'Lalu kata orang itu: \"Mereka telah berangkat dari sini, sebab telah kudengar mereka berkata: Marilah kita pergi ke Dotan.\" Maka Yusuf menyusul saudara-saudaranya itu dan didapatinyalah mereka di Dotan.',NULL),(3157,'PERJANJIAN LAMA','KEJADIAN',37,NULL,18,'Dari jauh ia telah kelihatan kepada mereka. Tetapi sebelum ia dekat pada mereka, mereka telah bermufakat mencari daya upaya untuk membunuhnya.',NULL),(3158,'PERJANJIAN LAMA','KEJADIAN',37,NULL,19,'Kata mereka seorang kepada yang lain: \"Lihat, tukang mimpi kita itu datang!',NULL),(3159,'PERJANJIAN LAMA','KEJADIAN',37,NULL,20,'Sekarang, marilah kita bunuh dia dan kita lemparkan ke dalam salah satu sumur ini, lalu kita katakan: seekor binatang buas telah menerkamnya. Dan kita akan lihat nanti, bagaimana jadinya mimpinya itu!\"',NULL),(3160,'PERJANJIAN LAMA','KEJADIAN',37,NULL,21,'Ketika Ruben mendengar hal ini, ia ingin melepaskan Yusuf dari tangan mereka, sebab itu katanya: \"Janganlah kita bunuh dia!\"',NULL),(3161,'PERJANJIAN LAMA','KEJADIAN',37,NULL,22,'Lagi kata Ruben kepada mereka: \"Janganlah tumpahkan darah, lemparkanlah dia ke dalam sumur yang ada di padang gurun ini, tetapi janganlah apa-apakan dia\" --maksudnya hendak melepaskan Yusuf dari tangan mereka dan membawanya kembali kepada ayahnya.',NULL),(3162,'PERJANJIAN LAMA','KEJADIAN',37,NULL,23,'Baru saja Yusuf sampai kepada saudara-saudaranya, merekapun menanggalkan jubah Yusuf, jubah maha indah yang dipakainya itu.',NULL),(3163,'PERJANJIAN LAMA','KEJADIAN',37,NULL,24,'Dan mereka membawa dia dan melemparkan dia ke dalam sumur. Sumur itu kosong, tidak berair.',NULL),(3164,'PERJANJIAN LAMA','KEJADIAN',37,NULL,25,'Kemudian duduklah mereka untuk makan. Ketika mereka mengangkat muka, kelihatanlah kepada mereka suatu kafilah orang Ismael datang dari Gilead dengan untanya yang membawa damar, balsam dan damar ladan, dalam perjalanannya mengangkut barang-barang itu ke Me',NULL),(3165,'PERJANJIAN LAMA','KEJADIAN',37,NULL,26,'Lalu kata Yehuda kepada saudara-saudaranya itu: \"Apakah untungnya kalau kita membunuh adik kita itu dan menyembunyikan darahnya?',NULL),(3166,'PERJANJIAN LAMA','KEJADIAN',37,NULL,27,'Marilah kita jual dia kepada orang Ismael ini, tetapi janganlah kita apa-apakan dia, karena ia saudara kita, darah daging kita.\" Dan saudara-saudaranya mendengarkan perkataannya itu.',NULL),(3167,'PERJANJIAN LAMA','KEJADIAN',37,NULL,28,'Ketika ada saudagar-saudagar Midian lewat, Yusuf diangkat ke atas dari dalam sumur itu, kemudian dijual kepada orang Ismael itu dengan harga dua puluh syikal perak. Lalu Yusuf dibawa mereka ke Mesir.',NULL),(3168,'PERJANJIAN LAMA','KEJADIAN',37,NULL,29,'Ketika Ruben kembali ke sumur itu, ternyata Yusuf tidak ada lagi di dalamnya. Lalu dikoyakkannyalah bajunya,',NULL),(3169,'PERJANJIAN LAMA','KEJADIAN',37,NULL,30,'dan kembalilah ia kepada saudara-saudaranya, katanya: \"Anak itu tidak ada lagi, ke manakah aku ini?\"',NULL),(3170,'PERJANJIAN LAMA','KEJADIAN',37,NULL,31,'Kemudian mereka mengambil jubah Yusuf, dan menyembelih seekor kambing, lalu mencelupkan jubah itu ke dalam darahnya.',NULL),(3171,'PERJANJIAN LAMA','KEJADIAN',37,NULL,32,'Jubah maha indah itu mereka suruh antarkan kepada ayah mereka dengan pesan: \"Ini kami dapati. Silakanlah bapa periksa apakah jubah ini milik anak bapa atau tidak?\"',NULL),(3172,'PERJANJIAN LAMA','KEJADIAN',37,NULL,33,'Ketika Yakub memeriksa jubah itu, ia berkata: \"Ini jubah anakku; binatang buas telah memakannya; tentulah Yusuf telah diterkam.\"',NULL),(3173,'PERJANJIAN LAMA','KEJADIAN',37,NULL,34,'Dan Yakub mengoyakkan jubahnya, lalu mengenakan kain kabung pada pinggangnya dan berkabunglah ia berhari-hari lamanya karena anaknya itu.',NULL),(3174,'PERJANJIAN LAMA','KEJADIAN',37,NULL,35,'Sekalian anaknya laki-laki dan perempuan berusaha menghiburkan dia, tetapi ia menolak dihiburkan, serta katanya: \"Tidak! Aku akan berkabung, sampai aku turun mendapatkan anakku, ke dalam dunia orang mati!\" Demikianlah Yusuf ditangisi oleh ayahnya.',NULL),(3175,'PERJANJIAN LAMA','KEJADIAN',37,NULL,36,'Adapun Yusuf, ia dijual oleh orang Midian itu ke Mesir, kepada Potifar, seorang pegawai istana Firaun, kepala pengawal raja.',NULL),(3176,'PERJANJIAN LAMA','KEJADIAN',38,NULL,1,'Pada waktu itu Yehuda meninggalkan saudara-saudaranya dan menumpang pada seorang Adulam, yang namanya Hira.',NULL),(3177,'PERJANJIAN LAMA','KEJADIAN',38,NULL,2,'Di situ Yehuda melihat anak perempuan seorang Kanaan; nama orang itu ialah Syua. Lalu Yehuda kawin dengan perempuan itu dan menghampirinya.',NULL),(3178,'PERJANJIAN LAMA','KEJADIAN',38,NULL,3,'Perempuan itu mengandung, lalu melahirkan seorang anak laki-laki dan menamai anak itu Er.',NULL),(3179,'PERJANJIAN LAMA','KEJADIAN',38,NULL,4,'Sesudah itu perempuan itu mengandung lagi, lalu melahirkan seorang anak laki-laki dan menamai anak itu Onan.',NULL),(3180,'PERJANJIAN LAMA','KEJADIAN',38,NULL,5,'Kemudian perempuan itu melahirkan seorang anak laki-laki sekali lagi, dan menamai anak itu Syela. Yehuda sedang berada di Kezib, ketika anak itu dilahirkan.',NULL),(3181,'PERJANJIAN LAMA','KEJADIAN',38,NULL,6,'Sesudah itu Yehuda mengambil bagi Er, anak sulungnya, seorang isteri, yang bernama Tamar.',NULL),(3182,'PERJANJIAN LAMA','KEJADIAN',38,NULL,7,'Tetapi Er, anak sulung Yehuda itu, adalah jahat di mata TUHAN, maka TUHAN membunuh dia.',NULL),(3183,'PERJANJIAN LAMA','KEJADIAN',38,NULL,8,'Lalu berkatalah Yehuda kepada Onan: \"Hampirilah isteri kakakmu itu, kawinlah dengan dia sebagai ganti kakakmu dan bangkitkanlah keturunan bagi kakakmu.\"',NULL),(3184,'PERJANJIAN LAMA','KEJADIAN',38,NULL,9,'Tetapi Onan tahu, bahwa bukan ia yang empunya keturunannya nanti, sebab itu setiap kali ia menghampiri isteri kakaknya itu, ia membiarkan maninya terbuang, supaya ia jangan memberi keturunan kepada kakaknya.',NULL),(3185,'PERJANJIAN LAMA','KEJADIAN',38,NULL,10,'Tetapi yang dilakukannya itu adalah jahat di mata TUHAN, maka TUHAN membunuh dia juga.',NULL),(3186,'PERJANJIAN LAMA','KEJADIAN',38,NULL,11,'Lalu berkatalah Yehuda kepada Tamar, menantunya itu: \"Tinggallah sebagai janda di rumah ayahmu, sampai anakku Syela itu besar,\" sebab pikirnya: \"Jangan-jangan ia mati seperti kedua kakaknya itu.\" Maka pergilah Tamar dan tinggal di rumah ayahnya.',NULL),(3187,'PERJANJIAN LAMA','KEJADIAN',38,NULL,12,'Setelah beberapa lama matilah anak Syua, isteri Yehuda. Habis berkabung pergilah Yehuda ke Timna, kepada orang-orang yang menggunting bulu domba-dombanya, bersama dengan Hira, sahabatnya, orang Adulam itu.',NULL),(3188,'PERJANJIAN LAMA','KEJADIAN',38,NULL,13,'Ketika dikabarkan kepada Tamar: \"Bapa mertuamu sedang di jalan ke Timna untuk menggunting bulu domba-dombanya,\"',NULL),(3189,'PERJANJIAN LAMA','KEJADIAN',38,NULL,14,'maka ditanggalkannyalah pakaian kejandaannya, ia bertelekung dan berselubung, lalu pergi duduk di pintu masuk ke Enaim yang di jalan ke Timna, karena dilihatnya, bahwa Syela telah menjadi besar, dan dia tidak diberikan juga kepada Syela itu untuk menjadi ',NULL),(3190,'PERJANJIAN LAMA','KEJADIAN',38,NULL,15,'Ketika Yehuda melihat dia, disangkanyalah dia seorang perempuan sundal, karena ia menutupi mukanya.',NULL),(3191,'PERJANJIAN LAMA','KEJADIAN',38,NULL,16,'Lalu berpalinglah Yehuda mendapatkan perempuan yang di pinggir jalan itu serta berkata: \"Marilah, aku mau menghampiri engkau,\" sebab ia tidak tahu, bahwa perempuan itu menantunya. Tanya perempuan itu: \"Apakah yang akan kauberikan kepadaku, jika engkau men',NULL),(3192,'PERJANJIAN LAMA','KEJADIAN',38,NULL,17,'Jawabnya: \"Aku akan mengirimkan kepadamu seekor anak kambing dari kambing dombaku.\" Kata perempuan itu: \"Asal engkau memberikan tanggungannya, sampai engkau mengirimkannya kepadaku.\"',NULL),(3193,'PERJANJIAN LAMA','KEJADIAN',38,NULL,18,'Tanyanya: \"Apakah tanggungan yang harus kuberikan kepadamu?\" Jawab perempuan itu: \"Cap meteraimu serta kalungmu dan tongkat yang ada di tanganmu itu.\" Lalu diberikannyalah semuanya itu kepadanya, maka ia menghampirinya. Perempuan itu mengandung dari padan',NULL),(3194,'PERJANJIAN LAMA','KEJADIAN',38,NULL,19,'Bangunlah perempuan itu, lalu pergi, ditanggalkannya telekungnya dan dikenakannya pula pakaian kejandaannya.',NULL),(3195,'PERJANJIAN LAMA','KEJADIAN',38,NULL,20,'Adapun Yehuda, ia mengirimkan anak kambing itu dengan perantaraan sahabatnya, orang Adulam itu, untuk mengambil kembali tanggungannya dari tangan perempuan itu, tetapi perempuan itu tidak dijumpainya lagi.',NULL),(3196,'PERJANJIAN LAMA','KEJADIAN',38,NULL,21,'Ia bertanya-tanya di tempat tinggal perempuan itu: \"Di manakah perempuan jalang, yang duduk tadinya di pinggir jalan di Enaim itu?\" Jawab mereka: \"Tidak ada di sini perempuan jalang.\"',NULL),(3197,'PERJANJIAN LAMA','KEJADIAN',38,NULL,22,'Kembalilah ia kepada Yehuda dan berkata: \"Tidak ada kujumpai dia; dan juga orang-orang di tempat itu berkata: Tidak ada perempuan jalang di sini.\"',NULL),(3198,'PERJANJIAN LAMA','KEJADIAN',38,NULL,23,'Lalu berkatalah Yehuda: \"Biarlah barang-barang itu dipegangnya, supaya kita jangan menjadi buah olok-olok orang; sungguhlah anak kambing itu telah kukirimkan, tetapi engkau tidak menjumpai perempuan itu.\"',NULL),(3199,'PERJANJIAN LAMA','KEJADIAN',38,NULL,24,'Sesudah kira-kira tiga bulan dikabarkanlah kepada Yehuda: \"Tamar, menantumu, bersundal, bahkan telah mengandung dari persundalannya itu.\" Lalu kata Yehuda: \"Bawalah perempuan itu, supaya dibakar.\"',NULL),(3200,'PERJANJIAN LAMA','KEJADIAN',38,NULL,25,'Waktu dibawa, perempuan itu menyuruh orang kepada mertuanya mengatakan: \"Dari laki-laki yang empunya barang-barang inilah aku mengandung.\" Juga dikatakannya: \"Periksalah, siapa yang empunya cap meterai serta kalung dan tongkat ini?\"',NULL),(3201,'PERJANJIAN LAMA','KEJADIAN',38,NULL,26,'Yehuda memeriksa barang-barang itu, lalu berkata: \"Bukan aku, tetapi perempuan itulah yang benar, karena memang aku tidak memberikan dia kepada Syela, anakku.\" Dan ia tidak bersetubuh lagi dengan perempuan itu.',NULL),(3202,'PERJANJIAN LAMA','KEJADIAN',38,NULL,27,'Pada waktu perempuan itu hendak bersalin, nyatalah ada anak kembar dalam kandungannya.',NULL),(3203,'PERJANJIAN LAMA','KEJADIAN',38,NULL,28,'Dan ketika ia bersalin, seorang dari anak itu mengeluarkan tangannya, lalu dipegang oleh bidan, diikatnya dengan benang kirmizi serta berkata: \"Inilah yang lebih dahulu keluar.\"',NULL),(3204,'PERJANJIAN LAMA','KEJADIAN',38,NULL,29,'Ketika anak itu menarik tangannya kembali, keluarlah saudaranya laki-laki, dan bidan itu berkata: \"Alangkah kuatnya engkau menembus ke luar,\" maka anak itu dinamai Peres.',NULL),(3205,'PERJANJIAN LAMA','KEJADIAN',38,NULL,30,'Sesudah itu keluarlah saudaranya laki-laki yang tangannya telah berikat benang kirmizi itu, lalu kepadanya diberi nama Zerah.',NULL),(3206,'PERJANJIAN LAMA','KEJADIAN',39,NULL,1,'Adapun Yusuf telah dibawa ke Mesir; dan Potifar, seorang Mesir, pegawai istana Firaun, kepala pengawal raja, membeli dia dari tangan orang Ismael yang telah membawa dia ke situ.',NULL),(3207,'PERJANJIAN LAMA','KEJADIAN',39,NULL,2,'Tetapi TUHAN menyertai Yusuf, sehingga ia menjadi seorang yang selalu berhasil dalam pekerjaannya; maka tinggallah ia di rumah tuannya, orang Mesir itu.',NULL),(3208,'PERJANJIAN LAMA','KEJADIAN',39,NULL,3,'Setelah dilihat oleh tuannya, bahwa Yusuf disertai TUHAN dan bahwa TUHAN membuat berhasil segala sesuatu yang dikerjakannya,',NULL),(3209,'PERJANJIAN LAMA','KEJADIAN',39,NULL,4,'maka Yusuf mendapat kasih tuannya, dan ia boleh melayani dia; kepada Yusuf diberikannya kuasa atas rumahnya dan segala miliknya diserahkannya pada kekuasaan Yusuf.',NULL),(3210,'PERJANJIAN LAMA','KEJADIAN',39,NULL,5,'Sejak ia memberikan kuasa dalam rumahnya dan atas segala miliknya kepada Yusuf, TUHAN memberkati rumah orang Mesir itu karena Yusuf, sehingga berkat TUHAN ada atas segala miliknya, baik yang di rumah maupun yang di ladang.',NULL),(3211,'PERJANJIAN LAMA','KEJADIAN',39,NULL,6,'Segala miliknya diserahkannya pada kekuasaan Yusuf, dan dengan bantuan Yusuf ia tidak usah lagi mengatur apa-apapun selain dari makanannya sendiri. Adapun Yusuf itu manis sikapnya dan elok parasnya.',NULL),(3212,'PERJANJIAN LAMA','KEJADIAN',39,NULL,7,'elang beberapa waktu isteri tuannya memandang Yusuf dengan berahi, lalu katanya: \"Marilah tidur dengan aku.\"',NULL),(3213,'PERJANJIAN LAMA','KEJADIAN',39,NULL,8,'Tetapi Yusuf menolak dan berkata kepada isteri tuannya itu: \"Dengan bantuanku tuanku itu tidak lagi mengatur apa yang ada di rumah ini dan ia telah menyerahkan segala miliknya pada kekuasaanku,',NULL),(3214,'PERJANJIAN LAMA','KEJADIAN',39,NULL,9,'bahkan di rumah ini ia tidak lebih besar kuasanya dari padaku, dan tiada yang tidak diserahkannya kepadaku selain dari pada engkau, sebab engkau isterinya. Bagaimanakah mungkin aku melakukan kejahatan yang besar ini dan berbuat dosa terhadap Allah?\"',NULL),(3215,'PERJANJIAN LAMA','KEJADIAN',39,NULL,10,'Walaupun dari hari ke hari perempuan itu membujuk Yusuf, Yusuf tidak mendengarkan bujukannya itu untuk tidur di sisinya dan bersetubuh dengan dia.',NULL),(3216,'PERJANJIAN LAMA','KEJADIAN',39,NULL,11,'Pada suatu hari masuklah Yusuf ke dalam rumah untuk melakukan pekerjaannya, sedang dari seisi rumah itu seorangpun tidak ada di rumah.',NULL),(3217,'PERJANJIAN LAMA','KEJADIAN',39,NULL,12,'Lalu perempuan itu memegang baju Yusuf sambil berkata: \"Marilah tidur dengan aku.\" Tetapi Yusuf meninggalkan bajunya di tangan perempuan itu dan lari ke luar.',NULL),(3218,'PERJANJIAN LAMA','KEJADIAN',39,NULL,13,'Ketika dilihat perempuan itu, bahwa Yusuf meninggalkan bajunya dalam tangannya dan telah lari ke luar,',NULL),(3219,'PERJANJIAN LAMA','KEJADIAN',39,NULL,14,'dipanggilnyalah seisi rumah itu, lalu katanya kepada mereka: \"Lihat, dibawanya ke mari seorang Ibrani, supaya orang ini dapat mempermainkan kita. Orang ini mendekati aku untuk tidur dengan aku, tetapi aku berteriak-teriak dengan suara keras.',NULL),(3220,'PERJANJIAN LAMA','KEJADIAN',39,NULL,15,'Dan ketika didengarnya bahwa aku berteriak sekeras-kerasnya, ditinggalkannyalah bajunya padaku, lalu ia lari ke luar.\"',NULL),(3221,'PERJANJIAN LAMA','KEJADIAN',39,NULL,16,'Juga ditaruhnya baju Yusuf itu di sisinya, sampai tuan rumah pulang.',NULL),(3222,'PERJANJIAN LAMA','KEJADIAN',39,NULL,17,'Perkataan itu jugalah yang diceritakan perempuan itu kepada Potifar, katanya: \"Hamba orang Ibrani yang kaubawa ke mari itu datang kepadaku untuk mempermainkan aku.',NULL),(3223,'PERJANJIAN LAMA','KEJADIAN',39,NULL,18,'Tetapi ketika aku berteriak sekeras-kerasnya, ditinggalkannya bajunya padaku, lalu ia lari ke luar.\"',NULL),(3224,'PERJANJIAN LAMA','KEJADIAN',39,NULL,19,'Baru saja didengar oleh tuannya perkataan yang diceritakan isterinya kepadanya: begini begitulah aku diperlakukan oleh hambamu itu, maka bangkitlah amarahnya.',NULL),(3225,'PERJANJIAN LAMA','KEJADIAN',39,NULL,20,'Lalu Yusuf ditangkap oleh tuannya dan dimasukkan ke dalam penjara, tempat tahanan-tahanan raja dikurung. Demikianlah Yusuf dipenjarakan di sana.',NULL),(3226,'PERJANJIAN LAMA','KEJADIAN',39,NULL,21,'Tetapi TUHAN menyertai Yusuf dan melimpahkan kasih setia-Nya kepadanya, dan membuat Yusuf kesayangan bagi kepala penjara itu.',NULL),(3227,'PERJANJIAN LAMA','KEJADIAN',39,NULL,22,'Sebab itu kepala penjara mempercayakan semua tahanan dalam penjara itu kepada Yusuf, dan segala pekerjaan yang harus dilakukan di situ, dialah yang mengurusnya.',NULL),(3228,'PERJANJIAN LAMA','KEJADIAN',39,NULL,23,'Dan kepala penjara tidak mencampuri segala yang dipercayakannya kepada Yusuf, karena TUHAN menyertai dia dan apa yang dikerjakannya dibuat TUHAN berhasil.',NULL),(3229,'PERJANJIAN LAMA','KEJADIAN',40,'Mimpi juru minuman dan juru roti',1,'Sesudah semuanya itu terjadilah, bahwa juru minuman raja Mesir dan juru rotinya membuat kesalahan terhadap tuannya, raja Mesir itu,',NULL),(3230,'PERJANJIAN LAMA','KEJADIAN',40,NULL,2,'maka murkalah Firaun kepada kedua pegawai istananya, kepala juru minuman dan kepala juru roti itu.',NULL),(3231,'PERJANJIAN LAMA','KEJADIAN',40,NULL,3,'Ia menahan mereka dalam rumah kepala pengawal raja, dalam penjara tempat Yusuf dikurung.',NULL),(3232,'PERJANJIAN LAMA','KEJADIAN',40,NULL,4,'Kepala pengawal raja menempatkan Yusuf bersama-sama dengan mereka untuk melayani mereka. Demikianlah mereka ditahan beberapa waktu lamanya.',NULL),(3233,'PERJANJIAN LAMA','KEJADIAN',40,NULL,5,'Pada suatu kali bermimpilah mereka keduanya--baik juru minuman maupun juru roti raja Mesir, yang ditahan dalam penjara itu--masing-masing ada mimpinya, pada satu malam juga, dan mimpi masing-masing itu ada artinya sendiri.',NULL),(3234,'PERJANJIAN LAMA','KEJADIAN',40,NULL,6,'Ketika pada waktu pagi Yusuf datang kepada mereka, segera dilihatnya, bahwa mereka bersusah hati.',NULL),(3235,'PERJANJIAN LAMA','KEJADIAN',40,NULL,7,'Lalu ia bertanya kepada pegawai-pegawai istana Firaun yang ditahan bersama-sama dengan dia dalam rumah tuannya itu: \"Mengapakah hari ini mukamu semuram itu?\"',NULL),(3236,'PERJANJIAN LAMA','KEJADIAN',40,NULL,8,'Jawab mereka kepadanya: \"Kami bermimpi, tetapi tidak ada orang yang dapat mengartikannya.\" Lalu kata Yusuf kepada mereka: \"Bukankah Allah yang menerangkan arti mimpi? Ceritakanlah kiranya mimpimu itu kepadaku.\"',NULL),(3237,'PERJANJIAN LAMA','KEJADIAN',40,NULL,9,'Kemudian juru minuman itu menceritakan mimpinya kepada Yusuf, katanya: \"Dalam mimpiku itu tampak ada pohon anggur di depanku.',NULL),(3238,'PERJANJIAN LAMA','KEJADIAN',40,NULL,10,'Pohon anggur itu ada tiga carangnya dan baru saja pohon itu bertunas, bunganya sudah keluar dan tandan-tandannya penuh buah anggur yang ranum.',NULL),(3239,'PERJANJIAN LAMA','KEJADIAN',40,NULL,11,'Dan di tanganku ada piala Firaun. Buah anggur itu kuambil, lalu kuperas ke dalam piala Firaun, kemudian kusampaikan piala itu ke tangan Firaun.\"',NULL),(3240,'PERJANJIAN LAMA','KEJADIAN',40,NULL,12,'Kata Yusuf kepadanya: \"Beginilah arti mimpi itu: ketiga carang itu artinya tiga hari;',NULL),(3241,'PERJANJIAN LAMA','KEJADIAN',40,NULL,13,'dalam tiga hari ini Firaun akan meninggikan engkau dan mengembalikan engkau ke dalam pangkatmu yang dahulu dan engkau akan menyampaikan piala ke tangan Firaun seperti dahulu kala, ketika engkau jadi juru minumannya.',NULL),(3242,'PERJANJIAN LAMA','KEJADIAN',40,NULL,14,'Tetapi, ingatlah kepadaku, apabila keadaanmu telah baik nanti, tunjukkanlah terima kasihmu kepadaku dengan menceritakan hal ihwalku kepada Firaun dan tolonglah keluarkan aku dari rumah ini.',NULL),(3243,'PERJANJIAN LAMA','KEJADIAN',40,NULL,15,'Sebab aku dicuri diculik begitu saja dari negeri orang Ibrani dan di sinipun aku tidak pernah melakukan apa-apa yang menyebabkan aku layak dimasukkan ke dalam liang tutupan ini.\"',NULL),(3244,'PERJANJIAN LAMA','KEJADIAN',40,NULL,16,'Setelah dilihat oleh kepala juru roti, betapa baik arti mimpi itu, berkatalah ia kepadanya: \"Akupun bermimpi juga. Tampak aku menjunjung tiga bakul berisi penganan.',NULL),(3245,'PERJANJIAN LAMA','KEJADIAN',40,NULL,17,'Dalam bakul atas ada berbagai-bagai makanan untuk Firaun, buatan juru roti, tetapi burung-burung memakannya dari dalam bakul yang di atas kepalaku.\"',NULL),(3246,'PERJANJIAN LAMA','KEJADIAN',40,NULL,18,'Yusuf menjawab: \"Beginilah arti mimpi itu: ketiga bakul itu artinya tiga hari;',NULL),(3247,'PERJANJIAN LAMA','KEJADIAN',40,NULL,19,'dalam tiga hari ini Firaun akan meninggikan engkau, tinggi ke atas, dan menggantung engkau pada sebuah tiang, dan burung-burung akan memakan dagingmu dari tubuhmu.\"',NULL),(3248,'PERJANJIAN LAMA','KEJADIAN',40,NULL,20,'Dan terjadilah pada hari ketiga, hari kelahiran Firaun, maka Firaun mengadakan perjamuan untuk semua pegawainya. Ia meninggikan kepala juru minuman dan kepala juru roti itu di tengah-tengah para pegawainya:',NULL),(3249,'PERJANJIAN LAMA','KEJADIAN',40,NULL,21,'kepala juru minuman itu dikembalikannya ke dalam jabatannya, sehingga ia menyampaikan pula piala ke tangan Firaun;',NULL),(3250,'PERJANJIAN LAMA','KEJADIAN',40,NULL,22,'tetapi kepala juru roti itu digantungnya, seperti yang ditakbirkan Yusuf kepada mereka.',NULL),(3251,'PERJANJIAN LAMA','KEJADIAN',40,NULL,23,'Tetapi Yusuf tidaklah diingat oleh kepala juru minuman itu, melainkan dilupakannya.',NULL),(3252,'PERJANJIAN LAMA','KEJADIAN',41,'Mimpi Firaun',1,'Setelah lewat dua tahun lamanya, bermimpilah Firaun, bahwa ia berdiri di tepi sungai Nil.',NULL),(3253,'PERJANJIAN LAMA','KEJADIAN',41,NULL,2,'Tampaklah dari sungai Nil itu keluar tujuh ekor lembu yang indah bangunnya dan gemuk badannya; lalu memakan rumput yang di tepi sungai itu.',NULL),(3254,'PERJANJIAN LAMA','KEJADIAN',41,NULL,3,'Kemudian tampaklah juga tujuh ekor lembu yang lain, yang keluar dari dalam sungai Nil itu, buruk bangunnya dan kurus badannya, lalu berdiri di samping lembu-lembu yang tadi, di tepi sungai itu.',NULL),(3255,'PERJANJIAN LAMA','KEJADIAN',41,NULL,4,'Lembu-lembu yang buruk bangunnya dan kurus badannya itu memakan ketujuh ekor lembu yang indah bangunnya dan gemuk itu. Lalu terjagalah Firaun.',NULL),(3256,'PERJANJIAN LAMA','KEJADIAN',41,NULL,5,'Setelah itu tertidur pulalah ia dan bermimpi kedua kalinya: Tampak timbul dari satu tangkai tujuh bulir gandum yang bernas dan baik.',NULL),(3257,'PERJANJIAN LAMA','KEJADIAN',41,NULL,6,'Tetapi kemudian tampaklah juga tumbuh tujuh bulir gandum yang kurus dan layu oleh angin timur.',NULL),(3258,'PERJANJIAN LAMA','KEJADIAN',41,NULL,7,'Bulir yang kurus itu menelan ketujuh bulir yang bernas dan berisi tadi. Lalu terjagalah Firaun. Agaknya ia bermimpi!',NULL),(3259,'PERJANJIAN LAMA','KEJADIAN',41,NULL,8,'Pada waktu pagi gelisahlah hatinya, lalu disuruhnyalah memanggil semua ahli dan semua orang berilmu di Mesir. Firaun menceritakan mimpinya kepada mereka, tetapi seorangpun tidak ada yang dapat mengartikannya kepadanya.',NULL),(3260,'PERJANJIAN LAMA','KEJADIAN',41,NULL,9,'Lalu berkatalah kepala juru minuman kepada Firaun: \"Hari ini aku merasa perlu menyebutkan kesalahanku yang dahulu.',NULL),(3261,'PERJANJIAN LAMA','KEJADIAN',41,NULL,10,'Waktu itu tuanku Firaun murka kepada pegawai-pegawainya, dan menahan aku dalam rumah pengawal istana, beserta dengan kepala juru roti.',NULL),(3262,'PERJANJIAN LAMA','KEJADIAN',41,NULL,11,'Pada satu malam juga kami bermimpi, aku dan kepala juru roti itu; masing-masing mempunyai mimpi dengan artinya sendiri.',NULL),(3263,'PERJANJIAN LAMA','KEJADIAN',41,NULL,12,'Bersama-sama dengan kami ada di sana seorang muda Ibrani, hamba kepala pengawal istana itu; kami menceritakan mimpi kami kepadanya, lalu diartikannya kepada kami mimpi kami masing-masing.',NULL),(3264,'PERJANJIAN LAMA','KEJADIAN',41,NULL,13,'Dan seperti yang diartikannya itu kepada kami, demikianlah pula terjadi: aku dikembalikan ke dalam pangkatku, dan kepala juru roti itu digantung.\"',NULL),(3265,'PERJANJIAN LAMA','KEJADIAN',41,NULL,14,'Kemudian Firaun menyuruh memanggil Yusuf. Segeralah ia dikeluarkan dari tutupan; ia bercukur dan berganti pakaian, lalu pergi menghadap Firaun.',NULL),(3266,'PERJANJIAN LAMA','KEJADIAN',41,NULL,15,'Berkatalah Firaun kepada Yusuf: \"Aku telah bermimpi, dan seorangpun tidak ada yang dapat mengartikannya, tetapi telah kudengar tentang engkau: hanya dengan mendengar mimpi saja engkau dapat mengartikannya.\"',NULL),(3267,'PERJANJIAN LAMA','KEJADIAN',41,NULL,16,'Yusuf menyahut Firaun: \"Bukan sekali-kali aku, melainkan Allah juga yang akan memberitakan kesejahteraan kepada tuanku Firaun.\"',NULL),(3268,'PERJANJIAN LAMA','KEJADIAN',41,NULL,17,'Lalu berkatalah Firaun kepada Yusuf: \"Dalam mimpiku itu, aku berdiri di tepi sungai Nil;',NULL),(3269,'PERJANJIAN LAMA','KEJADIAN',41,NULL,18,'lalu tampaklah dari sungai Nil itu keluar tujuh ekor lembu yang gemuk badannya dan indah bentuknya, dan makan rumput yang di tepi sungai itu.',NULL),(3270,'PERJANJIAN LAMA','KEJADIAN',41,NULL,19,'Tetapi kemudian tampaklah juga keluar tujuh ekor lembu yang lain, kulit pemalut tulang, sangat buruk bangunnya dan kurus badannya; tidak pernah kulihat yang seburuk itu di seluruh tanah Mesir.',NULL),(3271,'PERJANJIAN LAMA','KEJADIAN',41,NULL,20,'Lembu yang kurus dan buruk itu memakan ketujuh ekor lembu gemuk yang mula-mula.',NULL),(3272,'PERJANJIAN LAMA','KEJADIAN',41,NULL,21,'Lembu-lembu ini masuk ke dalam perutnya, tetapi walaupun telah masuk ke dalam perutnya, tidaklah kelihatan sedikitpun tandanya: bangunnya tetap sama buruknya seperti semula. Lalu terjagalah aku.',NULL),(3273,'PERJANJIAN LAMA','KEJADIAN',41,NULL,22,'Selanjutnya dalam mimpiku itu kulihat timbul dari satu tangkai tujuh bulir gandum yang berisi dan baik.',NULL),(3274,'PERJANJIAN LAMA','KEJADIAN',41,NULL,23,'Tetapi kemudian tampaklah juga tumbuh tujuh bulir yang kering, kurus dan layu oleh angin timur.',NULL),(3275,'PERJANJIAN LAMA','KEJADIAN',41,NULL,24,'Bulir yang kurus itu memakan ketujuh bulir yang baik tadi. Telah kuceritakan hal ini kepada semua ahli, tetapi seorangpun tidak ada yang dapat menerangkannya kepadaku.\"',NULL),(3276,'PERJANJIAN LAMA','KEJADIAN',41,NULL,25,'Lalu kata Yusuf kepada Firaun: \"Kedua mimpi tuanku Firaun itu sama. Allah telah memberitahukan kepada tuanku Firaun apa yang hendak dilakukan-Nya.',NULL),(3277,'PERJANJIAN LAMA','KEJADIAN',41,NULL,26,'Ketujuh ekor lembu yang baik itu ialah tujuh tahun, dan ketujuh bulir gandum yang baik itu ialah tujuh tahun juga; kedua mimpi itu sama.',NULL),(3278,'PERJANJIAN LAMA','KEJADIAN',41,NULL,27,'Ketujuh ekor lembu yang kurus dan buruk, yang keluar kemudian, maksudnya tujuh tahun, demikian pula ketujuh bulir gandum yang hampa dan layu oleh angin timur itu; maksudnya akan ada tujuh tahun kelaparan.',NULL),(3279,'PERJANJIAN LAMA','KEJADIAN',41,NULL,28,'Inilah maksud perkataanku, ketika aku berkata kepada tuanku Firaun: Allah telah memperlihatkan kepada tuanku Firaun apa yang hendak dilakukan-Nya.',NULL),(3280,'PERJANJIAN LAMA','KEJADIAN',41,NULL,29,'Ketahuilah tuanku, akan datang tujuh tahun kelimpahan di seluruh tanah Mesir.',NULL),(3281,'PERJANJIAN LAMA','KEJADIAN',41,NULL,30,'Kemudian akan timbul tujuh tahun kelaparan; maka akan dilupakan segala kelimpahan itu di tanah Mesir, karena kelaparan itu menguruskeringkan negeri ini.',NULL),(3282,'PERJANJIAN LAMA','KEJADIAN',41,NULL,31,'Sesudah itu akan tidak kelihatan lagi bekas-bekas kelimpahan di negeri ini karena kelaparan itu, sebab sangat hebatnya kelaparan itu.',NULL),(3283,'PERJANJIAN LAMA','KEJADIAN',41,NULL,32,'Sampai dua kali mimpi itu diulangi bagi tuanku Firaun berarti: hal itu telah ditetapkan oleh Allah dan Allah akan segera melakukannya.',NULL),(3284,'PERJANJIAN LAMA','KEJADIAN',41,NULL,33,'Oleh sebab itu, baiklah tuanku Firaun mencari seorang yang berakal budi dan bijaksana, dan mengangkatnya menjadi kuasa atas tanah Mesir.',NULL),(3285,'PERJANJIAN LAMA','KEJADIAN',41,NULL,34,'Baiklah juga tuanku Firaun berbuat begini, yakni menempatkan penilik-penilik atas negeri ini dan dalam ketujuh tahun kelimpahan itu memungut seperlima dari hasil tanah Mesir.',NULL),(3286,'PERJANJIAN LAMA','KEJADIAN',41,NULL,35,'Mereka harus mengumpulkan segala bahan makanan dalam tahun-tahun baik yang akan datang ini dan, di bawah kuasa tuanku Firaun, menimbun gandum di kota-kota sebagai bahan makanan, serta menyimpannya.',NULL),(3287,'PERJANJIAN LAMA','KEJADIAN',41,NULL,36,'Demikianlah segala bahan makanan itu menjadi persediaan untuk negeri ini dalam ketujuh tahun kelaparan yang akan terjadi di tanah Mesir, supaya negeri ini jangan binasa karena kelaparan itu.\"',NULL),(3288,'PERJANJIAN LAMA','KEJADIAN',41,'Yusuf di Mesir sebagai penguasa',37,'Usul itu dipandang baik oleh Firaun dan oleh semua pegawainya.',NULL),(3289,'PERJANJIAN LAMA','KEJADIAN',41,NULL,38,'Lalu berkatalah Firaun kepada para pegawainya: \"Mungkinkah kita mendapat orang seperti ini, seorang yang penuh dengan Roh Allah?\"',NULL),(3290,'PERJANJIAN LAMA','KEJADIAN',41,NULL,39,'Kata Firaun kepada Yusuf: \"Oleh karena Allah telah memberitahukan semuanya ini kepadamu, tidaklah ada orang yang demikian berakal budi dan bijaksana seperti engkau.',NULL),(3291,'PERJANJIAN LAMA','KEJADIAN',41,NULL,40,'Engkaulah menjadi kuasa atas istanaku, dan kepada perintahmu seluruh rakyatku akan taat; hanya takhta inilah kelebihanku dari padamu.\"',NULL),(3292,'PERJANJIAN LAMA','KEJADIAN',41,NULL,41,'Selanjutnya Firaun berkata kepada Yusuf: \"Dengan ini aku melantik engkau menjadi kuasa atas seluruh tanah Mesir.\"',NULL),(3293,'PERJANJIAN LAMA','KEJADIAN',41,NULL,42,'Sesudah itu Firaun menanggalkan cincin meterainya dari jarinya dan mengenakannya pada jari Yusuf; dipakaikannyalah kepada Yusuf pakaian dari pada kain halus dan digantungkannya kalung emas pada lehernya.',NULL),(3294,'PERJANJIAN LAMA','KEJADIAN',41,NULL,43,'Lalu Firaun menyuruh menaikkan Yusuf dalam keretanya yang kedua, dan berserulah orang di hadapan Yusuf: \"Hormat!\" Demikianlah Yusuf dilantik oleh Firaun menjadi kuasa atas seluruh tanah Mesir.',NULL),(3295,'PERJANJIAN LAMA','KEJADIAN',41,NULL,44,'Berkatalah Firaun kepada Yusuf: \"Akulah Firaun, tetapi dengan tidak setahumu, seorangpun tidak boleh bergerak di seluruh tanah Mesir.\"',NULL),(3296,'PERJANJIAN LAMA','KEJADIAN',41,NULL,45,'Lalu Firaun menamai Yusuf: Zafnat-Paaneah, serta memberikan Asnat, anak Potifera, imam di On, kepadanya menjadi isterinya. Demikianlah Yusuf muncul sebagai kuasa atas seluruh tanah Mesir.',NULL),(3297,'PERJANJIAN LAMA','KEJADIAN',41,NULL,46,'usuf berumur tiga puluh tahun ketika ia menghadap Firaun, raja Mesir itu. Maka pergilah Yusuf dari depan Firaun, lalu dikelilinginya seluruh tanah Mesir.',NULL),(3298,'PERJANJIAN LAMA','KEJADIAN',41,NULL,47,'Tanah itu mengeluarkan hasil bertumpuk-tumpuk dalam ketujuh tahun kelimpahan itu,',NULL),(3299,'PERJANJIAN LAMA','KEJADIAN',41,NULL,48,'maka Yusuf mengumpulkan segala bahan makanan ketujuh tahun kelimpahan yang ada di tanah Mesir, lalu disimpannya di kota-kota; hasil daerah sekitar tiap-tiap kota disimpan di dalam kota itu.',NULL),(3300,'PERJANJIAN LAMA','KEJADIAN',41,NULL,49,'Demikianlah Yusuf menimbun gandum seperti pasir di laut, sangat banyak, sehingga orang berhenti menghitungnya, karena memang tidak terhitung.',NULL),(3301,'PERJANJIAN LAMA','KEJADIAN',41,NULL,50,'Sebelum datang tahun kelaparan itu, lahirlah bagi Yusuf dua orang anak laki-laki, yang dilahirkan oleh Asnat, anak Potifera, imam di On.',NULL),(3302,'PERJANJIAN LAMA','KEJADIAN',41,NULL,51,'Yusuf memberi nama Manasye kepada anak sulungnya itu, sebab katanya: \"Allah telah membuat aku lupa sama sekali kepada kesukaranku dan kepada rumah bapaku.\"',NULL),(3303,'PERJANJIAN LAMA','KEJADIAN',41,NULL,52,'Dan kepada anaknya yang kedua diberinya nama Efraim, sebab katanya: \"Allah membuat aku mendapat anak dalam negeri kesengsaraanku.\"',NULL),(3304,'PERJANJIAN LAMA','KEJADIAN',41,NULL,53,'etelah lewat ketujuh tahun kelimpahan yang ada di tanah Mesir itu,',NULL),(3305,'PERJANJIAN LAMA','KEJADIAN',41,NULL,54,'mulailah datang tujuh tahun kelaparan, seperti yang telah dikatakan Yusuf; dalam segala negeri ada kelaparan, tetapi di seluruh negeri Mesir ada roti.',NULL),(3306,'PERJANJIAN LAMA','KEJADIAN',41,NULL,55,'Ketika seluruh negeri Mesir menderita kelaparan, dan rakyat berteriak meminta roti kepada Firaun, berkatalah Firaun kepada semua orang Mesir: \"Pergilah kepada Yusuf, perbuatlah apa yang akan dikatakannya kepadamu.\"',NULL),(3307,'PERJANJIAN LAMA','KEJADIAN',41,NULL,56,'Kelaparan itu merajalela di seluruh bumi. Maka Yusuf membuka segala lumbung dan menjual gandum kepada orang Mesir, sebab makin hebat kelaparan itu di tanah Mesir.',NULL),(3308,'PERJANJIAN LAMA','KEJADIAN',41,NULL,57,'Juga dari seluruh bumi datanglah orang ke Mesir untuk membeli gandum dari Yusuf, sebab hebat kelaparan itu di seluruh bumi.',NULL),(3309,'PERJANJIAN LAMA','KEJADIAN',42,'Saudara-saudara Yusuf pergi ke Mesir',1,'Setelah Yakub mendapat kabar, bahwa ada gandum di Mesir, berkatalah ia kepada anak-anaknya: \"Mengapa kamu berpandang-pandangan saja?\"',NULL),(3310,'PERJANJIAN LAMA','KEJADIAN',42,NULL,2,'Lagi katanya: \"Telah kudengar, bahwa ada gandum di Mesir; pergilah ke sana dan belilah gandum di sana untuk kita, supaya kita tetap hidup dan jangan mati.\"',NULL),(3311,'PERJANJIAN LAMA','KEJADIAN',42,NULL,3,'Lalu pergilah sepuluh orang saudara Yusuf untuk membeli gandum di Mesir.',NULL),(3312,'PERJANJIAN LAMA','KEJADIAN',42,NULL,4,'Tetapi Yakub tidak membiarkan Benyamin, adik Yusuf, pergi bersama-sama dengan saudara-saudaranya, sebab pikirnya: \"Jangan-jangan ia ditimpa kecelakaan nanti.\"',NULL),(3313,'PERJANJIAN LAMA','KEJADIAN',42,NULL,5,'Jadi di antara orang yang datang membeli gandum terdapatlah juga anak-anak Israel, sebab ada kelaparan di tanah Kanaan.',NULL),(3314,'PERJANJIAN LAMA','KEJADIAN',42,NULL,6,'Sementara itu Yusuf telah menjadi mangkubumi di negeri itu; dialah yang menjual gandum kepada seluruh rakyat negeri itu. Jadi ketika saudara-saudara Yusuf datang, kepadanyalah mereka menghadap dan sujud dengan mukanya sampai ke tanah.',NULL),(3315,'PERJANJIAN LAMA','KEJADIAN',42,NULL,7,'Ketika Yusuf melihat saudara-saudaranya, segeralah mereka dikenalnya, tetapi ia berlaku seolah-olah ia seorang asing kepada mereka; ia menegor mereka dengan membentak, katanya: \"Dari mana kamu?\" Jawab mereka: \"Dari tanah Kanaan untuk membeli bahan makanan',NULL),(3316,'PERJANJIAN LAMA','KEJADIAN',42,NULL,8,'Memang Yusuf mengenal saudara-saudaranya itu, tetapi dia tidak dikenal mereka.',NULL),(3317,'PERJANJIAN LAMA','KEJADIAN',42,NULL,9,'Lalu teringatlah Yusuf akan mimpi-mimpinya tentang mereka. Berkatalah ia kepada mereka: \"Kamu ini pengintai, kamu datang untuk melihat-lihat di mana negeri ini tidak dijaga.\"',NULL),(3318,'PERJANJIAN LAMA','KEJADIAN',42,NULL,10,'Tetapi jawab mereka: \"Tidak tuanku! Hanyalah untuk membeli bahan makanan hamba-hambamu ini datang.',NULL),(3319,'PERJANJIAN LAMA','KEJADIAN',42,NULL,11,'Kami ini sekalian anak dari satu ayah; kami ini orang jujur; hamba-hambamu ini bukanlah pengintai.\"',NULL),(3320,'PERJANJIAN LAMA','KEJADIAN',42,NULL,12,'Tetapi ia berkata kepada mereka: \"Tidak! Kamu datang untuk melihat-lihat di mana negeri ini tidak dijaga.\"',NULL),(3321,'PERJANJIAN LAMA','KEJADIAN',42,NULL,13,'Lalu jawab mereka: \"Hamba-hambamu ini dua belas orang, kami bersaudara, anak dari satu ayah di tanah Kanaan, tetapi yang bungsu sekarang ada pada ayah kami, dan seorang sudah tidak ada lagi.\"',NULL),(3322,'PERJANJIAN LAMA','KEJADIAN',42,NULL,14,'Lalu kata Yusuf kepada mereka: \"Sudahlah! Seperti telah kukatakan kepadamu tadi: kamu ini pengintai.',NULL),(3323,'PERJANJIAN LAMA','KEJADIAN',42,NULL,15,'Dalam hal ini juga kamu harus diuji: demi hidup Firaun, kamu tidak akan pergi dari sini, jika saudaramu yang bungsu itu tidak datang ke mari.',NULL),(3324,'PERJANJIAN LAMA','KEJADIAN',42,NULL,16,'Suruhlah seorang dari padamu untuk menjemput adikmu itu, tetapi kamu ini harus tinggal terkurung di sini. Dengan demikian perkataanmu dapat diuji, apakah benar, dan jika tidak, demi hidup Firaun, sungguh-sungguhlah kamu ini pengintai.\"',NULL),(3325,'PERJANJIAN LAMA','KEJADIAN',42,NULL,17,'Dan dimasukkannyalah mereka bersama-sama ke dalam tahanan tiga hari lamanya.',NULL),(3326,'PERJANJIAN LAMA','KEJADIAN',42,NULL,18,'Pada hari yang ketiga berkatalah Yusuf kepada mereka: \"Buatlah begini, maka kamu akan tetap hidup, aku takut akan Allah.',NULL),(3327,'PERJANJIAN LAMA','KEJADIAN',42,NULL,19,'Jika kamu orang jujur, biarkanlah dari kamu bersaudara tinggal seorang terkurung dalam rumah tahanan, tetapi pergilah kamu, bawalah gandum untuk meredakan lapar seisi rumahmu.',NULL),(3328,'PERJANJIAN LAMA','KEJADIAN',42,NULL,20,'Tetapi saudaramu yang bungsu itu haruslah kamu bawa kepadaku, supaya perkataanmu itu ternyata benar dan kamu jangan mati.\" Demikianlah diperbuat mereka.',NULL),(3329,'PERJANJIAN LAMA','KEJADIAN',42,NULL,21,'Mereka berkata seorang kepada yang lain: \"Betul-betullah kita menanggung akibat dosa kita terhadap adik kita itu: bukankah kita melihat bagaimana sesak hatinya, ketika ia memohon belas kasihan kepada kita, tetapi kita tidak mendengarkan permohonannya. Itu',NULL),(3330,'PERJANJIAN LAMA','KEJADIAN',42,NULL,22,'Lalu Ruben menjawab mereka: \"Bukankah dahulu kukatakan kepadamu: Janganlah kamu berbuat dosa terhadap anak itu! Tetapi kamu tidak mendengarkan perkataanku. Sekarang darahnya dituntut dari pada kita.\"',NULL),(3331,'PERJANJIAN LAMA','KEJADIAN',42,NULL,23,'Tetapi mereka tidak tahu, bahwa Yusuf mengerti perkataan mereka, sebab mereka memakai seorang juru bahasa.',NULL),(3332,'PERJANJIAN LAMA','KEJADIAN',42,NULL,24,'Maka Yusuf mengundurkan diri dari mereka, lalu menangis. Kemudian ia kembali kepada mereka dan berkata-kata dengan mereka; ia mengambil Simeon dari antara mereka; lalu disuruh belenggu di depan mata mereka.',NULL),(3333,'PERJANJIAN LAMA','KEJADIAN',42,NULL,25,'Sesudah itu Yusuf memerintahkan, bahwa tempat gandum mereka akan diisi dengan gandum dan bahwa uang mereka masing-masing akan dikembalikan ke dalam karungnya, serta bekal mereka di jalan akan diberikan kepada mereka. Demikianlah dilakukan orang kepada mer',NULL),(3334,'PERJANJIAN LAMA','KEJADIAN',42,NULL,26,'Sesudah itu merekapun memuat gandum itu ke atas keledai mereka, lalu berangkat dari situ.',NULL),(3335,'PERJANJIAN LAMA','KEJADIAN',42,NULL,27,'Ketika seorang membuka karungnya untuk memberi makan keledainya di tempat bermalam, dilihatnyalah uangnya ada di dalam mulut karungnya.',NULL),(3336,'PERJANJIAN LAMA','KEJADIAN',42,NULL,28,'Katanya kepada saudara-saudaranya: \"Uangku dikembalikan; lihat, ada dalam karungku!\" Lalu hati mereka menjadi tawar dan mereka berpandang-pandangan dengan gemetar serta berkata: \"Apakah juga yang diperbuat Allah terhadap kita!\"',NULL),(3337,'PERJANJIAN LAMA','KEJADIAN',42,NULL,29,'Ketika mereka sampai kepada Yakub, ayah mereka, di tanah Kanaan, mereka menceritakan segala sesuatu yang dialaminya, katanya:',NULL),(3338,'PERJANJIAN LAMA','KEJADIAN',42,NULL,30,'\"Orang itu, yakni yang menjadi tuan atas negeri itu, telah menegor kami dengan membentak dan memperlakukan kami sebagai pengintai negeri itu.',NULL),(3339,'PERJANJIAN LAMA','KEJADIAN',42,NULL,31,'Tetapi kata kami kepadanya: Kami orang jujur, kami bukan pengintai.',NULL),(3340,'PERJANJIAN LAMA','KEJADIAN',42,NULL,32,'Kami dua belas orang bersaudara, anak-anak ayah kami; seorang sudah tidak ada lagi, dan yang bungsu ada sekarang pada ayah kami, di tanah Kanaan.',NULL),(3341,'PERJANJIAN LAMA','KEJADIAN',42,NULL,33,'Lalu kata orang itu, yakni yang menjadi tuan atas negeri itu, kepada kami: Dari hal ini aku akan tahu, apakah kamu orang jujur: dari kamu bersaudara haruslah kamu tinggalkan seorang padaku; kemudian bawalah gandum untuk meredakan lapar seisi rumahmu dan p',NULL),(3342,'PERJANJIAN LAMA','KEJADIAN',42,NULL,34,'lalu bawalah kepadaku saudaramu yang bungsu itu, maka aku akan tahu, bahwa kamu bukan pengintai, tetapi orang jujur; dan aku akan mengembalikan saudaramu itu kepadamu, dan bolehlah kamu menjalani negeri ini dengan bebas.\"',NULL),(3343,'PERJANJIAN LAMA','KEJADIAN',42,NULL,35,'Ketika mereka mengosongkan karungnya, tampaklah ada pundi-pundi uang masing-masing dalam karungnya; dan ketika mereka beserta ayah mereka melihat pundi-pundi uang itu, ketakutanlah mereka',NULL),(3344,'PERJANJIAN LAMA','KEJADIAN',42,NULL,36,'Dan Yakub, ayah mereka, berkata kepadanya: \"Kamu membuat aku kehilangan anak-anakku: Yusuf tidak ada lagi, dan Simeon tidak ada lagi, sekarang Benyaminpun hendak kamu bawa juga. Aku inilah yang menanggung segala-galanya itu!\"',NULL),(3345,'PERJANJIAN LAMA','KEJADIAN',42,NULL,37,'Lalu berkatalah Ruben kepada ayahnya: \"Kedua anakku laki-laki boleh engkau bunuh, jika ia tidak kubawa kepadamu; serahkanlah dia ke dalam tanganku, maka dia akan kubawa kembali kepadamu.\"',NULL),(3346,'PERJANJIAN LAMA','KEJADIAN',42,NULL,38,'Tetapi jawabnya: \"Anakku itu tidak akan pergi ke sana bersama-sama dengan kamu, sebab kakaknya telah mati dan hanya dialah yang tinggal; jika dia ditimpa kecelakaan di jalan yang akan kamu tempuh, maka tentulah kamu akan menyebabkan aku yang ubanan ini tu',NULL),(3347,'PERJANJIAN LAMA','KEJADIAN',43,'Saudara-saudara Yusuf pergi ke Mesir untuk kedua kalinya',1,'Tetapi hebat sekali kelaparan di negeri itu.',NULL),(3348,'PERJANJIAN LAMA','KEJADIAN',43,NULL,2,'Dan setelah gandum yang dibawa mereka dari Mesir habis dimakan, berkatalah ayah mereka: \"Pergilah pula membeli sedikit bahan makanan untuk kita.\"',NULL),(3349,'PERJANJIAN LAMA','KEJADIAN',43,NULL,3,'Lalu Yehuda menjawabnya: \"Orang itu telah memperingatkan kami dengan sungguh-sungguh: Kamu tidak boleh melihat mukaku, jika adikmu itu tidak ada bersama-sama dengan kamu.',NULL),(3350,'PERJANJIAN LAMA','KEJADIAN',43,NULL,4,'Jika engkau mau membiarkan adik kami pergi bersama-sama dengan kami, maka kami mau pergi ke sana dan membeli bahan makanan bagimu.',NULL),(3351,'PERJANJIAN LAMA','KEJADIAN',43,NULL,5,'Tetapi jika engkau tidak mau membiarkan dia pergi, maka kami tidak akan pergi ke sana, sebab orang itu telah berkata kepada kami: Kamu tidak boleh melihat mukaku, jika adikmu itu tidak ada bersama-sama dengan kamu.\"',NULL),(3352,'PERJANJIAN LAMA','KEJADIAN',43,NULL,6,'Lalu berkatalah Israel: \"Mengapa kamu mendatangkan malapetaka kepadaku dengan memberitahukan kepada orang itu, bahwa masih ada adikmu seorang?\"',NULL),(3353,'PERJANJIAN LAMA','KEJADIAN',43,NULL,7,'Jawab mereka: \"Orang itu telah menanyai kami dengan seksama tentang kami sendiri dan tentang sanak saudara kita: Masih hidupkah ayahmu? Adakah adikmu lagi? Dan kami telah memberitahukan semuanya kepadanya seperti yang sebenarnya. Bagaimana kami dapat mend',NULL),(3354,'PERJANJIAN LAMA','KEJADIAN',43,NULL,8,'Lalu berkatalah Yehuda kepada Israel, ayahnya: \"Biarkanlah anak itu pergi bersama-sama dengan aku; maka kami akan bersiap dan pergi, supaya kita tetap hidup dan jangan mati, baik kami maupun engkau dan anak-anak kami.',NULL),(3355,'PERJANJIAN LAMA','KEJADIAN',43,NULL,9,'Akulah yang menanggung dia; engkau boleh menuntut dia dari padaku; jika aku tidak membawa dia kepadamu dan menempatkan dia di depanmu, maka akulah yang berdosa terhadap engkau untuk selama-lamanya.',NULL),(3356,'PERJANJIAN LAMA','KEJADIAN',43,NULL,10,'Jika kita tidak berlambat-lambat, maka tentulah kami sekarang sudah dua kali pulang.\"',NULL),(3357,'PERJANJIAN LAMA','KEJADIAN',43,NULL,11,'Lalu Israel, ayah mereka, berkata kepadanya: \"Jika demikian, perbuatlah begini: Ambillah hasil yang terbaik dari negeri ini dalam tempat gandummu dan bawalah kepada orang itu sebagai persembahan: sedikit balsam dan sedikit madu, damar dan damar ladan, bua',NULL),(3358,'PERJANJIAN LAMA','KEJADIAN',43,NULL,12,'Dan bawalah uang dua kali lipat banyaknya: uang yang telah dikembalikan ke dalam mulut karung-karungmu itu haruslah kamu bawa kembali; mungkin itu suatu kekhilafan.',NULL),(3359,'PERJANJIAN LAMA','KEJADIAN',43,NULL,13,'juga adikmu itu, bersiaplah dan kembalilah pula kepada orang itu.',NULL),(3360,'PERJANJIAN LAMA','KEJADIAN',43,NULL,14,'Allah Yang Mahakuasa kiranya membuat orang itu menaruh belas kasihan kepadamu, supaya ia membiarkan saudaramu yang lain itu beserta Benyamin kembali. Mengenai aku ini, jika terpaksa aku kehilangan anak-anakku, biarlah juga kehilangan!\"',NULL),(3361,'PERJANJIAN LAMA','KEJADIAN',43,NULL,15,'Lalu orang-orang itu mengambil persembahan itu dan mengambil uang dua kali lipat banyaknya, beserta Benyamin juga; mereka bersiap dan pergi ke Mesir. Kemudian berdirilah mereka di depan Yusuf.',NULL),(3362,'PERJANJIAN LAMA','KEJADIAN',43,NULL,16,'Ketika Yusuf melihat Benyamin bersama-sama dengan mereka, berkatalah ia kepada kepala rumahnya: \"Bawalah orang-orang ini ke dalam rumah, sembelihlah seekor hewan dan siapkanlah itu, sebab orang-orang ini akan makan bersama-sama dengan aku pada tengah hari',NULL),(3363,'PERJANJIAN LAMA','KEJADIAN',43,NULL,17,'Orang itu melakukan seperti yang dikatakan Yusuf dan dibawanyalah orang-orang itu ke dalam rumah Yusuf.',NULL),(3364,'PERJANJIAN LAMA','KEJADIAN',43,NULL,18,'Lalu ketakutanlah orang-orang itu, karena mereka dibawa ke dalam rumah Yusuf. Kata mereka: \"Yang menjadi sebab kita dibawa ke sini, ialah perkara uang yang dikembalikan ke dalam karung kita pada mulanya itu, supaya kita disergap dan ditangkap dan supaya k',NULL),(3365,'PERJANJIAN LAMA','KEJADIAN',43,NULL,19,'Karena itu mereka mendekati kepala rumah Yusuf itu, dan berkata kepadanya di depan pintu rumah:',NULL),(3366,'PERJANJIAN LAMA','KEJADIAN',43,NULL,20,'\"Mohon bicara tuan! Kami dahulu datang ke mari untuk membeli bahan makanan,',NULL),(3367,'PERJANJIAN LAMA','KEJADIAN',43,NULL,21,'tetapi ketika kami sampai ke tempat bermalam dan membuka karung kami, tampaklah uang kami masing-masing dengan tidak kurang jumlahnya ada di dalam mulut karung. Tetapi sekarang kami membawanya kembali.',NULL),(3368,'PERJANJIAN LAMA','KEJADIAN',43,NULL,22,'Uang lain kami bawa juga ke mari untuk membeli bahan makanan; kami tidak tahu siapa yang menaruh uang kami itu ke dalam karung kami.\"',NULL),(3369,'PERJANJIAN LAMA','KEJADIAN',43,NULL,23,'Tetapi jawabnya: \"Tenang sajalah, jangan takut; Allahmu dan Allah bapamu telah memberikan kepadamu harta terpendam dalam karungmu; uangmu itu telah kuterima.\" Kemudian dikeluarkannyalah Simeon dan dibawanya kepada mereka.',NULL),(3370,'PERJANJIAN LAMA','KEJADIAN',43,NULL,24,'Setelah orang itu membawa mereka ke dalam rumah Yusuf, diberikannyalah air, supaya mereka membasuh kaki; juga keledai mereka diberinya makan.',NULL),(3371,'PERJANJIAN LAMA','KEJADIAN',43,NULL,25,'Sesudah itu mereka menyiapkan persembahannya menantikan Yusuf datang pada waktu tengah hari, sebab mereka telah mendengar, bahwa mereka akan makan di situ.',NULL),(3372,'PERJANJIAN LAMA','KEJADIAN',43,NULL,26,'Ketika Yusuf telah pulang, mereka membawa persembahan yang ada pada mereka itu kepada Yusuf di dalam rumah, lalu sujud kepadanya sampai ke tanah.',NULL),(3373,'PERJANJIAN LAMA','KEJADIAN',43,NULL,27,'Sesudah itu ia bertanya kepada mereka apakah mereka selamat; lagi katanya: \"Apakah ayahmu yang tua yang kamu sebutkan itu selamat? Masih hidupkah ia?\"',NULL),(3374,'PERJANJIAN LAMA','KEJADIAN',43,NULL,28,'Jawab mereka: \"Hambamu, ayah kami, ada selamat; ia masih hidup.\" Sesudah itu berlututlah mereka dan sujud.',NULL),(3375,'PERJANJIAN LAMA','KEJADIAN',43,NULL,29,'Ketika Yusuf memandang kepada mereka, dilihatnyalah Benyamin, adiknya, yang seibu dengan dia, lalu katanya: \"Inikah adikmu yang bungsu itu, yang telah kamu sebut-sebut kepadaku?\" Lagi katanya: \"Allah kiranya memberikan kasih karunia kepadamu, anakku!\"',NULL),(3376,'PERJANJIAN LAMA','KEJADIAN',43,NULL,30,'Lalu segeralah Yusuf pergi dari situ, sebab hatinya sangat terharu merindukan adiknya itu, dan dicarinyalah tempat untuk menangis; ia masuk ke dalam kamar, lalu menangis di situ.',NULL),(3377,'PERJANJIAN LAMA','KEJADIAN',43,NULL,31,'Sesudah itu dibasuhnyalah mukanya dan ia tampil ke luar. Ia menahan hatinya dan berkata: \"Hidangkanlah makanan.\"',NULL),(3378,'PERJANJIAN LAMA','KEJADIAN',43,NULL,32,'Lalu dihidangkanlah makanan, bagi Yusuf tersendiri, bagi saudara-saudaranya tersendiri dan bagi orang-orang Mesir yang bersama-sama makan dengan mereka itu tersendiri; sebab orang Mesir tidak boleh makan bersama-sama dengan orang Ibrani, karena hal itu su',NULL),(3379,'PERJANJIAN LAMA','KEJADIAN',43,NULL,33,'Saudara-saudaranya itu duduk di depan Yusuf, dari yang sulung sampai yang bungsu, sehingga mereka berpandang-pandangan dengan heran.',NULL),(3380,'PERJANJIAN LAMA','KEJADIAN',43,NULL,34,'Lalu disajikan kepada mereka hidangan dari meja Yusuf, tetapi yang diterima Benyamin adalah lima kali lebih banyak dari pada setiap orang yang lain. Lalu minumlah mereka dan bersukaria bersama-sama dengan dia.',NULL),(3381,'PERJANJIAN LAMA','KEJADIAN',44,'Piala Yusuf hilang dan didapati',1,'Sesudah itu diperintahkannyalah kepada kepala rumahnya: \"Isilah karung orang-orang itu dengan gandum, seberapa yang dapat dibawa mereka, dan letakkanlah uang masing-masing di dalam mulut karungnya.',NULL),(3382,'PERJANJIAN LAMA','KEJADIAN',44,NULL,2,'Dan pialaku, piala perak itu, taruhlah di dalam mulut karung anak yang bungsu serta uang pembayar gandumnya juga.\" Maka diperbuatnyalah seperti yang dikatakan Yusuf.',NULL),(3383,'PERJANJIAN LAMA','KEJADIAN',44,NULL,3,'Ketika paginya hari terang tanah, orang melepas mereka beserta keledai mereka.',NULL),(3384,'PERJANJIAN LAMA','KEJADIAN',44,NULL,4,'Tetapi baru saja mereka keluar dari kota itu, belum lagi jauh jaraknya, berkatalah Yusuf kepada kepala rumahnya: \"Bersiaplah, kejarlah orang-orang itu, dan apabila engkau sampai kepada mereka, katakanlah kepada mereka: Mengapa kamu membalas yang baik deng',NULL),(3385,'PERJANJIAN LAMA','KEJADIAN',44,NULL,5,'Bukankah ini piala yang dipakai tuanku untuk minum dan yang biasa dipakainya untuk menelaah? Kamu berbuat jahat dengan melakukan yang demikian.\"',NULL),(3386,'PERJANJIAN LAMA','KEJADIAN',44,NULL,6,'Ketika sampai kepada mereka, diberitakannyalah kepada mereka perkataan Yusuf itu.',NULL),(3387,'PERJANJIAN LAMA','KEJADIAN',44,NULL,7,'Jawab mereka kepadanya: \"Mengapa tuanku mengatakan perkataan yang demikian? Jauhlah dari pada hamba-hambamu ini untuk berbuat begitu!',NULL),(3388,'PERJANJIAN LAMA','KEJADIAN',44,NULL,8,'Bukankah uang yang kami dapati di dalam mulut karung kami telah kami bawa kembali kepadamu dari tanah Kanaan? Masakan kami mencuri emas atau perak dari rumah tuanmu?',NULL),(3389,'PERJANJIAN LAMA','KEJADIAN',44,NULL,9,'Pada siapa dari hamba-hambamu ini kedapatan piala itu, biarlah ia mati, juga kami ini akan menjadi budak tuanku.\"',NULL),(3390,'PERJANJIAN LAMA','KEJADIAN',44,NULL,10,'Sesudah itu berkatalah ia: \"Ya, usulmu itu baik; tetapi pada siapa kedapatan piala itu, hanya dialah yang akan menjadi budakku dan kamu yang lain itu akan bebas dari salah.\"',NULL),(3391,'PERJANJIAN LAMA','KEJADIAN',44,NULL,11,'Lalu segeralah mereka masing-masing menurunkan karungnya ke tanah dan masing-masing membuka karungnya.',NULL),(3392,'PERJANJIAN LAMA','KEJADIAN',44,NULL,12,'Dan kepala rumah itu memeriksanya dengan teliti; ia mulai dengan yang sulung sampai kepada yang bungsu; maka kedapatanlah piala itu dalam karung Benyamin.',NULL),(3393,'PERJANJIAN LAMA','KEJADIAN',44,NULL,13,'Lalu mereka mengoyakkan jubahnya dan masing-masing memuati keledainya, dan mereka kembali ke kota.',NULL),(3394,'PERJANJIAN LAMA','KEJADIAN',44,NULL,14,'Ketika Yehuda dan saudara-saudaranya sampai ke dalam rumah Yusuf, Yusuf masih ada di situ, sujudlah mereka sampai ke tanah di depannya.',NULL),(3395,'PERJANJIAN LAMA','KEJADIAN',44,NULL,15,'Berkatalah Yusuf kepada mereka: \"Perbuatan apakah yang kamu lakukan ini? Tidakkah kamu tahu, bahwa seorang yang seperti aku ini pasti dapat menelaah?\"',NULL),(3396,'PERJANJIAN LAMA','KEJADIAN',44,NULL,16,'Sesudah itu berkatalah Yehuda: \"Apakah yang akan kami katakan kepada tuanku, apakah yang akan kami jawab, dan dengan apakah kami akan membenarkan diri kami? Allah telah memperlihatkan kesalahan hamba-hambamu ini. Maka kami ini, budak tuankulah kami, baik ',NULL),(3397,'PERJANJIAN LAMA','KEJADIAN',44,NULL,17,'Tetapi jawabnya: \"Jauhlah dari padaku untuk berbuat demikian! Pada siapa kedapatan piala itu, dialah yang akan menjadi budakku, tetapi kamu ini, pergilah kembali dengan selamat kepada ayahmu.\"',NULL),(3398,'PERJANJIAN LAMA','KEJADIAN',44,'Yehuda membela Benyamin',18,'Lalu tampillah Yehuda mendekatinya dan berkata: \"Mohon bicara tuanku, izinkanlah kiranya hambamu ini mengucapkan sepatah kata kepada tuanku dan janganlah kiranya bangkit amarahmu terhadap hambamu ini, sebab tuanku adalah seperti Firaun sendiri.',NULL),(3399,'PERJANJIAN LAMA','KEJADIAN',44,NULL,19,'Tuanku telah bertanya kepada hamba-hambanya ini: Masih adakah ayah atau saudara kamu?',NULL),(3400,'PERJANJIAN LAMA','KEJADIAN',44,NULL,20,'Dan kami menjawab tuanku: Kami masih mempunyai ayah yang tua dan masih ada anaknya yang muda, yang lahir pada masa tuanya; kakaknya telah mati, hanya dia sendirilah yang tinggal dari mereka yang seibu, sebab itu ayahnya sangat mengasihi dia.',NULL),(3401,'PERJANJIAN LAMA','KEJADIAN',44,NULL,21,'Lalu tuanku berkata kepada hamba-hambamu ini: Bawalah dia ke mari kepadaku, supaya mataku memandang dia.',NULL),(3402,'PERJANJIAN LAMA','KEJADIAN',44,NULL,22,'tetapi jawab kami kepada tuanku: Anak itu tidak dapat meninggalkan ayahnya, sebab jika ia meninggalkan ayahnya, tentulah ayah ini mati.',NULL),(3403,'PERJANJIAN LAMA','KEJADIAN',44,NULL,23,'Kemudian tuanku berkata kepada hamba-hambamu ini: Jika adikmu yang bungsu itu tidak datang ke mari bersama-sama dengan kamu, kamu tidak boleh melihat mukaku lagi.',NULL),(3404,'PERJANJIAN LAMA','KEJADIAN',44,NULL,24,'Setelah kami kembali kepada hambamu, ayahku, maka kami memberitahukan kepadanya perkataan tuanku itu.',NULL),(3405,'PERJANJIAN LAMA','KEJADIAN',44,NULL,25,'Kemudian ayah kami berkata: Kembalilah kamu membeli sedikit bahan makanan bagi kita.',NULL),(3406,'PERJANJIAN LAMA','KEJADIAN',44,NULL,26,'Tetapi jawab kami: Kami tidak dapat pergi ke sana. Jika adik kami yang bungsu bersama-sama dengan kami, barulah kami akan pergi ke sana, sebab kami tidak boleh melihat muka orang itu, apabila adik kami yang bungsu tidak bersama-sama dengan kami.',NULL),(3407,'PERJANJIAN LAMA','KEJADIAN',44,NULL,27,'Kemudian berkatalah hambamu, ayahku, kepada kami: Kamu tahu, bahwa isteriku telah melahirkan dua orang anak bagiku;',NULL),(3408,'PERJANJIAN LAMA','KEJADIAN',44,NULL,28,'yang seorang telah pergi dari padaku, dan aku telah berkata: Tentulah ia diterkam oleh binatang buas, dan sampai sekarang aku tidak melihat dia kembali.',NULL),(3409,'PERJANJIAN LAMA','KEJADIAN',44,NULL,29,'Jika anak ini kamu ambil pula dari padaku, dan ia ditimpa kecelakaan, maka tentulah kamu akan menyebabkan aku yang ubanan ini turun ke dunia orang mati karena nasib celaka.',NULL),(3410,'PERJANJIAN LAMA','KEJADIAN',44,NULL,30,'Maka sekarang, apabila aku datang kepada hambamu, ayahku, dan tidak ada bersama-sama dengan kami anak itu, padahal ayahku tidak dapat hidup tanpa dia,',NULL),(3411,'PERJANJIAN LAMA','KEJADIAN',44,NULL,31,'tentulah akan terjadi, apabila dilihatnya anak itu tidak ada, bahwa ia akan mati, dan hamba-hambamu ini akan menyebabkan hambamu, ayah kami yang ubanan itu, turun ke dunia orang mati karena dukacita.',NULL),(3412,'PERJANJIAN LAMA','KEJADIAN',44,NULL,32,'Tetapi hambamu ini telah menanggung anak itu terhadap ayahku dengan perkataan: Jika aku tidak membawanya kembali kepada bapa, maka akulah yang berdosa kepada bapa untuk selama-lamanya.',NULL),(3413,'PERJANJIAN LAMA','KEJADIAN',44,NULL,33,'Oleh sebab itu, baiklah hambamu ini tinggal menjadi budak tuanku menggantikan anak itu, dan biarlah anak itu pulang bersama-sama dengan saudara-saudaranya.',NULL),(3414,'PERJANJIAN LAMA','KEJADIAN',44,NULL,34,'Sebab masakan aku pulang kepada ayahku, apabila anak itu tidak bersama-sama dengan aku? Aku tidak akan sanggup melihat nasib celaka yang akan menimpa ayahku.\"',NULL),(3415,'PERJANJIAN LAMA','KEJADIAN',45,NULL,1,'Ketika itu Yusuf tidak dapat menahan hatinya lagi di depan semua orang yang berdiri di dekatnya, lalu berserulah ia: \"Suruhlah keluar semua orang dari sini.\" Maka tidak ada seorangpun yang tinggal di situ bersama-sama Yusuf, ketika ia memperkenalkan dirin',NULL),(3416,'PERJANJIAN LAMA','KEJADIAN',45,NULL,2,'Setelah itu menangislah ia keras-keras, sehingga kedengaran kepada orang Mesir dan kepada seisi istana Firaun.',NULL),(3417,'PERJANJIAN LAMA','KEJADIAN',45,NULL,3,'Dan Yusuf berkata kepada saudara-saudaranya: \"Akulah Yusuf! Masih hidupkah bapa?\" Tetapi saudara-saudaranya tidak dapat menjawabnya, sebab mereka takut dan gemetar menghadapi dia.',NULL),(3418,'PERJANJIAN LAMA','KEJADIAN',45,NULL,4,'Lalu kata Yusuf kepada saudara-saudaranya itu: \"Marilah dekat-dekat.\" Maka mendekatlah mereka. Katanya lagi: \"Akulah Yusuf, saudaramu, yang kamu jual ke Mesir.',NULL),(3419,'PERJANJIAN LAMA','KEJADIAN',45,NULL,5,'Tetapi sekarang, janganlah bersusah hati dan janganlah menyesali diri, karena kamu menjual aku ke sini, sebab untuk memelihara kehidupanlah Allah menyuruh aku mendahului kamu.',NULL),(3420,'PERJANJIAN LAMA','KEJADIAN',45,NULL,6,'Karena telah dua tahun ada kelaparan dalam negeri ini dan selama lima tahun lagi orang tidak akan membajak atau menuai.',NULL),(3421,'PERJANJIAN LAMA','KEJADIAN',45,NULL,7,'Maka Allah telah menyuruh aku mendahului kamu untuk menjamin kelanjutan keturunanmu di bumi ini dan untuk memelihara hidupmu, sehingga sebagian besar dari padamu tertolong.',NULL),(3422,'PERJANJIAN LAMA','KEJADIAN',45,NULL,8,'Jadi bukanlah kamu yang menyuruh aku ke sini, tetapi Allah; Dialah yang telah menempatkan aku sebagai bapa bagi Firaun dan tuan atas seluruh istananya dan sebagai kuasa atas seluruh tanah Mesir.',NULL),(3423,'PERJANJIAN LAMA','KEJADIAN',45,NULL,9,'Segeralah kamu kembali kepada bapa dan katakanlah kepadanya: Beginilah kata Yusuf, anakmu: Allah telah menempatkan aku sebagai tuan atas seluruh Mesir; datanglah mendapatkan aku, janganlah tunggu-tunggu.',NULL),(3424,'PERJANJIAN LAMA','KEJADIAN',45,NULL,10,'Engkau akan tinggal di tanah Gosyen dan akan dekat kepadaku, engkau serta anak dan cucumu, kambing domba dan lembu sapimu dan segala milikmu.',NULL),(3425,'PERJANJIAN LAMA','KEJADIAN',45,NULL,11,'Di sanalah aku memelihara engkau--sebab kelaparan ini masih ada lima tahun lagi--supaya engkau jangan jatuh miskin bersama seisi rumahmu dan semua orang yang ikut serta dengan engkau.',NULL),(3426,'PERJANJIAN LAMA','KEJADIAN',45,NULL,12,'Dan kamu telah melihat dengan mata sendiri, dan saudaraku Benyamin juga, bahwa mulutku sendiri mengatakannya kepadamu.',NULL),(3427,'PERJANJIAN LAMA','KEJADIAN',45,NULL,13,'Sebab itu ceritakanlah kepada bapa segala kemuliaanku di negeri Mesir ini, dan segala yang telah kamu lihat, kemudian segeralah bawa bapa ke mari.\"',NULL),(3428,'PERJANJIAN LAMA','KEJADIAN',45,NULL,14,'Lalu dipeluknyalah leher Benyamin, adiknya itu, dan menangislah ia, dan menangis pulalah Benyamin pada bahu Yusuf.',NULL),(3429,'PERJANJIAN LAMA','KEJADIAN',45,NULL,15,'Yusuf mencium semua saudaranya itu dengan mesra dan ia menangis sambil memeluk mereka. Sesudah itu barulah saudara-saudaranya bercakap-cakap dengan dia.',NULL),(3430,'PERJANJIAN LAMA','KEJADIAN',45,NULL,16,'Ketika dalam istana Firaun terdengar kabar, bahwa saudara-saudara Yusuf datang, hal itu diterima dengan baik oleh Firaun dan pegawai-pegawainya.',NULL),(3431,'PERJANJIAN LAMA','KEJADIAN',45,NULL,17,'Lalu berkatalah Firaun kepada Yusuf: \"Katakanlah kepada saudara-saudaramu Buatlah begini: muatilah binatang-binatangmu dan pergilah ke tanah Kanaan,',NULL),(3432,'PERJANJIAN LAMA','KEJADIAN',45,NULL,18,'jemputlah ayahmu dan seisi rumahmu dan datanglah mendapatkan aku, maka aku akan memberikan kepadamu apa yang paling baik di tanah Mesir, sehingga kamu akan mengecap kesuburan tanah ini.',NULL),(3433,'PERJANJIAN LAMA','KEJADIAN',45,NULL,19,'Selanjutnya engkau mendapat perintah mengatakan kepada mereka: Buatlah begini: bawalah kereta dari tanah Mesir untuk anak-anakmu dan isteri-isterimu, jemputlah ayahmu dari sana dan datanglah ke mari.',NULL),(3434,'PERJANJIAN LAMA','KEJADIAN',45,NULL,20,'Janganlah kamu merasa sayang meninggalkan barang-barangmu, sebab apa yang paling baik di seluruh tanah Mesir ini adalah milikmu.\"',NULL),(3435,'PERJANJIAN LAMA','KEJADIAN',45,NULL,21,'Demikianlah dilakukan oleh anak-anak Israel itu. Yusuf memberikan kereta kepada mereka menurut perintah Firaun; juga diberikan kepada mereka bekal di jalan.',NULL),(3436,'PERJANJIAN LAMA','KEJADIAN',45,NULL,22,'Kepada mereka masing-masing diberikannya sepotong pesalin dan kepada Benyamin diberikannya tiga ratus uang perak dan lima potong pesalin.',NULL),(3437,'PERJANJIAN LAMA','KEJADIAN',45,NULL,23,'Di samping itu kepada ayahnya dikirimkannya sepuluh ekor keledai jantan, dimuati dengan apa yang paling baik di Mesir, lagipula sepuluh ekor keledai betina, dimuati dengan gandum dan roti dan makanan untuk ayahnya dalam perjalanan.',NULL),(3438,'PERJANJIAN LAMA','KEJADIAN',45,NULL,24,'Kemudian ia melepas saudara-saudaranya serta berkata kepada mereka: \"Janganlah berbantah-bantah di jalan.\"',NULL),(3439,'PERJANJIAN LAMA','KEJADIAN',45,NULL,25,'Demikianlah mereka pergi dari tanah Mesir dan sampai di tanah Kanaan, kepada Yakub, ayah mereka.',NULL),(3440,'PERJANJIAN LAMA','KEJADIAN',45,NULL,26,'Mereka menceritakan kepadanya: \"Yusuf masih hidup, bahkan dialah yang menjadi kuasa atas seluruh tanah Mesir.\" Tetapi hati Yakub tetap dingin, sebab ia tidak dapat mempercayai mereka.',NULL),(3441,'PERJANJIAN LAMA','KEJADIAN',45,NULL,27,'Tetapi ketika mereka menyampaikan kepadanya segala perkataan yang diucapkan Yusuf, dan ketika dilihatnya kereta yang dikirim oleh Yusuf untuk menjemputnya, maka bangkitlah kembali semangat Yakub, ayah mereka itu.',NULL),(3442,'PERJANJIAN LAMA','KEJADIAN',45,NULL,28,'Kata Yakub: \"Cukuplah itu; anakku Yusuf masih hidup; aku mau pergi melihatnya, sebelum aku mati.\"',NULL),(3443,'PERJANJIAN LAMA','KEJADIAN',46,'Yakub pindah ke Mesir',1,'Jadi berangkatlah Israel dengan segala miliknya dan ia tiba di Bersyeba, lalu dipersembahkannya korban sembelihan kepada Allah Ishak ayahnya.',NULL),(3444,'PERJANJIAN LAMA','KEJADIAN',46,NULL,2,'Berfirmanlah Allah kepada Israel dalam penglihatan waktu malam: \"Yakub, Yakub!\" Sahutnya: \"Ya, Tuhan.\"',NULL),(3445,'PERJANJIAN LAMA','KEJADIAN',46,NULL,3,'Lalu firman-Nya: \"Akulah Allah, Allah ayahmu, janganlah takut pergi ke Mesir, sebab Aku akan membuat engkau menjadi bangsa yang besar di sana.',NULL),(3446,'PERJANJIAN LAMA','KEJADIAN',46,NULL,4,'Aku sendiri akan menyertai engkau pergi ke Mesir dan tentulah Aku juga akan membawa engkau kembali; dan tangan Yusuflah yang akan mengatupkan kelopak matamu nanti.\"',NULL),(3447,'PERJANJIAN LAMA','KEJADIAN',46,NULL,5,'Lalu berangkatlah Yakub dari Bersyeba, dan anak-anak Israel membawa Yakub, ayah mereka, beserta anak dan isteri mereka, dan mereka menaiki kereta yang dikirim Firaun untuk menjemputnya.',NULL),(3448,'PERJANJIAN LAMA','KEJADIAN',46,NULL,6,'Mereka membawa juga ternaknya dan harta bendanya, yang telah diperoleh mereka di tanah Kanaan, lalu tibalah mereka di Mesir, yakni Yakub dan seluruh keturunannya bersama-sama dengan dia.',NULL),(3449,'PERJANJIAN LAMA','KEJADIAN',46,NULL,7,'Anak-anak dan cucu-cucunya laki-laki dan perempuan, seluruh keturunannya dibawanyalah ke Mesir.',NULL),(3450,'PERJANJIAN LAMA','KEJADIAN',46,NULL,8,'Inilah nama-nama bani Israel yang datang ke Mesir, yakni Yakub beserta keturunannya. Anak sulung Yakub ialah Ruben.',NULL),(3451,'PERJANJIAN LAMA','KEJADIAN',46,NULL,9,'Anak-anak Ruben ialah Henokh, Palu, Hezron dan Karmi.',NULL),(3452,'PERJANJIAN LAMA','KEJADIAN',46,NULL,10,'Anak-anak Simeon ialah Yemuel, Yamin, Ohad, Yakhin dan Zohar serta Saul, anak seorang perempuan Kanaan.',NULL),(3453,'PERJANJIAN LAMA','KEJADIAN',46,NULL,11,'Anak-anak Lewi ialah Gerson, Kehat dan Merari.',NULL),(3454,'PERJANJIAN LAMA','KEJADIAN',46,NULL,12,'Anak-anak Yehuda ialah Er, Onan, Syela, Peres dan Zerah; tetapi Er dan Onan mati di tanah Kanaan; dan anak-anak Peres ialah Hezron dan Hamul.',NULL),(3455,'PERJANJIAN LAMA','KEJADIAN',46,NULL,13,'Anak-anak Isakhar ialah Tola, Pua, Ayub dan Simron.',NULL),(3456,'PERJANJIAN LAMA','KEJADIAN',46,NULL,14,'Anak-anak Zebulon ialah Sered, Elon dan Yahleel.',NULL),(3457,'PERJANJIAN LAMA','KEJADIAN',46,NULL,15,'Itulah keturunan Lea, yang melahirkan bagi Yakub di Padan-Aram anak-anak lelaki serta Dina juga, anaknya yang perempuan. Jadi seluruhnya, laki-laki dan perempuan, berjumlah tiga puluh tiga jiwa.',NULL),(3458,'PERJANJIAN LAMA','KEJADIAN',46,NULL,16,'Anak-anak Gad ialah Zifyon, Hagi, Syuni, Ezbon, Eri, Arodi dan Areli.',NULL),(3459,'PERJANJIAN LAMA','KEJADIAN',46,NULL,17,'Anak-anak Asyer ialah Yimna, Yiswa, Yiswi dan Beria; Serah ialah saudara perempuan mereka; dan anak-anak Beria ialah Heber dan Malkiel.',NULL),(3460,'PERJANJIAN LAMA','KEJADIAN',46,NULL,18,'Itulah keturunan Zilpa, yakni hamba perempuan yang telah diberikan Laban kepada Lea, anaknya perempuan, dan yang melahirkan anak-anak bagi Yakub; seluruhnya enam belas jiwa.',NULL),(3461,'PERJANJIAN LAMA','KEJADIAN',46,NULL,19,'Anak-anak Rahel, isteri Yakub, ialah Yusuf dan Benyamin.',NULL),(3462,'PERJANJIAN LAMA','KEJADIAN',46,NULL,20,'Bagi Yusuf lahir Manasye dan Efraim di tanah Mesir, yang dilahirkan baginya oleh Asnat, anak perempuan Potifera, imam di On.',NULL),(3463,'PERJANJIAN LAMA','KEJADIAN',46,NULL,21,'Anak-anak Benyamin ialah Bela, Bekher, Asybel, Gera, Naaman, Ehi, Rosh, Mupim, Hupim dan Ared.',NULL),(3464,'PERJANJIAN LAMA','KEJADIAN',46,NULL,22,'Itulah keturunan Rahel, yang telah lahir bagi Yakub, seluruhnya berjumlah empat belas jiwa.',NULL),(3465,'PERJANJIAN LAMA','KEJADIAN',46,NULL,23,'Anak Dan ialah Husim.',NULL),(3466,'PERJANJIAN LAMA','KEJADIAN',46,NULL,24,'Anak-anak Naftali ialah Yahzeel, Guni, Yezer dan Syilem.',NULL),(3467,'PERJANJIAN LAMA','KEJADIAN',46,NULL,25,'Itulah keturunan Bilha, yakni hamba perempuan yang diberikan Laban kepada Rahel, anaknya yang perempuan dan yang melahirkan anak-anak itu bagi Yakub--seluruhnya berjumlah tujuh jiwa.',NULL),(3468,'PERJANJIAN LAMA','KEJADIAN',46,NULL,26,'Semua orang yang tiba di Mesir bersama-sama dengan Yakub, yakni anak-anak kandungnya, dengan tidak terhitung isteri anak-anaknya, seluruhnya berjumlah enam puluh enam jiwa.',NULL),(3469,'PERJANJIAN LAMA','KEJADIAN',46,NULL,27,'Anak-anak Yusuf yang lahir baginya di Mesir ada dua orang. Jadi keluarga Yakub yang tiba di Mesir, seluruhnya berjumlah tujuh puluh jiwa.',NULL),(3470,'PERJANJIAN LAMA','KEJADIAN',46,NULL,28,'Yakub menyuruh Yehuda berjalan lebih dahulu mendapatkan Yusuf, supaya Yusuf datang ke Gosyen menemui ayahnya. Sementara itu sampailah mereka ke tanah Gosyen.',NULL),(3471,'PERJANJIAN LAMA','KEJADIAN',46,NULL,29,'Lalu Yusuf memasang keretanya dan pergi ke Gosyen, mendapatkan Israel, ayahnya. Ketika ia bertemu dengan dia, dipeluknyalah leher ayahnya dan lama menangis pada bahunya.',NULL),(3472,'PERJANJIAN LAMA','KEJADIAN',46,NULL,30,'Berkatalah Israel kepada Yusuf: \"Sekarang bolehlah aku mati, setelah aku melihat mukamu dan mengetahui bahwa engkau masih hidup.\"',NULL),(3473,'PERJANJIAN LAMA','KEJADIAN',46,NULL,31,'Kemudian berkatalah Yusuf kepada saudara-saudaranya dan kepada keluarga ayahnya itu: \"Aku mau menghadap Firaun dan memberitahukan kepadanya: Saudara-saudaraku dan keluarga ayahku, yang tinggal di tanah Kanaan, telah datang kepadaku;',NULL),(3474,'PERJANJIAN LAMA','KEJADIAN',46,NULL,32,'orang-orang itu gembala kambing domba, sebab mereka itu pemelihara ternak, dan kambing dombanya, lembu sapinya dan segala miliknya telah dibawa mereka.',NULL),(3475,'PERJANJIAN LAMA','KEJADIAN',46,NULL,33,'Apabila Firaun memanggil kamu dan bertanya: Apakah pekerjaanmu?',NULL),(3476,'PERJANJIAN LAMA','KEJADIAN',46,NULL,34,'maka jawablah: Hamba-hambamu ini pemelihara ternak, sejak dari kecil sampai sekarang, baik kami maupun nenek moyang kami--dengan maksud supaya kamu boleh diam di tanah Gosyen.\" --Sebab segala gembala kambing domba adalah suatu kekejian bagi orang Mesir.',NULL),(3477,'PERJANJIAN LAMA','KEJADIAN',47,'Yakub dan Firaun',1,'Kemudian pergilah Yusuf memberitahukan kepada Firaun: \"Ayahku dan saudara-saudaraku beserta kambing dombanya, lembu sapinya dan segala miliknya telah datang dari tanah Kanaan, dan sekarang mereka ada di tanah Gosyen.\"',NULL),(3478,'PERJANJIAN LAMA','KEJADIAN',47,NULL,2,'Dari antara saudara-saudaranya itu dibawanya lima orang menghadap Firaun.',NULL),(3479,'PERJANJIAN LAMA','KEJADIAN',47,NULL,3,'Firaun bertanya kepada saudara-saudara Yusuf itu: \"Apakah pekerjaanmu?\" Jawab mereka kepada Firaun: \"Hamba-hambamu ini gembala domba, baik kami maupun nenek moyang kami.\"',NULL),(3480,'PERJANJIAN LAMA','KEJADIAN',47,NULL,4,'Lagi kata mereka kepada Firaun: \"Kami datang untuk tinggal di negeri ini sebagai orang asing, sebab tidak ada lagi padang rumput untuk kumpulan ternak hamba-hambamu ini, karena hebat kelaparan itu di tanah Kanaan; maka sekarang, izinkanlah hamba-hambamu i',NULL),(3481,'PERJANJIAN LAMA','KEJADIAN',47,NULL,5,'Lalu berkatalah Firaun kepada Yusuf: \"Ayahmu dan saudara-saudaramu telah datang kepadamu.',NULL),(3482,'PERJANJIAN LAMA','KEJADIAN',47,NULL,6,'Tanah Mesir ini terbuka untukmu. Tunjukkanlah kepada ayahmu dan kepada saudara-saudaramu tempat menetap di tempat yang terbaik dari negeri ini, biarlah mereka diam di tanah Gosyen. Dan jika engkau tahu di antara mereka orang-orang yang tangkas, tempatkanl',NULL),(3483,'PERJANJIAN LAMA','KEJADIAN',47,NULL,7,'Yusuf membawa juga Yakub, ayahnya, menghadap Firaun. Lalu Yakub memohonkan berkat bagi Firaun.',NULL),(3484,'PERJANJIAN LAMA','KEJADIAN',47,NULL,8,'Kemudian bertanyalah Firaun kepada Yakub: \"Sudah berapa tahun umurmu?\"',NULL),(3485,'PERJANJIAN LAMA','KEJADIAN',47,NULL,9,'Jawab Yakub kepada Firaun: \"Tahun-tahun pengembaraanku sebagai orang asing berjumlah seratus tiga puluh tahun. Tahun-tahun hidupku itu sedikit saja dan buruk adanya, tidak mencapai umur nenek moyangku, yakni jumlah tahun mereka mengembara sebagai orang as',NULL),(3486,'PERJANJIAN LAMA','KEJADIAN',47,NULL,10,'Lalu Yakub memohonkan berkat bagi Firaun, sesudah itu keluarlah ia dari depan Firaun.',NULL),(3487,'PERJANJIAN LAMA','KEJADIAN',47,NULL,11,'Yusuf menunjukkan kepada ayahnya dan saudara-saudaranya tempat untuk menetap dan memberikan kepada mereka tanah milik di tanah Mesir, di tempat yang terbaik di negeri itu, di tanah Rameses, seperti yang diperintahkan Firaun.',NULL),(3488,'PERJANJIAN LAMA','KEJADIAN',47,NULL,12,'Dan Yusuf memelihara ayahnya, saudara-saudaranya dan seisi rumah ayahnya dengan makanan, menurut jumlah anak-anak mereka.',NULL),(3489,'PERJANJIAN LAMA','KEJADIAN',47,'Tindakan Yusuf',13,'Di seluruh negeri itu tidak ada makanan, sebab kelaparan itu sangat hebat, sehingga seisi tanah Mesir dan tanah Kanaan lemah lesu karena kelaparan itu.',NULL),(3490,'PERJANJIAN LAMA','KEJADIAN',47,NULL,14,'Maka Yusuf mengumpulkan segala uang yang terdapat di tanah Mesir dan di tanah Kanaan, yakni uang pembayar gandum yang dibeli mereka; dan Yusuf membawa uang itu ke dalam istana Firaun.',NULL),(3491,'PERJANJIAN LAMA','KEJADIAN',47,NULL,15,'Setelah habis uang di tanah Mesir dan di tanah Kanaan, datanglah semua orang Mesir menghadap Yusuf serta berkata: \"Berilah makanan kepada kami! Mengapa kami harus mati di depanmu? Sebab tidak ada lagi uang.\"',NULL),(3492,'PERJANJIAN LAMA','KEJADIAN',47,NULL,16,'Jawab Yusuf: \"Jika tidak ada lagi uang, berilah ternakmu, maka aku akan memberi makanan kepadamu sebagai ganti ternakmu itu.\"',NULL),(3493,'PERJANJIAN LAMA','KEJADIAN',47,NULL,17,'Lalu mereka membawa ternaknya kepada Yusuf dan Yusuf memberi makanan kepada mereka ganti kuda, kumpulan kambing domba dan kumpulan lembu sapi dan keledainya, jadi disediakannyalah bagi mereka makanan ganti segala ternaknya pada tahun itu.',NULL),(3494,'PERJANJIAN LAMA','KEJADIAN',47,NULL,18,'Setelah lewat tahun itu, datanglah mereka kepadanya, pada tahun yang kedua, serta berkata kepadanya: \"Tidak usah kami sembunyikan kepada tuanku, bahwa setelah uang kami habis dan setelah kumpulan ternak kami menjadi milik tuanku, tidaklah ada lagi yang ti',NULL),(3495,'PERJANJIAN LAMA','KEJADIAN',47,NULL,19,'Mengapa kami harus mati di depan matamu, baik kami maupun tanah kami? Belilah kami dan tanah kami sebagai ganti makanan, maka kami dengan tanah kami akan menjadi hamba kepada Firaun. Berikanlah benih, supaya kami hidup dan jangan mati, dan supaya tanah it',NULL),(3496,'PERJANJIAN LAMA','KEJADIAN',47,NULL,20,'Lalu Yusuf membeli segala tanah orang Mesir untuk Firaun, sebab orang Mesir itu masing-masing menjual ladangnya, karena berat kelaparan itu menimpa mereka. Demikianlah negeri itu menjadi milik Firaun.',NULL),(3497,'PERJANJIAN LAMA','KEJADIAN',47,NULL,21,'Dan tentang rakyat itu, diperhambakannyalah mereka di daerah Mesir dari ujung yang satu sampai ujung yang lain.',NULL),(3498,'PERJANJIAN LAMA','KEJADIAN',47,NULL,22,'Hanya tanah para imam tidak dibelinya, sebab para imam mendapat tunjangan tetap dari Firaun, dan mereka hidup dari tunjangan itu; itulah sebabnya mereka tidak menjual tanahnya.',NULL),(3499,'PERJANJIAN LAMA','KEJADIAN',47,NULL,23,'Berkatalah Yusuf kepada rakyat itu: \"Pada hari ini aku telah membeli kamu dan tanahmu untuk Firaun; inilah benih bagimu, supaya kamu dapat menabur di tanah itu.',NULL),(3500,'PERJANJIAN LAMA','KEJADIAN',47,NULL,24,'Mengenai hasilnya, kamu harus berikan seperlima bagian kepada Firaun, dan yang empat bagian lagi, itulah menjadi benih untuk ladangmu dan menjadi makanan kamu dan mereka yang ada di rumahmu, dan menjadi makanan anak-anakmu.\"',NULL),(3501,'PERJANJIAN LAMA','KEJADIAN',47,NULL,25,'Lalu berkatalah mereka: \"Engkau telah memelihara hidup kami; asal kiranya kami mendapat kasih tuanku, biarlah kami menjadi hamba kepada Firaun.\"',NULL),(3502,'PERJANJIAN LAMA','KEJADIAN',47,NULL,26,'Yusuf membuat hal itu menjadi suatu ketetapan mengenai tanah di Mesir sampai sekarang, yakni bahwa seperlima dari hasilnya menjadi milik Firaun; hanya tanah para imam tidak menjadi milik Firaun.',NULL),(3503,'PERJANJIAN LAMA','KEJADIAN',47,'Yakub pada akhir hidupnya',27,'Maka diamlah Israel di tanah Mesir, di tanah Gosyen, dan mereka menjadi penduduk di situ. Mereka beranak cucu dan sangat bertambah banyak.',NULL),(3504,'PERJANJIAN LAMA','KEJADIAN',47,NULL,28,'Dan Yakub masih hidup tujuh belas tahun di tanah Mesir, maka umur Yakub, yakni tahun-tahun hidupnya, menjadi seratus empat puluh tujuh tahun.',NULL),(3505,'PERJANJIAN LAMA','KEJADIAN',47,NULL,29,'Ketika hampir waktunya bahwa Israel akan mati, dipanggilnyalah anaknya, Yusuf, dan berkata kepadanya: \"Jika aku mendapat kasihmu, letakkanlah kiranya tanganmu di bawah pangkal pahaku, dan bersumpahlah, bahwa engkau akan menunjukkan kasih dan setia kepadak',NULL),(3506,'PERJANJIAN LAMA','KEJADIAN',47,NULL,30,'karena aku mau mendapat perhentian bersama-sama dengan nenek moyangku. Sebab itu angkutlah aku dari Mesir dan kuburkanlah aku dalam kubur mereka.\" Jawabnya: \"Aku akan berbuat seperti katamu itu.\"',NULL),(3507,'PERJANJIAN LAMA','KEJADIAN',47,NULL,31,'Kemudian kata Yakub: \"Bersumpahlah kepadaku.\" Maka Yusufpun bersumpah kepadanya. Lalu sujudlah Israel di sebelah kepala tempat tidurnya.',NULL),(3508,'PERJANJIAN LAMA','KEJADIAN',48,'Yakub memberkati Manasye dan Efraim',1,'Sesudah itu ada orang mengatakan kepada Yusuf: \"Ayahmu sakit!\" Lalu dibawanyalah kedua anaknya, Manasye dan Efraim.',NULL),(3509,'PERJANJIAN LAMA','KEJADIAN',48,NULL,2,'Ketika diberitahukan kepada Yakub: \"Telah datang anakmu Yusuf kepadamu,\" maka Israel mengumpulkan segenap kekuatannya dan duduklah ia di tempat tidurnya.',NULL),(3510,'PERJANJIAN LAMA','KEJADIAN',48,NULL,3,'Berkatalah Yakub kepada Yusuf: \"Allah, Yang Mahakuasa telah menampakkan diri kepadaku di Lus di tanah Kanaan dan memberkati aku',NULL),(3511,'PERJANJIAN LAMA','KEJADIAN',48,NULL,4,'serta berfirman kepadaku: Akulah yang membuat engkau beranak cucu, dan Aku akan membuat engkau bertambah banyak dan menjadi sekumpulan bangsa-bangsa; Aku akan memberikan negeri ini kepada keturunanmu untuk menjadi miliknya sampai selama-lamanya.',NULL),(3512,'PERJANJIAN LAMA','KEJADIAN',48,NULL,5,'Maka sekarang kedua anakmu yang lahir bagimu di tanah Mesir, sebelum aku datang kepadamu ke Mesir, akulah yang empunya mereka; akulah yang akan empunya Efraim dan Manasye sama seperti Ruben dan Simeon.',NULL),(3513,'PERJANJIAN LAMA','KEJADIAN',48,NULL,6,'Dan keturunanmu yang kauperoleh sesudah mereka, engkaulah yang empunya, tetapi dalam pembagian warisan nama mereka akan disebutkan berdasarkan nama kedua saudaranya itu.',NULL),(3514,'PERJANJIAN LAMA','KEJADIAN',48,NULL,7,'Kalau aku, pada waktu perjalananku dari Padan, aku kematian Rahel di tanah Kanaan di jalan, ketika kami tidak berapa jauh lagi dari Efrata, dan aku menguburkannya di sana, di sisi jalan ke Efrata\" --yaitu Betlehem.',NULL),(3515,'PERJANJIAN LAMA','KEJADIAN',48,NULL,8,'Ketika Israel melihat anak-anak Yusuf itu, bertanyalah ia: \"Siapakah ini?\"',NULL),(3516,'PERJANJIAN LAMA','KEJADIAN',48,NULL,9,'Jawab Yusuf kepada ayahnya: \"Inilah anak-anakku yang telah diberikan Allah kepadaku di sini.\" Maka kata Yakub: \"Dekatkanlah mereka kepadaku, supaya kuberkati mereka.\"',NULL),(3517,'PERJANJIAN LAMA','KEJADIAN',48,NULL,10,'Adapun mata Israel telah kabur karena tuanya, jadi ia tidak dapat lagi melihat. Kemudian Yusuf mendekatkan mereka kepada ayahnya: dan mereka dicium serta didekap oleh ayahnya.',NULL),(3518,'PERJANJIAN LAMA','KEJADIAN',48,NULL,11,'Lalu berkatalah Israel kepada Yusuf: \"Tidak kusangka-sangka, bahwa aku akan melihat mukamu lagi, tetapi sekarang Allah bahkan memberi aku melihat keturunanmu.\"',NULL),(3519,'PERJANJIAN LAMA','KEJADIAN',48,NULL,12,'Lalu Yusuf menarik mereka dari antara lutut ayahnya, dan ia sujud dengan mukanya sampai ke tanah.',NULL),(3520,'PERJANJIAN LAMA','KEJADIAN',48,NULL,13,'Setelah itu Yusuf memegang mereka keduanya, dengan tangan kanan dipegangnya Efraim, yaitu di sebelah kiri Israel, dan dengan tangan kiri Manasye, yaitu di sebelah kanan Israel, lalu didekatkannyalah mereka kepadanya.',NULL),(3521,'PERJANJIAN LAMA','KEJADIAN',48,NULL,14,'Tetapi Israel mengulurkan tangan kanannya dan meletakkannya di atas kepala Efraim, walaupun ia yang bungsu, dan tangan kirinya di atas kepala Manasye--jadi tangannya bersilang, walaupun Manasye yang sulung.',NULL),(3522,'PERJANJIAN LAMA','KEJADIAN',48,NULL,15,'Sesudah itu diberkatinyalah Yusuf, katanya: \"Nenekku dan ayahku, Abraham dan Ishak, telah hidup di hadapan Allah; Allah itu, sebagai Allah yang telah menjadi gembalaku selama hidupku sampai sekarang,',NULL),(3523,'PERJANJIAN LAMA','KEJADIAN',48,NULL,16,'dan sebagai Malaikat yang telah melepaskan aku dari segala bahaya, Dialah kiranya yang memberkati orang-orang muda ini, sehingga namaku serta nama nenek dan bapaku, Abraham dan Ishak, termasyhur oleh karena mereka dan sehingga mereka bertambah-tambah menj',NULL),(3524,'PERJANJIAN LAMA','KEJADIAN',48,NULL,17,'Ketika Yusuf melihat bahwa ayahnya meletakkan tangan kanannya di atas kepala Efraim, hal itu dipandangnya tidak baik; lalu dipegangnya tangan ayahnya untuk memindahkannya dari atas kepala Efraim ke atas kepala Manasye.',NULL),(3525,'PERJANJIAN LAMA','KEJADIAN',48,NULL,18,'Katanya kepada ayahnya: \"Janganlah demikian, ayahku, sebab inilah yang sulung, letakkanlah tangan kananmu ke atas kepalanya.\"',NULL),(3526,'PERJANJIAN LAMA','KEJADIAN',48,NULL,19,'Tetapi ayahnya menolak, katanya: \"Aku tahu, anakku, aku tahu; ia juga akan menjadi suatu bangsa dan ia juga akan menjadi besar kuasanya; walaupun begitu, adiknya akan lebih besar kuasanya dari padanya, dan keturunan adiknya itu akan menjadi sejumlah besar',NULL),(3527,'PERJANJIAN LAMA','KEJADIAN',48,NULL,20,'Lalu diberkatinyalah mereka pada waktu itu, katanya: \"Dengan menyebutkan namamulah orang Israel akan memberkati, demikian: Allah kiranya membuat engkau seperti Efraim dan seperti Manasye.\" Demikianlah didahulukannya Efraim dari pada Manasye.',NULL),(3528,'PERJANJIAN LAMA','KEJADIAN',48,NULL,21,'Kemudian berkatalah Israel kepada Yusuf: \"Tidak lama lagi aku akan mati, tetapi Allah akan menyertai kamu dan membawa kamu kembali ke negeri nenek moyangmu.',NULL),(3529,'PERJANJIAN LAMA','KEJADIAN',48,NULL,22,'Dan sekarang aku memberikan kepadamu sebagai kelebihanmu dari pada saudara-saudaramu, suatu punggung gunung yang kurebut dengan pedang dan panahku dari tangan orang Amori.\"',NULL),(3530,'PERJANJIAN LAMA','KEJADIAN',49,'Perkataan Yakub yang penghabisan kepada anak-anaknya',1,'Kemudian Yakub memanggil anak-anaknya dan berkata: \"Datanglah berkumpul, supaya kuberitahukan kepadamu, apa yang akan kamu alami di kemudian hari.',NULL),(3531,'PERJANJIAN LAMA','KEJADIAN',49,NULL,2,'Berhimpunlah kamu dan dengarlah, ya anak-anak Yakub, dengarlah kepada Israel, ayahmu.',NULL),(3532,'PERJANJIAN LAMA','KEJADIAN',49,NULL,3,'Ruben, engkaulah anak sulungku, kekuatanku dan permulaan kegagahanku, engkaulah yang terutama dalam keluhuran, yang terutama dalam kesanggupan.',NULL),(3533,'PERJANJIAN LAMA','KEJADIAN',49,NULL,4,'Engkau yang membual sebagai air, tidak lagi engkau yang terutama, sebab engkau telah menaiki tempat tidur ayahmu; waktu itu engkau telah melanggar kesuciannya. Dia telah menaiki petiduranku!',NULL),(3534,'PERJANJIAN LAMA','KEJADIAN',49,NULL,5,'Simeon dan Lewi bersaudara; senjata mereka ialah alat kekerasan.',NULL),(3535,'PERJANJIAN LAMA','KEJADIAN',49,NULL,6,'Janganlah kiranya jiwaku turut dalam permupakatan mereka, janganlah kiranya rohku bersatu dengan perkumpulan mereka, sebab dalam kemarahannya mereka telah membunuh orang dan dalam keangkaraannya mereka telah memotong urat keting lembu.',NULL),(3536,'PERJANJIAN LAMA','KEJADIAN',49,NULL,7,'Terkutuklah kemarahan mereka, sebab amarahnya keras, terkutuklah keberangan mereka, sebab berangnya bengis. Aku akan membagi-bagikan mereka di antara anak-anak Yakub dan menyerakkan mereka di antara anak-anak Israel.',NULL),(3537,'PERJANJIAN LAMA','KEJADIAN',49,NULL,8,'Yehuda, engkau akan dipuji oleh saudara-saudaramu, tanganmu akan menekan tengkuk musuhmu, kepadamu akan sujud anak-anak ayahmu.',NULL),(3538,'PERJANJIAN LAMA','KEJADIAN',49,NULL,9,'Yehuda adalah seperti anak singa: setelah menerkam, engkau naik ke suatu tempat yang tinggi, hai anakku; ia meniarap dan berbaring seperti singa jantan atau seperti singa betina; siapakah yang berani membangunkannya?',NULL),(3539,'PERJANJIAN LAMA','KEJADIAN',49,NULL,10,'Tongkat kerajaan tidak akan beranjak dari Yehuda ataupun lambang pemerintahan dari antara kakinya, sampai dia datang yang berhak atasnya, maka kepadanya akan takluk bangsa-bangsa.',NULL),(3540,'PERJANJIAN LAMA','KEJADIAN',49,NULL,11,'Ia akan menambatkan keledainya pada pohon anggur dan anak keledainya pada pohon anggur pilihan; ia akan mencuci pakaiannya dengan anggur dan bajunya dengan darah buah anggur.',NULL),(3541,'PERJANJIAN LAMA','KEJADIAN',49,NULL,12,'Matanya akan merah karena anggur dan giginya akan putih karena susu.',NULL),(3542,'PERJANJIAN LAMA','KEJADIAN',49,NULL,13,'Zebulon akan diam di tepi pantai laut, ia akan menjadi pangkalan kapal, dan batasnya akan bersisi dengan Sidon.',NULL),(3543,'PERJANJIAN LAMA','KEJADIAN',49,NULL,14,'Isakhar adalah seperti keledai yang kuat tulangnya, yang meniarap diapit bebannya,',NULL),(3544,'PERJANJIAN LAMA','KEJADIAN',49,NULL,15,'ketika dilihatnya, bahwa perhentian itu baik dan negeri itu permai, maka disendengkannyalah bahunya untuk memikul, lalu menjadi budak rodi.',NULL),(3545,'PERJANJIAN LAMA','KEJADIAN',49,NULL,16,'Adapun Dan, ia akan mengadili bangsanya sebagai salah satu suku Israel.',NULL),(3546,'PERJANJIAN LAMA','KEJADIAN',49,NULL,17,'Semoga Dan menjadi seperti ular di jalan, seperti ular beludak di denai yang memagut tumit kuda, sehingga penunggangnya jatuh ke belakang.',NULL),(3547,'PERJANJIAN LAMA','KEJADIAN',49,NULL,18,'Aku menanti-nantikan keselamatan yang dari pada-Mu, ya TUHAN.',NULL),(3548,'PERJANJIAN LAMA','KEJADIAN',49,NULL,19,'Gad, ia akan diserang oleh gerombolan, tetapi ia akan menyerang tumit mereka.',NULL),(3549,'PERJANJIAN LAMA','KEJADIAN',49,NULL,20,'Asyer, makanannya akan limpah mewah dan ia akan memberikan santapan raja-raja.',NULL),(3550,'PERJANJIAN LAMA','KEJADIAN',49,NULL,21,'Naftali adalah seperti rusa betina yang terlepas; ia akan melahirkan anak-anak indah.',NULL),(3551,'PERJANJIAN LAMA','KEJADIAN',49,NULL,22,'Yusuf adalah seperti pohon buah-buahan yang muda, pohon buah-buahan yang muda pada mata air. Dahan-dahannya naik mengatasi tembok.',NULL),(3552,'PERJANJIAN LAMA','KEJADIAN',49,NULL,23,'Walaupun pemanah-pemanah telah mengusiknya, memanahnya dan menyerbunya,',NULL),(3553,'PERJANJIAN LAMA','KEJADIAN',49,NULL,24,'namun panahnya tetap kokoh dan lengan tangannya tinggal liat, oleh pertolongan Yang Mahakuat pelindung Yakub, oleh sebab gembalanya Gunung Batu Israel,',NULL),(3554,'PERJANJIAN LAMA','KEJADIAN',49,NULL,25,'oleh Allah ayahmu yang akan menolong engkau, dan oleh Allah Yang Mahakuasa, yang akan memberkati engkau dengan berkat dari langit di atas, dengan berkat samudera raya yang letaknya di bawah, dengan berkat buah dada dan kandungan.',NULL),(3555,'PERJANJIAN LAMA','KEJADIAN',49,NULL,26,'Berkat ayahmu melebihi berkat gunung-gunung yang sejak dahulu, yakni yang paling sedap di bukit-bukit yang berabad-abad; semuanya itu akan turun ke atas kepala Yusuf, ke atas batu kepala orang yang teristimewa di antara saudara-saudaranya.',NULL),(3556,'PERJANJIAN LAMA','KEJADIAN',49,NULL,27,'Benyamin adalah seperti serigala yang menerkam; pada waktu pagi ia memakan mangsanya dan pada waktu petang ia membagi-bagi rampasannya.\"',NULL),(3557,'PERJANJIAN LAMA','KEJADIAN',49,NULL,28,'Itulah semuanya suku Israel, dua belas jumlahnya; dan itulah yang dikatakan ayahnya kepada mereka, ketika ia memberkati mereka; tiap-tiap orang diberkatinya dengan berkat yang diuntukkan kepada mereka masing-masing.',NULL),(3558,'PERJANJIAN LAMA','KEJADIAN',49,'Yakub meninggal dan dikuburkan',29,'Kemudian berpesanlah Yakub kepada mereka: \"Apabila aku nanti dikumpulkan kepada kaum leluhurku, kuburkanlah aku di sisi nenek moyangku dalam gua yang di ladang Efron, orang Het itu,',NULL),(3559,'PERJANJIAN LAMA','KEJADIAN',49,NULL,30,'dalam gua yang di ladang Makhpela di sebelah timur Mamre di tanah Kanaan, ladang yang telah dibeli Abraham dari Efron, orang Het itu, untuk menjadi kuburan milik.',NULL),(3560,'PERJANJIAN LAMA','KEJADIAN',49,NULL,31,'Di situlah dikuburkan Abraham beserta Sara, isterinya; di situlah dikuburkan Ishak beserta Ribka, isterinya,',NULL),(3561,'PERJANJIAN LAMA','KEJADIAN',49,NULL,32,'dan di situlah juga kukuburkan Lea; ladang dengan gua yang ada di sana telah dibeli dari orang Het.\"',NULL),(3562,'PERJANJIAN LAMA','KEJADIAN',49,NULL,33,'Setelah Yakub selesai berpesan kepada anak-anaknya, ditariknyalah kakinya ke atas tempat berbaring dan meninggallah ia, maka ia dikumpulkan kepada kaum leluhurnya.',NULL),(3563,'PERJANJIAN LAMA','KEJADIAN',50,NULL,1,'Lalu Yusuf merebahkan dirinya mendekap muka ayahnya serta menangisi dan mencium dia.',NULL),(3564,'PERJANJIAN LAMA','KEJADIAN',50,NULL,2,'Dan Yusuf memerintahkan kepada tabib-tabib, yaitu hamba-hambanya, untuk merempah-rempahi mayat ayahnya; maka tabib-tabib itu merempah-rempahi mayat Israel.',NULL),(3565,'PERJANJIAN LAMA','KEJADIAN',50,NULL,3,'Hal itu memerlukan empat puluh hari lamanya, sebab demikianlah lamanya waktu yang diperlukan untuk merempah-rempahi, dan orang Mesir menangisi dia tujuh puluh hari lamanya.',NULL),(3566,'PERJANJIAN LAMA','KEJADIAN',50,NULL,4,'Setelah lewat hari-hari penangisan itu, berkatalah Yusuf kepada seisi istana Firaun: \"Jika kiranya aku mendapat kasihmu, katakanlah kepada Firaun,',NULL),(3567,'PERJANJIAN LAMA','KEJADIAN',50,NULL,5,'bahwa ayahku telah menyuruh aku bersumpah, katanya: Tidak lama lagi aku akan mati; dalam kuburku yang telah kugali di tanah Kanaan, di situlah kaukuburkan aku. Oleh sebab itu, izinkanlah aku pergi ke sana, supaya aku menguburkan ayahku; kemudian aku akan ',NULL),(3568,'PERJANJIAN LAMA','KEJADIAN',50,NULL,6,'Lalu berkatalah Firaun: \"Pergilah ke sana dan kuburkanlah ayahmu itu, seperti yang telah disuruhnya engkau bersumpah.\"',NULL),(3569,'PERJANJIAN LAMA','KEJADIAN',50,NULL,7,'Lalu berjalanlah Yusuf ke sana untuk menguburkan ayahnya, dan bersama-sama dengan dia berjalanlah semua pegawai Firaun, para tua-tua dari istananya, dan semua tua-tua dari tanah Mesir,',NULL),(3570,'PERJANJIAN LAMA','KEJADIAN',50,NULL,8,'serta seisi rumah Yusuf juga, saudara-saudaranya dan seisi rumah ayahnya; hanya anak-anaknya serta kambing domba dan lembu sapinya ditinggalkan mereka di tanah Gosyen.',NULL),(3571,'PERJANJIAN LAMA','KEJADIAN',50,NULL,9,'Baik kereta maupun orang-orang berkuda turut pergi ke sana bersama-sama dengan dia, sehingga iring-iringan itu sangat besar.',NULL),(3572,'PERJANJIAN LAMA','KEJADIAN',50,NULL,10,'Setelah mereka sampai ke Goren-Haatad, yang di seberang sungai Yordan, maka mereka mengadakan di situ ratapan yang sangat sedih dan riuh; dan Yusuf mengadakan perkabungan tujuh hari lamanya karena ayahnya itu.',NULL),(3573,'PERJANJIAN LAMA','KEJADIAN',50,NULL,11,'Ketika penduduk negeri itu, orang-orang Kanaan, melihat perkabungan di Goren-Haatad itu, berkatalah mereka: \"Inilah perkabungan orang Mesir yang amat riuh.\" Itulah sebabnya tempat itu dinamai Abel-Mizraim, yang letaknya di seberang Yordan.',NULL),(3574,'PERJANJIAN LAMA','KEJADIAN',50,NULL,12,'Anak-anak Yakub melakukan kepadanya, seperti yang dipesankannya kepada mereka.',NULL),(3575,'PERJANJIAN LAMA','KEJADIAN',50,NULL,13,'Anak-anaknya mengangkut dia ke tanah Kanaan, dan mereka menguburkan dia dalam gua di ladang Makhpela yang telah dibeli Abraham dari Efron, orang Het itu, untuk menjadi kuburan milik, yaitu ladang yang di sebelah timur Mamre.',NULL),(3576,'PERJANJIAN LAMA','KEJADIAN',50,NULL,14,'Setelah ayahnya dikuburkan, pulanglah Yusuf ke Mesir, dia dan saudara-saudaranya dan semua orang yang turut pergi ke sana bersama-sama dengan dia untuk menguburkan ayahnya itu.',NULL),(3577,'PERJANJIAN LAMA','KEJADIAN',50,'Yusuf menghiburkan hati saudara-saudaranya',15,'Ketika saudara-saudara Yusuf melihat, bahwa ayah mereka telah mati, berkatalah mereka: \"Boleh jadi Yusuf akan mendendam kita dan membalaskan sepenuhnya kepada kita segala kejahatan yang telah kita lakukan kepadanya.\"',NULL),(3578,'PERJANJIAN LAMA','KEJADIAN',50,NULL,16,'Sebab itu mereka menyuruh menyampaikan pesan ini kepada Yusuf: \"Sebelum ayahmu mati, ia telah berpesan:',NULL),(3579,'PERJANJIAN LAMA','KEJADIAN',50,NULL,17,'Beginilah harus kamu katakan kepada Yusuf: Ampunilah kiranya kesalahan saudara-saudaramu dan dosa mereka, sebab mereka telah berbuat jahat kepadamu. Maka sekarang, ampunilah kiranya kesalahan yang dibuat hamba-hamba Allah ayahmu.\" Lalu menangislah Yusuf, ',NULL),(3580,'PERJANJIAN LAMA','KEJADIAN',50,NULL,18,'Juga saudara-saudaranya datang sendiri dan sujud di depannya serta berkata: \"Kami datang untuk menjadi budakmu.\"',NULL),(3581,'PERJANJIAN LAMA','KEJADIAN',50,NULL,19,'Tetapi Yusuf berkata kepada mereka: \"Janganlah takut, sebab aku inikah pengganti Allah?',NULL),(3582,'PERJANJIAN LAMA','KEJADIAN',50,NULL,20,'Memang kamu telah mereka-rekakan yang jahat terhadap aku, tetapi Allah telah mereka-rekakannya untuk kebaikan, dengan maksud melakukan seperti yang terjadi sekarang ini, yakni memelihara hidup suatu bangsa yang besar.',NULL),(3583,'PERJANJIAN LAMA','KEJADIAN',50,NULL,21,'Jadi janganlah takut, aku akan menanggung makanmu dan makan anak-anakmu juga.\" Demikianlah ia menghiburkan mereka dan menenangkan hati mereka dengan perkataannya.',NULL),(3584,'PERJANJIAN LAMA','KEJADIAN',50,'Yusuf meninggal',22,'Adapun Yusuf, ia tetap tinggal di Mesir beserta kaum keluarganya; dan Yusuf hidup seratus sepuluh tahun.',NULL),(3585,'PERJANJIAN LAMA','KEJADIAN',50,NULL,23,'Jadi Yusuf sempat melihat anak cucu Efraim sampai keturunan yang ketiga; juga anak-anak Makhir, anak Manasye, lahir di pangkuan Yusuf.',NULL),(3586,'PERJANJIAN LAMA','KEJADIAN',50,NULL,24,'Berkatalah Yusuf kepada saudara-saudaranya: \"Tidak lama lagi aku akan mati; tentu Allah akan memperhatikan kamu dan membawa kamu keluar dari negeri ini, ke negeri yang telah dijanjikan-Nya dengan sumpah kepada Abraham, Ishak dan Yakub.\"',NULL),(3587,'PERJANJIAN LAMA','KEJADIAN',50,NULL,25,'Lalu Yusuf menyuruh anak-anak Israel bersumpah, katanya: \"Tentu Allah akan memperhatikan kamu; pada waktu itu kamu harus membawa tulang-tulangku dari sini.\"',NULL),(3588,'PERJANJIAN LAMA','KEJADIAN',50,NULL,26,'Kemudian matilah Yusuf, berumur seratus sepuluh tahun. Mayatnya dirempah-rempahi, dan ditaruh dalam peti mati di Mesir.',NULL);

