		SET nlen=nlen+1;
	END WHILE;	
	
	
	RETURN CONCAT(varLokasiGereja, '.', varNomorKKSelanjutnya, '.', varPosisi, '-', cNoAnggotaSelanjutnya);
	
    END */$$
